eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   newsOne: () => (/* binding */ newsOne),\n/* harmony export */   newsSidebar: () => (/* binding */ newsSidebar)\n/* harmony export */ });\n/* harmony import */ var _images_blog_hashdescription_jpg__WEBPACK_IMPORTED_MODULE_0__ = __webpack_require__(/*! @/images/blog/hashdescription.jpg */ \"./src/assets/images/blog/hashdescription.jpg\");\n/* harmony import */ var _images_blog_paracezalari_jpg__WEBPACK_IMPORTED_MODULE_1__ = __webpack_require__(/*! @/images/blog/paracezalari.jpg */ \"./src/assets/images/blog/paracezalari.jpg\");\n/* harmony import */ var _images_blog_baasModeli_jpg__WEBPACK_IMPORTED_MODULE_2__ = __webpack_require__(/*! @/images/blog/baasModeli.jpg */ \"./src/assets/images/blog/baasModeli.jpg\");\n/* harmony import */ var next_dynamic__WEBPACK_IMPORTED_MODULE_3__ = __webpack_require__(/*! next/dynamic */ \"./node_modules/next/dynamic.js\");\n/* harmony import */ var next_dynamic__WEBPACK_IMPORTED_MODULE_3___default = /*#__PURE__*/__webpack_require__.n(next_dynamic__WEBPACK_IMPORTED_MODULE_3__);\n// import image1 from \"@/images/blog/yayin-1.jpg\";\n// import image2 from \"@/images/blog/yayin-2.jpg\";\n// import image3 from \"@/images/blog/yayin-3.jpg\";\n// import image4 from \"@/images/blog/yayin-4.jpg\";\n// import image5 from \"@/images/blog/yayin-5.jpg\";\n\n\n\n\n// import { inputs } from \"./contact\";\n// import { socials } from \"./teamSection\";\nconst newsOne = {\n    tagline: \"G\\xfcncel Yaynlar\",\n    title: \"Yaynlar ve Haberler\",\n    newsData: []\n};\n// to add HTML tags from the data section. I have defined a dynamicContent array in the newsSidebar object. This array contains different types of content such as paragraphs, lists, headers, and images. I will use this dynamicContent array to render the HTML tags in the NewsDetailsLeft component.\nconst newsSidebar = {\n    newses: [\n        {\n            id: 47,\n            subtitle: \"GDPR Karar\",\n            date: \"16.05.2024\",\n            title: \"Hrvatistan Veri Koruma Otoritesi (''AZOP''), ilgili kiinin gizli Facebook hesabndaki fotoraflarn haber i\\xe7eriinde herhangi bir yasal dayanak olmakszn yaymlayan veri sorumlusunun ilgili fotoraflar silmesine karar verdi.\",\n            slug: \"kisisel-verilerin-yasal-dayanak-olmaksizin-haber-iceriginde-yayimlanmasi\",\n            text: \"AZOP, fotoraflarn ilgili kiinin gizli Facebook hesabnda yaymlanmas sebebiyle ilgili kii tarafndan kamuya a\\xe7k/aleni ekilde paylalma iradesi bulunmad halde veri sorumlusunun fotoraflar kullanarak haber i\\xe7eriinde yaymladn deerlendirmitir. fade \\xf6zg\\xfcrl\\xfc\\xfc ve \\xf6zel hayatn gizlilii balamnda deerlendirme yapan AZOP, fotoraflarn gizli hesapta paylalmas sebebiyle veri sorumlusunun kiisel verileri yasal dayanak olmakszn iledii sonucuna varmtr.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Hrvatistan Veri Koruma Otoritesi (''AZOP''), bir medya kuruluunun, verilerin aleniletirilmemesi ve kamu yararnn ilgili kiinin mahremiyet hakkna \\xfcst\\xfcn gelmemesi nedeniyle, bir ilgili kiinin kiisel verilerini hukuka aykr olarak ilediine karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bir ilgili kii, veri sorumlusu olan bir medya kuruluunun web sitesinde ve Facebook sayfasnda kendisiyle ilgili kiisel verileri, daha spesifik olarak bacaklarnn fotoraflarn i\\xe7eren bir makale yaynladn tespit etmitir. S\\xf6z konusu fotoraflar ilgili kii tarafndan \\xf6zel Facebook profilinde yaynlanmtr, dolaysyla genel olarak kamu tarafndan g\\xf6r\\xfclmeleri ama\\xe7lanmamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu bavurusunda, makalesinde dier kiilerin yan sra ilgili kiiden de bahsettiini ve siyasi bir partinin \\xf6nde gelen bir \\xfcyesi olduu i\\xe7in ilgili kiinin makalelerinden birinde ilk kez yer almadn belirtmitir. Ayrca, veri sorumlusu s\\xf6z konusu fotoraflarn kamuya a\\xe7k olduunu, zira ilgili kiinin bunlar sosyal medyada yaynladn iddia etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"AZOP, t\\xfcm ger\\xe7ekleri ve ilgili GDPR maddelerinin yan sra Hrvatistan Medya Yasas'nn medya \\xf6zg\\xfcrl\\xfc\\xfc ve ifade \\xf6zg\\xfcrl\\xfc\\xfcne ilikin h\\xfck\\xfcmlerini de dikkate almtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"AZOP, \\xf6zellikle, Medya Kanunu'nun 8. Maddesinin, gazetecilik faaliyetleriyle ilgili olarak hakim bir kamu yarar olmas halinde veri koruma hakknn ihlal edilemeyeceini \\xf6ng\\xf6rd\\xfc\\xfcn\\xfc kabul etmitir. Bu balamda AZOP, Medya Kanunu'nun, bir medya kuruluu olarak veri sorumlusu tarafndan s\\xf6z konusu kanun tarafndan belirlenen ama\\xe7lara ulamak i\\xe7in kiisel verilerin ilenmesi i\\xe7in yasal dayana temsil ettiine karar vermitir. Ancak AZOP, bu davada veri sorumlusunun ilgili kiinin fotoraflarn ilemek i\\xe7in yasal bir dayanak salayamadn belirtmitir. AZOP, veri sorumlusunun, ilgili kiinin siyasi faaliyetleriyle ilgisi olmayan resimlerinin yaynlanmasn hakl \\xe7karmak i\\xe7in ilgili kiinin bir siyasi partinin \\xfcyesi olduu ger\\xe7eine dayanamayacan belirtmitir. Bu balamda AZOP, veri sorumlusunun GDPR Madde 5(1)(a) ve GDPR Madde 6'ya aykr hareket ettiine karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca AZOP, fotoraflarn yalnzca ilgili kiinin \\xf6zel Facebook hesabnda mevcut olduunu ve \\xfc\\xe7\\xfcnc\\xfc taraflarn eriimine a\\xe7k olmamas gerektiini yinelemitir. Bu balamda AZOP, Medya Kanunu'nun uygulanmasna ve ifade \\xf6zg\\xfcrl\\xfc\\xfcn\\xfcn \\xf6nemine ramen, medya kurulularnn ve gazetecilerin bireylerin mahremiyetine, onuruna ve itibarna sayg g\\xf6stermekle y\\xfck\\xfcml\\xfc olduuna karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca, ihtilafl makaleye hala \\xe7evrimi\\xe7i olarak eriilebildiinden, AZOP, veri sorumlusunun ilgili kii hakknda hukuka aykr olarak yaynlanan kiisel verileri silmesine karar vermitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://gdprhub.eu/index.php?title=AZOP_(Croatia)_-_Decision_10-08-2023&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"Hrvatistan\",\n                \"Veri Koruma Otoritesi\"\n            ]\n        },\n        {\n            id: 46,\n            subtitle: \"Makale\",\n            date: \"2020\",\n            slug: \"sosyal-medya-celiskileri\",\n            title: \"Sosyal Medyada D\\xfczenlenen \\xc7ekililerin Hukuki Dayanaklar\",\n            text: \"Hemen hemen herkesin g\\xfcnl\\xfck hayatnda karlat sosyal medya \\xe7ekilileri \\xf6zellikle ylba zamanlarnda bir hayli fazlalamakta ve sosyal medya hesaplarmz s\\xf6z konusu \\xe7ekili bildirimleri ile younlamaktadr. Gerek ger\\xe7ek kiiler gerekse de t\\xfczel kiiler tarafndan d\\xfczenlenen \\xe7ekililerde \\xe7eitli katlm artlar belirlenmekte ve sosyal medya kullanclar s\\xf6z konusu \\xe7ekililerin hukuki dayanaklar hakknda bilgi sahibi olmadan bu \\xe7ekililere katlm salamaktadr. bu bilgi notu ile sosyal medyada d\\xfczenlenen \\xe7ekililerin hukuki dayanaklar ve d\\xfczenlenme artlar ele alnacaktr.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"\\xd6ncelikle sosyal medyada d\\xfczenlenen s\\xf6z konusu \\xe7ekililerin hukuki niteliini belirlemek ve buna g\\xf6re bir inceleme yapmak yerinde olacaktr. Sosyal medya \\xe7ekililerinde belirli hesaplar takip etmek, yorum ksmna bakalarn etiketlemek gibi eylemler ile \\xe7ekilie, daha doru bir deyile piyangoya katlm hakk elde edilmektedir. 320 Sayl Kanun H\\xfckm\\xfcnde Kararnamenin (KHK) 41. Maddesinde Piyango Tertip Ve \\xc7ekili D\\xfczenleme Hakk h\\xfck\\xfcm altna alnmaktadr. lgili madde uyarnca  her ne ekilde olursa olsun katlm hakk verilerek karl nakit olmayan her t\\xfcrl\\xfc eya ve benzeri piyango ve \\xe7ekili tertip edilebilmesi i\\xe7in Milli Piyango daresinden (dare) izin alnmas zorunludur. B\\xf6ylelikle sosyal medya \\xe7ekililerinde katlma artlar arasnda saylan hesap takip etme, yoruma bakalarn etiketleme gibi eylemler de KHKda belirtilen her ne ekilde olursa olsun katlm hakk veren ifadesi ile uyumaktadr. Bu sebeple g\\xfcnl\\xfck hayatta yaplan sosyal medya \\xe7ekilileri de bu kapsamda deerlendirilebilecektir ve piyango olarak nitelendirilebilecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"KHKnn 41. Maddesinin devamnda Bu maddenin uygulanmas y\\xf6netmelik ile d\\xfczenlenir h\\xfckm\\xfc bulunmaktadr. Piyango d\\xfczenlenmesi hakknda detayl d\\xfczenlemeler 26309 sayl ve 4 Ekim 2006 tarihli Resmi Gazetede yaynlanarak y\\xfcr\\xfcrl\\xfce giren Karl Nakit Olmayan Piyangolar ve \\xc7ekililer Hakknda Y\\xf6netmelik (Y\\xf6netmelik) ile belirlenmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmeliin 6. Maddesinde Piyango d\\xfczenleyebilecek kiiler h\\xfck\\xfcm altna alnrken 7. Maddede ise Bavuru ve zin Alma Zorunluluu h\\xfck\\xfcm altna alnmaktadr. Y\\xf6netmeliin 7. Maddesi uyarnca Piyango d\\xfczenlemeye karar veren kii ve kurulularn dareye bavurarak izin almalar zorunludur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yine ayn Y\\xf6netmeliin 9. Maddesinde ise Piyango d\\xfczenlemeye karar veren kiinin bavuru i\\xe7in ibraz etmesi gereken bilgi ve belgeler h\\xfck\\xfcm altna alnmaktadr. S\\xf6z konusu maddede Piyango d\\xfczenleyenin kiisel bilgileri, kampanyann balama ve biti tarihleri ve kapsayaca il-il\\xe7e, \\xe7ekilie katlma ekil ve artlar, datlacak ikramiyenin adedi, cinsi ve toplam deeri, \\xe7ekiliin yaplaca adres, tarih, saat ve \\xe7ekili usul\\xfc ile ka\\xe7 adet yedek talihli belirlenecei, ger\\xe7ek kii d\\xfczenleyiciler i\\xe7in sabka kayd, idarece belirlenecek tutarda teminatn salandna ilikin belge gibi esasl unsurlar ile birlikte bunlarla snrl olmamak \\xfczere maddenin devamnda saylan dier bilgi ve belgelerin de dareye ibraz edilmesi gerektii h\\xfck\\xfcm altna alnmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmeliin 10. Maddesinde ise Sanal ortam \\xfczerinden d\\xfczenlenecek piyangolarda da bir mal veya hizmetin tantm, sat, pazarlanmas esas olup, dorudan gelir elde etmeye y\\xf6nelik piyango d\\xfczenlenemez h\\xfckm\\xfc bulunmaktadr. \\xd6te yandan y\\xf6netmeliin 9. Maddesinde belirlenen bavuru i\\xe7in gereken bilgi ve belgelere ek olarak 10. Maddenin 2. Fkrasnda Sanal ortam \\xfczerinden piyango d\\xfczenlenmesi halinde yerine getirilmesi gerekecek ek artlar h\\xfck\\xfcm altna alnmaktadr. lgili ek artlar u ekilde sralanmaktadr:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Kampanyann hangi sanal ortam ara\\xe7lar \\xfczerinden ve hangi kii ve kurulular aracl ile yaplacann katlmclara duyurulmas,\",\n                        \"Katlmcdan katlm srasnda ad-soyad-adres ve katlma ilikin ifre veya kod numaras bilgilerinin istenmesi ve bu bilgiler esas alnarak \\xe7ekiliin ger\\xe7ekletirilmesi,\",\n                        \"Kampanyaya katlmn yapld sanal ortam iletiim hizmetine ait bedelin standart tarife uygulanan bir birim bedelden fazla olmamas ve bu hususlarn yaplacak reklam ve duyurularda kolayca okunabilecek ekilde yer almas,\",\n                        \"Talihlilere kazandklar ikramiye ile bavuru ve teslim s\\xfcresine ilikin tebligatn taahh\\xfctl\\xfc posta kanalyla yaplmas,\",\n                        \"Katlma ilikin t\\xfcm kayt ve belgelerin birer \\xf6rneinin \\xe7ekiliten \\xf6nce manyetik ve/veya elektronik ortamda dareye teslim edilmesi ve\",\n                        \"G\\xfcn\\xfcn teknolojik gelimelerine bal olarak darece yerine getirilmesi uygun g\\xf6r\\xfclen dier hususlar\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmeliin 11. Maddesinde Piyango d\\xfczenleyenler tarafndan dareye verilmesi gereken teminat h\\xfck\\xfcm altna alnmaktadr. Bu h\\xfck\\xfcm uyarnca Piyangoya izin verilebilmesi i\\xe7in, \\xe7ekilite taahh\\xfct edilen ikramiyelerin toplam rayi\\xe7 bedelinin %10 fazlas tutarda teminatn d\\xfczenleyici tarafndan salanmas zorunludur. lgili maddenin 2. ve 3. fkralarnda ise teminatn artabilmesi ve azalabilmesi durumlar belirlenmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmeliin 13. Maddesinde ise zin verilmeyecek haller sralanmaktadr. zin verilmeyen \\xe7eitli durumlarn yan sra (g) bendinde Bir kampanya i\\xe7in darece uygun g\\xf6r\\xfclen adetten daha fazla adette ikramiye taahh\\xfcd\\xfc i\\xe7eren d\\xfczenlemelere ifadesi bulunmaktadr. Bu h\\xfck\\xfcm uyarnca dareye yaplan Piyango d\\xfczenleme bavurusunda belirtilen ikramiyenin adedi, dare tarafndan uygun bulunmad takdirde darece snrlandrabilmektedir. Bu snr aan ikramiye datan Piyangolar ise izin verilmeyecek Piyangolar arasnda g\\xf6sterilmektedir. B\\xf6ylelikle mevzuatta herhangi bir \\xfcst snr/parasal snr belirtilmemekle beraber bu hususun takdiri a\\xe7k ekilde dareye braklmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmeliin devam h\\xfck\\xfcmlerinde ise Piyangolarn ve \\xe7ekililerin izin sonras ger\\xe7ekletirilme usulleri belirlenmektedir. \\xd6te yandan mevzuat h\\xfck\\xfcmlerine a\\xe7k\\xe7a aykr ekilde d\\xfczenlenen Piyangolar hakknda KHKnn 52. Maddesinde h\\xfck\\xfcm altna alnan Cezai H\\xfck\\xfcmler uygulanabilecektir. S\\xf6z konusu h\\xfck\\xfcm u ekildedir:\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"'Madde 52: Bu Kanun H\\xfckm\\xfcnde Kararnamenin 41' nci maddesinde tertip ve \\xe7ekili d\\xfczenleme hakk m\\xfcnhasran dareye tannm olan oyunlar tertipleyenlerle, ayn maddenin ikinci fkras h\\xfckm\\xfcn\\xfc ihlal edenler veya bu fkra h\\xfckm\\xfcne g\\xf6re gerekli izni almakla birlikte \\xe7ekilileri yapmayanlar veya \\xe7ekili sonu\\xe7larn ilan etmeyenler veya taahh\\xfctlerini yerine getirmeyenler ile talih oyunlarnn oynanmasna mahsus oyun makina, ara\\xe7 ve gere\\xe7lerini bozanlar veya bunlar bozuk olmasna ramen kullandranlar veya talih oyunlar ile ilgili olarak her ne ekilde olursa olsun hile yapanlar hakknda y\\xfcz bin liradan on milyon liraya kadar ar para cezas ve iki aydan iki seneye kadar hapis cezas h\\xfckmolunur.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sonu\\xe7 olarak sosyal medyada sklkla karlatmz \\xe7ekililer aslnda izne tabi olan ve yasal mevzuat h\\xfck\\xfcmleri uyarnca belirli artlar tamas gereken piyangolardr. Y\\xf6netmeliin 10. maddesi Sanal Ortam \\xdczerinden Piyango D\\xfczenlenmesi hususunu ele almakta olup, sosyal medyada \\xe7ekili (Piyango) d\\xfczenleyen kiilerin \\xf6zellikle ibu maddede saylan artlar da salamalar gerektii a\\xe7kken bir\\xe7ok \\xe7ekiliin aslnda salanmas gereken artlar salamad da aikardr. \\xd6te yandan \\xe7ekili (Piyango) d\\xfczenlemek isteyen kii tarafndan izin bavurusu yapldnda bavuru i\\xe7in gereken bilgilerden olan kramiye miktar/adedi darece deerlendirilecek olup, bu miktar/adet uygun g\\xf6r\\xfclmedii takdirde ise darece piyango izni verilmeyebilecek ve piyango d\\xfczenleme talebi reddedilebilecektir.\"\n                }\n            ],\n            tags: [\n                \"sosyalmedya\",\n                \"hukuki\",\n                \"dayanak\"\n            ],\n            author: \"\"\n        },\n        {\n            id: 45,\n            subtitle: \"Makale\",\n            date: \"2021\",\n            slug: \"ticari-vekil-veya-temsilci-tarafindan-tescil-edilen-markanin-hukumsuzlugu\",\n            title: \"TCAR VEKL VEYA TEMSLC TARAFINDAN TESCL ETTRLEN MARKANIN H\\xdcK\\xdcMS\\xdcZL\\xdc\\xdc\",\n            text: \"Bir iletmenin mal veya hizmetlerini dierlerinden ayrt eden ve bu ayrm salayacak ekilde de her t\\xfcrl\\xfc kii adlar, s\\xf6zc\\xfckler, ekiller, resimler, logolar, harfler, saylar, mallarn veya ambalajlarn bi\\xe7imi, \\xfc\\xe7 boyutlu ekiller, renkler, kokular marka olarak kullanlabilmektedir. \\xd6te yandan markadan bahsedilebilmesi i\\xe7in her eyden \\xf6nce bir iaretin bulunmas ve bu iaretin bir iletmenin mal veya hizmetlerini, bir baka iletmenin mal veya hizmetlerinden ayrt edebilecek nitelikte olmas gerekmektedir. Bu iki unsura ilaveten, s\\xf6z konusu iaretin, Marka Hukukunun salam olduu korumadan yararlanabilmesi i\\xe7in ayrca usul\\xfcne uygun olarak tescil edilmesi de gerekmektedir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Ticari hayatta \\xf6zellikle tacirlere bir\\xe7ok fayda salayan markalar kimi zaman ger\\xe7ek marka sahipleri dnda kiilerce tescil ettirilebilmekte, b\\xf6ylelikle ger\\xe7ek hak sahiplerinin korunmas gereken menfaatleri ihlal edilebilmektedir. Kanun koyucu, korunmas gereken marka hakk tehlikeye giren ger\\xe7ek marka sahibinin, \\xfc\\xe7\\xfcnc\\xfc kiilerce haksz ekilde tescil edilen markasn geri alabilmesine ya da h\\xfck\\xfcms\\xfcz klabilmesine baz \\xf6zel koullar altnda imkan salamaktadr. Markann h\\xfck\\xfcms\\xfcz klnmas talebi 556 Sayl Markalarn Korunmas Hakknda Kanun H\\xfckm\\xfcnde Kararnamenin (KHK) 42 ve devam maddelerinde d\\xfczenlenmekte iken, 6769 sayl Snai M\\xfclkiyet Kanununun (SMK) y\\xfcr\\xfcrl\\xfce girmesi ile birlikte konuya ilikin h\\xfck\\xfcmler SMKnn 25 ve devam maddelerinde d\\xfczenlenme imkan bulmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar verilebilecek hallerden birisi de uygulamada sklkla karlalan markann ticari vekil ya da temsilci tarafndan tescil ettirilmesi halidir. Kanun koyucu, bu gibi hallerde h\\xfck\\xfcms\\xfczl\\xfck kararnn verilebilmesi i\\xe7in belirli artlarn mevcut olmas gerektiini h\\xfck\\xfcm altna almaktadr. Bu balamda \\xe7almamzda marka hakknda genel bilgilendirmeler yaptktan sonra ticari vekil ya da temsilci tarafndan tescil ettirilen markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar verilebilmesinin artlar, doktrin g\\xf6r\\xfcleri de dahil edilerek, detayl ekilde incelenecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"I. MARKA HAKKINDA GENEL BLGLER\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"A. Markann Tanm\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Markann gerek SMKda gerek KHKda dorudan bir tanmlamas yaplmamaktadr; fakat SMKnn 4. maddesinde marka olabilecek iaretler h\\xfck\\xfcm altna alnmtr. lgili madde uyarnca 'Marka, bir teebb\\xfcs\\xfcn mallarnn veya hizmetlerinin dier teebb\\xfcslerin mallarndan veya hizmetlerinden ayrt edilmesini salamas ve marka sahibine salanan korumann konusunun a\\xe7k ve kesin olarak anlalmasn salayabilecek ekilde sicilde g\\xf6sterilebilir olmas artyla kii adlar d\\xe2hil s\\xf6zc\\xfckler, ekiller, renkler, harfler, saylar, sesler ve mallarn veya ambalajlarnn bi\\xe7imi olmak \\xfczere her t\\xfcr iaretten oluabilir'. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"SMKnn 4. maddesine paralel olarak her ne kadar y\\xfcr\\xfcrl\\xfckten kaldrlm olsa da 09.04.2005 tarih ve 25781 sayl Resmi Gazetede yaymlanarak y\\xfcr\\xfcrl\\xfce giren 556 sayl Markalarn Korunmas Hakknda Kanun H\\xfckm\\xfcnde Kararnamenin Uygulanmasna Dair Y\\xf6netmelikte de marka, 'Bir iletmenin imal\\xe2tn ve/veya ticaretini yapt mallar ve/veya sunduu hizmetleri, baka iletmelerin mal ve/veya hizmetlerinden ayrt etmeye yarayan ticaret ve/veya hizmet markas olarak da nitelendirilebilen iaret' olarak tanmlanmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Nitekim Doktrinde de \\xe7eitli marka tanmlamalar yaplm olup bu tanmlamalar hem mevzuat h\\xfck\\xfcmleri hem de birbirleri ile paralel ifadeler i\\xe7ermektedir. Bir tanma g\\xf6re marka 'bir nesnenin ve \\xf6zellikle ticari mallarn, emtiann tantlmasna, benzerlerinden ayrt edilmesine yarayan iaretlerdir'. Bir dier tanmda ise 'bir teebb\\xfcs\\xfcn mal ve hizmetlerini baka teebb\\xfcs\\xfcn mal ve hizmetlerinden ayrt etmeyi salamas kouluyla kullanlan her t\\xfcrl\\xfc iaret' ifadelerine yer verilmektedir. Doktrinde bulunan dier baz marka tanmlamalar da u ekilde sralanabilecektir: 'Marka kendiliinden bir ticari deer olup snai m\\xfclkiyet haklarndan birini oluturmaktadr.', 'Marka \\xfczerine konulduu eyann ya da hizmetin belli bir iletmeye ait olduunu g\\xf6steren veya eyay ya da hizmeti piyasadaki benzerlerinden ayrt etmeye yarayan tantma ve ayrt etme iaretidir.', 'Marka bir mamul\\xfcn dierinden ayrm ve tehisine yarayan bir iarettir ve \\xfczerinde bulunduu emtiann muayyen bir iletmeye aidiyetini belirtir.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Gerek mevzuat h\\xfck\\xfcmleri gerekse de \\xe7eitli yazarlarn yapm olduu tanmlamalar g\\xf6z \\xf6n\\xfcnde bulundurulduunda marka, bir iletmenin mal veya hizmetlerini dierlerinden ayrt etmeli ve bu ayrm salayacak ekilde de her t\\xfcrl\\xfc kii adlar, s\\xf6zc\\xfckler, ekiller, resimler, logolar, harfler, saylar, mallarn veya ambalajlarn bi\\xe7imi, \\xfc\\xe7 boyutlu ekiller, renkler, kokular marka olarak kullanlabilmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"B. Markann Unsurlar ve levleri\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yukarda yaplan tanmlamalardan da anlalaca \\xfczere bir markadan bahsedilebilmesi i\\xe7in her eyden \\xf6nce kapsam yukarda belirtilen bir iaretin bulunmas ve bu iaretin bir iletmenin mal veya hizmetlerini, bir baka iletmenin mal veya hizmetlerinden ayrt edebilecek nitelikte olmas gerekmektedir. Bu iki unsura ilaveten, s\\xf6z konusu iaretin, Marka Hukukunun salam olduu korumadan yararlanabilmesi i\\xe7in ayrca usul\\xfcne uygun olarak tescil edilmesi de gerekmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xd6te yandan markann gerek hukuki gerekse de ekonomik olarak bir\\xe7ok farkl amaca hizmet eden ilevi bulunmaktadr. Markann ilevleri srasyla kaynak g\\xf6sterme, ayrt etme, garanti ve reklam ilevleridir. Bu ilevleri sayesinde marka, marka sahibine bir\\xe7ok yarar salamakta, ticari faaliyetlerinin y\\xfcr\\xfct\\xfclmesinde b\\xfcy\\xfck \\xf6nem tamaktadr. Sahibine \\xfcretim ve pazarlama balamnda kalite, ticari deer ve itibar kazandrma ilevi g\\xf6rd\\xfc\\xfc i\\xe7in rekabet piyasasnda marka sahiplerini rakiplerin haksz rekabetine kar korumak ve teknoloji ve ekonomi alanlarda gelime g\\xfcvenini salamak, marka hukukunun temel ama\\xe7larn oluturmaktadr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"II. MARKANIN H\\xdcK\\xdcMS\\xdcZL\\xdc\\xdc\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"A. H\\xfck\\xfcms\\xfczl\\xfck Kavram\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"H\\xfck\\xfcms\\xfczl\\xfck, s\\xf6zl\\xfck anlamyla 'Y\\xfcr\\xfcrl\\xfckten \\xe7karlm, y\\xfcr\\xfcrl\\xfc\\xfc kalmam, ge\\xe7ersiz klnm kavramlarna tekab\\xfcl etmektedir. Marka hukuku anlamnda h\\xfck\\xfcms\\xfczl\\xfck ise Tescil edilmi bir markann, gerekli koullara sahip olmamas nedeniyle dava yoluyla iptali ve b\\xf6ylece evvelce elde edilmi marka hakknn son bulmas demektir.'\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"B. H\\xfck\\xfcms\\xfczl\\xfck Talebi ve H\\xfck\\xfcms\\xfczl\\xfck Davas Koullar\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"6769 Sayl Snai M\\xfclkiyet Kanununun Beinci Ksmnda Markann H\\xfck\\xfcms\\xfczl\\xfc\\xfc ve ptaline ilikin h\\xfck\\xfcmler bulunmaktadr. Markann h\\xfck\\xfcms\\xfcz klnmas talebi 25. maddenin 2. fkrasnda d\\xfczenlenmekte olup, madde uyarnca 'Menfaati olanlar, Cumhuriyet savclar veya ilgili kamu kurum ve kurulular markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcn\\xfc mahkemeden isteyebilir'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yukarda a\\xe7klanan h\\xfck\\xfcms\\xfczl\\xfck talebinde bulunabilecek kiilerin bu taleplerinin \\xf6ne s\\xfcr\\xfclebilmesi, bir baka deyile marka h\\xfck\\xfcms\\xfczl\\xfck davas a\\xe7labilmesi i\\xe7in baz artlarn birlikte mevcut olmas gerekmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu artlardan ilki bir \\xf6n koul olan tescilli bir markann bulunmasdr. Bilindii \\xfczere bir marka \\xfczerinde hak iddia edilebilmesi ve marka sahipliinin s\\xf6z konusu olabilmesi ilgili markann tesciline baldr. Doktrinde bu duruma marka hakknn iktisabnda tescil ilkesi veya sadece tescil ilkesi denilmektedir. Dolaysyla, bir iaretin marka olarak kabul edilmesi ve Marka Hukukunun salad korumadan yararlanabilmesi i\\xe7in \\xf6ncelikle ilgili mevzuatta bulunan usul ve esaslara uygun olarak tescil edilmi olmas gerekmektedir. Aksi takdirde, ortada tescilli bir marka bulunmayacandan bunun h\\xfck\\xfcms\\xfczl\\xfc\\xfc veya iptalinden s\\xf6z etmek de m\\xfcmk\\xfcn olamayacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mahkemeden tescilli bir markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar verilmesini isteyebilmek i\\xe7in gerekli ikinci ve en \\xf6nemli koul ise SMKnn 25. maddesinde belirtilen hallerden birinin bulunmasdr. lgili maddede \\xe7eitli haller saylmakla beraber uygulamada sklkla karlalan uyumazlklar SMKnn 5. ve 6. maddelerinde saylan marka tescilinde red i\\xe7in mutlak ve nispi nedenlerin bulunmas sebebiyle markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcn\\xfcn talep edilmesi noktasnda karmza \\xe7kmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"SMKnn Marka tescilinde red i\\xe7in nispi nedenler balkl 6. maddesinin ikinci fkrasnda Ticari vekil veya temsilcinin, marka sahibinin izni olmakszn ve hakl bir sebebe dayanmakszn markann ayn veya ayrt edilemeyecek kadar benzerinin kendi adna tescili i\\xe7in yapt bavuru, marka sahibinin itiraz \\xfczerine reddedilir. h\\xfckm\\xfc bulunmaktadr. SMKnn 25/1 maddesinde 6. maddeye atf yapldndan, ticari vekil ya da temsilci tarafndan tescil edilen markann, marka sahibinin usul\\xfcne uygun bavurusu ile h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar verilebilecei anlalmaktadr. Fakat s\\xf6z konusu h\\xfck\\xfcms\\xfczl\\xfck kararnn verilebilmesi i\\xe7in belirli artlarn mevcut olmas gerekmektedir. Bu balamda \\xe7almamzn devamnda ticari vekil ya da temsilci tarafndan tescil ettirilen markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar verilebilmesinin artlar incelenecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"III. MARKANIN TCAR VEKL VEYA TEMSLC TARAFINDAN TESCL\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"SMKnn 10. ve ve 25. maddelerinde markas hukuka aykr ekilde ticari vekili veya temsilcisi tarafndan tescil ettirilmi olan marka sahibine, (a) markann kullanmnn durdurulmasn, (b) markann kendisine devredilmesini veya (c) tescilin h\\xfck\\xfcms\\xfczl\\xfc\\xfcn\\xfc isteme haklar tannmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xf6z konusu d\\xfczenlemelerin amac, ticari hayatta tacirlerin fazlasyla g\\xfcvendii ticari vekil ya da temsilciler karsnda ger\\xe7ek marka sahibi olan tacirin menfaatlerini haksz m\\xfcdahalelere kar korumak ve marka sahibi ile yakn ilikide olmas sebebiyle markaya ait bilgilere sahip olan tacir yardmclarnn bu bilgiden haksz ekilde yararlanmasn engellemektir. B\\xf6ylece bir ticari ilikinin temeli olan g\\xfcven ve d\\xfcr\\xfcstl\\xfck ilkelerinin ihlali yoluyla ticari vekil veya temsilci tarafndan marka \\xfczerinde eklen oluturulmu m\\xfclkiyet hakk kullanmn durdurulmas yoluyla kstlanmakta, devir veya h\\xfck\\xfcms\\xfczl\\xfck ile de sona erdirilmektedir. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Markann ticari vekil ya da temsilci tarafndan tescili halinde ger\\xe7ek marka sahibinin markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcn\\xfc talep edebilmesi i\\xe7in aada yer alan baz unsurlarn bir arada bulunmas gerekmektedir:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Taleplerin ger\\xe7ek marka sahibi tarafndan ileri s\\xfcr\\xfclmesi,\",\n                        \"Markann ticari vekil veya temsilci adna tescil edilmi olmas,\",\n                        \"Markalarn ayn veya benzer olmas,\",\n                        \"Marka sahibinin tescil i\\xe7in ticari vekil ya da temsilciye onay vermemi olmas, ve son olarak\",\n                        \"Ticari vekil ya da temsilcinin marka tescili i\\xe7in hakl bir nedeninin bulunmamasdr.\"\n                    ]\n                },\n                {\n                    type: \"subheader\",\n                    content: \"A. Ger\\xe7ek Marka Sahibinin Bavuruda Bulunmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"SMKnn 25 ve devam maddelerinin uygulanarak h\\xfck\\xfcms\\xfczl\\xfck karar verilebilmesi i\\xe7in \\xf6ncelikle markann ger\\xe7ek sahibi tarafndan bir talepte bulunulmas gerekmektedir. Markay kullanan, lehine lisans hakk tannan kiiler bu talebi ileri s\\xfcremeyecektir. Ayrca markann ger\\xe7ek sahibinin marka \\xfczerindeki haklarnn, ticari vekil ya da temsilci tarafndan yaplan tescil bavurusundan \\xf6nce hali hazrda var olmas gerekmektedir. Bu husus Yargtay kararlarnda da ele alnm olup h\\xfck\\xfcms\\xfczl\\xfck talebini ileri s\\xfcrebilmek i\\xe7in kesin olarak markann ger\\xe7ek sahiplii sfatnn varl aranmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"556 sayl KHK'nn 8/.... fkras uyarnca 'Marka sahibinin ticari vekili veya temsilcisi tarafndan markann kendi adna tescili i\\xe7in, marka sahibinin izni olmadan ve ge\\xe7erli bir gerek\\xe7e g\\xf6sterilmeden yaplan bavuru, marka sahibinin itiraz \\xfczerine reddedilir.' Ayrca ayn KHK'nn 11. maddesine g\\xf6re, marka sahibinin izni alnmadan marka tescili yaplmas halinde marka sahibinin kullanma itiraz etme hakk olduu gibi, .... madde uyarnca da yine hakl bir gerek\\xe7e olmakszn markann ticari vekil ya da temsilci adna tescili halinde markann kendi adna devredilmesini isteme yetkisi vardr. Yine 556 sayl KHK'nn 8/.... maddesinde belirtilen itiraz nedenine dayal olarak ger\\xe7ek hak sahibinin h\\xfck\\xfcms\\xfczl\\xfck davas a\\xe7abilecei de ayn KHK'nn 42/b bendinde d\\xfczenlenmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Anlan h\\xfck\\xfcmlerde, ticari temsilci ya da vekilin hakl bir neden olmakszn marka tescili yaptrmas halinde, ger\\xe7ek hak sahibinin ileri s\\xfcrebilecei talepler ayr ayr belirtilmek suretiyle, tescilde k\\xf6t\\xfcniyetin varlna ilikin \\xf6zel haller de ayn kapsamda d\\xfczenlenmi ve yukarda a\\xe7klanan se\\xe7eneklere dayal olarak dava a\\xe7ma hakk ger\\xe7ek marka hakk sahibine tannmtr. Dairemizin yerleik uygulamas bu y\\xf6ndedir.'\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"B. Markann Ticari Vekil Veya Temsilci Adna Tescil Edilmi Olmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mevcut olmas gereken bir dier temel art ise uyumazlk konusu markann, markann ger\\xe7ek sahibinin ticari vekili veya temsilcisi adna tescilli olmasdr. Bu art \\xf6zelinde \\xf6nemli olan husus marka sahibi ile hi\\xe7bir ilikisi i\\xe7erisinde olmayan kiiler ile marka sahibi ile iliki i\\xe7erisinde olmasna ramen bu ilikinin ticari vekillik/temsilcilik kapsamnda olmad kiiler bakmndan SMKnn ilgili h\\xfck\\xfcmleri uygulama alan bulmayacadr. Bir baka deyile, markann ger\\xe7ek sahibinin \\xe7alan olup ticari vekil/temsilci sfatna sahip olmayan dier personeller tarafndan tescil edilen markalar a\\xe7sndan h\\xfck\\xfcms\\xfczl\\xfck talebiyle dava a\\xe7lmas m\\xfcmk\\xfcn olmayacaktr. Taraflar arasnda vekillik veya temsilcilik ilikisinin bulunduunu ispat y\\xfck\\xfc ise ger\\xe7ek marka sahibindedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu hususta marka sahibi ile ticari vekil veya temsilci arasndaki iliki tespit edilirken geni yorumlama yaplmas gerekmektedir. Nitekim ilgili mevzuatta tanmland ekliyle ticari vekil ve temsilcinin markay tescil ettirmesi art aranm olsayd ger\\xe7ekten de uygulamada ger\\xe7ek marka sahiplerinin aleyhine bir d\\xfczenleme olaca \\xfcphesizdir. Oysaki bu terimler geni yorumlandnda ger\\xe7ek marka sahibi ile taraflar arasnda d\\xfcr\\xfcstl\\xfck ve sadakat y\\xfck\\xfcml\\xfcl\\xfc\\xfc douran, s\\xf6zlemesel bir ticari ilikiye girmi kiiler (satc, datc, lisans veya franchise alan vs) de bu kapsamda deerlendirilmelidir. \\xd6zellikle yabanc marka sahibinin \\xfcr\\xfcnlerini T\\xfcrkiye'de pazarlayan tek yetkili satcnn veya marka sahibiyle yapt franchising s\\xf6zlemesine dayanarak marka sahibinin sisteminden yararlanan franchise alann markay kendi adna tescil ettirmesi halinde de ger\\xe7ek marka sahibi h\\xfck\\xfcms\\xfczl\\xfck talep etme hakkna sahip olmaldr. Nitekim bu husus Yargtay kararlarnda da sabittir:\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"'Mahkemece iddia, savunma, ve t\\xfcm dosya kapsamna g\\xf6re, 2006-2007 yllarnda davac ile daval arasnda bir distrib\\xfct\\xf6rl\\xfck ilikisinin bulunduunun taraflar arasnda \\xe7ekimesiz olduu, ECHO markasnn ger\\xe7ek hak sahibinin davac irket olduu ve davacnn bu makay bata Japonya olmak \\xfczere pek \\xe7ok \\xfclkede kulland, marka tescillerinin mevcut olduu, davacnn T\\xfcrkiye distrib\\xfct\\xf6r\\xfc olarak bir s\\xfcre faaliyet g\\xf6steren daval tarafn, dava konusu markay kendi adna tescil ettirebilmesi i\\xe7in markann ger\\xe7ek sahibinin iznini almas ve 556 sayl KHK'nn .... maddesi anlamndan hakl bir gerek\\xe7esinin bulunmasnn gerektii, ancak daval tarafn, bu tescili yaptrrken davacnn iznini aldn ya da hakl bir gerek\\xe7esinin bulunduunu ispat edemedii, davac irketin T\\xfcrkiye distrib\\xfct\\xf6rl\\xfc\\xfcn\\xfc davaldan alarak baka bir irket vermesi de, KHK' nun .... maddesi anlamnda hakl bir gerek\\xe7e olmad, bu nedenle daval tarafndan yaptrlan tescilin k\\xf6t\\xfc niyetli olduu gerek\\xe7esiyle davann ksmen kabul\\xfc ile 556 sayl KHK'nn .... maddesi gereince markann, ger\\xe7ek hak sahibi olan davacya devrine'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Her somut olay ve uyumazlk \\xf6zelinde taraflar arasndaki ticari ilikinin nitelii ve kapsam ayr ayr deerlendirilmelidir. Taraflarn uzun s\\xfcreler boyunca ticari iliki i\\xe7erisinde olmas durumunda markann ger\\xe7ek sahibinin gerekmesi halinde bu kiilere kar da marka h\\xfck\\xfcms\\xfczl\\xfck davas a\\xe7abilmesi s\\xf6z konusu olmalyken taraflar arasndaki ilikinin bir veya birka\\xe7 seferlik mal veya hizmet almna dayanmas durumunda markann ger\\xe7ek sahibinin bu kiilere kar marka h\\xfck\\xfcms\\xfczl\\xfck davas a\\xe7amayacann kabul edilmesi gerekecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu noktada uygulamada karlalabilecek esasl sorunlardan birisi de markann ger\\xe7ek sahibi ile hen\\xfcz ticari iliki i\\xe7erisinde olmayan fakat ticari iliki g\\xf6r\\xfcmeleri ciddi ekilde devam eden bir ahs tarafndan yaplan tescile veya tescil ger\\xe7ekletikten sonra balayan ticari ilikiye bu h\\xfck\\xfcmlerin uygulanp uygulanamayacadr. Nitekim tacirler arasnda yaplan ticari faaliyet balangc g\\xf6r\\xfcmelerinde gizlilik esas olup, ciddi ekilde ilerleyen g\\xf6r\\xfcmelerde son noktaya gelindiinde g\\xf6r\\xfcmelerin olumsuz ekilde sonu\\xe7landrlmas s\\xf6z konusu olabilecek, bu durumda gelinen aamaya kadar dier tarafa aktarlan gizli bilgiler sebebiyle gizli bilgiyi aktaran taraf nezdinde \\xe7eitli sorunlar domas muhtemel olacaktr. Kanaatimizce bu durumda marka sahibi ile ticari vekil veya temsilci arasndaki ilikiyi d\\xfczenleyen h\\xfck\\xfcmlerden degil, genel h\\xfck\\xfcmlerden yararlanarak ger\\xe7ek hak sahiplii, \\xf6nceye dayal kullanm, k\\xf6t\\xfc niyetli tescil gibi gerek\\xe7elerle markann h\\xfck\\xfcms\\xfcz klnmas s\\xf6z konusu olmaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Son olarak deinilmesi gereken husus ise markann bizzat marka sahibi ile ticari iliki i\\xe7erisinde olan ticari vekil veya temsilci tarafndan deil, bu kiilerin y\\xf6nlendirmesi ile hareket eden veya bu kiiler \\xfczerinden menfaat elde eden kiiler tarafndan tescil edilmesi halinde bu kiilerin de ticari vekil veya temsilci kabul edilmesi gerektiidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ksacas ticari vekil veya temsilci terimlerinin dar yorumlanmas kanun koyucunun oluturmay ama\\xe7lad korumay salamayacak ve  marka korsanl ile m\\xfccadeleyi de zayflatarak ticari vekil veya temsilcinin haksz bir ekilde markay ele ge\\xe7irmesine imkan verecektir. \\xd6te yandan kanun koyucunun amacna aykrlk tekil etmemek i\\xe7in de geniletici yorum dikkatli bir ekilde kullanlmal ve marka sahibinden mal veya hizmet satn alan herkes ticari vekil veya temsilci kapsamna sokulmamal, taraflar arasnda karlkl g\\xfcven ve sadakat douran ve belli bir s\\xfcreklilik tayan ilikinin taraflar bu kapsamda deerlendirilmelidir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"C. Markalarn Ayn Veya Benzer Olmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7almann ilk ksmlarnda da a\\xe7kland \\xfczere SMKnn 6. maddesinin 2. fkras ... markann ayn veya ayrt edilemeyecek kadar benzerinin kendi adna tescili i\\xe7in, ... yaplan bavuru, marka sahibinin itiraz \\xfczerine reddedilir. h\\xfckm\\xfcn\\xfc i\\xe7ermektedir. Y\\xfcr\\xfcrl\\xfckten kaldrlan KHKnn 8. maddesi g\\xf6z \\xf6n\\xfcnde bulundurulduunda m\\xfclga mevzuatta net bir a\\xe7klama bulunmamakla beraber h\\xfck\\xfcms\\xfczl\\xfc\\xfc talep edilen markann ger\\xe7ek marka sahibinin markas ile ayn olmas gerektii anlalmaktadr. Fakat ticari vekil ya da temsilci tarafndan ger\\xe7ek marka sahibinin markasnn benzerinin tescil edildii durumlarda bu markann da h\\xfck\\xfcms\\xfczl\\xfc\\xfcn\\xfcn talep edilip edilemeyecei hususunda kanun koyucu bir netlik getirmemitir. Bu belirsizliin giderilmesi amacyla SMKnn ilgili maddesine markann ayn veya ayrt edilemeyecek kadar benzerinin ifadesi eklenmi olup, korumann kapsam geniletilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"SMKda getirilen ek d\\xfczenlemeye paralel olarak kanaatimizce de markann birebir aynsnn yan sra ayrt edilemeyecek kadar benzerinin tescil ettirilmesi halinde de markann ger\\xe7ek sahibinin h\\xfck\\xfcms\\xfczl\\xfck talep edebilme hakk olmaldr. Zira birebir ayn markann, ger\\xe7ek sahibine devrine veya h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar verilip, benzerinin ticari vekil veya temsilci uhdesinde braklmas veya h\\xfck\\xfcms\\xfcz klnmamas hakkaniyete aykr olaca gibi ticari vekil ya da temsilcinin k\\xf6t\\xfc niyetinin de korunmas anlamna gelecektir. Nitekim SMKnn y\\xfcr\\xfcrl\\xfce girmesinden \\xf6nce bu konuda bir netlik bulunmamakta iken Yargtayn 1999 ylnda verdii bir kararda da, G\\xfcney Korede tescilli bir saat markasnn T\\xfcrkiyede pazarlayan kii tarafndan \\xe7ok benzerinin kendi adna tescil ettirmesinde benzerlie ve iltibasa meydan vermesine ramen T\\xfcrk Medeni Kanununun 2. maddesine dayanarak T\\xfcrkiyedeki tescilin h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu konuya ilikin bir dier sorun ise ticari vekil ya da temsilcinin ayn veya benzer markay ger\\xe7ek marka sahibinin y\\xfcr\\xfctt\\xfc\\xfc ticari faaliyetlerden farkl ekilde, tamamen baka mal veya hizmet sat i\\xe7in tescil ettirmesi durumunda s\\xf6z konusu markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar verilip verilemeyeceidir. Bu noktada dikkate alnmas gereken kriter taraflarca t\\xfcketicilere salanan mal ve hizmetler bakmndan t\\xfcketiciler nezdinde herhangi bir karkla sebebiyet verilip verilmediidir. Eer ticari vekil ya da temsilcinin tescil ettirdii marka, ger\\xe7ek marka sahibinin faaliyette bulunduu mal ve hizmetlerden tamamen farkl mal ve hizmetlere ilikin tescil ettirilmi ise ve mal ve hizmetler a\\xe7sndan herhangi bir balant kurulamyorsa ger\\xe7ek marka sahibi tarafndan markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcn\\xfcn talep edilemeyeceinin kabul\\xfc hakkaniyete uygun olacaktr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"D. Marka Sahibinin Tescil i\\xe7in Ticari Vekil Ya Da Temsilciye Onay Vermemi Olmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ger\\xe7ek marka sahibi tarafndan marka h\\xfck\\xfcms\\xfczl\\xfck talebinde bulunulabilmesi i\\xe7in gereken koullardan bir dieri ise markann tescil edilmesi hususunda ger\\xe7ek marka sahibi tarafndan ticari vekil veya temsilciye yetki verilmemi olmasdr. Karkla mahal vermemek adna s\\xf6z konusu yetki ile tacir ve ticari vekil veya temsilci arasndaki iliki kapsamnda verilen yetki deil, markann T\\xfcrk Patent ve Marka Kurumu nezdinde tescil ettirilmesine ilikin ticari vekil veya temsilciye yetki verilmesi kastedilmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ticari vekil veya temsilci tarafndan tescil ettirilen marka aleyhine a\\xe7lan h\\xfck\\xfcms\\xfczl\\xfck davalarnda menfi durumun ispat marka sahibinden istenemeyeceinden marka sahibinin izninin varlnn markay tescil ettiren ticari vekil veya temsilci tarafndan ispatlanmas gerekecektir. Fakat s\\xf6z konusu iznin/yetkilendirmenin ger\\xe7ek marka sahibi tarafndan nasl verilmi olmas gerektii noktasnda doktrinde bir fikir birlii bulunmamaktadr. Nitekim kimine g\\xf6re ger\\xe7ek marka sahibinin ticari vekil ya da temsilciyi markann kendisi adna tescil ettirilmesi hususunda yetkilendirdiinin kabul edilebilmesi i\\xe7in bu hususun ger\\xe7ek marka sahibi tarafndan a\\xe7k ve net bir ekilde ifade edilmi olmas gerekir. Muvafakat, haktan vazge\\xe7ildiini inkar edilemez ekilde g\\xf6sterecek a\\xe7klkta olmaldr. Bir dier g\\xf6r\\xfce g\\xf6re ise  SMK madde 6/2de atf yaplan izin herhangi bir ekil artna tabi deildir. Bu nedenle, bu t\\xfcr bir yetkilendirme veya iznin yazl bir s\\xf6zlemeye dayanmas gerekmez. Benzer ekilde, bu t\\xfcr bir yetkilendirme veya iznin 'a\\xe7k' olmas da gerekmez. Ger\\xe7ek marka sahibinin, markann kendi adna tescili i\\xe7in ticari vekili veya temsilcisine verecei yetki veya izin zmni (\\xf6rt\\xfck) de olabilir. Her somut olay \\xf6zelinde yaplacak bir deerlendirme ile marka tescili i\\xe7in a\\xe7k ya da zmni, yazl ya da s\\xf6zl\\xfc bir yetkilendirme veya izin olup olmadnn deerlendirilmesi, fakat her hal\\xfckarda s\\xf6z konusu yetki veya iznin varlnn ticari vekil ya da temsilci tarafndan ispatlanmas hukuka uygun olacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xd6te yandan, ticari vekil ya da temsilcinin sahip olduu daha kapsaml bir piyasa bilgisine ve ticari markann korunmas i\\xe7in daha hzl ve daha verimli \\xf6nlemler alma yeteneine dayanan bu t\\xfcrde bir yetki veya izin, taraflar arasndaki tacir-tacir yardmcs ilikisi devam etmekte olsa dahi herhangi bir zamanda ger\\xe7ek marka sahibi tarafndan iptal edilebilir. Ger\\xe7ek marka sahibi, hakl ve hukuki gerek\\xe7elerle ticari vekil ya da temsilciye verdii tescil ettirme yetkisini iptal ederse, bu durumda tescilli markann kullanmnn durdurulmas, markann kendi adna tescil edilmek \\xfczere devredilmesi ve markann h\\xfck\\xfcms\\xfcz klnmasn da talep edebilir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"E. Ticari Vekil Ya Da Temsilcinin Marka Tescili \\xe7in Hakl Bir Nedeninin Bulunmamas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"SMK madde 6/2 h\\xfckm\\xfcnde ticari vekil ya da temsilcinin marka tescili i\\xe7in hakl bir nedeninin bulunmas durumunda ger\\xe7ek marka sahibi tarafndan ileri s\\xfcr\\xfclecek marka h\\xfck\\xfcms\\xfczl\\xfck taleplerinin reddedilecei dolayl olarak ifade edilmektedir. Ger\\xe7ek marka sahibinin markann ticari vekil ya da temsilci tarafndan tesciline izin verdii halde hakl nedenin varlnda kuku yoktur. Fakat hakl nedenin kapsamnn belirlenebilmesi i\\xe7in daha geni kapsaml bir deerlendirme yaplmal ve sadece izin olup olmadna baklmamaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Maddede ifade edilen 'hakl nedenin ne olduu' doktrinde tartlm, ve 2 farkl g\\xf6r\\xfc ortaya \\xe7kmtr. Maddede belirtilen anlamdaki herhangi bir hakl gerek\\xe7enin ancak s\\xf6zlemeye dayal olabileceini iddia eden Tekinalp a\\xe7sndan temsilcinin, acentenin veya datcnn yatrm, korunma ihtiyac, markay tescil ettirme eylemini hakl \\xe7karmaz. Bu balamda, yazar, ger\\xe7ek marka sahibi ile ticari vekil ya da temsilci arasndaki s\\xf6zlemenin, ticari vekil ya da temsilciye ticari markay kendi adna tescil ettirme hakk vermesi durumunda, temsilcinin eyleminin hakl \\xe7karlabileceini savunmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Aksi kanaatte olan Arkana g\\xf6re ise Marka sahibinin izni olmadan markann ticari vekil veya temsilcisi adna tescili i\\xe7in yaplan bavurunun itiraz \\xfczerine reddedilebilmesi i\\xe7in, ticari vekil veya temsilcinin ge\\xe7erli bir gerek\\xe7e g\\xf6stermemesi gerekir. Bu anlamda ge\\xe7erli gerek\\xe7e, uzun ve zahmetli bir \\xe7alma sonucunda markay ilgili piyasaya tantan, ona itibar kazandran ticari vekil veya temsilcinin haklarnn etkin bi\\xe7imde korunmas ihtiyac olabilir. \\xd6zellikle marka sahibi yabanc \\xfcreticinin, ticari vekil veya temsilcinin faaliyette bulunduu piyasa ile ilgisinin kalmadn a\\xe7k\\xe7a veya davranlaryla g\\xf6sterdii hallerde bu husus \\xf6nem kazanr. Yabanc marka sahibinin, ticari vekilin faaliyet g\\xf6sterdii piyasada sat yaplan mallarda kulland markann koruma s\\xfcresinin yenilenmesi hususunda hi\\xe7bir teebb\\xfcste bulunmamas; bu marka hakkndan vazge\\xe7mesinde olduu gibi. Bu gibi hallerde marka sahibi, makasnn acente, tek satc adna tesciline itiraz edememelidir. Arkann yukarda belirtilen a\\xe7klamalar doktrindeki dier baz yazarlar tarafndan da benimsenmitir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"IV. SONU\\xc7\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcne karar verilebilecek hallerden birisi de uygulamada sklkla karlalan markann ticari vekil ya da temsilci tarafndan tescil ettirilmesi halidir. SMKnn 10. ve 25. maddelerinde markas hukuka aykr ekilde ticari vekili veya temsilcisi tarafndan tescil ettirilmi olan marka sahibine, markann kullanmnn durdurulmasn, markann kendisine devredilmesini veya tescilin h\\xfck\\xfcms\\xfczl\\xfc\\xfcn\\xfc isteme haklar tannmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xf6z konusu d\\xfczenlemelerin amac, ticari hayatta tacirlerin fazlasyla g\\xfcvendii ticari vekil ya da temsilciler karsnda ger\\xe7ek marka sahibi olan tacirin menfaatlerini haksz m\\xfcdahalelere kar korumak ve marka sahibi ile yakn ilikide olmas sebebiyle markaya ait bilgilere sahip olan tacir yardmclarnn bu bilgiden haksz ekilde yararlanmasn engellemektir. B\\xf6ylece bir ticari ilikinin temeli olan g\\xfcven ve d\\xfcr\\xfcstl\\xfck ilkelerinin ihlali yoluyla ticari vekil veya temsilci tarafndan marka \\xfczerinde eklen oluturulmu m\\xfclkiyet hakk kullanmn durdurulmas yoluyla kstlanmakta, devir veya h\\xfck\\xfcms\\xfczl\\xfck ile de sona erdirilmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Markann ticari vekil ya da temsilci tarafndan tescili halinde ger\\xe7ek marka sahibinin markann h\\xfck\\xfcms\\xfczl\\xfc\\xfcn\\xfc talep edebilmesi i\\xe7in baz unsurlarn bir arada bulunmas gerekmektedir. Bu unsurlar: Taleplerin ger\\xe7ek marka sahibi tarafndan ileri s\\xfcr\\xfclmesi, Markann ticari vekil veya temsilci adna tescil edilmi olmas, Markalarn ayn veya benzer olmas, Marka sahibinin tescil i\\xe7in ticari vekil ya da temsilciye onay vermemi olmas ve son olarak Ticari vekil ya da temsilcinin marka tescili i\\xe7in hakl bir nedeninin bulunmamasdr. T\\xfcm bu koullarn eksiksiz ve bir arada salanmas durumunda usul\\xfcne uygun ekilde mahkemeye yaplan markann h\\xfck\\xfcms\\xfczl\\xfc\\xfc talepli bavurular mahkeme tarafndan kabul edilmeli ve marka h\\xfck\\xfcms\\xfcz klnmaldr. Unutulmamaldr ki burada a\\xe7klam olduumuz kriterler g\\xf6z \\xf6n\\xfcnde bulundurularak bir deerlendirme yaplmas da hakkaniyet ve d\\xfcr\\xfcstl\\xfck kurallarna uygun bir sonuca varabilmek adna \\xf6nem tamaktadr.\"\n                }\n            ],\n            tags: [\n                \"markannh\\xfck\\xfcms\\xfczl\\xfc\\xfc\",\n                \"temsilci\",\n                \"ticarivekil\"\n            ],\n            author: \"\"\n        },\n        {\n            id: 44,\n            subtitle: \"GDPR Karar\",\n            date: \"15.05.2024\",\n            title: \"Finlandiya Veri Koruma Otoritesi, eriim talebinde bulunan ilgili kiiden imzal bir form ve kimliinin bir kopyasn g\\xf6ndermesini talep eden veri sorumlusunun ilgili kii haklarnn kullanlmasn kolaylatrmadna karar verdi.\",\n            slug: \"saklama-surelerine-uyulmasi\",\n            text: \"Bir ilgili kiinin veri sorumlusuna yapt eriim talebi bavuru koullarna uyulmamas sebebiyle veri sorumlusu tarafndan reddedilmitir. Bunun \\xfczerine yaplan inceleme kapsamnda Otorite veri sorumlusundan, ilgili kii haklarnn kullanlmasn nasl kolaylatrdna ve saklama s\\xfcrelerine ilikin bilgi talebinde bulunmutur. Talebe verilen yant sonucunda Otorite, ilgili kiilerin eriim talebi i\\xe7in imzal bir form ve kimliklerinin bir kopyasn sunmasnn makul olmayan bir \\xe7aba gerektirdiini deerlendirerek, veri sorumlusunun ilgili kii haklarnn kullanlmasn kolaylatrmadna karar vermitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Finlandiya Veri Koruma Otoritesine (Finlandiya DPA veya Otorite), bir ilk yardm eitimi salaycsnn (''Veri Sorumlusu''), ilgili kiinin eriim hakkn kullanabilmesi i\\xe7in e-posta yoluyla imzal bir form ve kimliinin bir kopyasn g\\xf6ndermesini talep ettii bildirilmitir. lgili kii bir eriim talebinde bulunmu ancak doldurulmu bir form ve kimlik fotokopisi sunmamtr. Bu nedenle, veri sorumlusu tarafndan ilgili kiinin kiisel verilerine eriim imkan salanmamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, veri sorumlusundan ilgili kii haklarnn kullanlmasn nasl kolaylatrdn ve kiisel verileri ne kadar s\\xfcreyle sakladn a\\xe7klamasn istemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Talebe cevaben veri sorumlusu; ilgili kiinin kimliini teyit edemediini \\xe7\\xfcnk\\xfc eriim talebinin yalnzca ilgili kiinin adn ve e-posta adresini i\\xe7eren bir e-posta ile g\\xf6nderildiini a\\xe7klamtr. Bu e-posta ile  veri sorumlusu tarafndan talebin yerine getirilemedii \\xe7\\xfcnk\\xfc ilgili kiinin imzal bilgi talep formunu g\\xf6ndermedii veya veri sorumlusu tarafndan talep edildii ekilde kimliini belirtmeyi kabul etmedii iddia edilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu saklama s\\xfcreleri ile ilgili olarak, tamamlanan eitimin \\xfc\\xe7 yl boyunca ge\\xe7erli olduunu ve kiisel verilerin ge\\xe7erlilik s\\xfcresinin bitiminden iki yl sonra silineceini belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, veri sorumlusu tarafndan salanan bilgilere dayanarak;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"veri sorumlusunun ilgili kiinin kimliini belirleme y\\xf6nteminin vaka/durum baznda bir deerlendirmeye dayanmadn ve kimlik belgesinin bir kopyasnn talep edilmesinin standart bir kimlik belirleme y\\xf6ntemi olduunu deerlendirmitir.\",\n                        \"veri sorumlusunun GDPR Madde 12(6) uyarnca ilgili kiinin kimliini teyit etmek i\\xe7in ek bilgi talep etme imkannn makul olmayan gerekliliklere ve ilgili kii ile talep edilen kiisel veriler arasndaki balanty dorulamak i\\xe7in gerekli olmayan kiisel verilerin toplanmasna yol a\\xe7mamas gerektiini vurgulamtr.\",\n                        \"ilgili kiinin imzal bir form ve kimliinin bir kopyasn g\\xf6nderirken makul olmayan bir \\xe7aba sarf etmesi nedeniyle, veri sorumlusunun GDPR Madde 12(2) uyarnca ilgili kii haklarnn kullanlmasn kolaylatrmadn tespit etmitir.\",\n                        \"ayrca, veri sorumlusu tarafndan belirlenen saklama s\\xfcresine dayanarak, ilgili kiinin eriim talebinden \\xf6nce bile ilgili kiinin kiisel verilerini silmi olmas gerektiini belirtmitir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Toplanan bilgilere dayanarak Otorite, veri sorumlusunun GDPR Madde 5(1)(c), GDPR Madde 5(1)(e), GDPR Madde 12(2), GDPR Madde 12(6) ve GDPR Madde 25(2)'yi ihlal ettiine karar vermitir.GDPR Madde 58(2)(c) uyarnca Otorite, veri sorumlusunun ilgili kiinin eriim talebini yerine getirmesini emretmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Son olarak Otorite, GDPR Madde 58(2)(d) uyarnca veri sorumlusunun kimlik dorulama politikasn GDPR'n yukarda belirtilen h\\xfck\\xfcmlerine uyacak ekilde deitirmesini ve belirtilen saklama s\\xfcresinden daha eski kiisel verileri gereksiz gecikme olmakszn silmesini emretmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://gdprhub.eu/index.php?title=Tietosuojavaltuutetun_toimisto_(Finland)_-_TSV/224/2023&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"verikoruma\",\n                \"kiiselveri\",\n                \"veri\",\n                \"data\"\n            ]\n        },\n        {\n            id: 43,\n            subtitle: \"IAPP Haberleri\",\n            date: \"14.05.2024\",\n            title: \"Haftalk IAPP Haberleri 8-14 Mays 2024\",\n            slug: \"haftalik-iapp-haberleri-8-14-mayis-2024\",\n            text: \"D\\xfcnya genelinde kiisel verilere ilikin g\\xfcncel gelimeler.\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1- Avrupal sendikalar tarafndan Amazon \\xe7alanlarnn g\\xf6zetlenmesi hakknda soruturma balatlmas talep edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Euronews tarafndan yaymlanan haberde, on bir Avrupa \\xfclkesini temsil eden sendika liderlerinin ilgili veri koruma otoritelerinden Amazon'un \\xe7alanlarn izleme uygulamalarnn incelenmesini istedikleri bildirildi. Bahse konu talebin, Fransa Veri Koruma Otoritesi tarafndan Amazon'un itiraz ettii ar izleme iddialar nedeniyle perakende devine para cezas verilmesinin ardndan geldii belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/trade-unions-push-for-amazon-worker-surveillance-probe\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2- spanya Veri Koruma Otoritesi (''AEPD'') ve b\\xf6lgesel veri koruma otoriteleri tarafndan Wi-Fi izleme teknolojisine ilikin bir klavuz yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"AEPD tarafndan, mobil cihazlarn yaydklar Wi-Fi sinyalleri araclyla izlenmesine olanak tanyan Wi-Fi izleme teknolojisini kullanmak isteyen kurululara ilikin olarak \\xfc\\xe7 b\\xf6lgesel veri koruma otoritesi ile hazrlanan ortak bir klavuz yaymland. Veri koruma otoriteleri tarafndan yaplan a\\xe7klamada, bu t\\xfcr bir teknoloji kullanlmadan \\xf6nce bir veri koruma etki deerlendirmesinin yaplmas gerektii belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/aepd-regional-dpas-issue-guidance-for-wi-fi-tracking-technology\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3- Birleik Krallk ordu mensuplar bir veri ihlalinden etkilendi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"BBC News tarafndan yaymlanan habere g\\xf6re, Birleik Krallk Savunma Bakanl'nn maa bordrosu yapan firmaya y\\xf6nelik bir siber saldryla mevcut ve eski Birleik Krallk ordu mensuplarnn kiisel verilerinin ele ge\\xe7irildii a\\xe7kland. Bahse konu veri ihlali ile birlikte ''kiisel (HM Revenue and Customs) veriler'' ele ge\\xe7irilmi olsa da bu durumun ordunun operasyonel sistemlerini etkilemedii saptand.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/uk-military-members-experience-cyberattack\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4- Singapur Siber G\\xfcvenlik Ajans tarafndan, Siber G\\xfcvenlik Yasasna dair yaplacak g\\xfcncellemeler onayland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The Straits Times tarafndan, Singapur Siber G\\xfcvenlik Ajans'na y\\xfcksek riskli bilgisayar sistemleri \\xfczerinde daha fazla denetim yetkisi veren bir yasada g\\xfcncelleme yaplmas hakknda haber yapld. Tasar uyarnca kritik bilgi altyaps operat\\xf6rlerinin, Siber G\\xfcvenlik Yasas kapsamnda sunucularn etkileyen t\\xfcm kesinti ve saldrlar bildirmeleri gerekecei tespit edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/singapore-lawmakers-give-approval-to-bill-updating-cybersecurity-act\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5- Kanada Veri Koruma Otoritesi (OPC) tarafndan gizlilik anketinin sonu\\xe7lar yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"OPC tarafndan, Kanadal iletmelerin gizlilikle ilgili konulardaki g\\xf6r\\xfclerine ilikin anket sonu\\xe7lar yaymland. Ankete katlan 800 kiinin %80'inin m\\xfcteri bilgilerinin korunmasn y\\xfcksek \\xf6ncelik olarak g\\xf6rd\\xfc\\xfc ve \\xe7ounun yasalar kapsamndaki gizlilik y\\xfck\\xfcml\\xfcl\\xfcklerinin farknda olduu ortaya konuldu.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/canada-opc-releases-results-of-privacy-survey\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6- Google'n 62 milyon USDlik konum gizlilii anlamasnn t\\xfcketici zararlarn kapsamad belirtildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Reuters'in haberine g\\xf6re, ABD Kaliforniya Kuzey B\\xf6lgesi B\\xf6lge Mahkemesi tarafndan, Google'n 62 milyon dolarlk gizlilik anlamas onayland. Bu kapsamda mahkeme tarafndan, ilgili dosyada savunucu \\xf6rg\\xfctlere 42 milyon USD ve avukatlara 18 milyon USD tazminat verilmesine h\\xfckmedildi. Toplu davada, Google'n t\\xfcketicilerin rzas olmadan konum verilerini toplad ve saklad iddia edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/googles-usd62m-location-privacy-settlement-does-not-award-money-to-consumers\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7- Kaliforniya Eyalet Mahkemesi tarafndan, Kaliforniya Veri Koruma Otoritesi (''CPPA'') d\\xfczenleme s\\xfcrecine ilikin duruma organize edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sacramento B\\xf6lgesi, Kaliforniya Y\\xfcksek Mahkemesi tarafndan Kaliforniya Gizlilik Koruma Ajans'nn mevzuat oluturma yetkisine ilikin tartmalar i\\xe7in 21 Haziran 2024 tarihine bir duruma organize edildi. Kaliforniya Ticaret Odas tarafndan, CPPAin uyum tedbirlerinin oluturulmas i\\xe7in bir s\\xfcre tanmakszn gelecekteki d\\xfczenlemeleri yaynlama yetkisine sahip olup olmad konusunda itirazda bulunuldu. Davann ilk olarak CalChamber tarafndan Kaliforniya Gizlilik Haklar Yasas'nn ilk d\\xfczenlemelerinin y\\xfcr\\xfcrl\\xfce girmesinin geciktirilmesini salamak amacyla  a\\xe7ld ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/california-state-court-sets-hearing-on-cppa-regulations-process\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8- Almanya Bamsz Veri Koruma Otoriteleri Konferans tarafndan, \\xfcretken yapay zekann AB Genel Veri Koruma T\\xfcz\\xfc\\xfc (''GDPR'') uyumluluuna ilikin bir tavsiye karar yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bloomberg Law'n haberine g\\xf6re, Almanya Bamsz Veri Koruma Otoriteleri Konferans tarafndan; \\xfcretken yapay zekann GDPR kapsamnda \\xe7ok sayda veri gizlilii sorunu yaratacan belirten bir tavsiye karar yaymland. Konferansn ilgili karar ile yapay zeka kullanan kurululara, veri silme ve d\\xfczeltme haklarn salarken eitim verilerini ilemek i\\xe7in kullanm amac ve yasal bir dayanak oluturmalar oluturmalar hatrlatld.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/dsk-issues-advisory-warning-of-gdpr-compliance-risks-associated-with-generative-ai \"\n                },\n                {\n                    type: \"header\",\n                    content: \"9- ABD Federal Ticaret Komisyonunun (''FTC''), BetterHelp ile uzlama \\xf6demelerine balayaca belirtildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"FTC tarafndan, FTC ile \\xe7evrimi\\xe7i terapi salaycs BetterHelp arasnda yaplan 7,8 milyon USD tutarndaki gizlilik anlamas kapsamnda yaklak 800.000 ilgili kiiye geri \\xf6deme yaplaca duyuruldu. 2023 tarihli bahse konu uzlamann, BetterHelp'in ilgili kiilerin kiisel salk verilerinin yalnzca snrl ama\\xe7larla ileneceine dair s\\xf6z verilmesine ramen ilgili kiilerin salk verilerinin reklam ama\\xe7l kulland iddialarn kapsad ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/online-therapy-provider-settles-ftc-dispute-for-7-8m\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10- Yeni Zelanda Veri Koruma Otoritesi tarafndan kredi raport\\xf6rlerinin yllk uyum raporlar yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yeni Zelanda Veri Koruma Otoritesi tarafndan, 2022-23 d\\xf6nemine ilikin \\xfc\\xe7 b\\xfcy\\xfck kredi raporlama irketine y\\xf6nelik uygunluk incelemeleri yaymland. Otorite tarafndan, irketlerin Kredi Raporlama Gizlilik Yasas kapsamndaki uygulamalarnda herhangi bir uygunsuzluk tespit edilmedii a\\xe7kland.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kaynak\",\n                    href: \"https://iapp.org/news/b/new-zealand-releases-credit-reporters-annual-compliance-reports\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"haberler\",\n                \"verikoruma\",\n                \"kiiselveri\",\n                \"veri\",\n                \"GDPR\",\n                \"veriaktarm\"\n            ]\n        },\n        {\n            id: 42,\n            subtitle: \"Makale\",\n            date: \"2020\",\n            slug: \"alan-adi-marka-hakki-ihlali\",\n            title: \"ALAN ADI KULLANIMI LE MARKA HAKKI HLAL EDLENLER TARAFINDAN BAVURULABLECEK HUKUK YOLLAR\",\n            text: \"Tescilli marka/hizmet sahipleri, tescilli markasnn bir bakas tarafndan alan ad (domain name) olarak tescil ettirilmesi karsnda marka hakk ihlali sebebiyle birtakm hukuki yollara bavurabilmektedir.\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1. WIPO Tahkim ve Arabuluculuk Merkezine Bavuru\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"nternet Tahsisli Saylar ve simler Kurumu (Internet Corporation for Assigned Names and Numbers - ICANN) tarafndan y\\xfcr\\xfcrl\\xfce girmesi kararlatrlan Alan Ad Uyumazlklarnn Yeknesak \\xc7\\xf6z\\xfcm Politikas (Uniform Domain Name Resolution Policy - UDRP) ile alan ad uyumazlklar bakmndan tahkim yolu \\xf6ng\\xf6r\\xfclm\\xfc olup, ICANN tahkim usul\\xfcne g\\xf6re tahkime yetkili klnan kurululardan uyumazlk \\xe7\\xf6z\\xfcm\\xfc i\\xe7in en sk bavurulan kurulu D\\xfcnya Fikri M\\xfclkiyet \\xd6rg\\xfct\\xfcd\\xfcr (World Intellectual Property Organization - WIPO).\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Tescilli marka/hizmet sahibi, alan adnn tarafna devrini veyahut alan adnn silinmesini ICANN tahkim usul\\xfcne g\\xf6re WIPO nezdinde talep edebilir. Ancak talepte bulunan (ikayet eden) UDRPnin 4(a) maddesi uyarnca; i.htilafl alan adnn, ikayet edenin \\xfczerinde hak sahibi olduu markayla ayn veya kartrlma (iltibas) ihtimali yaratacak derecede benzer olduunu, ii. htilafl alan adyla ilgili olarak ikayet edilenin hi\\xe7bir hakk veya meru menfaati bulunmadn ve, iii. htilafl alan adnn k\\xf6t\\xfc niyetle tescil edildiini ve kullanldn ispatla m\\xfckelleftir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Birinci bendin ispat, her somut olay bakmndan farkl ekilde ele alnmakla birlikte, bir alan ad ikayet edenin tescilli markasn tamamen i\\xe7eriyor ise; ayniyet ve iltibas oluturacak d\\xfczeyde benzerliin var olduu kabul edilmektedir (Bkz; Magnum Piering, Inc v. The Mudjackers and Garwood S. Wilson Sr., WIPO Dava No. D2000-1525). Alan adnda markann tamamnn bulunduu halde; alan adna tanmlayc ekler, (-) gibi iaretler ilave edilmesi ise iltibas ihtimalini ortadan kaldrmamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"kinci bent a\\xe7sndan ispat y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfcn yerine getirilmesinin olduk\\xe7a g\\xfc\\xe7 olduu deerlendirilmi olup, ikayet edilenin ihtilafl alan ad \\xfczerinde hak veya meru menfaatinin bulunmad ikayet\\xe7i tarafndan prima facie, bir dier deyile karine, olarak ortaya koyulabiliyor ise; ispat y\\xfck\\xfcn\\xfcn ikayet edilene ge\\xe7tii kabul edilmitir (Bkz; Crotia Airlines d.d.v. Modern Empire Internet Ltd., WIPO Dava No. D2003-0455). Bu durumda ispat y\\xfck\\xfc yer deitireceinden, ikayet edilenin ihtilafl alan ad \\xfczerinde hak veya meru menfaati bulunduunu ispat etmesi gerekecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xdc\\xe7\\xfcnc\\xfc bentte yer verilen alan ad kullanm ve tescilinin k\\xf6t\\xfc niyetle yapld hususunun ispat i\\xe7in UDPRde d\\xfczenlenen birtakm koullarn salanmas gerekmekle birlikte her somut olay baznda farkl deerlendirme yaplmaktadr. \\xd6rnein, uygulamada sklkla karlald \\xfczere alan adnn ikayet edilen tarafndan tescilli marka/hizmet sahibine veyahut marka sahibinin rakibine fahi fiyatlarla satlmaya \\xe7allmas 4(a) maddesi uyarnca ikayet edilenin k\\xf6t\\xfc niyetli kullanmn ortaya koymaya elverili g\\xf6r\\xfcnen hallerden bir tanesidir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. Marka Hakkna Tecav\\xfcz\\xfcn Tespiti, \\xd6nlenmesi, Men'i, Ref'i, Maddi ve Manevi Tazminat Davas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Alan ad ile marka hakk ihlalinin \\xf6n\\xfcne ge\\xe7ilebilmesi i\\xe7in bir dier \\xe7\\xf6z\\xfcm yolu, 6769 sy. Snai M\\xfclkiyet Kanununun 7. ve 29. maddeleri dorultusunda yetkili ve g\\xf6revli mahkemeler nezdinde dava a\\xe7mak suretiyle, ilgili siteye eriimin kalc olarak engellenmesini talep etmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"'Mahkemece bozma ilamna uyularak yaplan yarglama srasnda alnan bilirkii raporu ve t\\xfcm dosya kapsamna g\\xf6re; daval ...'n s\\xf6z konusu site ile bir ilgisinin bulunmad gerek\\xe7esiyle, ... hakkndaki davann reddine, daval ...'nun s\\xf6z konusu sitenin sahibi olduu gerek\\xe7esiyle davacnn tescilli ... ibareli markasna internet site alan adnda aynen kullanmak suretiyle davac markasna tecav\\xfczde ve haksz rekabette bulunduunun tespiti ile men ve ref'ine, karar kesinletiinde \\xf6zetinin ilanna karar verilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Karar daval (...) vekili temyiz etmitir. Dosyadaki yazlara, mahkemece uyulan bozma karar gereince h\\xfck\\xfcm verilmi olmasna ve delillerin takdirinde bir isabetsizlik bulunmamasna g\\xf6re, daval ... vekilinin b\\xfct\\xfcn temyiz itirazlar yerinde deildir.'  (T.C. YARGITAY 11. HUKUK DARES E. 2015/13656 K. 2017/1555 T. 15.3.2017) \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu aamda belirtmeliyiz ki, WIPOya bavuru hakknn kullanlmas ulusal mevzuat uyarnca mahkemeye m\\xfcracaat yolunu kapatmamaktadr. Nitekim WIPO nezdinde ger\\xe7ekletirilen tahkim yarglamasnda, idari hakem heyeti baz karmak uyumazlklarn \\xe7\\xf6z\\xfcm\\xfc i\\xe7in yeterli yetkilerle donatlmadklarndan bahisle; uyumazln mahkemeler nezdinde \\xe7\\xf6z\\xfcmlenmesinin daha doru ve isabetli olaca kansna varabilmektedir. (Bkz; Levantur, S.A. v. Media Insight, WIPO Case No. D2009-0608)\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bununla birlikte, tahkim yarglamas aleyhine sonu\\xe7lanan tarafn genel yetkili mahkemeler nezdinde alan ad \\xfczerinde hak sahiplii iddias ile dava a\\xe7mas halinde WIPO hakem heyeti kararlarnn icra edilebilirliinin durdurulmas m\\xfcmk\\xfcnd\\xfcr. Keza tahkim heyetince verilen kararlar icra edilmek amacyla, WIPO Tahkim Divan tarafndan ICANNe bildirilmekte ve karar ayrca internette yaynlanmaktadr. Kararn ICANNe tebliini takiben 10 i g\\xfcn\\xfc i\\xe7erisinde, yetkili mahkemeler nezdinde dava a\\xe7ld ispatlanrsa; a\\xe7lm olan davann reddedildii, geri alnd veya taraflar arasnda sulh vb. herhangi bir sebeple davann sona erdii kantlanncaya kadar WIPO hakem heyeti kararlarnn icras ICANN tarafndan yerine getirilmez.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"Marka Hakkna Tecav\\xfcz Nedeniyle Cumhuriyet Basavclna Su\\xe7 Duyurusu\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"6769 sy. Snai M\\xfclkiyet Kanununun marka hakkna tecav\\xfcze ilikin cezai h\\xfck\\xfcmler balkl 30. maddesinde bakasna ait marka hakkna iktibas veya iltibas suretiyle tecav\\xfcz ederek mal \\xfcreten veya hizmet sunan, sata arz eden veya satan, ithal ya da ihra\\xe7 eden, ticari ama\\xe7la satn alan, bulunduran, nakleden veya depolayan kii bir yldan \\xfc\\xe7 yla kadar hapis ve yirmi bin g\\xfcne kadar adli para cezas ile cezalandrlaca h\\xfckm\\xfcne yer verilmitir. Bu dorultuda, tescilli markaya alan adnda veya ilgili sitenin i\\xe7eriinde yer vermek suretiyle markaya tecav\\xfcz eden ahslara kar ilgili madde uyarnca su\\xe7 duyurusunda bulunulmas m\\xfcmk\\xfcnd\\xfcr.\"\n                }\n            ],\n            tags: [\n                \"alanad\",\n                \"markaihlali\",\n                \"hukukiyollar\"\n            ],\n            author: \"\"\n        },\n        {\n            id: 41,\n            subtitle: \"GDPR Karar\",\n            date: \"10.05.2024\",\n            title: \"Finlandiya tarihinde en \\xe7ok sayda madurun yer ald, psikoterapi merkezinin hasta veri tabannn hacklenmesi konulu davada Mahkeme 6 yl hapis cezasna h\\xfckmetti.\",\n            slug: \"hasta-veri-tabaninin-hacklenmesi-ile-saglik-verilerinin-ihlal-edilmesi\",\n            text: \"Mahkeme, Aleksanteri Kivim\\xe4ki'yi psikoterapi merkezinin hasta veri tabannn hacklenmesi ve bilgilerin yaylmas nedeniyle su\\xe7lu bularak 6 yl 3 ay hapis cezasna \\xe7arptrmtr. Kivim\\xe4ki, arlatrlm veri ihlali, bilgilerin yaylmas, mahremiyet ihlali, gaspa teebb\\xfcs ve antaj nedeniyle su\\xe7lanmtr. Kivim\\xe4ki veri tabann hackledikten yaklak iki yl sonra hem irketten hem de m\\xfcterilerinden para szdrmaya \\xe7alm, irketin 370.000 Euro tutarnda Bitcoin'i kendisine \\xf6demeyi reddetmesi \\xfczerine hasta kaytlarn Tor anda yaynlamaya balamtr.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Bat Uusimaa B\\xf6lge Mahkemesi, Aleksanteri Kivim\\xe4ki'yi psikoterapi merkezi Vastaamo'nun hasta veri tabannn hacklenmesiyle ilgili t\\xfcm su\\xe7lamalardan su\\xe7lu bularak 6 yl 3 ay hapis cezasna \\xe7arptrmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kivim\\xe4ki, arlatrlm veri ihlali, bilgilerin yaylmasyla ilgili yaklak 9.600 arlatrlm mahremiyet ihlali, 21.300'den fazla arlatrlm gasp giriimi ve 20 arlatrlm antaj su\\xe7lamasyla kar karya kalmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu davada Finlandiya ceza tarihindeki dier t\\xfcm davalardan daha fazla madur bulunmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Davada savclk, mahkemeye 26 yandaki Kivim\\xe4ki'nin 2018 sonbaharnda firmann tahmini 33.000 kiinin kiisel bilgilerini i\\xe7eren veri tabanna girdiini s\\xf6ylemitir. Kivim\\xe4ki yaklak iki yl sonra hem irketten hem de m\\xfcterilerinden para szdrmaya \\xe7alm ve \\xf6deme yapmadklar takdirde \\xf6zel nitelikli verilerini dark web'de yaymakla tehdit etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mahkeme, Kivim\\xe4ki'nin balang\\xe7ta Vastaamo'dan 370.000 Euro tutarnda Bitcoin talep ettiini ve irketin \\xf6deme yapmay reddetmesi \\xfczerine hasta kaytlarn Tor anda yaynlamaya baladn bildirmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Savclk, mahkemeden Kivim\\xe4ki'ye m\\xfcmk\\xfcn olan en y\\xfcksek ceza olan yedi yl hapis cezas verilmesini talep etmitir. Mahkeme cezaya karar verirken su\\xe7larn ciddiyetini, ileni bi\\xe7imini ve Kivim\\xe4ki'nin pervasz tutumunu dikkate aldn belirtmitir. Bununla birlikte, hafifletici bir fakt\\xf6r olarak, sann davadaki binlerce davacyla tazminat talepleri konusunda artl uzlamay kabul ettiini de kaydedilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kivim\\xe4ki'nin avukat Peter Jaari gazetecilere yapt a\\xe7klamada m\\xfcvekkilinin mahkeme kararndan dolay hayal krklna uradn ve b\\xfcy\\xfck olaslkla karar temyize g\\xf6t\\xfcreceini ifade etmitir. Jaari, Kivim\\xe4ki'nin hala herhangi bir su\\xe7 ilediini reddettiini de s\\xf6zlerine eklemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kivim\\xe4ki daha \\xf6nce dolandrclktan h\\xfck\\xfcm giymi olsa da, Vastaamo'nun veri tabannn hacklenmesinden \\xf6nceki be yl i\\xe7inde herhangi bir hapis cezasna \\xe7arptrlmad i\\xe7in Finlandiya yasalarna g\\xf6re ilk kez su\\xe7 ilemi saylmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Daha \\xf6nce American Airlines ve ABD makamlarna kar dolandrclk yapmaktan su\\xe7lu bulunan Kivim\\xe4ki, ABD polis departmanlarnn insanlarn evlerine \\xf6zel kuvvetler g\\xf6ndermesine ve havayolu irketinin bir u\\xe7uu iptal etmesine neden olan sahte imdat \\xe7arlar yapmtr. Kivim\\xe4ki s\\xf6z konusu aramalar 2014 ylnda, 16-17 yalarndayken ger\\xe7ekletirmitir. Helsinki Temyiz Mahkemesi 2022 ylnda Kivim\\xe4ki'ye para cezasyla birlikte 10 ay ertelenmi hapis cezas vermitir. Helsinki B\\xf6lge Mahkemesi ge\\xe7en yl Nisan aynda Vastaamo'nun eski CEO'su Ville Tapio'ya Genel Veri Koruma Y\\xf6netmelii (GDPR) gerekliliklerini yerine getirmedii gerek\\xe7esiyle veri koruma su\\xe7undan \\xfc\\xe7 ay ertelenmi hapis cezas vermitir. Bu karar hem Tapio hem de savc tarafndan temyiz edilmi olup temyiz durumas Mays 2025'te balayacaktr.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Karar detaylar\",\n                    href: \"https://yle.fi/a/74-20086499?mkt_tok=MTM4LUVaTS0wNDIAAAGSzvGFlCpKBPLmvS4DGgp1tcceVm2E5wDbYebM6RT7tZXUiBYG4NHtMcI8zJZ3LowxAoodByxqDn-00CdUofY190njaWR7Bta0ARJnNOx6KlyT\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"verikoruma\",\n                \"kiiselveri\",\n                \"veri\",\n                \"GDPR\",\n                \"data\"\n            ]\n        },\n        {\n            id: 40,\n            subtitle: \"GDPR Karar\",\n            date: \"08.05.2024\",\n            title: \"talya Veri Koruma Otoritesi ve zlanda Veri Koruma Otoritesi iverenin \\xe7alan veri ileme faaliyeti hakknda eksik bilgilendirmesi nedeniyle ihlal kararlar verdi.\",\n            slug: \"isverenin-aydinlatma-yukumlulugunu-yerine-getirmemesi\",\n            text: \"\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"talya Veri Koruma Otoritesi Karar\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bir \\xe7alann kurumsal hesabnda \\xfcpheli faaliyet tespit eden ve eriimini engelleyen bir irket, dahili teknik denetimlerin belirli hedefleri ve y\\xf6ntemleri hakknda \\xf6nceden bilgi vermedii i\\xe7in 15.000 Euro para cezasna \\xe7arptrlmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"3 Temmuz 2020 tarihinde, ilgili kii ivereni olan veri sorumlusuna, i s\\xf6zlemesini feshetmek isteini bildirmitir. Rzaya dayal bir anlamayla, s\\xf6zlemenin 31 Temmuz 2020'de sona ereceine karar vermilerdir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayn ay, veri sorumlusunun bilgi sistemlerini y\\xf6neten veri ileyen, veri sorumlusunun merkezinin tanmasndan sonra verilerin g\\xfcvenli bir ekilde aktarlmasn salamak i\\xe7in teknik bir denetim ger\\xe7ekletirmitir. Denetim srasnda, veri ileyen, sunuculardan yaklak 600 dosyann indirildiini tespit etmi ve bunun ilgili kiinin kurumsal hesab \\xfczerinden yapldn dorulamtr. Veri ileyen bu durumu ilgili kiinin sunuculara ve kurumsal e-postalarna eriiminin engellenmesine karar veren veri sorumlusuna iletmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu durumdan memnun olmayan ilgili kii, talya Veri Koruma Otoritesine (Otorite) ikayette bulunarak, i s\\xf6zlemesi devam ederken kurumsal e-postalarna eriim i\\xe7in gerekli kimlik bilgilerinin deitirildiini ve bunun da kendi kiisel verilerine eriimini imkansz hale getirdiini iddia etmitir. Veri sorumlusu ise i gizliliinin korunmas ve veri ihlallerinin \\xf6nlenmesi konusunda meru bir menfaati olduunu savunmutur. Bununla birlikte i\\xe7 d\\xfczenlemeler uyarnca, kurumsal hesabnn \\xf6zel ama\\xe7lar i\\xe7in deil yalnzca ile ilgili faaliyetler i\\xe7in kullanlabileceini iddia etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ger\\xe7ekleri tespit ettikten sonra Otorite, irket i\\xe7 d\\xfczenlemelerinin; irketin kurallarna uyulduunu dorulamay ama\\xe7layan denetimler yaplmasn a\\xe7k\\xe7a \\xf6ng\\xf6rmediini tespit etmitir. Bu nedenle, veri sorumlusunun, ilgili kiiyi i\\xe7 denetimlerin belirli ama\\xe7lar ve y\\xf6ntemleri ile \\xe7alanlarn kurumsal hesaplarna eriimini engelleme olasl hakknda \\xf6nceden bilgilendirmemesi nedeniyle GDPR Madde 13'\\xfc ihlal ettiine karar vermitir. Ayrca Otorite, \\xe7alanlarn kiisel veri ileme faaliyetleri hakknda bilgilendirilmesinin GDPR Madde 5(1)(a)'da \\xf6ng\\xf6r\\xfclen adillik ilkesinin bir ifadesini oluturduunu ve mevcut olayda veri sorumlusu tarafndan bunun ihlal edildiini belirtmitir. Yukardaki nedenlerden dolay Otorite, veri sorumlusuna 15.000 Euro para cezas vermitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Karar detaylar\",\n                    href: \"https://gdprhub.eu/index.php?title=Garante_per_la_protezione_dei_dati_personali_(Italy)_-_9891673&mtc=today\"\n                },\n                {\n                    type: \"header\",\n                    content: \"zlanda Veri Koruma Otoritesi Karar\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"zlanda Veri Koruma Otoritesi (Otorite), verileri bir ama\\xe7 i\\xe7in toplayp daha sonra baka bir ama\\xe7 i\\xe7in kullanan bir veri sorumlusunu knamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite ilgili kiiden bir ik\\xe2yet almtr. vereni (veri sorumlusu), ilgili kiinin iinde kulland bir ara\\xe7ta takograf (s\\xfcr\\xfc s\\xfcreleri ve dinlenme s\\xfcrelerinin yan sra bir s\\xfcr\\xfcc\\xfc tarafndan alnan dier \\xe7alma ve uygunluk s\\xfcrelerini kaydeden bir cihaz) kullanmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kiiye ie baladnda g\\xfcvenlik nedeniyle \\xe7alan ara\\xe7larna takograf takld s\\xf6ylenmitir. Takograftan elde edilen \\xe7alma performans ve yemek molalarna ilikin veriler daha sonra kiinin irketten \\xe7karlmasn hakl g\\xf6stermek i\\xe7in kullanlmtr. lgili kii, iten \\xe7karlmas \\xf6ncesinde kiisel bilgilerinin ilenmesinin takografn asl kullanm amacyla uyumlu olmadndan ikayet\\xe7i olmutur. Ayrca, ileme ger\\xe7eklemeden \\xf6nce takografn deien amac hakknda kendisine bilgi verilmediini iddia etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu ikayete yant olarak Otoriteye ilgili kiinin arabasndaki takografn performansn izlemek amacyla kullanlabileceinin farknda olmas gerektiini s\\xf6ylemi ve eitim materyallerini Otoriteye kant olarak sunmutur. Ayrca, ilgili kiinin verilerin ilenmesi i\\xe7in a\\xe7k rza g\\xf6sterdiini iddia etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite yapm olduu inceleme ve deerlendirme sonucunda;\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lk olarak, veri sorumlusu GDPR Madde 6(1) kapsamnda ileme i\\xe7in yasal dayanak olarak rza talep ettii tespit edilmitir. Otorite, iverenler ve \\xe7alanlar arasndaki g\\xfc\\xe7 dengesizliinin bu rzay zorunlu hale getirdiini ve ge\\xe7ersiz kldn belirtmitir. Otorite, veri sorumlusunun meru bir menfaati olduunu kantlayabilmesi halinde takograflarn GDPR Madde 6(1)(f) kapsamnda kullanlabileceini belirten sve\\xe7 Veri Koruma Otoritesinin bir kararn kullanmtr. Dolaysyla Otorite, veri sorumlusunun yasal bir dayana olduunu d\\xfc\\xfcnm\\xfct\\xfcr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"kinci olarak, deitirilen ama\\xe7 ilgili taraflara \\xf6nceden bildirilmedii s\\xfcrece, kiisel verilerin daha \\xf6nce belirtilen ama\\xe7lardan farkl ama\\xe7lar i\\xe7in kullanlmasnn yasak olduu ifade edilmitir. Otorite, eitim materyallerinde takograf i\\xe7in farkl bir kullanm belirtebilecek hi\\xe7bir bulgu bulamamtr. Sonu\\xe7 olarak, Otorite, toplanan kiisel verilerin, ilgili kiinin balang\\xe7ta bilgilendirildii ama\\xe7 dnda bir ama\\xe7 i\\xe7in kullanld sonucuna varm ve yeni deiiklikten de haberdar edilmediini tespit etmitir. Bu durumun, veri sorumlusu tarafndan ger\\xe7ekletirilen ilemenin adil ve effaf olmad ve GDPR Madde 5(1)(a)'nn ihlal edildii anlamna geldii belirtilmitir. Bununla birlikte, kiisel verilerinin gerektiinden daha fazla ilenmesinin, GDPR Madde 5(1)(b) ile \\xe7elien asl ama\\xe7la tutarsz bir ekilde yapld anlalmtr.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Karar detaylar\",\n                    href: \"https://gdprhub.eu/index.php?title=Pers%C3%B3nuvernd_(Island)_-_M%C3%A1l_nr._2022050836&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"verikoruma\",\n                \"kiiselveri\",\n                \"veri\",\n                \"GDPR\",\n                \"data\"\n            ]\n        },\n        {\n            id: 39,\n            subtitle: \"IAPP Haberleri\",\n            date: \"07.05.2024\",\n            title: \"Haftalk IAPP Haberleri 1-7 Mays 2024\",\n            slug: \"haftalik-iapp-haberleri-1-7-mayis-2024\",\n            text: \"D\\xfcnya genelinde kiisel verilere ilikin g\\xfcncel gelimeler.\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1- Bir salk hizmetleri irketinin yazlmnn 13 milyon m\\xfcterinin verilerini ihlal ettii iddia edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The Record'un haberinde, Kaiser Permanente isimli salk irketinin \\xe7evrimi\\xe7i takip yazlmyla 13 milyon m\\xfcterinin kiisel verilerini \\xfc\\xe7\\xfcnc\\xfc taraflarla paylat iddia edildi. irketin ge\\xe7mite kulland takip yazlm nedeniyle toplu dava ile kar karya kald belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/health-care-companys-software-allegedly-breaches-13m-customers-data/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2- Danimarka Veri Koruma Otoritesi tarafndan \\xe7ocuklarn verilerinin ilenmesine ilikin endielere yant verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Danimarka Veri Koruma Otoritesi tarafndan, \\xc7ocuk Haklar Ulusal Dernei B\\xf8rns Vilk\\xe5r'n sosyal medya platformlarnn Danimarka Veri Koruma Yasas kapsamnda belirlenen ya snr gerekliliklerini ihlal edebileceini iddia eden sorusuna yant verildi. Otorite tarafndan konuyla ilgili olarak yaplan a\\xe7klamada; \\xe7ocuklarn rzasna ilikin ya snrnn, \\xe7ocuklarn s\\xf6z konusu sosyal medya platformlarna genel eriimi \\xfczerinde bir etkiye sahip olmad belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/denmarks-dpa-responds-to-childrens-data-processing-concerns/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3- talya Veri Koruma Otoritesi (Garante) tarafndan ChatGPT'nin talya'da yeniden etkinletirilmesine izin verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Reuters'in haberine g\\xf6re Garante tarafndan, AB Genel Veri Koruma T\\xfcz\\xfc\\xfc (GDPR) kapsamnda kiisel verilerin ilenmesiyle ilgili \\xe7eitli koullar yerine getirmesi kouluyla OpenAI'nin ChatGPT'yi \\xfclkede yeniden etkinletirmesine izin verildi. OpenAI tarafndan, gizlilik politikasnn ve kullanclarn pasif rza y\\xf6netimi imkannn daha fazla g\\xf6r\\xfcn\\xfcrl\\xfc\\xfcn\\xfc salama taahh\\xfcd\\xfcnde bulunuldu. Ayrca AB vatandalarnn ChatGPT'nin kendi modelini eitmek i\\xe7in kullanc verilerini kullanmasn reddetmelerini salamak amacyla yeni bir pasif rza y\\xf6netimi imkan da sunuldu.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/garante-permits-reactivation-of-chatgpt-in-italy/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4- Fransa Veri Koruma Otoritesi (CNIL) tarafndan huzurevlerinin g\\xf6zetimine ilikin bir klavuz yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNIL tarafndan, huzurevi sakinlerinin yatak odalarnda g\\xfcvenlik kameras bulunmamasnn yal istismarna yol a\\xe7abilecei endielerinin ardndan huzurevlerinin g\\xf6zetimine ilikin bir klavuz yaymland. CNIL tarafndan, kiisel mahremiyete \\xf6ncelik verilmesini salamak amacyla g\\xfcvenlik kameralarnn yatak odalarnda ancak bir olay meydana geldikten ve bir soruturma sonucunda k\\xf6t\\xfc muamele tespit edildikten sonra kullanlabilecei belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/cnil-publishes-guidance-on-nursing-home-surveillance/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5- ngiltere Veri Koruma Otoritesi (ICO) tarafndan, HIV hastalar i\\xe7in veri koruma \\xf6nlemlerinin artrlmas \\xe7arsnda bulunuldu.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ICO tarafndan veri ihlallerinde bireylerin HIV durumlarnn hedef alnmasnn ardndan salk kurulular veri koruma \\xf6nemlerini iyiletirmeye davet edildi. Bilgi Komiseri John Edwards tarafndan, ICO'nun daha iyi eitim, kiisel veri ihlallerinin derhal rapor edilmesi ve hassasiyet i\\xe7eren iletiimler i\\xe7in BCC kullanmna son verilmesi gibi iyiletirmelerin m\\xfcmk\\xfcn olan en hzl ekilde uygulanmasn salamann hedeflendii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/ico-calls-for-increased-data-protections-for-those-with-hiv/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6- Hollanda Veri Koruma Otoritesi (AP) tarafndan web sitelerinde veri kazmaya ilikin klavuz yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"AP tarafndan, web sitelerinden veri kazmann GDPR kapsamnda \\xe7ou balamda neden yasad olduunu detaylandran bir klavuz yaymland. AP tarafndan; veri kazmann kamuya a\\xe7k veriler kapsamnda yaplmas halinde hukuka uygun olacana dair genel anlamda bir yanl alg olduu ancak bunun kullanclarn bakalarnn kiisel verilerini kazmasna bireysel olarak rza verdii anlamna gelmedii iddia edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/netherlands-dpa-issues-guidance-against-web-scraping/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7- CNIL tarafndan, Balayc irket Kurallarna (BCR) ilikin bir deerlendirme arac tantld.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNIL tarafndan kullanma sunulan aracn, kiisel verileri AB dna aktaran irketlerin 'Avrupa Veri Koruma Kurulu tarafndan kabul edilen BCR standartlarnn gerekliliklerine ilikin olarak projenin olgunluk d\\xfczeyini kontrol etmelerine' olanak tand ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/cnil-introduces-bcr-self-assessment-tool/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8- Avrupa Birlii Bakanlar Konseyi tarafndan, Japonya ve AB arasndaki veri transferine ilikin bir protokol kabul edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avrupa Birlii Bakanlar Konseyi tarafndan, ekonomik ortaklk anlamasnn bir par\\xe7as olarak AB ve Japonya arasnda serbest veri akna izin veren bir protokol kabul edildi. Bahse konu protokol\\xfcn, veri yerelletirme tedbirlerini \\xf6nlemek \\xfczere tasarland ve bu kapsamda \\xf6ng\\xf6r\\xfclebilir bir yasal \\xe7er\\xe7eve sunduu ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/council-of-europe-adopts-data-transfer-framework-with-japan/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9- ABD Federal letiim Komisyonu (FCC) tarafndan, corafi konum paylam iddialar nedeniyle mobil ebeke operat\\xf6rlerine 200 milyon dolar tutarnda ceza verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The Wall Street Journal'n haberine g\\xf6re FCC tarafndan; AT&T, Sprint, T-Mobile ve Verizon adl mobil ebeke operat\\xf6rlerine, rzaya dayal olmayan corafi konum veri paylam iddialar nedeniyle toplam 200 milyon dolar tutarnda para cezas verildi. FCC tarafndan, operat\\xf6rlerin 'm\\xfcterilerinin konum bilgilerini agregat\\xf6rlere satt, agregat\\xf6rlerin de bu bilgileri \\xfc\\xe7\\xfcnc\\xfc taraf konum tabanl hizmet salayclara yeniden satt' iddia edildi. Bu kapsamda T-Mobile 80 milyon dolar ile en ar cezay alrken, AT&T, Sprint ve Verizona srasyla 57 milyon dolar, 12 milyon dolar ve 47 milyon dolar tutarnda ceza verildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/fcc-fines-wireless-carriers-combined-200m-over-geolocation-privacy-claims/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10- UnitedHealth Group CEO'su tarafndan 22 milyon dolarlk fidye yazlm \\xf6demesi doruland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNBC'nin haberinde, salk sigortas irketi UnitedHealth Groupun bilgisayar korsanlarna 22 milyon dolar tutarnda fidye \\xf6demesi yapt ABD Senatosu Finans Komitesine doruland. UnitedHealth Group CEO'su Andrew Witty tarafndan, bilgisayar korsanlarnn \\xe7ok fakt\\xf6rl\\xfc kimlik dorulama ara\\xe7larnn eksiklii nedeniyle sisteme eriebildii ve hastalarn kiisel verilerini hukuka aykr ekilde ele ge\\xe7iren bir veri ihlaline yol a\\xe7ld belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber detaylar\",\n                    href: \"https://iapp.org/news/a/health-insurance-company-confirms-it-paid-usd22m-in-ransomware-payments/\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"haberler\",\n                \"verikoruma\",\n                \"kiiselveri\",\n                \"veri\",\n                \"GDPR\",\n                \"veriaktarm\"\n            ]\n        },\n        {\n            id: 38,\n            subtitle: \"GDPR Karar\",\n            date: \"03.05.2024\",\n            title: \"Bel\\xe7ika Veri Koruma Otoritesi, bir online itibar danmanlk irketinin ilgili kii adna yapt ikayetin GDPR Madde 80(1) kapsamnda kabul edilemez olduuna karar verdi.\",\n            slug: \"ilgili-kisi-adina-yapilacak-sikayetin-kosullari\",\n            text: \"2007 ylnda, bir gazete tarafndan bir i\\xe7inin \\xf6l\\xfcm\\xfc sonrasnda ilgili irketin genel m\\xfcd\\xfcr\\xfc hakknda \\xe7eitli su\\xe7lamalar i\\xe7eren bir makale yaynlamtr. irketin genel m\\xfcd\\xfcr\\xfc, makalenin internet sitesinden kaldrlmas i\\xe7in \\xfc\\xe7 kez talepte bulunmutur. Ger\\xe7ekletirilen ikinci ve \\xfc\\xe7\\xfcnc\\xfc talepler, ilgili kii adna bir Fransz online itibar danmanlk irketi tarafndan yaplm ancak t\\xfcm bu talepler veri sorumlusu tarafndan reddedilmitir. Bunun \\xfczerine online itibar danmanlk irketi, ilgili kii adna Bel\\xe7ika Veri Koruma Otoritesine ('APD') bir ik\\xe2yette bulunmutur. \",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"2007 ylnda, 'La Derni\\xe8re Heure Les Sports' gazetesi ('veri sorumlusu'), \\xe7alanlarndan birinin \\xf6l\\xfcm\\xfcn\\xfcn ardndan bir irketin genel m\\xfcd\\xfcr\\xfc ('ilgili kii') hakknda internet sitesinde bir makale yaynlamtr. Bu makalede, ilgili kiinin adam \\xf6ld\\xfcrme su\\xe7unun yan sra i ekipmanlarnn kullanm ve i sal ve g\\xfcvenlii ile ilgili mevzuata aykr davranmaktan su\\xe7lu bulunduu bildirilmitir. Kazadan bu yana gerekli d\\xfczeltmeler yapldndan, mahkeme ilgili kiinin cezai h\\xfckm\\xfcn\\xfcn ertelenmesine karar vermitir. Bununla birlikte, ilgili kii hukuki olarak sorumlu ilan edilmi ve \\xf6len i\\xe7inin ailesine tazminat \\xf6demesine h\\xfckmedilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"2018 ve 2019'da, ilgili kii, sonu\\xe7larn kaldrlmas i\\xe7in veri sorumlusu tarafndan \\xe7evrimi\\xe7i olarak sunulan standart formu kullanarak makalenin URL'sinin kaldrlmasn 3 kez talep etmitir. kinci ve \\xfc\\xe7\\xfcnc\\xfc talepler, ilgili kii adna bir Fransz online itibar danmanlk irketi tarafndan yaplmtr. Bir online itibar danmanlk irketi, \\xf6zellikle kendileriyle balantl URL'lerin kaldrlmasn isteyerek insanlarn \\xe7evrimi\\xe7i itibarlaryla ilgilenmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu, menfaatler ve haklar dengesini g\\xf6z \\xf6n\\xfcnde bulundurduktan sonra URL'yi engellememeye karar verdiklerini belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"18 Haziran 2020 tarihinde, online itibar danmanlk irketi, ilgili kii  adna Bel\\xe7ika Veri Koruma Otoritesine  ('APD') bir ik\\xe2yette bulunmutur. irket ayrca, ilgili kiiden alnan ve  i\\xe7erisinde 'Ben, aada imzas bulunan X [ilgili kiiyi okuyun] (...), X1 irketinin [e-danmanlk irketini okuyun] (...) kendisine verilen g\\xf6revi yerine getirmek amacyla internet sitelerinin yaynclar ve barndrclar ile ilgili olarak beni m\\xfcnhasran temsil etmeye yetkili olduunu beyan ve tasdik ederim' ifadesinin yer ald bir vekaletnameyi de eklemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu, APD'den ikayetin Fransz yasalarna g\\xf6re kurulmu bir irket tarafndan yapld ve dolaysyla GDPR Madde 80(1)'i ihlal ettii i\\xe7in kabul edilemez olarak deerlendirilmesini talep etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"GDPR Madde 80(1), ilgili kiininin (i) bir \\xdcye devletin yasalarna uygun ekilde oluturulmu, (ii) kamu yararna olan yasal hedefleri olan ve veri koruma alannda aktif olan (iii) kar amac g\\xfctmeyen bir organ, kurulu veya dernei kendi adna ikayette bulunmak \\xfczere yetkilendirme hakkna sahip olduunu belirtmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"APD yapm olduu incelemede; online danmanlk irketinin, kar amac g\\xfctmeyen bir kurum, kurulu veya dernek olmadn ve irketin web sitesinde farkl fiyatlardan oluan ' online itibar temizlii (URL'lerin silinmesi talebi) ve arama motoru sonu\\xe7 sayfas ekillendirme (Serp-Sculpting) gibi hizmetlerin sat' ile ilgili h\\xfck\\xfcm ve koullarn yer almas sebebiyle  kamu yararna olan yasal hedeflere sahip olmadn deerlendirmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"APD, irketin GDPR Madde 80(1)'in gerekliliklerini yerine getirmedii ve bu nedenle bir ilgili kiiyi temsil edemeyecei sonucuna varmtr. Dolaysyla, irketin ik\\xe2yetini kabul edilemez olarak deerlendirmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Karar Detaylar\",\n                    href: \"https://gdprhub.eu/index.php?title=APD/GBA_(Belgium)_-_39/2024&mtc=today\"\n                }\n            ],\n            tags: [\n                \"belgiandpa\",\n                \"gpdr\",\n                \"onlinereputation\",\n                \"dataprotection\",\n                \"complaint\",\n                \"GDPRArticle80(1)\",\n                \"datarights\",\n                \"representation\"\n            ]\n        },\n        {\n            id: 37,\n            subtitle: \"GDPR Karar\",\n            date: \"01.05.2024\",\n            title: \"Avusturya Veri Koruma Otoritesi, bir jinekoloa internette yaplan olumsuz yoruma yant olarak ilgili kiinin salk verisini ifa etmesi nedeniyle 10.000 Euro ceza verdi.\",\n            slug: \"jinekologun-saglik-verisini-ifsa-etmesi\",\n            text: \"Avusturya Veri Koruma Otoritesi, bir jinekoloa, internette yaplan olumsuz bir yoruma yant olarak ilgili kiinin salk verisi olan tehisini a\\xe7klamas nedeniyle ceza vermitir. Otorite bu paylamn salk verilerinin ilenmesine ilikin istisnalar kapsamnda olmadn belirterek kanunilik ilkesinin ihlal edildiine h\\xfckmetmitir. Jinekologun cevab ile veri toplama amac arasnda balant olmadn tespit ederek ilendikleri ama\\xe7la balantl, snrl ve \\xf6l\\xe7\\xfcl\\xfc olma ilkesinin ihlal edildiine h\\xfckmedilmitir. Ayrca, doru bir imaj oluturma amac i\\xe7in gereksiz veri toplandn belirterek veri minimizasyonu ilkesinin ihlal edildiini belirtmitir. Otorite, jinekologa 10.000 Euro para cezas vermitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, bir jinekoloa, ilgili kii tarafndan internette yaplan olumsuz bir yoruma kamuya a\\xe7k bir yant vererek ilgili kiinin tehisini a\\xe7klamasnn ardndan 10.000 Euro para cezas vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"26 Eyl\\xfcl 2022 tarihinde ilgili kii, bir jinekoloun muayenehanesindeki deneyimleri hakknda kendi adna bir web sitesinde olumsuz bir yorum yaynlamtr. Bir g\\xfcn sonra, jinekolog olan veri sorumlusu, yoruma kamuya a\\xe7k bir ekilde yant vermi ve ilgili kiiye vajinal enfeksiyon tehisi konulduunu a\\xe7klamtr. Veri sorumlusu, okuyucular i\\xe7in doru bir imaj yaratmak amacyla kiisel verileri ifa ettiini savunmutur. Yant 3 Ekim 2023 tarihine kadar kamuya a\\xe7k kalmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lk olarak, Avusturya Veri Koruma Otoritesi, veri sorumlusunun cevabn \\xe7evrimi\\xe7i yaynlayarak ilgili kiinin kiisel verilerini ilediine karar vermitir. Ayrca, Otorite, bir kiinin vajinal enfeksiyonuna ilikin bilgilerin GDPR Madde 4(15) kapsamnda salk verilerine ilikin veriler olduuna karar vermitir. Bu, GDPR Madde 9(1) uyarnca \\xf6zel nitelikli kiisel veri kategorisidir ve GDPR Madde 9(2)'deki istisnalardan biri ge\\xe7erli olmadk\\xe7a ilenmesi yasaktr. Otorite durumun b\\xf6yle olmadn tespit etmitir. Dolaysyla, veri sorumlusu GDPR Madde 9'u ve GDPR Madde 5(1)(a) kapsamndaki kanunilik ilkesini ihlal etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"kinci olarak, veri sorumlusu GDPR Madde 5(1)(b) kapsamndaki ama\\xe7 snrlamas ilkesini ihlal etmitir. Otorite, veri toplama amac (tehis) ile verilerin daha fazla ilenmesi arasnda somut bir balant olmadn tespit etmitir. Ayrca, veri sorumlusunun tbbi tehisi hakknda veri toplayaca ve bunu ilgili kiinin incelemesine bir yant olarak yaynlayaca ilgili kii i\\xe7in \\xf6ng\\xf6r\\xfclebilir deildir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xdc\\xe7\\xfcnc\\xfc olarak, veri sorumlusu GDPR Madde 5(1)(c) kapsamnda veri minimizasyonu ilkesini ihlal etmitir, zira okurlar i\\xe7in doru bir imaj oluturma amac tehisten bahsedilmeden de yerine getirilebilirdi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"DPA, mali durumunu a\\xe7klamad i\\xe7in veri sorumlusunun tahmini gelirine dayanarak GDPR Madde 83(1) uyarnca 10.000 Euro para cezas vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ceza miktarna ilikin karara Federal dare Mahkemesi'nde (Bundesverwaltungsgericht, BVwG) itiraz edilmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Karar Detaylar\",\n                    href: \"https://gdprhub.eu/index.php?title=DSB_(Austria)_-_2023-0.420.407&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"Veri Koruma Otoritesi\",\n                \"Cezai lem\"\n            ]\n        },\n        {\n            id: 36,\n            subtitile: \"Makale\",\n            date: \"2023\",\n            slug: \"kayitli-ekonomik-posta-sistemine-ilikin-usul-ve-esaslar-hakkinda-yonetmelikte-degisiklik-yapilmasina-dair-yonetmelik-ile-getirilen-yenilikler\",\n            title: \"Kaytl Elektronik Posta Sistemine likin Usul Ve Esaslar Hakknda Y\\xf6netmelikte Deiiklik Yaplmasna Dair Y\\xf6netmelik le Getirilen Yenilikler\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"13.12.2022 tarih ve 32042 sayl Resmi Gazete ile Kaytl Elektronik Posta Sistemine likin Usul ve Esaslar Hakknda Y\\xf6netmelikte Deiiklik Yaplmasna Dair Y\\xf6netmelik ('Deiik Y\\xf6netmelik') yaymlanmtr. Deiik Y\\xf6netmelikin t\\xfcm h\\xfck\\xfcmleri, yaym tarihinde y\\xfcr\\xfcrl\\xfce girecektir. Bu ksa notta, Deiik Y\\xf6netmelik ile Kaytl Elektronik Posta Sistemine likin Usul ve Esaslar Hakknda Y\\xf6netmelike ('Y\\xf6netmelik') getirilen yenilikler incelenecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"Deiik Y\\xf6netmelik ile getirilen balca yenilikler nelerdir?\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin 'Tanmlar ve Ksaltmalar' balkl 4.maddesine, 'Kimlik Dorulama Y\\xf6netmelii' tanm getirilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin 'Kaytl Elektronik Posta Hesab Bavurusu' balkl 9.maddesinin 2.fkrasna yaplan ekleme ile Kaytl Elektronik Posta Hizmet Salayclarn ('KEPHS'), Kaytl Elektronik Posta ('KEP') hesab a\\xe7mak i\\xe7in bavuru ger\\xe7ekletiren bavuru sahiplerinin kimliini tespit etme y\\xf6ntemleri genilemektedir. \\xf6yle ki;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Kimlik tespitinin ger\\xe7ek kiiler i\\xe7in T\\xfcrkiye Cumhuriyeti Kimlik Kart, pasaport, s\\xfcr\\xfcc\\xfc belgesi gibi fotorafl ve kimlik yerine ge\\xe7en ge\\xe7erli resm\\xee belgelerle veya elektronik ortamda g\\xfcvenli elektronik imza ile ya da Kimlik Dorulama Y\\xf6netmelii h\\xfck\\xfcmlerine g\\xf6re ger\\xe7ekletirilecei; bavurunun elektronik ortamda yaplmas halinde KEPHSnin, bavuru sahibi t\\xfczel kiiler tarafndan ilem yetkilisi olarak belirlenen ger\\xe7ek kiilerin kimlik bilgilerini Kimlik Dorulama Y\\xf6netmelii h\\xfck\\xfcmlerine g\\xf6re dorulayaca d\\xfczenlenmitir.\",\n                        \"Bu kapsamda Deiik Y\\xf6netmelik ile getirilen yeni d\\xfczenleme ile KEPHS, halihazrda Y\\xf6netmelikte var olan kimlik tespiti y\\xf6ntemlerine ek olarak, Kimlik Dorulama Y\\xf6netmeliinin 5.maddesinin 2.fkrasnda yer alan; -E-Devlet Kaps, -ICAO 9303 standardna uygun yakn alan iletiimi \\xf6zellii olan belge ile birlikte yapay zek\\xe2 veya yetkili marifetiyle g\\xf6r\\xfcnt\\xfcl\\xfc dorulama, -TCKK ile birlikte PAdES oluturma, Y\\xfcz y\\xfcze kanallarda bavuru sahibinin kimlik belgesi ile birlikte ileme \\xf6zg\\xfclenecek video g\\xf6r\\xfcnt\\xfcs\\xfc alma y\\xf6ntemleri vastasyla kimlik tespiti yapabilecektir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin Kaytl Elektronik Posta Hesabnn Kullanma A\\xe7lmas balkl 10. Maddesinde;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"1.fkraya yaplan ekleme ile bavurunun Kimlik Dorulama Y\\xf6netmelii h\\xfck\\xfcmlerine g\\xf6re alnmas halinde bavuru sahibi ile imzalanacak s\\xf6zleme veya taahh\\xfctnamenin, Kimlik Dorulama Y\\xf6netmeliinin lem Belgesi ve Verilerin Saklanmas balkl 9. maddesi uyarnca oluturulan ilem belgesi i\\xe7erisine der\\xe7 edilecei d\\xfczenlenmitir.\",\n                        \"2.fkrasnda yaplan ekleme ile KEPHSnin, bavuru sahibinin onayn, g\\xfcvenli elektronik imza ile veya Kimlik Dorulama Y\\xf6netmelii h\\xfck\\xfcmlerine g\\xf6re aldktan sonra KEP hesabn kullanma a\\xe7aca d\\xfczenlenmektedir.\",\n                        \"3.fkrasnda yaplan ekleme ile ger\\xe7ek kiinin, KEP hesabn sadece ileti almak amacyla kullanacan belirtmesi h\\xe2linde KEP hesab a\\xe7l i\\xe7in gerekli olan onay alma y\\xf6ntemleri arasna Kimlik Dorulama Y\\xf6netmelii h\\xfck\\xfcmleri de dahil edilmitir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin Kaytl Elektronik Posta Hesabnn Kullanma Kapatlmas balkl 13. Maddesine eklenen 9.fkra ile;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"KEPHSnin, kullanma kapatlma veya kullanma kapatlan KEP hesabn yeniden a\\xe7ma taleplerini; hesap sahibinin, ilem yetkilisinin veya s\\xf6zleme ya da taahh\\xfctname ile kapatma talebinde bulunma yetkisi verilenlerin kimlik bilgilerini elektronik ortamda Kimlik Dorulama Y\\xf6netmelii h\\xfck\\xfcmlerine g\\xf6re dorulayarak alabilecei d\\xfczenlenmitir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"DY\\xf6netmelikin, KEPHS olmak isteyenlerin, yapacaklar bavuruda Bilgi Teknolojileri ve letiim Kurumuna sunmas gereken bilgi ve belgelerin d\\xfczenlendii Bavuruda Sunulacak Bilgi ve Belgeler balkl ekine yaplan d\\xfczenlemeler ile;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"2.fkrasnda yer alan, KEPHSnin irketi ile ilgili sunmas gereken bilgiler arasndaki, irketin imza sirk\\xfcleri ve ticaret sicil belgesi kaldrlm, yerine sicil tasdiknamesi getirilmitir.\",\n                        \"9.madde olarak; Kimlik Dorulama Y\\xf6netmelii h\\xfck\\xfcmlerine g\\xf6re hizmet sunulmas halinde bu Y\\xf6netmelik ile istenilen bilgi ve belgeler dahil edilmitir.\"\n                    ]\n                }\n            ],\n            tags: [\n                \"Kaytl Elektronik Posta Sistemi\",\n                \"Y\\xf6netmelik\",\n                \"Kaytl Elektronik Posta\"\n            ]\n        },\n        {\n            id: 35,\n            subtitle: \"Makale\",\n            date: \"2021\",\n            slug: \"uzaktan-\\xe7alma-y\\xf6netmelii\",\n            title: \"UZAKTAN \\xc7ALIMA Y\\xd6NETMELNE LKN BLG NOTU\",\n            text: \"bu bilgi notunda, 10.03.2021 tarihli ve 31419 sayl Resmi Gazetede yaymlanarak y\\xfcr\\xfcrl\\xfce giren 'Uzaktan \\xc7alma Y\\xf6netmelii' ('Y\\xf6netmelik') dorultusunda (i) uzaktan \\xe7almann usul ve esaslar, (ii) uzaktan \\xe7almann yaplamayaca iler, ve (iii) verilerin korunmas ve paylalmasna ilikin iletme kurallarnn uygulanmas incelenecektir. Y\\xf6netmelikin Tanmlar balkl 4. maddesi uyarnca uzaktan \\xe7alma, '\\xe7inin, iveren tarafndan oluturulan i organizasyonu kapsamnda i g\\xf6rme edimini evinde ya da teknolojik iletiim ara\\xe7lar ile iyeri dnda yerine getirmesi esasna dayal ve yazl olarak kurulan i ilikisi' olarak tanmlanmaktadr. Bu kapsamda uzaktan \\xe7alan ise, ' g\\xf6rme ediminin tamamn veya bir ksmn uzaktan \\xe7alarak yerine getiren i\\xe7i' olarak tanmlanmtr.\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1. UZAKTAN \\xc7ALIMANIN USUL VE ESASLARI\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"S\\xf6zlemenin ekil ve \\xe7erii\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uzaktan \\xe7almaya ilikin yaplan d\\xfczenleme uyarnca 'Uzaktan \\xe7almaya ilikin i s\\xf6zlemeleri yazl ekilde yaplr.' (Y\\xf6netmelik, md 5/1) lgili madde kapsamnda, \\xe7alma y\\xf6ntemi olarak uzaktan \\xe7alma yoluyla \\xe7alacak olan i\\xe7inin, i s\\xf6zlemesinin mutlaka yazl olarak yaplmas ve i\\xe7eriinde uzaktan \\xe7alma yaplacann belirtilmesi gerekmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yazl olarak yaplacak uzaktan \\xe7almaya ilikin i s\\xf6zlemelerinde yer almas gereken asgari unsurlar u ekilde belirtilmitir: 'in tanm, yaplma ekli, iin s\\xfcresi ve yeri, \\xfccret ve \\xfccretin \\xf6denmesine ilikin hususlar, iveren tarafndan salanan i ara\\xe7lar, ekipman ve bunlarn korunmasna ilikin y\\xfck\\xfcml\\xfcl\\xfckler, iverenin i\\xe7iyle iletiim kurmas ile genel ve \\xf6zel \\xe7alma artlarna ilikin h\\xfck\\xfcmlerin' mutlak bir ekilde i s\\xf6zlemesinde belirtilmesi gerekmektedir. (Y\\xf6netmelik, md. 5/2)\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uzaktan \\xe7almaya ilikin i s\\xf6zlemelerinde yer almas gereken asgari unsurlar, iyerinde \\xe7almaya ilikin i s\\xf6zlemeleri ile paralel ekilde d\\xfczenlenmi olmakla birlikte; i\\xe7inin \\xe7alma alannn, \\xe7alt iyerine ait ofis, fabrika, tesis vs. olmayaca g\\xf6z \\xf6n\\xfcne alndnda, \\xe7alma yapaca alann i s\\xf6zlemesinde a\\xe7k\\xe7a belirtilmesi gerekmektedir. Ayrca, \\xfccrete ilikin hususlar, mesai saatleri, salanacak i ara\\xe7lar, uzaktan \\xe7alma sebebiyle varsa \\xf6zel \\xe7alma artlarnn i s\\xf6zlemelerinde mutlaka belirtilmesi y\\xf6n\\xfcnde d\\xfczenleme yaplmtr. \"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"\\xc7alma Mekannn D\\xfczenlenmesi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uzaktan \\xe7alma yaplacak mekana ilikin yaplacak olan d\\xfczenlemelerin i balamadan \\xf6nce yaplacana ve bu d\\xfczenlemelerden kaynaklanan maliyetlerin ne ekilde karlanacann uzaktan \\xe7alan ile iveren tarafndan birlikte belirleneceine y\\xf6nelik d\\xfczenleme yaplmtr. (Y\\xf6netmelik, md. 6) Bu kapsamda, uzaktan \\xe7alma yaplacak mekana y\\xf6nelik olarak taraflarn belirli d\\xfczenlemeler yapabilmesi m\\xfcmk\\xfcn klnm olup; bu d\\xfczenlemelerin yaplmas i\\xe7in gerekli \\xfccretlerin hangi taraf\\xe7a ve ne ekilde karlanacana ilikin hususun kararlatrlmas taraflarn karlkl mutabakatna balanmtr. \"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Malzeme ve  Ara\\xe7larnn Temini ve Kullanm\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uzaktan \\xe7alma srasnda uzaktan \\xe7alan tarafndan kullanlacak olan malzeme ve i ara\\xe7larnn temini ve kullanmna ilikin olarak i s\\xf6zlemesinde aksi kararlatrlmad s\\xfcrece bu malzeme ve ara\\xe7larn iveren tarafndan uzaktan \\xe7alana salanmas d\\xfczenlenmitir. (Y\\xf6netmelik, md. 7/1) Bu halde, uzaktan \\xe7alann uzaktan \\xe7alma esnasnda ihtiyac olabilecek i tanm ile ilikili olarak bilgisayar, telefon, \\xe7alma masas, \\xe7alma sandalyesi gibi her t\\xfcrl\\xfc malzeme ve i ara\\xe7larnn aksi i s\\xf6zlemesinde belirtilmedii s\\xfcrece iveren tarafndan salanmas s\\xf6z konusu olacaktr. veren tarafndan salanan malzeme ve i ara\\xe7larnn kullanm esaslar ile bakm ve onarm koullarnn a\\xe7k ve anlalr bir ekilde uzaktan \\xe7alana bildirilmesi, iverenin y\\xfck\\xfcml\\xfcl\\xfc\\xfcndedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"veren tarafndan uzaktan \\xe7alana salanacak malzeme ve i ara\\xe7larna ilikin olarak iveren tarafndan izlenmesi gereken prosed\\xfcrler u ekilde d\\xfczenlenmitir: ' ara\\xe7larnn iveren tarafndan salanmas halinde, bunlarn i\\xe7iye teslim edildii tarihteki bedellerini belirten i ara\\xe7lar listesi, iveren tarafndan yazl olarak i\\xe7iye teslim edilir. \\xe7iye teslim edilen belgenin i\\xe7i tarafndan imzal bir n\\xfcshas ise iveren tarafndan i\\xe7i \\xf6zl\\xfck dosyasnda saklanr.  ara\\xe7larnn listesi, i s\\xf6zlemesi i\\xe7erisinde veya s\\xf6zleme tarihinde i s\\xf6zlemesine ek olarak d\\xfczenlenirse ayrca yazl belge d\\xfczenlenmesi art aranmaz.'(Y\\xf6netmelik, md. 7/2)\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xf6z konusu d\\xfczenleme uyarnca, iveren tarafndan uzaktan \\xe7alan i\\xe7iye salanan i ara\\xe7larna ilikin olarak bu i ara\\xe7larnn teslim tarihindeki \\xfccretlerinin de yer ald bir envanter hazrlanarak i\\xe7iye teslim edilmesi ve bu envanterin i\\xe7i tarafndan imzalanm bir n\\xfcshasnn i\\xe7i \\xf6zl\\xfck dosyasnda saklanmasna y\\xf6nelik bir d\\xfczenleme yaplm olup; salanan i ara\\xe7larnda meydana gelebilecek zararlara ilikin olarak iverenin s\\xf6z konusu zararlar i\\xe7iden tazmin etme hakk g\\xfcvence altna alnmtr. Bu dorultuda, s\\xf6z konusu i ara\\xe7larna zarar gelmesi halinde iveren, \\xf6zl\\xfck dosyasnda saklanan envanter kaydnda yer alan i ara\\xe7larna ilikin bedelleri, i\\xe7ilerden talep edebilecektir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"\\xdcretim Maliyetlerinin Karlanmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelik uyarnca, iin yerine getirilmesinden kaynaklanan mal veya hizmet \\xfcretimiyle dorudan ilgili zorunlu giderlerin tespit edilmesine ve karlanmasna ilikin hususlar i s\\xf6zlemesinde belirtilir.(Y\\xf6netmelik, md. 8) bu d\\xfczenleme dorultusunda, uzaktan \\xe7alacak i\\xe7inin istihdam s\\xfcresince uzaktan \\xe7alma srasnda yapaca zorunlu giderlerin neler olabilecei ve bu giderlerin ne ekilde karlanaca hususlarnn, uzaktan \\xe7alan i\\xe7i ile imzalanacak olan i s\\xf6zlemesinde a\\xe7k\\xe7a d\\xfczenlenmesi gerekmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"\\xc7alma S\\xfcresinin Belirlenmesi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7alma s\\xfcrelerine ilikin yaplan d\\xfczenleme uyarnca uzaktan \\xe7alan i\\xe7ilerin \\xe7alma s\\xfcrelerinin i s\\xf6zlemelerinde belirlenecei, mevzuatta \\xf6ng\\xf6r\\xfclen snrlara bal olarak taraflarca deiiklik yaplabilecei, fazla \\xe7almann iverenin yazl talebi \\xfczerine i\\xe7inin kabul\\xfc ile mevzuat h\\xfck\\xfcmlerine uygun olarak yaplabilecei h\\xfck\\xfcm altna alnmtr. (Y\\xf6netmelik, md. 9) S\\xf6z konusu d\\xfczenleme, iyerinde \\xe7almaya ilikin i s\\xf6zlemelerinde yer alan hususlardan farkl bir d\\xfczenleme olmamakla birlikte; uzaktan \\xe7alma esnasnda sk\\xe7a karlalmas m\\xfcmk\\xfcn olan i\\xe7ilerin \\xe7alma saatleriyle ilgili olarak ortaya \\xe7kabilecek uyumazlklarn \\xf6n\\xfcne ge\\xe7ebilmek adna, \\xe7alma saatlerine ilikin t\\xfcm detaylarn uzaktan \\xe7almaya ilikin i s\\xf6zlemelerine eklenmesine y\\xf6nelik bir d\\xfczenlemeye yer vermektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"letiim\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uzaktan \\xe7alma esnasnda iveren ile i\\xe7i arasnda fiziken bir iletiim s\\xf6z konusu olmayaca i\\xe7in, bu iletiimin ne zaman ve hangi yolla ger\\xe7ekleecei b\\xfcy\\xfck bir \\xf6nem arz etmektedir. Bu kapsamda 'Uzaktan \\xe7almada iletiimin y\\xf6ntemi ve zaman aral uzaktan \\xe7alan ile iveren tarafndan belirlenir.' h\\xfckm\\xfc d\\xfczenlenmitir. (Y\\xf6netmelik, md. 10) Buna g\\xf6re, uzaktan \\xe7alan i\\xe7i ile salanacak iletiimin hangi y\\xf6ntemle ger\\xe7ekleecei ve hangi zaman dilimlerinde salanabileceinin iveren tarafndan i\\xe7iye bildirilmesi gerekmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Verilerin Korunmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uzaktan \\xe7alma esnasnda iyerine ve ie ait verilerin korunmasna ilikin usul ve esaslar konusunda, iverenin iyerine ve ie ait verilerin korunmasna ilikin hususlar iletme kurallar ve ilgili mevzuat uyarnca belirleyip, uzaktan \\xe7alana bildirme y\\xfck\\xfcml\\xfcl\\xfc\\xfc d\\xfczenlenmitir. (Y\\xf6netmelik, md. 11) Korunmas gereken verilere ilikin tanmlar ve kapsamlarn belirtilen ekilde iletme kurallarna ve ilgili mevzuata uygun ekilde d\\xfczenlenerek i s\\xf6zlemesinde belirtilmesi gerekmektedir. Uzaktan \\xe7alan i\\xe7inin, iveren tarafndan belirlenen bu kurallara uymas zorunlu klnmtr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2.  SALII VE G\\xdcVENL KAPSAMINDA UZAKTAN \\xc7ALIMA\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"4857 sayl  Kanunu 2. madde uyarnca iyeri u ekilde tanmlanmaktadr: 'veren tarafndan mal veya hizmet \\xfcretmek amacyla madd\\xee olan ve olmayan unsurlar ile i\\xe7inin birlikte \\xf6rg\\xfctlendii birime iyeri denir. verenin iyerinde \\xfcrettii mal veya hizmet ile nitelik y\\xf6n\\xfcnden ball bulunan ve ayn y\\xf6netim altnda \\xf6rg\\xfctlenen yerler (iyerine bal yerler) ile dinlenme, \\xe7ocuk emzirme, yemek, uyku, ykanma, muayene ve bakm, beden ve meslek\\xee eitim ve avlu gibi dier eklentiler ve ara\\xe7lar da iyerinden saylr.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uygulamada da herhangi bir karkla yol a\\xe7mayacak ekilde iyeri, i\\xe7inin fiilen bulunduu ve i s\\xf6zlemesinden doan i g\\xf6rme borcunu ifa ettii yer olarak kabul g\\xf6rmektedir. Uzaktan \\xe7alma sisteminde i\\xe7i, i g\\xf6rme borcunu evde, otelde, yurtta, k\\xfct\\xfcphanede vb. yerlerde yerine getirdiinden \\xf6t\\xfcr\\xfc; uzaktan \\xe7alann i g\\xf6rme borcunu yerine getirdii yer, iyeri olarak kabul edilmekte olup; iverenin iyerinde yerine getirmekle y\\xfck\\xfcml\\xfc olduu i sal ve g\\xfcvenliine ilikin y\\xfck\\xfcml\\xfcl\\xfcklerini, uzaktan \\xe7alma srasnda da yerine getirme y\\xfck\\xfcml\\xfcl\\xfc\\xfc devam etmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Nitekim Y\\xf6netmelik uyarnca  Kanununa paralel bir d\\xfczenleme yaplm olup, veren, uzaktan \\xe7alann yapt iin niteliini dikkate alarak i sal ve g\\xfcvenlii \\xf6nlemleri hususunda \\xe7alan bilgilendirmekle, gerekli eitimi vermekle, salk g\\xf6zetimini salamakla ve salad ekipmanla ilgili gerekli i g\\xfcvenlii tedbirlerini almakla y\\xfck\\xfcml\\xfcd\\xfcr. h\\xfckm\\xfc eklenmitir. (Y\\xf6netmelik, md. 12)\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lgili h\\xfck\\xfcm uyarnca iveren, uzaktan \\xe7alma esnasnda uzaktan \\xe7alann almas gereken \\xf6nlemlerle ilgili gerekli bilgilendirmeleri yapmak, eitimleri vermek ve gerekli ekipmanlar (sandalye, srt destei vb.) uzaktan \\xe7alana salamakla y\\xfck\\xfcml\\xfcd\\xfcr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. UZAKTAN \\xc7ALIMA YAPILAMAYACAK LER\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelik kapsamnda, uzaktan \\xe7alma yaplamayacak haller d\\xfczenlenmi olup, ilgili h\\xfck\\xfcm uyarnca 'Tehlikeli kimyasal madde ve radyoaktif maddelerle \\xe7alma, bu maddelerin ilenmesi veya s\\xf6z konusu maddelerin atklar ile \\xe7alma, biyolojik etkenlere maruz kalma riski bulunan \\xe7alma ilemlerini i\\xe7eren ilerde uzaktan \\xe7alma yaplamaz.' (Y\\xf6netmelik, md. 13/1)\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca bu hususta, tehlikeli kimyasal madde ve radyoaktif maddelerle \\xe7alma durumuna ek olarak; 'Kamu kurum ve kurulularnca ilgili mevzuatna g\\xf6re hizmet alm suretiyle g\\xf6rd\\xfcr\\xfclen iler ile mill\\xee g\\xfcvenlik a\\xe7sndan stratejik \\xf6nemi haiz birim, proje, tesis veya hizmetlerden hangilerinde uzaktan \\xe7alma yaplamayaca birim, proje, tesis veya hizmetten sorumlu olan veya hizmeti alan kamu kurum ve kuruluunca belirlenir.' h\\xfckm\\xfcne de yer verilmitir.  (Y\\xf6netmelik, md. 13/2)\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. UZAKTAN \\xc7ALIMAYA GE\\xc7\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Halihazrda iyerinde \\xe7almasn s\\xfcrd\\xfcren iyerlerinin uzaktan \\xe7alma yoluyla \\xe7almaya devam etmesine y\\xf6nelik usul ve esaslar d\\xfczenlenmekte olup; ilgili h\\xfck\\xfcm uyarnca ' ilikisi dorudan uzaktan \\xe7alma s\\xf6zlemesi ile kurulabilir veya h\\xe2lihazrda iyerinde \\xe7alan i\\xe7inin i s\\xf6zlemesi, i\\xe7inin ve iverenin anlamas halinde, uzaktan \\xe7alma s\\xf6zlemesine d\\xf6n\\xfct\\xfcr\\xfclebilir.' d\\xfczenlemesine yer verilmitir. (Y\\xf6netmelik, md 14/1)\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xf6z konusu d\\xfczenleme ile birlikte, iverenlerin yeni kuracaklar i ilikilerini dorudan uzaktan \\xe7alma s\\xf6zlemesi yoluyla d\\xfczenlemesini m\\xfcmk\\xfcn klm; \\xf6nceden iyerinde \\xe7alma yaptran iverenlerin ise, mevcut i s\\xf6zlemelerinin, i\\xe7i ve iverenin karlkl mutabakat dorultusunda, uzaktan \\xe7alma s\\xf6zlemesine d\\xf6n\\xfct\\xfcr\\xfclebileceini d\\xfczenlemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca Y\\xf6netmelikin 14. maddesinin 2. fkrasnda, i\\xe7i tarafndan uzaktan \\xe7alma talep edilmesi halinde izlenmesi gereken usul d\\xfczenlenmitir:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"'Talep yazl olarak yaplr.\",\n                        \"Talep iyerinde belirlenen usul dorultusunda iverence deerlendirilir.\",\n                        \"Talep deerlendirilirken, iin ve i\\xe7inin nitelii gerei uzaktan \\xe7almaya uygunluu ile iverence belirlenecek dier kstaslar kullanlr.'\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"veren, i\\xe7inin uzaktan \\xe7alma talebini en ge\\xe7 30 g\\xfcn i\\xe7erisinde deerlendirerek, kararn i\\xe7iye bildirmek zorundadr. Ayrca \\xe7iye, uzaktan \\xe7alma yaptktan sonra diledii zaman iyerinde \\xe7alma talebinde bulunmas hakk tannmtr. \\xe7inin bu talebinin de, yukarda belirtilen usule g\\xf6re yaplmas gerekmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelik kapsamnda, uzaktan \\xe7almann mevzuatta belirlenen zorlayc hallerde iyerinin tamamnda veya bir b\\xf6l\\xfcm\\xfcnde uygulanacak olmas halinde, uzaktan \\xe7almaya ge\\xe7i i\\xe7in i\\xe7inin talebinin veya onaynn aranmayacan h\\xfck\\xfcm altna almtr. Bu h\\xfck\\xfcmle birlikte, COVID-19 d\\xf6neminde, bir\\xe7ok iyerinin uzaktan \\xe7almaya ge\\xe7mesine, yasal a\\xe7dan bir temel kazandrlm olup; iverenleri, uzaktan \\xe7almaya ge\\xe7mek istemeyen i\\xe7ilerden gelebilecek taleplere kar koruma altna almaktadr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. SONU\\xc7\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uzaktan \\xc7alma Y\\xf6netmelii ile birlikte, COVID-19 \\xf6ncesinde yaygn olmayan uzaktan \\xe7almann, pandemi d\\xf6neminde bir\\xe7ok iletme tarafndan uygulanmaya balamas sebebiyle; gelecekte ortaya \\xe7kabilecek i\\xe7i-iveren taleplerinin yasal d\\xfczenleme altna alnmas ama\\xe7lamtr. Bu dorultuda, Y\\xf6netmelik ile birlikte, uzaktan \\xe7alma d\\xf6neminde taraflarn hak ve y\\xfck\\xfcml\\xfcl\\xfckleri genel bir kapsamda d\\xfczenlenmi olup, s\\xf6z konusu s\\xfcrecin y\\xfcr\\xfct\\xfclmesinde i\\xe7inin ve iverenin menfaat dengesinin kurulmas ama\\xe7lanmaktadr.\"\n                }\n            ],\n            tags: [\n                \"uzaktan\\xe7alma\",\n                \"i\\xe7i\",\n                \"y\\xf6netmelik\"\n            ],\n            author: \"\"\n        },\n        {\n            id: 34,\n            subtitle: \"Makale\",\n            date: \"2021\",\n            slug: \"eser-s\\xf6zlemesi-bildirim\",\n            title: \"ESER S\\xd6ZLEMESNDE  SAHBNN G\\xd6ZDEN GE\\xc7RME VE BLDRM Y\\xdcK\\xdcML\\xdcL\\xdc\\xdc\",\n            text: \"Eser s\\xf6zlemesi, 6098 Sayl T\\xfcrk Bor\\xe7lar Kanununda (TBK) d\\xfczenleme alan bulan en \\xf6nemli s\\xf6zleme t\\xfcrlerinden birisidir. Eser s\\xf6zlemesi ile y\\xfcklenici, i sahibinin \\xf6demeyi taahh\\xfct ettii \\xfccret karlnda bir eser meydana getirmeyi ve meydana getirdii bu eseri i sahibine teslim etmeyi \\xfcstlenir. Y\\xfcklenicinin teslim edecei eseri s\\xf6zlemede kararlatrld \\xfczere eksiksiz ve aypsz olarak tamamlayp i sahibine teslim etmesi gerekir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"T\\xfcrk hukuk uygulamasnda eser s\\xf6zlemeleriyle ilgili pek \\xe7ok uyumazlkla karlalmaktadr. Y\\xfcklenicinin aypl ifasna ilikin uyumazlklar belirtilen uyumazlklar arasnda \\xf6nemli bir yer tutmaktadr. Bu itibarla eser s\\xf6zlemeleri ve aypl ifaya ilikin temel hukuki esaslarn deerlendirilmesi hukuk teorisi ve uygulamas a\\xe7sndan g\\xfcncelliini korumakta ve her ge\\xe7en g\\xfcn pop\\xfclerliini arttrmaktadr. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Eserin teslimi a\\xe7sndan tamamlanm olma art varken eserin aypl olmas kural olarak teslime engel deildir. Teslim edilen eserin aypl olmas halinde y\\xfcklenicinin ayba kar tekeff\\xfcl borcu s\\xf6z konusu olur.  sahibi ise ayptan kaynakl se\\xe7imlik haklarn kanunun arad artlar yerine getirmek suretiyle kullanabilir. S\\xf6z konusu artlardan birisi de i sahibinin eseri inceleme ve varsa ayplar bildirme y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc yerine getirmesidir. bu \\xe7almada eser s\\xf6zlemelerinde i sahibinin eseri inceleme ve ayb bildirme y\\xfck\\xfcml\\xfcl\\xfc\\xfc t\\xfcm detaylaryla incelenecek olup, doktrinde ve Yargtay kararlarnda bulunan fikir birlikleri ile fikir ayrlklarna da deinilecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"I. Y\\xdcKLENCNN AYIPLI FADAN DOAN SORUMLULUU\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Eser s\\xf6zlemesinde eserin aypsz olarak meydana getirilmesini salama borcu y\\xfcklenicinin asli edim y\\xfck\\xfcml\\xfcl\\xfc\\xfc kapsamnda ve eseri teslim borcunun tamamlaycs niteliinde olan bir bor\\xe7tur. Y\\xfcklenici, s\\xf6zleme ile taraflarn t\\xfcm \\xf6zellikleri a\\xe7sndan mutabk kald eseri meydana getirmek ve bu eseri s\\xf6zlemenin dier taraf olan i sahibine teslim etmekle y\\xfck\\xfcml\\xfcd\\xfcr. Y\\xfcklenicinin, i sahibi ile mutabk kalnan \\xf6zelliklere haiz eseri i sahibine teslimi konusundaki asli edim y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfcn ihlali durumunda y\\xfcklenicinin ayba kar tekeff\\xfcl sorumluluu s\\xf6z konusu olacaktr. Bir baka deyile y\\xfcklenicinin meydana getirdii eser, taraflarn s\\xf6zlemede kararlatrd \\xf6zellikleri tamayan, aypl bir eser ise y\\xfcklenicinin edim borcuna aykr bir davran i\\xe7inde olduu s\\xf6ylenebilecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Eser s\\xf6zlemesine ilikin ayba kar tekeff\\xfcl borcu y\\xfckleniciye asli borcunu gerei gibi yerine getirmemesi halinde bir garanti y\\xfck\\xfcml\\xfcl\\xfc\\xfc y\\xfcklemekte olup bu y\\xfck\\xfcml\\xfcl\\xfck kurtulu kant getirme imk\\xe2n olmakszn y\\xfcklenicinin sorumlu tutulmas sonucunu dourmaktadr. Eserin aypl olmas durumunda i sahibi s\\xf6zlemeye uygun olarak meydana getirilmeyen eseri teslim almaktan ka\\xe7nabilir; bu durumda i sahibi alacakl temerr\\xfcd\\xfcne d\\xfcmeyecektir. Bunun yannda i sahibinin, y\\xfckleniciyi bor\\xe7lu temerr\\xfcd\\xfcne d\\xfc\\xfcrmek suretiyle TBK madde 123 ve devam h\\xfck\\xfcmlerine bavurmas m\\xfcmk\\xfcn olabilecektir. Eserin i sahibi tarafndan teslim alnmas ile birlikte artk aypl ifadan kaynakl sorumluluk, bir baka deyile y\\xfcklenicinin ayba kar tekeff\\xfcl\\xfc s\\xf6z konusu olabilecektir. B\\xf6ylelikle s\\xf6zleme konusu eser teslim alnd i\\xe7in artk i sahibinin y\\xfckleniciye kar TBK madde 123 ve devam h\\xfck\\xfcmlerine gitmesinin imkan kalmayacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Eser s\\xf6zlemesinde y\\xfcklenicinin ayptan doan sorumluluu TBK madde 474-478 arasnda d\\xfczenlenmektedir. TBK madde 474 ile aybn belirlenmesi, TBK madde 475 ile eserdeki ayptan y\\xfcklenicinin sorumlu olduu hallerde i sahibinin se\\xe7imlik haklar, TBK madde 476 ile ise eserin aypl olmasnda i sahibinin sorumluluu belirlenmitir. Bu maddelerin yan sra TBK m. 477 eserin teslim ve kabul\\xfcnden sonra taraflarn haklarn d\\xfczenlenmi olup y\\xfcklenicinin ayptan doan sorumluluu bu maddeler \\xe7er\\xe7evesinde \\xe7\\xf6z\\xfcmlenecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"II. Y\\xdcKLENCNN AYIPLI FADAN DOAN SORUMLULUUNUN ARTLARI\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yukarda da a\\xe7kland \\xfczere y\\xfcklenicinin aypl ifas sebebiyle i sahibinin TBK madde 475de saylan se\\xe7imlik haklarn kullanabilmesi baz artlara baldr. Bu artlarn mevcut olmas durumunda i sahibi; s\\xf6zlemeden d\\xf6nme, aybn giderilmesi veya \\xfccretten indirim talep etme hakkndan birini se\\xe7erek kullanabilecektir. Y\\xfcklenicinin ayptan sorumlu olmas, bir baka deyile i sahibinin se\\xe7imlik haklarn kullanabilmesi i\\xe7in; (i) eserin aypl olmas ve i sahibine aypl olarak teslim edilmesi, (ii) i sahibinin g\\xf6zden ge\\xe7irme ve bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc yerine getirmesi, ve (iii) aybn i sahibinden kaynaklanmam olmas gerekmektedir. Bu artlarn tamamnn birlikte ve eksiksiz olarak karlanm olmas durumunda i sahibi se\\xe7imlik haklarn kullanabilecektir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"A.  SAHBNN G\\xd6ZDEN GE\\xc7RME VE BLDRM Y\\xdcK\\xdcML\\xdcL\\xdc\\xdc\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"1. G\\xf6zden Ge\\xe7irme Y\\xfck\\xfcml\\xfcl\\xfc\\xfc\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" sahibinin eseri muayene etmesi ve eserdeki ayplar y\\xfckleniciye bildirmesi zorunluluu, hukuki nitelii itibariyle i sahibi a\\xe7sndan bir bor\\xe7 olmayp, sadece i sahibinin ayba kar tekeff\\xfclden doan haklarn kullanabilmesinin \\xf6n koulunu oluturan k\\xfclfettir. Bu k\\xfclfetlerin yerine getirilmemesi, i sahibinin y\\xfckleniciye kar bir sorumluluunu gerektirmemekte, sadece aypl eser teslimi dolaysyla sahip olduu haklardan yararlanamamas sonucunu dourmaktadr. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"TBK madde 474 uyarnca' sahibi, eserin tesliminden sonra, ilerin olaan akna g\\xf6re imkan bulur bulmaz eseri g\\xf6zden ge\\xe7irmek ve ayplar varsa, bunu uygun bir s\\xfcre i\\xe7inde y\\xfckleniciye bildirmek zorundadr. Taraflardan her biri, giderini karlayarak, eserin bilirkii tarafndan g\\xf6zden ge\\xe7irilmesini ve sonucun bir raporla belirlenmesini isteyebilir.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" sahibinin eserin teslimini m\\xfcteakip g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfc domaktadr. Gerek doktrinde gerekse de Yargtay kararlarnda bu husus sabit olup, g\\xf6zden ge\\xe7irme ve bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc yerine getirmeyen i sahibinin eseri kabul etmi saylaca su g\\xf6t\\xfcrmez bir ger\\xe7ektir. Nitekim Yargtay 15. Hukuk Dairesinin 2002/1685 E. 2002/2483 K. ve 13.05.2002 tarihli kararnda;\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"'in aypl olup olmadna dair muayene ve ihbar y\\xfck\\xfcml\\xfcl\\xfc\\xfc, BKnn 359. maddesi uyarnca imal olunan eyin tesliminden sonra domaktadr. Dava konusu olayda 130 adet dairenin kalorifer yapm s\\xf6z konusu olup, 50 adedi hen\\xfcz teslim edilmediinden i sahibinin muayene ve ihbar k\\xfclfeti /bu aamada) bulunmamaktadr.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"h\\xfckm\\xfcne yer vererek Yargtayca kabul edilen g\\xf6r\\xfc\\xfc net bir ekilde g\\xf6zler \\xf6n\\xfcne sermitir. Eseri kabul eden i sahibinin, bu durumda y\\xfcklenicinin ayba kar tekeff\\xfclden doan sorumluluunun da ortadan kalkacann bilincinde olmas gerekmektedir. 'Bir ev inasnda b\\xfct\\xfcn iler tamamlanmadan i sahibi eve tanm ise hen\\xfcz teslim vaki olmu saylmayacandan, s\\xf6z\\xfc ge\\xe7en k\\xfclfetler de ortaya \\xe7kmaz. Bir kimse bir evin inaasn tamamlayp anahtar teslimi taahh\\xfct etmi ve sonra inaata ait \\xe7eitli ileri \\xe7eitli alt y\\xfcklenicilere yaptrmsa, eseri g\\xf6zden ge\\xe7irme ve bildirimde bulunma k\\xfclfetleri bu ilerin her biri i\\xe7in ayr ayr onlarn tamamlanmasndan itibaren deil, evin b\\xfct\\xfcn ileri tamamlanp teslim edilmeden sonra kendini g\\xf6sterir.' Eserin tamamlanp teslim edilmesi ise iskan ruhsatnn alnmasndan sonra s\\xf6z konusudur. skan ruhsat alnmadan teslim, teslim olmadan da muayene ve ihbar k\\xfclfetleri balamamaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" sahibi, y\\xfcklenici tarafndan tamamlanan ve kendisine teslim edilen eseri, hayatn olaan akna uygun ekilde g\\xf6zden ge\\xe7irmek (muayene etmek) ve s\\xf6z konusu incelemeyi yine hayatn olaan akna uygun ekilde bitirmekle y\\xfck\\xfcml\\xfcd\\xfcr. Nitekim TBK madde 474/1 uyarnca ' sahibi, eserin tesliminden sonra, ilerin olaan akna g\\xf6re imkan bulur bulmaz eseri g\\xf6zden ge\\xe7irmek ve ayplar varsa, bunu uygun bir s\\xfcre i\\xe7inde y\\xfckleniciye bildirmek zorundadr.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Maddedeki 'imk\\xe2n bulur bulmaz' ifadesinin kanun koyucu tarafndan konulma amac ise i sahibinin ger\\xe7ekletirecei g\\xf6zden ge\\xe7irme eyleminin s\\xfcre bakmndan herhangi bir keyfiyete mahal verilmesinin \\xf6n\\xfcne ge\\xe7ilmesidir. Unutulmamaldr ki s\\xf6z konusu ifade i sahibine kendi subjektif durumuna g\\xf6re bir g\\xf6zden ge\\xe7irme aciliyeti belirlenmesi hakk da tanmamaktadr.  sahibi, g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc eserin tesliminden itibaren hayatn olaan akna g\\xf6re, objektif kriterler g\\xf6zetilerek belirlenecek uygun s\\xfcre i\\xe7erisinde tamamlamakla y\\xfck\\xfcml\\xfcd\\xfcr. Fakat i sahibinin hakl bir nedenle g\\xf6zden ge\\xe7irme ilemine balayamamas durumunda, d\\xfcr\\xfcstl\\xfck kuralna g\\xf6re g\\xf6zden ge\\xe7irme s\\xfcresinin hakl nedenin ortadan kalkmasna kadar ertelenebileceinin kabul edilmesi gerekir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"G\\xf6zden ge\\xe7irme s\\xfcresi i\\xe7in toplumda benimsenen ortak bir uygulama bulunmuyorsa, sadece imk\\xe2n bulma unsuruna dayanmak yeterli olacaktr. Bu durumda da somut olaydaki subjektif koullar g\\xf6zetilerek, normal bir i sahibinin eseri g\\xf6zden ge\\xe7irmeye balamas ve bu ii \\xf6zenle yapmas i\\xe7in ne kadar zaman gerektiine baklmaldr. \\xd6rnein inaat s\\xf6zlemesi kapsamnda teslim edilen eserin snma sisteminde ger\\xe7ekletirilmesi gereken g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfc ancak k mevsiminin gelmesi ile, eserin \\xe7atsnda ger\\xe7ekletirilmesi gereken g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfc ise ancak yamur yamas ile birlikte tam bir ekilde ger\\xe7ekletirilebilecektir. Fakat her hal\\xfckarda g\\xf6zden ge\\xe7irme s\\xfcresinin tespitinde m\\xfcmk\\xfcn olduu kadar geni davranlmas hakkaniyete uygun olacaktr. \\xd6zellikle i sahibinin tacir olmad veya yeterli deneyime sahip olmad durumlarda b\\xf6yle bir gereklilik s\\xf6z konusu olmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"TBK madde 474'de yer alan g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfc, eserdeki a\\xe7k ayplar bakmndan s\\xf6z konusudur. Buna karlk teslim esnasnda a\\xe7k\\xe7a belli olmayan gizli ayplar ve y\\xfcklenicinin kastl bir ekilde saklad ayplar hakknda i sahibinin g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfc olmad kabul edilmektedir. Sradan bir inceleme ile ortaya \\xe7kmayan, farkedilemeyen ayplar gizli ayp olarak nitelendirildiinden, s\\xf6z konusu ayplarn (gizli ayp) ilerleyen zamanlarda, ortaya \\xe7ktklar anda y\\xfckleniciye bildirilmeleri m\\xfcmk\\xfcnd\\xfcr. Buna karlk, y\\xfcklenicinin kastl bir ekilde saklad ayplar, gizli veya a\\xe7k ayp niteliinde olabilir. Y\\xfcklenicinin kastl olarak gizledii a\\xe7k ayplar bakmndan da i sahibinin g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc yerine getirmemesinin y\\xfcklenicinin sorumluluunu ortadan kaldrmayacann kabul edilmesi gerekir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" sahibi, eseri ortalama bir kiinin g\\xf6sterecei dikkatle s\\xf6zlemeye uygunluk ve ayp bulunup bulunmad bakmndan makul bir deerlendirme yapabilecek bi\\xe7imde incelemelidir. Bu incelemenin tarz, kapsam ve y\\xf6ntemi, eserin \\xe7eidine g\\xf6re deiir; gerekli \\xf6l\\xe7\\xfcmler, y\\xfcklemeler, kullanma veya ileme yaplmaldr; iin \\xe7eidine g\\xf6re bu konuda bir team\\xfcl de olabilir. \\xd6rnein otomobil tamirinden sonra usta ile birlikte bir deneme gezisinin yaplmas gibi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xf6zleme veya team\\xfcl gerektirmedik\\xe7e, i sahibi g\\xf6zden ge\\xe7irme ilemini bir uzmana ya da bir bilirkiiye yaptrmak zorunda deildir. Bununla birlikte gerek i sahibinin, gerek y\\xfcklenicinin, masraflar kendisine ait olmak \\xfczere eserin, bilirkiiye muayene ettirilmesini ve muayene sonucunun bir raporla tespitini istemeye hakk vardr. TBK madde 474/2 'Taraflardan her biri, giderini karlayarak, eserin bilirkii tarafndan g\\xf6zden ge\\xe7irilmesini ve sonucun bir raporla belirlenmesini isteyebilir' h\\xfckm\\xfcn\\xfc i\\xe7ermektedir. Bu h\\xfck\\xfcmde s\\xf6z\\xfc ge\\xe7en bilirkiinin, kanunda bu husus a\\xe7k\\xe7a belirtilmemi olmasna ramen, resmen tayin edilmi bir bilirkii olmas gerektii ileri s\\xfcr\\xfclmektedir. T\\xfcrk hukukunda, bilirkii aracl ile delil tespiti mahkemelerden talep edilebilmektedir. B\\xf6yle bir talepte bulunabilmek i\\xe7in ispat vastalarnn tehlikeye d\\xfcmesi veya eserde bir ayp bulunmasnn kuvvetle muhtemel olmas art aranmaz. Kald ki bilirkiiye bavurmak bir y\\xfck\\xfcml\\xfcl\\xfck deil, taraflara tannm bir haktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bilirkiinin raporunu ge\\xe7 vermesi, g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfcn vaktinde yerine getirilmemi olduu iddiasna yol a\\xe7mamaldr; bir baka deyile, mahkemece tayin edilen bilirkiinin raporunu vermekte gecikmesi, i sahibinin tekeff\\xfclden doan hakknn d\\xfcmesine yol a\\xe7mamaldr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"2. Bildirim Y\\xfck\\xfcml\\xfcl\\xfc\\xfc\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" sahibi ya da onun yetkili temsilcisi tarafndan fark edilen her t\\xfcrl\\xfc ayp y\\xfckleniciye veya b\\xf6yle bir beyan/ihbar/bildirimi almaya yetkili temsilcisine vaktinde bildirilmek zorundadr. Aybn g\\xf6zden ge\\xe7irme y\\xfck\\xfcml\\xfcl\\xfc\\xfc sonucu ortaya \\xe7kmas, teslim srasnda a\\xe7k\\xe7a belli olmas ya da g\\xf6zden ge\\xe7irme srasnda belirlenememekle birlikte sonradan ortaya \\xe7kan bir gizli ayp olmas bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc ortadan kaldrmamaktadr. Bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfc konusunda bilinmesi gereken en \\xf6nemli husus eserin teslimi srasnda y\\xfcklenici tarafndan bilinen ve/veya kastl bir ekilde saklanan ayplarn, i sahibi tarafndan y\\xfckleniciye bildirilmesine gerek bulunmamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfc kapsamnda eserin aypl olduu, s\\xf6zlemede mutabk kalnan \\xf6zellikleri tamad, tatmin edici olmad gibi genel nitelikte a\\xe7klamalar yeterli deildir.  sahibi dayanaca her bozukluu ayr ayr g\\xf6stermeli ve g\\xf6r\\xfcn\\xfc bi\\xe7imine g\\xf6re y\\xfcklenicinin anlayaca bi\\xe7imde tanmlamaldr. Ancak aybn uzmanlk a\\xe7sndan doru bi\\xe7imde ve b\\xfct\\xfcn ayrntlaryla g\\xf6sterilmesi, ayrca nedeninin bildirilmesi zorunlu deildir.  sahibi bozukluun nedenini de bildirmi ve bunda yanlm ise bunun bir \\xf6nemi yoktur. \\xd6rnein, balkonda demirlerin yetersiz kullanldnn veya mutfakta yanl fayans kullanldnn belirtilmesi yeterli olup, ne miktar demir ve hangi marka fayans kullanldnn belirtilmesine gerek bulunmamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"TBK madde 474/1'de g\\xf6zden ge\\xe7irme sonucu ortaya \\xe7kan ayplarn 'uygun bir s\\xfcrede' y\\xfckleniciye bildirilmesinden s\\xf6z edilmesine ramen, somut bir s\\xfcre \\xf6ng\\xf6r\\xfclmemitir. Gizli olup da sonradan \\xf6renilen ayplar bakmndan ise 'gecikmeksizin' bildirimden s\\xf6z edilmektedir. G\\xf6zden ge\\xe7irme ile ortaya \\xe7kan ayplar bakmndan da ayp ihbarnn olaan g\\xf6zden ge\\xe7irme s\\xfcresinin tamamlanmasndan sonra, derhal yaplmas gerektii kabul edilmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Doktrinde tartlan ve uygulamada b\\xfcy\\xfck bir sorun haline gelen hususlarn banda ise i sahibinin y\\xfckleniciye bildirmedii ayplarn, sonradan daha b\\xfcy\\xfck bir zarara yol a\\xe7mas durumunda, i sahibinin ayp ihbarnda bulunup, buna ilikin haklardan yararlanp yararlanamayacadr. Doktrinde b\\xfcy\\xfck bir \\xe7ounluun kabul ettii g\\xf6r\\xfce g\\xf6re, ihbar edilmeyen a\\xe7k ya da gizli ayplardan dolay y\\xfcklenicinin sorumluluunun bulunmad, ancak i sahibinin bu ayplarn sonradan verecei zarar tahmin edememesi durumunda ya da \\xf6nemsenmeyecek bir aybn sonradan \\xf6nem ve boyutunun anlalmas \\xfczerine derhal bildirilmesiyle ayb bildirme y\\xfck\\xfcml\\xfcl\\xfc\\xfc yerine getirilmi olacaktr. Bir baka deyile ayp bildiriminde esas olan bildirim yaplmayan ayplarn i sahibi tarafndan kabul edildii, ayba kar se\\xe7imlik haklarn kullanlmayacann kabul edilmesidir. Fakat s\\xf6z konusu ayplarn sonradan meydana getirecei zararlarn i sahibi tarafndan tahmin edilmesinin g\\xfc\\xe7 olduu durumlarda, ve/veya bildirilmeyen aybn mahiyetinin sonradan anlalmas durumlarnda istisna olarak i sahibi tarafndan derhal bildirimde bulunulabilecei kabul edilmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" sahibinin bildirimde bulunma y\\xfck\\xfcml\\xfcl\\xfc\\xfc kural olarak eserin g\\xf6zden ge\\xe7irilmesinden/muayenesinden sonra domaktadr. Yani g\\xf6zden ge\\xe7irme s\\xfcresi bitmeden \\xf6nce bilinen ayplarn y\\xfckleniciye bildirilmesi gerekmemektedir. Fakat, s\\xf6z konusu aybn y\\xfckleniciye, haberdar olunduu andan itibaren en ksa s\\xfcre i\\xe7erisinde bildirilmemesi durumunda b\\xfcy\\xfck zararlara yol a\\xe7ma riskinin bulunmas halinde, d\\xfcr\\xfcstl\\xfck kural gerei bunlarn derhal, g\\xf6zden ge\\xe7irme s\\xfcresinin bitiminin beklenmesine gerek olmakszn, y\\xfckleniciye bildirilmesi gerektii kabul edilmelidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayp bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfcne ilikin yasal d\\xfczenlemeler tamamlayc hukuk kurallar olduklarndan, eser s\\xf6zlemesinin taraflar bu y\\xfck\\xfcml\\xfcl\\xfc\\xfcn ne kadar s\\xfcrede yaplacan ayrca ve serbest\\xe7e kararlatrabilirler. Y\\xfcklenicinin imalat ve i\\xe7ilik hatalarna kar i sahibine garanti verdii durumlarda, g\\xf6zden ge\\xe7irme ve bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfcnden i sahibi yararna vazge\\xe7ildiinin, y\\xfcklenici tarafndan verilen garanti s\\xfcresince y\\xfcklenicinin ayplar gidermeyi garanti ettiinin kabul\\xfc gerekir. Nitekim bu husus Yargtay kararlarnda da sabittir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayp, bir malda ya da eserde s\\xf6zleme veya yasa h\\xfck\\xfcmlerine g\\xf6re normal olarak bulunmas gereken niteliklerin bulunmamas ya da bulunmamas gereken bozukluklarn bulunmas olarak tanmlanabilir. Eserin tesliminden sonra i sahibi, ilerin olaan gidiine g\\xf6re, imkan bulur bulmaz eseri g\\xf6zden ge\\xe7irmek ve bozukluu varsa derhal y\\xfckleniciye bildirmek zorundadr. Garanti s\\xfcresi kararlatrlm ise, garanti s\\xfcresi i\\xe7inde de ayp ihbar yaplabilir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"'Y\\xfcklenici, s\\xf6zlemede, imalat ve i\\xe7ilik kusurlar i\\xe7in 12 aylk garanti s\\xfcresi tanmtr. B\\xf6ylece y\\xfcklenici, yararna olan yasa kurallarndan vazge\\xe7mekte, i sahibinin g\\xf6zden ge\\xe7irme ve kusurlar bildirme y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc kaldrmakta, \\xe7kan bozukluun garanti s\\xfcresi i\\xe7inde kendisinden istenilmesi hakkn tanmaktadr.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayp bildirimi ile ama\\xe7lanan, i sahibinin ayplardan dolay y\\xfckleniciyi sorumlu tutacana ilikin irade a\\xe7klamasnn y\\xfckleniciye ulatrlmasdr.  sahibinin ayp ihbarna ilikin irade a\\xe7klamas, hukuki ilem benzeri bir fiildir.  sahibinin ayp ihbar ile birlikte, ayp dolaysyla sahip olduu se\\xe7imlik haklar kullanmas gerekmemektedir. Bu haklar s\\xfcresi i\\xe7inde, daha sonra ileri s\\xfcrmesi m\\xfcmk\\xfcnd\\xfcr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayp bildirimi herhangi bir ekle bal deildir. Hatta s\\xf6zleme tacirler arasnda akdedilmi olsa bile ayp bildirimi i\\xe7in herhangi bir ekil art bulunmamaktadr. Bildirimin yaplma ekli sadece ispat hukuku a\\xe7sndan \\xf6nem tamaktadr. Zira bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfcn yerine getirildiinin somut delillerle ispat i sahibinin lehine olacaktr \\xe7\\xfcnk\\xfc kural olarak taraflar arasnda bu hususa ilikin bir uyumazlk doduunda ayp bildiriminin yapldnn ispat y\\xfck\\xfc i sahibinde, bildirimin s\\xfcresinde yaplmadnn ispat y\\xfck\\xfc ise y\\xfcklenici \\xfczerindedir. Yine bu hususa ilikin Yargtay kararlar da bulunmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"'Eser S\\xf6zlemelerinde y\\xfcklenicinin kararlatrlan i bedeline hak kazanabilmesi i\\xe7in eseri s\\xf6zleme ve eklerine ve i sahibinin ondan bekledii amaca uygun olarak tamamlayarak teslim etmesi gerekir. Eserin s\\xf6zlemede kararlatrlan niteliklerine, ya da i sahibinin bekledii amaca uygun olmamas veya l\\xfczumlu baz vasflardan bir ya da bir ka\\xe7nn bulunmamas halinde aypl yapldnn kabul\\xfc gerekir. Dairemizin yerleik i\\xe7tihat ve uygulamalarna g\\xf6re ayp ihbarnn yaplmas ekle tabi deildir. Her t\\xfcrl\\xfc delille, hatta tank beyan ile dahi kantlanmas m\\xfcmk\\xfcnd\\xfcr. Eserin aypl olmas ve s\\xfcresinde ayp ihbar yaplm olmas halinde i sahibi BK madde 360da \\xf6ng\\xf6r\\xfclen haklarn kullanabilir. Dinlenilen daval tan ayp ihbarnn s\\xfcresinde yapldn beyan etmitir.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"'Eser s\\xf6zlemesine dayanan ilikilerde ayp ihbarnn yapldnn tank delili dahil olmak \\xfczere her t\\xfcrl\\xfc delille kantlanmas m\\xfcmk\\xfcnd\\xfcr. Somut olayda daval vekili tarafndan g\\xf6sterilen tanklar dinlenmemitir. Ayrca daval irket adna . A. tarafndan 21.03.2011 tarihinde g\\xf6nderilen e-mailin ayp ihbar niteliinde olduu, y\\xfcklenici tarafndan bu e-maile karlk olarak ayn tarihte g\\xf6nderilen e-maille ayp iddialarnn kabul edildii dikkate alnmamtr. Mahkemece yukarda belirtilen e-mailler dikkate alnmadan ve daval taraflarn tanklar dinlenmeden ayp ihbarnn s\\xfcresinde yaplmad ve yazl olmad gerek\\xe7esiyle bu savunma dikkate alnmayp karar verilmesi doru olmamtr.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Son olarak, ticari eser s\\xf6zlemeleri i\\xe7in, muayene ve ihbar s\\xfcreleri bakmndan T\\xfcrk Ticaret Kanunu'nun satm s\\xf6zlemesinde alcnn muayene ve ihbar s\\xfcrelerine ilikin h\\xfck\\xfcmlerin uygulanp uygulanmayacan tespit etmek gerekir. Doktrinde benimsenen bir g\\xf6r\\xfce g\\xf6re i sahibinin eserin aypl olmasndan doan haklar, kural olarak satm s\\xf6zlemesinden doan haklarn bal olduu zamanam s\\xfcresine tabidir, bu y\\xfczden eer taraflar tacir ise bu t\\xfcr ticari nitelikteki eser s\\xf6zlemelerinde ayplarn bildirim s\\xfcresinin de ticari satmlardaki bildirim s\\xfcresine tabi olduu kabul edilmelidir. A\\xe7k ayplar bakmndan 2 g\\xfcnl\\xfck, \\xf6zenli bir muayene ile ortaya \\xe7kacak a\\xe7k ayplar bakmndan ise 8 g\\xfcnl\\xfck ihbar s\\xfcresi uygulama alan bulmaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Her ne kadar b\\xf6ylesine bir g\\xf6r\\xfc bulunsa da bizim de katldmz, gerek doktrinde gerekse de Yargtay kararlarnda benimsenen g\\xf6r\\xfc ticari eser s\\xf6zlemelerinde g\\xf6zden ge\\xe7irme ve bildirim s\\xfcreleri bakmndan satm s\\xf6zlemesine ilikin s\\xfcrelerin kyasen uygulanmasnn m\\xfcmk\\xfcn olmad y\\xf6n\\xfcndedir. Yargtay bir kararnda konuyu etraflca a\\xe7klam ve destekledii g\\xf6r\\xfc\\xfc a\\xe7k\\xe7a ifade etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"'Ayp sebebiyle y\\xfcklenicinin sorumluluunun d\\xfczenleyen TBK'nn 474. maddesi uyarnca a\\xe7k ayplar y\\xf6n\\xfcnden i sahibi imk\\xe2n bulur bulmaz eseri g\\xf6zden ge\\xe7irmek ve ayplar varsa, bunu uygun bir s\\xfcre i\\xe7inde, gizli ayplar y\\xf6n\\xfcnden ise, 477/son maddesi uyarnca da, ortaya \\xe7kar \\xe7kmaz gecikmeksizin durumu y\\xfckleniciye bildirmek zorunluluu bulunmaktadr. Aybn bildirilmemesi halinde eser kabul edilmi saylr. Ne var ki, ayp ihbarnn s\\xfcresinde yaplp yaplmadnn da mahkemece re'sen g\\xf6zetilmesi m\\xfcmk\\xfcn deildir. Dier bir anlatmla, ayp ihbarnn yaplp yaplmad mahkemece re'sen g\\xf6zetilmeyip, y\\xfcklenicinin bu hususu def'i olarak ileri s\\xfcrmesi gerekir. Gerek Dairemizin gerekse Yargtay Hukuk Genel Kurulu'nun kararlar da bu y\\xf6ndedir. Ayrca, eksikler y\\xf6n\\xfcnden ise ayp ihbarna gerek olmayp, zamanam s\\xfcresi i\\xe7erisinde eksikler y\\xf6n\\xfcnden istemde bulunulmas m\\xfcmk\\xfcnd\\xfcr. Mahkemece ayp ihbarnn s\\xfcresinde yaplmadndan bahisle davann esasna girilmemesi doru deildir. \\xd6te yandan eser s\\xf6zlemelerinde ayp ihbarnn varl her t\\xfcrl\\xfc delille yaplabilecei Dairemizin uygulamalarnda kabul edilmektedir. Esasnda davac taraf konteyneri teslim ald 17.05.2014 tarihinden itibaren BK'nn 474. maddesi uyarnca uygun s\\xfcre i\\xe7erisinde 23.05.2014 tarihinde elektronik posta ile davalya bildirdiinden ihbarn s\\xfcresinde yapld kabul edilmelidir. TTK'nn 21/1-c maddesindeki (2) g\\xfcnl\\xfck ihbar s\\xfcresinin eser s\\xf6zlemelerinde uygulama yeri bulunmamaktadr.'\"\n                },\n                {\n                    type: \"header\",\n                    content: \"III. SONU\\xc7\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7almann giri ksmnda da belirtildii \\xfczere eser s\\xf6zlemeleri bakmndan uygulamada sklkla karlalan sorunlarn banda y\\xfcklenicilerin eseri aypl ifa etmeleri ve bu sebeple doan sorumluluklar gelmektedir. Y\\xfcklenici ile i sahibi bir araya gelerek taleplerini ve beklentilerini paylamakta, bu talep ve beklentileri ise s\\xf6zleme d\\xfczenleme yoluyla somut hale getirmektedirler. Eser s\\xf6zlemesinin d\\xfczenlenmesi ile i sahibinin borcu i bedelini \\xf6demek (TBK'nn 479/1.md.), y\\xfcklenicinin borcu ise, eseri i sahibinin amacna ve talebine uygun, hakl menfaatlerini g\\xf6zeterek, sadakat ve \\xf6zenle ifa etmektir. Fakat her durumda y\\xfckleniciler s\\xf6zlemede kararlatrld gibi bir eser ortaya \\xe7karamamaktadrlar. Bu gibi durumlarn varlnda kanun koyucu, i sahiplerine ayba katlanmamalar i\\xe7in bir hak, y\\xfcklenicilere ise bir y\\xfck\\xfcml\\xfcl\\xfck getirmektedir. Bahsetmi olduumuz y\\xfcklenicinin ayba kar tekeff\\xfcl borcunun doumu ise baz artlara balanmaktadr. Bu artlardan en \\xf6nemlisi ise kanmzca i sahibinin g\\xf6zden ge\\xe7irme ve bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfcd\\xfcr. Kanun koyucu tarafndan her ne kadar g\\xf6zden ge\\xe7irme ve bildirimde bulunma i\\xe7in belirli s\\xfcreler belirlenmemi olsa da i sahiplerinin hayatn olaan akn da g\\xf6z \\xf6n\\xfcnde bulundurarak eseri teslim aldktan sonra m\\xfcmk\\xfcn olan en ksa s\\xfcre i\\xe7erisinde muayene etmesi, daha sonra herhangi bir ayp saptanmas halinde ise yine m\\xfcmk\\xfcn olan en ksa s\\xfcre i\\xe7erisinde y\\xfckleniciye bildirmesi gerekmektedir. Kanun koyucu tarafndan g\\xf6zden ge\\xe7irme ve bildirimde bulunmak i\\xe7in belirli bir s\\xfcre \\xf6ng\\xf6r\\xfclmemesi taraflarca ne geni ne de dar yorumlanmaldr. Ger\\xe7ekten de her somut olay \\xf6zelinde farkl bir deerlendirme yaplmal ve \\xe7almamzda a\\xe7kladmz istisna haller g\\xf6zetilerek bu y\\xfck\\xfcml\\xfcl\\xfckler yerine getirilmelidir. Ayrca TBK madde 474 h\\xfckm\\xfcn\\xfcn emredici olmad da g\\xf6z \\xf6n\\xfcnde bulundurularak taraflarca hem g\\xf6zden ge\\xe7irme hem de bildirimde bulunma i\\xe7in s\\xf6zlemesel s\\xfcreler belirlenmesi uyumazlk domas ihtimalinde nispeten g\\xf6zden ge\\xe7irme ve bildirim y\\xfck\\xfcml\\xfcl\\xfcklerinin s\\xfcresinde yerine getirilip getirilmedii noktasnda uyumazla netlik kazandrabilecektir.\"\n                }\n            ],\n            tags: [\n                \"Esers\\xf6zlemesi\",\n                \"Y\\xfcklenici\",\n                \"Y\\xfck\\xfcml\\xfcl\\xfck\"\n            ],\n            author: \"\"\n        },\n        {\n            id: 33,\n            subtitle: \"Makale\",\n            date: \"2021\",\n            slug: \"kep-rehberi\",\n            title: \"MERKEZ KEP REHBERNE LKN BLG NOTU\",\n            text: \"bu bilgi notunda, 03.07.2021 tarih ve 31530 sayl Resmi Gazetede yaymlanarak y\\xfcr\\xfcrl\\xfce giren Kaytl Elektronik Posta Rehberi Ve Kaytl Elektronik Posta Hesab Adreslerine likin Teblide Deiiklik Yaplmasna Dair Tebli dorultusunda d\\xfczenlenen Merkezi Kaytl Elektronik Posta (KEP) Rehberinin kuruluu ve uygulanmasna ilikin usul ve esaslar incelenecektir.\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1. Tanmlar\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yaplan deiiklik ile birlikte Kaytl Elektronik Posta Rehberi Ve Kaytl Elektronik Posta Hesab Adreslerine likin Tebliin (Tebli) 4. maddesine u tanmlar eklenmitir:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"o) Devlet Tekilat Merkezi Kayt Sistemi (DETSS): T\\xfcrkiye Cumhuriyeti Devlet Tekilat i\\xe7erisinde yer alan kurum ve kurulular ile bunlarn merkez, tara ve yurt d tekilatlarnda bulunan her d\\xfczeydeki birimlerinin hiyerarik yapya uygun olarak T\\xfcrkiye Cumhuriyeti Devlet Tekilat Numaras ile tanmland sistemi,\",\n                        \"\\xf6) DETSS No: DETSSe kaytl t\\xfczel kiilere verilen tekil numaray,\",\n                        \"p) Kimlik Numaras: T.C. kimlik numarasn veya yabanc kimlik numarasn veya pasaport numarasn,\",\n                        \"r) Merkezi KEP Rehberi: T\\xfcm KEPHSler tarafndan verilen KEP hesab bilgilerinin g\\xfcncelliinin salanarak tek merkez \\xfczerinden dorulanmas ve sorgulanabilmesi amacyla Kurum tarafndan iletilen rehberi,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yaplan tanmlamalar ile birlikte, KEP Hizmet Salayclarnn verecei bilgiler dorultusunda oluturulacak ve Bilgi Teknolojileri ve letiim Kurumu (BTK) tarafndan iletilecek olan Merkezi KEP Rehberi sistemi tanmlanmtr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. Merkezi KEP Rehberinin Kurulmas, letilmesi ve Kullanlmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yaplan deiiklik dorultusunda, Tebliin 4. maddesine ek olarak 4/A ve 4/B maddeleri eklenerek Merkezi KEP Rehberinin nasl kurulaca, nasl iletilecei ve nasl kullanlacana ilikin usul ve esaslar d\\xfczenlenmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda, BTK tarafndan kurulacak ve gizlilii, b\\xfct\\xfcnl\\xfc\\xfc, eriilebilirlii BTKnn kontrol\\xfcnde salanacak olan Merkezi KEP Rehberinin kurulumuna, y\\xf6netimine, iletilmesine ilikin usul ve esaslar ile KEPHSlerin bu kapsamdaki y\\xfck\\xfcml\\xfcl\\xfckleri de BTK tarafndan d\\xfczenlenecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"KEPHS'ler ger\\xe7ek zamanl olarak KEP rehberini g\\xfcncel tutmak, merkezi KEP rehberine entegre olmak ve bu rehberle uyumlu \\xe7alabilmek i\\xe7in gerekli tedbirleri almak, altyapy kurmak ve iletmekle y\\xfck\\xfcml\\xfc tutulmutur. Ayrca KEPHS, kendi KEP rehberi kaytlarnda meydana gelen t\\xfcm deiiklikleri doru, eksiksiz ve anlalabilir bir ekilde merkezi KEP rehberine ilemekle y\\xfck\\xfcml\\xfcd\\xfcr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Tebliin 5. maddesinde yaplan deiiklik ile birlikte KEP Rehberinde kaytl KEP Hesaplarna ilikin olarak yer almas gereken zorunlu ve istee bal bilgiler a\\xe7k\\xe7a d\\xfczenlenmi olup; KEPHSlerinin bu bilgileri maddenin devamnda yer alan usule uygun olarak Merkezi KEP Rehberine uyumlu bir ekilde oluturmas gerekmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Tebliin 6. maddesinde yaplan deiiklik dorultusunda KEPHS, kendi rehberinde tuttuu kaytlar, Merkezi KEP Rehberine de ilemekle y\\xfck\\xfcml\\xfcd\\xfcr. S\\xf6z konusu bilgiler Merkezi KEP Rehberine ilenirken, ger\\xe7ek kiilerin rehber kaydnn sorgulanabilirliine ilikin olarak ger\\xe7ek kiiden onay alnrken, t\\xfczel kiilerde ise KEPHSlere t\\xfczel kiiden onay alnmakszn rehbere ileme yetkisi tannmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Tebliin 7. maddesinde yaplan deiiklik ile, rehber kaytlarnn sorgulanmas ve dorulanmas esnasnda uygulamann nasl ger\\xe7ekleecei d\\xfczenlenmitir. Buna g\\xf6re Hesap sahipleri, KEP rehberini, sadece hizmet ald KEPHS vastasyla sorgulayabilecek; KEPHS, g\\xf6ndericiden gelen sorgu talebini derhal alarak merkezi KEP rehberinde sorgulayacak ve sorgu sonucunu doru, eksiksiz ve anlalabilir bir ekilde hesap sahibine sunacak; rehber sorgusuna a\\xe7k olmayan KEP hesaplarna ilikin sorgu sonucunu hesap sahibine g\\xf6stermeyecektir. Rehber sorgusuna a\\xe7k olmayan KEP hesaplar sadece dorulama ama\\xe7l kullanlr. Ayrca KEPHS, sorgu sonucunda birden fazla ger\\xe7ek kiiye ait kayt bulmas halinde sorgu sonucunu bildirmeyecek ve sorgu sonucunun tek kiiye ait rehber kayd veya kaytlarna indirgenmesi i\\xe7in kullancdan yeni rehber alanlarn girmesini isteyecektir. Sorgu sonucu bir tek ger\\xe7ek kiiye indirgeninceye kadar sorgulama ilemi tekrar edilecektir. Ger\\xe7ek kiilerin rehber sorgusu, sadece kimlik numaras ile de yaplabilecek ve ilgili kimlik numarasna ait t\\xfcm hesaplar listelenecektir. KEPHS, kendisine merkezi KEP rehberinden iletilen sorgu sonucunu ilgili g\\xf6ndericiye ilettikten sonra kendi sistemlerinden silmekle y\\xfck\\xfcml\\xfcd\\xfcr. Ayrca kendisine gelen KEP rehber sorgusuna ilikin olarak, ger\\xe7ek kiiler i\\xe7in kimlik numaras hari\\xe7 olmak \\xfczere, rehberde bulunan zorunlu alanlar sorgu sonucu olarak bildirecek ve KEP adresinin varlnn ve doruluunun kontrol edilmesine ilikin hizmet sunabilecektir. KEPHS tarafndan bu hizmetin sunulmas halinde; KEP adresinin rehberde yaynlanmasna baklmakszn, ger\\xe7ek kiiler i\\xe7in kimlik numaras, t\\xfczel kiiler i\\xe7in MERSS No, Ticaret Sicil No, DETSS No veya Vergi Numaras ile KEP adresi, hesap sahibi tarafndan dorulanabilecektir. KEPHS, dorulamas yaplan KEP adresi, kullanma kapatlmam ve sorgu kriterlerine uygun ise olumlu, kullanma kapatlm ya da sorgu kriterlerine uygun deilse olumsuz yant d\\xf6nmekle y\\xfck\\xfcml\\xfcd\\xfcr. KEPHS ile merkezi KEP rehberi arasndaki rehber kaytlarna ilikin bir sorgu talebinin en ge\\xe7 20 saniye i\\xe7erisinde cevaplanmas esastr. htiya\\xe7 duyulmas halinde sorgu talebi bana en fazla 10 saniye daha ek s\\xfcre kullanlr. KEPHS ile merkezi KEP rehberi arasndaki rehber kaytlar arasnda uyumsuzluk olmas halinde m\\xfccbir sebep halleri dnda, merkezi KEP rehberindeki kaytlar esas alnacaktr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. Kaytlarn G\\xfcncellenmesi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"D\\xfczenlemeyle birlikte, Tebliin 8. maddesi uyarnca KEP Hesap Sahiplerine kaytlar ile ilgili deiiklikleri KEPHSlere bildirim y\\xfck\\xfcml\\xfcl\\xfc\\xfc d\\xfczenlenmi olup; KEPHS, hesap sahipleri tarafndan kendisine bildirilen bilgileri hem kendi rehberinde hem de Merkezi KEP Rehberinde g\\xfcncellemekle y\\xfck\\xfcml\\xfc tutulmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Hesaplarn kapatlmasna ilikin ger\\xe7ek kiiler tarafndan gelen talepler, KEPHS tarafndan derhal uygulanacak olup; KEPHS, hesaba ilikin kaytlar hem kendi rehberinden hem de Merkezi KEP Rehberinden derhal silmekle y\\xfck\\xfcml\\xfc olacaktr. Kapanan KEP hesabna ilikin rehber kayd, ilgili KEPHS tarafndan kendi KEP rehberinden ve merkezi KEP rehberinde derhal Kullanma Kapatld olarak g\\xfcncellenecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. Rehberin Devreye Alnmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Teblie eklenen ge\\xe7ici madde 1 ile, KEPHSlere Merkezi KEP Rehberine entegrasyon ve gerekli altyapnn salanmas i\\xe7in 4 ay s\\xfcre tannmtr. Bu kapsamda KEPHSler 4 ay i\\xe7inde altyapy kurarak bahsi ge\\xe7en sistem ile entegrasyonu tamamlamak ve mevcut ger\\xe7ek ve t\\xfczel kii hesap sahiplerine ait 5. maddede d\\xfczenlenen zorunlu bilgileri bu s\\xfcre i\\xe7erisinde sisteme ilemekle y\\xfck\\xfcml\\xfcd\\xfcr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. Saklama S\\xfcreleri \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"KEPHS, merkezi KEP rehberinden yapm olduu t\\xfcm ilemlere ilikin ilem kaytlarn ilgili mevzuat ile belirlenen s\\xfcre boyunca saklamakla y\\xfck\\xfcml\\xfc tutulmutur.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6. Genel Deerlendirme\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yaplan deiiklik ile birlikte, KEP adreslerinin tek bir merkezi rehber \\xfczerinde toplanmas suretiyle, KEP hesaplarna ait bilgilerin eriilebilirliinin kolaylatrlmas ama\\xe7lanm olup; ayrca ortaya \\xe7kan sistem ile KEP adreslerinin dorulanabilirlii hususunda da kullanclara kolaylk salanmaktadr. Bu kapsamda, kullanclar Merkezi KEP Rehberi \\xfczerinden iletiime ge\\xe7ecekleri KEP adreslerinin bilgilerine rahatlkla ulaabilecek ve bu adreslerin ait olduu tarafa ait bilgileri sorgulama imkanna sahip olacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca, yaplan deiiklikler neticesinde KEP adreslerine ait bilgilerin doru, g\\xfcncel ve eksiksiz bir bi\\xe7imde kullanclara ulatrlmas amacyla BTK tarafndan kontrol salanacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Tebli, 03.07.2021 tarihi itibariyle y\\xfcr\\xfcrl\\xfce girmekte olup, Bilgi Teknolojileri ve letiim Kurulu Bakan tarafndan y\\xfcr\\xfct\\xfclecektir.\"\n                }\n            ],\n            tags: [\n                \"KEP\",\n                \"KEPHS\",\n                \"Rehber\"\n            ],\n            author: \"\"\n        },\n        {\n            id: 32,\n            subtitle: \"IAPP Haberleri\",\n            date: \"30.04.2024\",\n            title: \"Haftalk IAPP Haberleri 23 - 30 Nisan 2024\",\n            slug: \"haftalik-iapp-haberleri-23-30-nisan-2024\",\n            text: \"D\\xfcnya Genelinde Kiisel Verilere likin G\\xfcncel Gelimeler\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1- ABD Temsilciler Meclisi tarafndan TikTok'un satn zorunlu brakacak yasa tasars kabul edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The New York Times'n haberine g\\xf6re ABD Temsilciler Meclisi tarafndan; TikTok'un ana irketi ByteDance uygulamasnn satn zorunlu brakacak bir yasa tasarsnn hzl bir ekilde hayata ge\\xe7irilmesi lehinde oy kullanld. Tasarnn kabul edilmesi ve yasalamas halinde ByteDance'a TikTok i\\xe7in ABD h\\xfck\\xfcmeti tarafndan onaylanm bir alc bulmas i\\xe7in bir yla kadar s\\xfcre tannaca aksi halde ByteDance'n \\xfclke \\xe7apnda bir yasakla karlaaca belirtildi. Bloomberg'in haberinde tasarnn, TikTok'un Erich Andersen'i genel danmanlktan almay planlad srada deerlendirileceine yer verildi. Bu esnada, Avrupa Komisyonu tarafndan bir soruturma balatld ve TikTok Lite'n potansiyel olarak askya alnmasnn deerlendirilecei ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/us-house-passes-bill-to-compel-sale-of-tiktok/ \"\n                },\n                {\n                    type: \"header\",\n                    content: \"2- Avrupa Birliinin potansiyel TikTok yasa konusunda ABD'yi takip etmeyecei bildirildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Politico'nun haberinde Avrupa Birlii kanun koyucularnn, \\xc7in merkezli ByteDance'i ulusal g\\xfcvenlik ve hassas verilerin korunmas kayglar nedeniyle sosyal platformunu satmaya zorlayan ABD yasasnn kabul edilmesinin ardndan TikTok'la ilgili iddialar hemen ele almayacana yer verildi. Avrupa Parlamentosu Bakan Yardmcs Dita Charazonv\\xe1 tarafndan, AB'nin bu zorluklar yllar \\xf6nce fark ettii ve bu nedenle platformlar farkl davranmaya zorlayan Dijital Hizmetler Yasasna sahip olduklar belirtildi. Ayrca Reuters tarafndan, TikTok'un Dijital Hizmet Yasas uyum endielerinin ardndan AB'deki TikTok Lite programn askya ald ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/eu-to-avoid-tiktok-debate-ahead-of-election/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3- Googlen konum gizlilii anlamas kapsamnda 62 milyon dolar \\xf6deyecei kararlatrld.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"MediaPost'un haberinde, ABD Kaliforniya Kuzey B\\xf6lgesi B\\xf6lge Mahkemesinin, konum gizlilii davasnda Google'n 62 milyon dolar \\xf6demesini gerektirecek uzlama koullarn kabul ettiine yer verildi. Toplu davada Googlen, arama ve haritalar da dahil olmak \\xfczere baz hizmetlerden elde edilen konum verilerini, kullanclarn konum verilerinin ilenmesine rza vermemi olsalar bile  depolamakla su\\xe7land belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/google-to-pay-62m-in-location-privacy-settlement/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4- Hollanda Veri Koruma Otoritesi tarafndan, h\\xfck\\xfcmete Facebook kullanmna kar uyarda bulunuldu.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Hollanda Veri Koruma Otoritesi tarafndan; devlet dairelerine, verilerinin nasl etkileneceinden emin deillerse Facebook'u kullanmamalar konusunda uyarda bulunuldu. Otorite tarafndan, 2021 ylnda yaplan bir aratrmann ardndan ziyaret\\xe7i bilgilerinin platform tarafndan yasal olarak toplanp toplanmadnn belirlenemedii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/nethlands-dpa-warns-against-govt-facebook-use-over-privacy-concerns/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5- ngiltere Veri Koruma Otoritesi (ICO) tarafndan, telekom\\xfcnikasyon irketlerine pazarlama aramalar ihlalleri nedeniyle ceza kesildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ICO tarafndan, pazarlama aramas yaplmasn istemeyen kiilere arama yaplmas nedeniyle Outsource Strategies'e 240.000 ngiliz Sterlini ve Dr Telemarketing'e 100.000 ngiliz Sterlini tutarnda para cezas verildi. ICO tarafndan, telekom\\xfcnikasyon irketlerinin savunmasz kiilere pazarlama aramalar yapmasyla ilgili 76 ikayet alnd s\\xf6ylendi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/ico-issues-fines-telecommunications-companies-340000-euros/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6- svi\\xe7re Veri Koruma Otoritesi (FDPIC) tarafndan, bir \\xe7evrimi\\xe7i perakende irketinin veri ileme standartlarn ihlal ettii tespit edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"FDPIC tarafndan, online perakende irketi Digitec Galaxus hakknda y\\xfcr\\xfct\\xfclen soruturmann detaylar yaynland. FDPIC tarafndan, irketin kiisel veri ileme faaliyetini bir m\\xfcteri hesab oluturma y\\xfck\\xfcml\\xfcl\\xfc\\xfcne balayarak hizmet art haline getirdii gerek\\xe7esiyle \\xf6l\\xe7\\xfcl\\xfcl\\xfck ilkesinin ihlal edildii belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/switzerlands-dpa-finds-online-retailer-violated-data-processing-standards/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7- Avrupa Parlamentosu tarafndan Salk Veri Alan onayland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avrupa Parlamentosu tarafndan, hastalarn baka bir \\xfcye devlette bulunan bilgiler de dahil olmak \\xfczere salk verilerine erimesine olanak tanyan bir portal olan Avrupa Salk Veri Alan'nn oluturulmasna y\\xf6nelik ge\\xe7ici bir anlama onayland. Bu kapsamda, aratrmalarda kullanlmak \\xfczere baz verilerin anonimletirilecei ya da takma adlatrlaca ifade edildi. Avrupa Birlii Konseyi'nin onaynn ardndan \\xe7er\\xe7eve yasann, Avrupa Birlii Resmi Gazetesi'nde yaynlandktan 20 g\\xfcn sonra y\\xfcr\\xfcrl\\xfce girecei a\\xe7kland.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/european-parliament-approves-health-data-space/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8- General Motors'un s\\xfcr\\xfcc\\xfclerden izinsiz kiisel veri toplad iddia edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"New York Times teknoloji muhabiri Kashmir Hill tarafndan, General Motors'un OnStar programn kullanarak kendisinden ve dier t\\xfcketicilerden izinsiz s\\xfcr\\xfc verileri toplad iddia edildi. ddiaya g\\xf6re, ara\\xe7larn bilgi-elence sisteminde y\\xfckl\\xfc olan OnStar yol yardm programnn s\\xfcr\\xfc verilerini toplamak ve sigorta irketlerine satmak i\\xe7in kullanld ifade edildi. General Motors tarafndan, ilgili kiilerin OnStar ile iletiime ge\\xe7erek veri toplamay devre d brakabilecekleri a\\xe7kland.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/general-motors-allegedly-used-connected-car-program-to-collect-data-from-drivers-without-consent/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9- Avrupa Veri Koruma Kurulu (EDPB) tarafndan, AB-ABD veri gizlilii \\xe7er\\xe7evesi kapsamnda tazminat s\\xfcre\\xe7lerine ilikin klavuz yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"EDPB tarafndan, AB-ABD veri gizlilii \\xe7er\\xe7evesi kapsamnda AB taleplerine y\\xf6nelik tazminat s\\xfcre\\xe7lerine ilikin bir klavuz yaymland. Bahse konu klavuzda; soru-cevap bilgileri, ABD Ulusal stihbarat Direkt\\xf6rl\\xfc\\xfc Sivil \\xd6zg\\xfcrl\\xfckleri Koruma G\\xf6revlisine yaplacak ik\\xe2yetler i\\xe7in bir ablon form ve AB veri koruma makamlarna yaplacak ticari balantl ik\\xe2yetler i\\xe7in bir ablon formun yer ald ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/edpb-issues-guidance-for-personal-data-transfers-to-us/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10- ABD Hesap Verebilirlik Ofisi (GAO) tarafndan, biyometrik teknoloji kullanmna ilikin bir \\xe7alma yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"GAO tarafndan yaplan bir \\xe7almada, biyometrik teknolojilerin gelimekte olduu ancak bu kapsamdaki doruluk eksikliklerini giderebilmek i\\xe7in daha iyi demografik \\xe7eitlilie ilikin eitim verilerine ihtiya\\xe7 duyulduu tespit edildi. GAO tarafndan, d\\xfczenlemeye y\\xf6nelik risk temelli yaklamlar ve teknoloji etrafnda kapsaml gizlilik yasas veya rehberlii uygulamak da dahil olmak \\xfczere kanun koyucularn \\xfczerinde durmas gereken be iyiletirme alan \\xf6nerildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haber deyatlar\",\n                    href: \"https://iapp.org/news/a/u-s-gao-releases-study-on-biometric-tech-use/\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"ABD\",\n                \"TikTok\",\n                \"ByteDance\",\n                \"AB\",\n                \"Avrupa\",\n                \"Google\",\n                \"konum gizlilii\"\n            ]\n        },\n        {\n            id: 31,\n            subtitle: \"Makale\",\n            date: \"2022\",\n            slug: \"kripto-para-sigortas\",\n            title: \"Kripto Para Sigortas\",\n            text: \"Teknolojinin gelimesi ile birlikte ekonomik varlklar da dijitalleme s\\xfcrecine girmi, b\\xf6ylece dijital para kavram ortaya \\xe7kmtr. Avrupa Merkez Bankas tarafndan dijital para d\\xfczenlemesi olmayan, onu gelitirenler tarafndan \\xe7karlan ve kontrol edilen ve belli bir sanal \\xe7evre i\\xe7inde kabul g\\xf6ren dijital para olarak tanmlanmaktadr. lk kez 2008 ylndan itibaren hayatmza giren kripto paralar, kriptografi (ifreleme bilimi) kullanlarak oluturulan, merkezi olmayan bir kripto sisteminde \\xfcretilen dijital varlklardr. Kripto paralara ilikin her t\\xfcrl\\xfc ilem T\\xfcrk\\xe7ede blok zinciri anlamna gelen blockchain teknolojisi \\xfczerinden yaplmaktadr.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Her ge\\xe7en g\\xfcn daha fazla insann alternatif bir para birimi olarak kripto paray tercih etmesinin bir sonucu olarak kripto para ve blok zinciri teknolojisi g\\xfcn\\xfcm\\xfczde bir\\xe7ok sekt\\xf6rde yerini almtr. Bu alandaki hzl b\\xfcy\\xfcme, beraberinde bu alanda yeni ihtiya\\xe7larn domasna da sebep olmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bug\\xfcn kripto para piyasasnn en \\xf6nemli ihtiya\\xe7larndan birisi \\xfcphesiz kripto paralarn g\\xfcvenliinin salanmasdr.               \"\n                },\n                {\n                    type: \"header\",\n                    content: \"1. Kripto Para Sigortasna Genel Bir Bak\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sigorta, ayn veya benzer rizikolara maruz bulunan ahslar topluluunda belirli bir karlk (prim) \\xf6deyerek rizikonun ger\\xe7eklemesi halinde ortaya \\xe7kacak ekonomik ihtiyacn karlanmasna y\\xf6nelik bamsz talebe sahip olunmasdr. Bu balamda kripto para sigortas da; kripto para yatrmclar veya iletmelerinin biraraya gelerek tehlike birlii i\\xe7inde kripto varlklarn \\xf6ng\\xf6r\\xfclemeyen risklere kar sabit bir prim karlnda korumas olarak tanmlanabilir. Burada s\\xf6z edilen koruma, dier alanlardaki sigorta anlay ile pek \\xe7ok y\\xf6nden paralel \\xf6zellikler g\\xf6stermektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Olduk\\xe7a yaygn olan ara\\xe7 sigortas, salk sigortas ve hayat sigortasnda sigortalnn talep haklar ve sigortalya salanan g\\xfcvence, kripto para sigortasnda da ayn esaslar \\xe7er\\xe7evesinde sigortalya salanyor olsa da, kendine \\xf6zg\\xfc bir alan olan kripto para sekt\\xf6r\\xfc, daha \\xe7ok elektronik ortamda ger\\xe7ekleebilecek rizikolar kapsamnda barndrmaktadr. \"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. Kripto Para Sigortasnn Geliimi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto paralarn ksa zamanda deerli dijital varlklar haline gelmesi, kripto varlklar \\xfczerindeki hrszlk ve dolandrclk gibi vakalarnn y\\xfckselmesi ile sonu\\xe7lanm, b\\xf6ylece borsalarn ve kripto para c\\xfczdanlarnn kripto varlklar \\xfczerinde salad koruma yetersiz kalmtr. Bu durumun bir sonucu olarak yatrmclar i\\xe7in kripto varlklarn daha kapsaml bir ekilde korunmas \\xf6ncelikli bir ihtiya\\xe7 haline getirmitir. Sigorta sekt\\xf6r\\xfc yatrmc ve iletmelerin bu ihtiyacna kaytsz kalmam ve nihayet 2019 ylnda yeni bir alan olan Kripto Para Sigortas sekt\\xf6r\\xfcnde hzla yerini almtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lk olarak ngilterede bulunan bir sigorta irketi tarafndan \\xe7evrimi\\xe7i ve scak c\\xfczdanlarda tutulan kripto para hrszlndan kaynaklanan kayplara kar koruma salamak i\\xe7in 1.000\\xa3 gibi d\\xfc\\xfck esnek limitlerle balatlan kripto para sigortas, \\xe7ok ksa bir s\\xfcre i\\xe7inde sekt\\xf6r\\xfcn odak noktas haline gelerek bir\\xe7ok yatrmcnn, irketlerin ve kripto para borsalarnn dikkatini \\xe7ekmeyi baarmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Halen gelimekte olan bir sigorta end\\xfcstrisi olan kripto para sigortas, bug\\xfcn d\\xfcnya kripto para piyasasnn yaklak %4'\\xfc \\xfczerinde koruma salamaktadr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. Kripto Para Sigortasnn \\xd6nemi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Blockchain analitik firmas Chainalysis'in yeni bir raporuna g\\xf6re, 2022 Temmuz ay sonuna kadar hrszlk, bilgisayar korsanl ve dolandrclk nedeniyle bildirilen kayplarn 1,9 milyar dolar olduu belirtilmitir. Olduk\\xe7a y\\xfcksek miktardaki bu kayplar \\xf6zellikle yatrmclar nezdinde kripto para salayc iletmelere kar g\\xfcvensizlik duyulmasna neden olmutur. Bu durumun bir \\xe7\\xf6z\\xfcm\\xfc olarak sekt\\xf6rde yerini alan kripto para sigortasnn salad koruma, yatrmcya huzur vererek kripto para sekt\\xf6r\\xfcn\\xfcn g\\xfcvenilirliini artrmaktadr. B\\xf6ylece yatrmclara; herhangi bir saldr veya ihmalin t\\xfcm yatrmlarn bir anda ortadan kaldracandan endie etmeden \\xf6zg\\xfcrce yatrm yapabilecekleri g\\xfcvenli bir sistem ina edilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dier yandan kripto para sigortasnn bu sekt\\xf6rde  hizmet veren iletmelere, bu iletmelerin y\\xf6neticilerine ve \\xe7alanlarna kar salad koruma ile kripto para irketleri de herhangi bir yasal ve ekonomik tehdit altnda olmakszn varlklarn s\\xfcrd\\xfcrebilmektedir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. Kripto Para Sigortasnn Unsurlar\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.1. Riziko\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sigorta Hukukunda riziko, ger\\xe7ekleip ger\\xe7eklemeyecei veya ne zaman ger\\xe7ekleecei belli olmayan, ancak ger\\xe7eklemesi halinde zarar veya dier bir ekonomik ihtiyac douran olaydr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto para sigortasnda riziko, dolandrclk, hrszlk ve siber saldr gibi \\xe7eitli siber su\\xe7lar, a g\\xfcvenlii ile gizlilik kontrollerindeki aksaklklar ve veri ihlalleri sonucunda kripto varlklarn kayb olarak ifade edilebilir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto para sigortasndan sigortalanan rizikonun belirlenmesi son derece \\xf6nemlidir. Zira sigortalnn sigorta konusu menfaati dolaysyla zarara uramasna neden olabilecek \\xe7ok sayda ve \\xe7eitli riziko s\\xf6z konusudur ve sigortalnn maruz bulunduu t\\xfcm rizikolarn teminat altna alnmas m\\xfcmk\\xfcn deildir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yukardakilere ek olarak sigorta hukukunda T\\xfcr itibari ile belirlenen rizikonun belirli bir zaman dilimi ile snrlandrlmas hususu \\xf6nem tamaktadr. Kripto para sigortasnda da belirlenen zaman diliminin balangcndan \\xf6nceki ve sona ermesinden \\xf6nceki rizikolar teminat kapsamnda olmayacaktr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.2. Tehlike Birliktelii\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayn veya benzer rizikoya maruz kalabilecek ahslarn biraraya gelerek oluturduklar topluluk olarak nitelendirilmektedir. Kripto para sigortasnda, yatrmclar, kripto para ihra\\xe7 edenler, kripto para c\\xfczdan salayclar, borsalar, kripto para varlklarn \\xf6deme y\\xf6ntemi olarak kabul eden ve depolayan e-ticaret siteleri, ICOlar, kripto para madencileri bata olmak \\xfczere kripto varlklar ile ilikili hizmet salayan iletmeler tehlike birlii i\\xe7indedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bug\\xfcn var olan \\xf6zel kripto para sigortas poli\\xe7eleri daha \\xe7ok borsalar ve kripto c\\xfczdanlar tarafndan tercih edilmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.3. Sigorta G\\xfcvencesi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sigorta g\\xfcvencesi, rizikonun ger\\xe7eklemesi sonucu ortaya \\xe7kan ekonomik gereksinimin karlanmas anlamna gelmektedir. Kripto para sigortalarnda sigortac, sigortalnn urayabilecei kripto para kayplarn karlama taahh\\xfcd\\xfc ile bu g\\xfcvenceyi salayacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto para sigortas, kripto para kayplarna kar koruma salarken piyasadaki dalgalanmalara ve fiyat deiikliklerine ilikin kayplar kripto para sigortas ile salanan bu korumann kapsamnda yer almamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto para sigortasnn salad korumann kapsamnda sigorta irketleri aadaki hizmetleri salamaktadr:\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.3.1. Su\\xe7 Sorumluluu Sigortas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Genel olarak su\\xe7 sorumluluu sigortas; hrszlk, zimmete para ge\\xe7irme, dolandrclk, sahtecilik gibi malvarlna ilikin olarak ilenen su\\xe7lara kar koruma salamaktadr. Bu sigorta korumas; kripto para varlklarn \\xf6zellikle son yllarda olduk\\xe7a pop\\xfcler hale gelmesinin bir sonucu olarak hrszlarn ve dolandrclarn radarna girmesi ile kripto paralar bakmndan da en b\\xfcy\\xfck gerekliliklerden birisi haline gelmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu poli\\xe7e, kripto varlklarnn k\\xf6t\\xfcye kullanlmas, hrszlk, bilgisayar korsanl, ve siber dolandrclk gibi bir su\\xe7 yoluyla dorudan kripto varlklarn kaybn kapsamaktadr. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda sigortal, kripto para birimlerine kar ilenen bir su\\xe7tan kaynaklanan zararlar sigortacdan talep edebilmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.3.2. Siber Sorumluluk Sigortas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Her irket siber riskle kar karyadr. Ancak kripto para sekt\\xf6r\\xfc mahiyeti gerei dier sekt\\xf6rlere nazaran daha riskli bir noktada yer almaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Siber sigorta poli\\xe7esi; bilgisayar korsanl, k\\xf6t\\xfc ama\\xe7l yazlm, veri veya siber ihlal gibi siber g\\xfcvenlie ilikin risklere kar koruma salamakla birlikte siber su\\xe7lardan kaynaklanmayan a g\\xfcvenlii veya gizlilik aksaklklarndan doabilecek dorudan/dolayl t\\xfcm ekonomik risklere kar da koruma salamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu poli\\xe7e kapsamnda sigortal, veri ihlali nedeniyle urayabilecei aratrma hizmetleri, i kesintisi ve veri kurtarmaya ilikin urad dier t\\xfcm zararlar sigorta irketinden talep edebilecektir. Ayrca sigortal, iletmeye y\\xf6nelik bir siber saldrdan etkilenen m\\xfcterilere veya ortaklara ilikin zararlarn da bu sigorta kapsamnda sigorta irketinden talep edebilecektir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.3.3. Y\\xf6neticiler ve \\xc7alanlar Sigortas (D&O Policy)\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mali sorumluluk sigortasnn \\xf6zel bir ekli olarak D&O (Directors & Officers) sigortas, \\xf6zel hukuka tabi t\\xfczel kiilerin y\\xf6neticilerinin, y\\xf6netim faaliyetlerini s\\xfcrd\\xfcr\\xfcrken, kanun ve s\\xf6zleme h\\xfck\\xfcmlerini ihlal etmeleri sonucu sorumluluklarnn g\\xfcndeme geldii durumlarda, tazminat taleplerini karlayarak, bu kiilere mali a\\xe7dan koruma salayan bir sigorta \\xe7eididir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda D&O poli\\xe7esi, kripto para birimine ilikin hizmet veren iletmelerin y\\xf6neticilerinin ve \\xe7alanlarnn g\\xf6rev ihlali sebebi ile urad zararlar  kapsamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu poli\\xe7e kapsamnda sigortal, yarglama giderleri de dahil olmak \\xfczere uram olduu t\\xfcm zararlar talep edebilmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.3.4. Hatalar ve hmaller Sorumluluu Sigortas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu poli\\xe7e; verilen hizmetlerde ihmal, hata, yanl beyanda bulunma, iyi niyet ve hakkaniyete uygun davran ihlali, yanl tavsiye ve yetersiz \\xe7alma gibi aksaklklar sebebi ile iletmelerin, kripto para varlklarn kaybeden m\\xfcterilerine kar sahip olduu t\\xfcm y\\xfck\\xfcml\\xfcl\\xfckleri kapsamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda Sigortal, Avukatlk \\xfccreti ve yarglama giderleri dahil ve bunlarla snrl olmamak \\xfczere uram olduu pek \\xe7ok zarar kalemini sigorta irketinden  talep edebilmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.3.5. Merkezi Olmayan Finans (DeFi) Sigortas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto varlklar i\\xe7in Merkezi Olmayan Finans (DeFi) Sigortas, akll s\\xf6zlemelerden kaynaklanabilecek aksaklklar kapsamas sebebi ile akll s\\xf6zleme sigortas olarak da bilinmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto para birimi i\\xe7in DeFi sigorta poli\\xe7esi, kapsamnda Sigortal, akll s\\xf6zleme hatasndan kaynaklanan t\\xfcm zararlarn talep edebilir. B\\xf6ylece bu poli\\xe7e, sigortalnn kripto para biriminin yazlmnn hacklenemez olduundan ve alm satm ve dier t\\xfcm ilemlerin akll s\\xf6zleme koullarna uygun bir ekilde ger\\xe7ekletirdiinden emin olmasn salamaktadr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.3.6. Saklama Sigortas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto para birimleri kripto para c\\xfczdannda, borsalarda veya \\xe7evrimi\\xe7i platformlarda saklanr. Saklama Sigortas, \\xe7eitli nedenlerle bu platformlara eriimin salanamamas durumunda kullancya g\\xfcvence salamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mevcut Bitcoin'in yaklak %20'sinin kaybolduu ya da ifreleri bilinmeyen c\\xfczdanlarda mahsur kald tahmin edilmektedir. Mays 2021 itibariyle, yatrmclarn birikmi kayp Bitcoin'i yaklak olarak 185 milyar dolara tekab\\xfcl etmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Saklama sigortas poli\\xe7esi kapsamnda yer alan kripto ifresi depolama, ifre kurtarma ve acil kurtarma hizmetleri sayesinde iletme veya yatrmc, kripto para birimine eriimini sonsuza kadar kaybetmeyecektir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.4. Prim\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sigorta g\\xfcvencesi, sigortalnn \\xf6deyecei prim olarak adlandrlan belirli bir bedel karlnda salanr. Kripto para sigortasnda da sigortal prim karlnda kripto varlklara ilikin kayplarn g\\xfcvence altna almaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto para birimi sigortasnda prim, kripto parann temel deerlerine g\\xf6re belirlenmektedir. Dier bir deyile kripto varlnn deeri poli\\xe7e d\\xf6nemi boyunca dalgalansa bile, sigortann salad koruma t\\xfcm varlklar kapsayacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ancak deeri dalgalanmaya daha meyilli olan kripto varlklarn g\\xfcvence altna alnmas sigortaclar tarafndan daha b\\xfcy\\xfck bir risk tekil edeceinden bu husus primin y\\xfcksek olmas sonucunu dourmaktadr. Dier yandan  tercih edilen sigortann koruma kapsam, sigorta irketi ve korunacak kripto varlklarn deeri de primin belirlenmesinde \\xf6nemli rol oynayan deienlerdir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Neticede kripto para sigortasnda risk y\\xfcksek olduu i\\xe7in sigorta primleri de olduk\\xe7a y\\xfcksektir. Ancak kripto paralar i\\xe7in \\xf6ng\\xf6r\\xfclen yllk primler, teminat limitlerinin en fazla y\\xfczde 5'i kadar y\\xfcksek olabilmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.5. Sigortalnn talep hakk\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sigorta hukuku kapsamnda sigortalnn rizikonun ger\\xe7eklemesi ihtimalinde urad zarar s\\xf6zleme \\xe7er\\xe7evesinde sigortacdan talep hakk bulunmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kripto para sigortasnda sigortal, taraflarca karlkl olarak belirlenen riziko ile snrl olmak kaydyla sigortacnn salad g\\xfcvence kapsamnda urad t\\xfcm zararlarn karlanmasn sigortacdan talep edebilecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. Kripto Para Sigortasnda Mevcut Uygulamalar\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uygulamada hen\\xfcz Madde 5.3te saylan sigortalarn tamam tek bir sigorta irketi tarafndan salanamamaktadr. Kripto para sigortas irketinin salad korumalara \\xf6rnek olarak 4 farkl irketin sunduu koruma kapsam aada yer almaktadr:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"hrszla/hacklere kar kripto c\\xfczdan korumas,\",\n                        \"kripto paralara eriimin kaybedilmesine ve akll s\\xf6zleme aksaklklarna kar koruma,\",\n                        \"iletme \\xe7alanlarnn bilgi szdrmas, hack veya kripto ifrelerine eriim gibi durumlara kar koruma,\",\n                        \"siber saldrlara, \\xe7eitli teknik aksaklklara ve d\\xf6viz kesintilerinden kaynaklanan kayplara kar koruma\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sonu\\xe7 olarak, 2019 ylndan g\\xfcn\\xfcm\\xfcze kadar yava bir ilerleme seyretmi olan kripto para sigortas sigorta irketleri i\\xe7in halen a\\xe7k bir pazar halindedir. \\xd6n\\xfcm\\xfczdeki yllarda sigorta irketlerinin salad korumann daha kapsaml hale gelmesi ve daha \\xe7ok sigorta irketinin sekt\\xf6rde yerini almas beklenmektedir\"\n                }\n            ],\n            tags: [\n                \"kriptopara\",\n                \"sigorta\",\n                \"blockchain\"\n            ],\n            author: \"\"\n        },\n        {\n            id: 30,\n            subtitle: \"GDPR Karar\",\n            date: \"26.04.2024\",\n            title: \"sve\\xe7 Veri Koruma Otoritesi, m\\xfcterilerinin mali durumuna ilikin kiisel veri i\\xe7eren bir dosyay dier m\\xfcterilerine g\\xf6nderdii gerek\\xe7esiyle veri sorumlusuna 43.700 Euro para cezas verdi.\",\n            slug: \"kisisel-veri-iceren-dosyanin-yanlislikla-e-posta-ile-gonderilmesi\",\n            text: \"Bir menkul kymetler irketinin bir \\xe7alan tarafndan m\\xfcterilerinin mali durumunu g\\xf6steren ve kiisel veri i\\xe7eren bir dosya dier m\\xfcterilere sehven g\\xf6nderilmitir. sve\\xe7 Veri Koruma Otoritesi tarafndan veri sorumlusunun her ne kadar ihlalin \\xe7alann kusuru ile ortaya \\xe7kt belirtmise de bu durumun veri sorumlusunun ihlal bakmndan sorumluluunu ortadan kaldrmad deerlendirilmitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"sve\\xe7 Veri Koruma Otoritesi bir menkul kymetler irketine, kiisel veriler i\\xe7eren bir dosyay yanllkla e-posta ile g\\xf6ndererek GDPR Madde 32(1)'i ihlal ettii gerek\\xe7esiyle 500.000 SEK (yaklak 43.700 Euro) para cezas vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"sve\\xe7 Veri Koruma Otoritesi, 20 Ocak 2021 tarihinde Indecap'in (veri sorumlusu) dier m\\xfcterilerin yan sra m\\xfcterilerin mali durumlar hakknda kiisel veriler i\\xe7eren bir dosyay dier m\\xfcterilere e-posta ile g\\xf6nderdiini iddia eden ikayetler almtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu hatay kabul etmi ve ihlalin insan hatasndan kaynaklandn ve bir \\xe7alann, doru dosyaya benzer ekilde adlandrld i\\xe7in yanllkla yanl Excel sayfasn mail olarak g\\xf6nderdii ifade edilmitir. Yanl dosyada m\\xfcterilerin ad, sosyal g\\xfcvenlik numaras, bankas, banka danmannn ad, e-posta adresi, se\\xe7ilen risk seviyesi, fonlara tahsisat (bireysel fon se\\xe7imi ile snrl) ve m\\xfcterilerin bu fonlardaki varlklarnn son y\\xfcklenen deeri hakknda bilgilerin yer ald belirtilmitir. Hatal g\\xf6nderiler 52.364 ilgili kiinin kiisel verilerini i\\xe7erdii ve g\\xf6nderilerin en fazla 2.813 kiiye iletildii tespit edilmitir. Indecap'in kendi aratrmalar, e-postann bir\\xe7ok m\\xfcterinin posta filtresine takldn g\\xf6sterdiinden, alclarn tam says belirlenememitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Indecap, ihlalin zararn azaltmak i\\xe7in \\xe7eitli admlar atmtr. Dahili riskleri belirlemek ve dahili bir eylem plan oluturmak i\\xe7in harici uzmanlarla birlikte b\\xfcy\\xfck bir olay incelemesi balatmtr. lgili kiilere olay hakknda bilgi g\\xf6ndermi, ek teknik g\\xfcvenlik \\xf6nlemleri alm ve \\xe7alanlar i\\xe7in ekstra eitim oturumlar d\\xfczenlemitir. Ayrca, kiisel veriler i\\xe7eren e-postay alan alclarla iletiime ge\\xe7erek mesaj silmelerini ve mesajn silindiini teyit etmelerini istemitir. Son olarak Indecap, sve\\xe7 Veri Koruma Otoritesine bir kiisel veri ihlali bildiriminde bulunmu ve sve\\xe7 Mali Denetim Otoritesine de bir rapor sunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Indecap, dosyann bir \\xe7alan tarafndan yaplan bir hata sonucu e-postaya eklendiini belirtmitir. Ancak, veri sorumlusu olarak Indecap, kendi y\\xf6netimi altnda veya kendi adna ger\\xe7ekleen t\\xfcm kiisel veri ileme faaliyetlerinden sorumludur. Dolaysyla, sve\\xe7 Veri Koruma Otoritesi \\xe7alana deil Indecap'e ceza vermeyi tercih etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Indecap bir menkul kymetler irketidir, yani yapt iin doas, dier eylerin yan sra finansal bilgileri ve ulusal g\\xfcvenlik numaralarn iledii i\\xe7in y\\xfcksek koruma standartlar getirmitir. Bu y\\xfcksek standartlar ulusal yasalara da yansmtr. Menkul Kymetler Piyasas Kanunu'nun (2007:528) 1. B\\xf6l\\xfcm, 11. Ksm, birinci paragraf, bir menkul kymetler irketine bal olan veya olmu olan bir kiinin, ii veya g\\xf6revi srasnda bir bakasnn ii veya kiisel durumu hakknda \\xf6rendiklerini yetkisiz bir ekilde ifa edemeyeceini veya kullanamayacan belirtmektedir. Bu nedenle s\\xf6z konusu ilemin y\\xfcksek risk i\\xe7erdii a\\xe7ktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"GDPR'nin 32. Maddesi uyarnca Indecap, uygun teknik ve idari tedbirleri alarak irketin iledii kiisel verileri koruma y\\xfck\\xfcml\\xfcl\\xfc\\xfcne sahiptir. Kiisel verilerin ilenmesi Indecap'in ana faaliyeti \\xe7er\\xe7evesinde ger\\xe7ekletii ve irketin uygun bir g\\xfcvenlik seviyesi salama konusunda iyi bir kabiliyete sahip olmas gerektii belirtilmitir. Indecap'in kendi bilgilerine g\\xf6re, hatal olarak eklenen dosyann nedeni, fonlarn performans hakknda genel bilgiler i\\xe7eren baka bir dosyaya benzer bir isim verilmi olmasdr. Bu durum, Indecap'in m\\xfcteri verilerini i\\xe7eren belgelerin dier kamuya a\\xe7k belgelerle kartrlmasn \\xf6nlemek i\\xe7in yeterince a\\xe7k talimatlara sahip olmadn g\\xf6stermektedir. Ayrca, ihlal \\xe7ok sayda ilgili kiiyi (yaklak 52.000 kii) kapsamaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu nedenlerle sve\\xe7 Veri Koruma Otoritesi tarafndan Indecap'in GDPR Madde 32(1)'i ihlal ettiine h\\xfckmedilmi ve Indecap'e yaklak 43.700 Euro para cezas verilmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Karar detaylar\",\n                    href: \"https://gdprhub.eu/index.php?title=IMY_%28Sweden%29_-_DI-2021-3422&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"sve\\xe7 Veri Koruma Otoritesi\",\n                \"m\\xfcteri\",\n                \"finans\",\n                \"kiisel veri\"\n            ]\n        },\n        {\n            id: 29,\n            subtitile: \"Makale\",\n            date: \"2023\",\n            slug: \"cekle-ilgili-karslkszdr-islemi-yaplmasna-sebebiyet-verme-sucu\",\n            title: \"\\xc7ekle lgili Karlkszdr lemi Yaplmasna Sebebiyet Verme Su\\xe7u\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek; muhatab banka olan, 6102 sayl T\\xfcrk Ticaret Kanununun (TTK) 780. maddesinde yer alan unsurlar i\\xe7eren ve \\xf6deme arac niteliine sahip bir kymetli evrak t\\xfcr\\xfcd\\xfcr. Nitelii gerei \\xe7ek, g\\xfcn\\xfcm\\xfcz d\\xfcnyasnda kullanld alanlarda giderek \\xf6nem kazanm ve hakknda \\xf6zel d\\xfczenlemeler yaplmas ihtiyac domutur. Bu kapsamda 5941 sayl \\xc7ek Kanunu ile \\xe7eklerin i\\xe7eriine, kullanlmalarna ve \\xe7ek hamillerinin korunmasna ilikin baz h\\xfck\\xfcmler getirilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Nitekim 6728 sayl Yatrm Ortamnn yiletirilmesi Amacyla Baz Kanunlarda Deiiklik Yaplmasna Dair Kanun ile 5941 sayl \\xc7ek Kanununda deiiklik yaplarak, \\xe7ek hamillerinin korunmas amacyla; \\xe7ek \\xfczerinde yazl bulunan d\\xfczenleme tarihine g\\xf6re kanuni ibraz s\\xfcresi i\\xe7inde muhatap tarafndan bankaya ibraz edildiinde, \\xe7ekin karlnn ilgili bankada bulunmamas ve \\xe7ek ile ilgili karlkszdr ilemine sebebiyet verilmesi hali 5941 sayl \\xc7ek Kanunun 5. Maddesinde su\\xe7 olarak kabul edilmitir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"A.\\xc7ekle lgili Karlkszdr lemi Yaplmasna Sebebiyet Verme Su\\xe7unun Unsurlar\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ekin bedeli, kanun tarafndan \\xf6ng\\xf6r\\xfclen ibraz s\\xfcresi i\\xe7erisinde yetkili hamil tarafndan \\xe7ekin bankaya ibraz edilmesi ile tahsil olunabilmektedir. Ancak baz durumlarda hamilin ibraz s\\xfcresinde \\xe7eki bankaya sunmu olmasna karn, \\xe7eki keide edenin hesabnda \\xe7ek bedelini karlayacak miktarda para bulunmamas sebebiyle \\xe7ekin bedeli tahsil olunamamaktadr. \\xc7ek hamillerinin bu durumla karlama ihtimalini azaltmak amacyla kanun koyucu, \\xe7ek keide edenin hesabndaki parann \\xe7ek bedelini karlamamas halinde, \\xe7eki keide edeni cezalandrma yoluna bavurmutur. Ancak \\xe7eki d\\xfczenleyen veya sorumlular hakknda cezaya karar verilebilmesi i\\xe7in ise s\\xf6z konusu su\\xe7un unsurlarnn k\\xfcm\\xfclatif olmas arttr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"1.Hukuken ge\\xe7erli bir \\xe7ekin varl s\\xf6z konusu olmaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek, T\\xfcrk Ticaret Kanununun 780. maddesi ile 823. maddeleri arasnda d\\xfczenlenmitir. lgili kanun uyarnca \\xe7ek i\\xe7eriinde ayn kanunun 780. maddesinde yer alan zorunlu unsurlarn bulunmas gerekmektedir. Bu zorunlu unsurlar ise unlardr:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"'\\xc7ek' kelimesi ve eer senet T\\xfcrk\\xe7eden baka bir dille yazlm ise o dilde \\xe7eke karlk kullanlan kelime\",\n                        \"Belirli bir bedelin kaytsz ve artsz \\xf6deneceine ilikin havale\",\n                        \"Muhatap yani, \\xe7eki \\xf6deyecek kimsenin ad, soyad veya unvan (Kanun gereince T\\xfcrkiyede sadece bankalar muhatap olabilir.)\",\n                        \"\\xc7ekin d\\xfczenlenme yeri ve tarihi\",\n                        \"\\xc7eki d\\xfczenleyen kiinin imzas\",\n                        \"Banka tarafndan verilen seri numaras\",\n                        \"Karekod\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Zorunlu unsurlardan Banka tarafndan verilen seri numaras ile Karekod, 6728 sayl Yatrm Ortamnn Iyilestirilmesi Amacyla Baz Kanunlarda Degisiklik Yaplmasna Dair Kanunun 70. maddesi ile Turk Ticaret Kanununun 780. maddesinde degisiklik yaplarak cekin zorunlu unsurlar arasna eklenmitir. Bununla birlikte, ayn kanunun 72. maddesi ile TTKna eklenen ge\\xe7ici 11. madde uyarnca 31.12.2016dan \\xf6nce keide edilen \\xe7ekler i\\xe7in Banka tarafndan verilen seri numaras ile Karekod unsurlar aranmayacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"TTK uyarnca bulundurulmas zorunlu artlar salayan kambiyo senetleri \\xe7ek niteliini tayacak ve \\xe7ek ile ilgili her t\\xfcrl\\xfc hukuki ve cezai h\\xfck\\xfcmlere tabi olacaktr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"2.\\xc7ekin kanun uyarnca \\xf6ng\\xf6r\\xfclen s\\xfcreler i\\xe7erisinde muhataba ibraz edilmesi gerekmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"T\\xfcrk Ticaret Kanununun 796. maddesindeki d\\xfczenlemeye g\\xf6re bir \\xe7ek d\\xfczenlendii yerde \\xf6denecekse on g\\xfcn; d\\xfczenlendii yerden baka bir yerde \\xf6denecekse bir ay i\\xe7inde muhataba ibraz edilmelidir. \\xc7ekin d\\xfczenleme ve \\xf6deme yerinin farkl \\xfclkelerde olmas halinde ise d\\xfczenleme ve \\xf6deme yerleri ayn veya ayr ktalarda bulunmasna g\\xf6re bir ay ve \\xfc\\xe7 ay olmak \\xfczere iki farkl s\\xfcre s\\xf6z konusu olacaktr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"3.\\xc7ek ibraz edildikten sonra karlksz kalmas halinde, \\xe7ekin \\xfczerine karlkszdr ilemi yaplmal ve karlksz kalan miktar a\\xe7k\\xe7a yazlmaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek Kanununun braz, \\xf6deme, \\xe7ekin karlksz olduunun tespiti ve gecikme cezas balkl 3. maddesinin 4. fkrasnda; 'Hamilin talepte bulunmas h\\xe2linde, karlkszdr ilemi; \\xe7ekin arka y\\xfcz\\xfcne tahsil i\\xe7in bankaya ibraz edildii tarih, hesap durumu, bankann y\\xfck\\xfcml\\xfcl\\xfc\\xfc \\xe7er\\xe7evesinde \\xf6dedii miktar ve ibraz eden ger\\xe7ek kiinin ad ve soyad yazlmak, bu kiinin t\\xfczel kii adna bedeli tahsil etmesi h\\xe2linde bu husus belirtilmek ve bu kii ile birlikte banka yetkilisi tarafndan imzalanmak suretiyle yaplr. Banka tarafndan \\xf6denen miktar d\\xfc\\xfcld\\xfckten sonra karlksz kalan tutar a\\xe7k\\xe7a belirtilir. Hamilin imzalamaktan ka\\xe7nmas h\\xe2linde, karlkszdr ilemi yaplmaz.' d\\xfczenlemesi ile karlkszdr ileminde yer alacak unsurlar belirtilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek, yetkili hamil veya onun vekili ya da temsilcisi tarafndan kanuni ibraz s\\xfcresinde muhatap bankaya ibraz edildii zaman, \\xe7ek keide edenin hesabndaki para \\xe7ek bedelini karlyorsa banka \\xf6demeyi ger\\xe7ekletirir. Ancak \\xe7ek hesabndaki parann \\xe7ek bedelini ksmen veya tamamen karlayamad durumlarda karlkszdr ilemi yaplr. Karlkszdr ilemi yaplrken karlksz kalan tutarn yazlmasnda, \\xc7ek Kanununun 3. maddesi ile muhatap bankann \\xe7ek hamiline \\xf6demekle y\\xfck\\xfcml\\xfc klnd bedel de dikkate alnr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"4.\\xc7ekle ilgili karlkszdr ilemi yaplmasna sebebiyet verme su\\xe7u, kovuturmas ikayete tabi su\\xe7lardandr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"T\\xfcrk Ceza Hukuku sisteminde bir su\\xe7 sebebiyle soruturma ve kovuturma yaplmasnda ilgili makamlarnn resen harekete ge\\xe7mesi temel esastr. Ancak kanun koyucu baz su\\xe7larda bu temel esasa istisna getirmi, bu su\\xe7larda soruturma ve kovuturma yaplmasn ikayet m\\xfcessesesine balamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kanun koyucu tarafndan s\\xf6z konusu bu su\\xe7ta ilgili makamlarn harekete ge\\xe7mesi, su\\xe7un madurunun ikayette bulunmas artna tabi klnm olup cra flas Kanununun 347. maddesine g\\xf6re ikayet s\\xfcresi, madurun su\\xe7un ilendiini \\xf6rendii yani, bankaya \\xe7eki usul\\xfcne uygun bir ekilde ibraz ettiinde \\xe7ekin karlksz kalmas neticesinde karlkszdr kaesinin vurulduu andan itibaren 3 ay ve her hal\\xfckarda su\\xe7un ilendii tarihten itibaren 1 yldr. Bu s\\xfcreler hak d\\xfc\\xfcr\\xfcc\\xfc s\\xfcreler olduundan madurun ikayet s\\xfcresini ka\\xe7rmamas elzemdir. Ek olarak, \\xe7ekin yetkili hamil tarafndan kanuni ibraz s\\xfcresinde muhataba ibraz edilmemesi de madurun ikayet hakkn kullanmasna engel olmakta ve ikayet hakkn d\\xfc\\xfcrmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Deinilmesinde \\xf6nem arz eden dier bir husus ise, ikayet hakknn sadece yetkili hamile tannm olmasdr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"5.Su\\xe7un faili, \\xe7ek sahibi ger\\xe7ek kii veya \\xe7ek sahibinin t\\xfczel kii olmas durumunda t\\xfczel kiilii temsile yetkili ger\\xe7ek kii olacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek ile ilgili karlkszdr ilemi yaplmasna sebebiyet verme su\\xe7unun faili, \\xe7ek karln banka hesabnda bulundurmas gereken kii yani \\xe7eki keide edendir. \\xc7ek keide eden ger\\xe7ek kii olabilecei gibi t\\xfczel kii de olabilir. \\xc7ek keide edenin t\\xfczel kii olmas halinde ise, mali ileri y\\xf6netmekle g\\xf6revli y\\xf6netim organ \\xfcyesi ya da y\\xf6netim organn oluturan ger\\xe7ek kii \\xe7ek karln bankada bulundurmakla y\\xfck\\xfcml\\xfc klnmtr. T\\xfczel kiiliin y\\xf6netim organnda mali ilerin y\\xf6netimi ile ilgili g\\xf6rev ayrm olmamas durumunda, y\\xf6netim organnda yer alan kiilerin t\\xfcm\\xfcn\\xfcn sorumluluu s\\xf6z konusu olacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek Kanununun 5. maddesinde yer alan d\\xfczenlemeye g\\xf6re de, \\xe7ek hesab sahibi ger\\xe7ek kii, kendisi adna \\xe7ek d\\xfczenlemek \\xfczere bir bakasn temsilci veya vekil olarak tayin edemeyecektir. Ger\\xe7ek kiinin temsilcisi veya vekili olarak \\xe7ek d\\xfczenlenmesi h\\xe2linde, bu \\xe7ekten dolay hukuk\\xee ve cezai sorumluluk yine \\xe7ek hesab sahibine ait olacaktr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"B.G\\xf6revli Ve Yetkili Mahkeme\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek Kanununun 5. maddesine g\\xf6re s\\xf6z konusu su\\xe7un kovuturulmasnda g\\xf6revli mahkeme icra ceza mahkemeleri iken, yetkili mahkemeler ise \\xe7ekin tahsil i\\xe7in bankaya ibraz edildii veya \\xe7ek hesabnn a\\xe7ld banka ubesinin bulunduu yer ya da hesap sahibinin yahut ik\\xe2yet\\xe7inin yerleim yeri mahkemesidir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"C.Su\\xe7un Yaptrm\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kanun, \\xe7ek ile ilgili karlkszdr ilemine sebebiyet verme su\\xe7unda yarglama sonucunda mahkumiyet karar verilmesi durumunda \\xf6ncelikle adli para cezasna h\\xfckmedilmesi gerektiini d\\xfczenlemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek Kanunu Madde 5:'\\xdczerinde yazl bulunan d\\xfczenleme tarihine g\\xf6re kanuni ibraz s\\xfcresi i\\xe7inde ibraznda, \\xe7ekle ilgili olarak karlkszdr ilemi yaplmasna sebebiyet veren kii hakknda, hamilin ik\\xe2yeti \\xfczerine, her bir \\xe7ekle ilgili olarak, binbey\\xfcz g\\xfcne kadar adli para cezasna h\\xfckmolunur. Ancak, h\\xfckmedilecek adli para cezas; \\xe7ek bedelinin karlksz kalan miktar, ()(2) az olamaz.'\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xf6z konusu su\\xe7tan dolay verilecek adli para cezas, \\xe7ekin karlksz kalan ksmndan az olmayacaktr. Yarglama sonucunda h\\xfckmolunan adli para cezasnn \\xf6denmemesi durumunda, verilen bu ceza, 5275 sayl Ceza ve G\\xfcvenlik Tedbirlerinin nfaz Hakknda Kanunda yer alan kamuya yararl bir ite \\xe7altrma karar verilmeksizin dorudan hapis cezasna \\xe7evrilmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mahkeme ayrca kararnda, \\xe7ek d\\xfczenleme ve \\xe7ek hesab a\\xe7ma yasana; bu yasan bulunmas h\\xe2linde, \\xe7ek d\\xfczenleme ve \\xe7ek hesab a\\xe7ma yasann devamna h\\xfckmeder. Mahkeme tarafndan yarglama srasnda da resen koruma tedbiri olarak \\xe7ek d\\xfczenleme ve \\xe7ek hesab a\\xe7ma yasana h\\xfckmolunabilecektir. \\xc7ek d\\xfczenleme ve \\xe7ek hesab a\\xe7ma yasa, \\xe7ek hesab sahibi ger\\xe7ek veya t\\xfczel kii, bu t\\xfczel kii adna \\xe7ek keide edenler ve karlksz \\xe7ekin bir sermaye irketi adna d\\xfczenlenmesi durumunda ayrca y\\xf6netim organ ile ticaret siciline tescil edilen irket yetkilileri hakknda uygulanacaktr. Burada \\xf6nem arz eden hususlardan bir dieri ise, \\xe7ek d\\xfczenleme ve \\xe7ek hesab a\\xe7ma yasa karar verilen kiiler, h\\xfckmolunan bu yasakllk s\\xfcresince sermaye irketlerinin y\\xf6netim organlarnda g\\xf6rev alamayacaklardr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xc7ek d\\xfczenleme ve \\xe7ek hesab a\\xe7ma yasa kararna ilikin bilgiler, MERSS ile Risk Merkezine bildirilir. Hakknda \\xe7ek hesab a\\xe7ma yasa karar verilen kiiler, Risk Merkezi tarafndan bankalara bildirilir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"D.Cezay Kaldran Haller Ve nfaz Aamasnn Tamamlanmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"1.Kiinin \\xe7ek bedelinin karlksz kalan ksmn, \\xe7ekin \\xfczerinde yazl bulunan d\\xfczenleme tarihine g\\xf6re kanun\\xee ibraz tarihinden itibaren ileyecek 3095 sayl Kanuna g\\xf6re ticar\\xee ilerde temerr\\xfct faiz oran \\xfczerinden hesaplanacak faizi ile birlikte tamamen \\xf6demesi veya madurun ikayetten vazge\\xe7mesi halinde; yarglama aamasnda mahkeme tarafndan davann d\\xfcmesine, mahk\\xfbmiyet h\\xfckm\\xfcn\\xfcn kesinlemesinden sonra mahkeme tarafndan h\\xfckm\\xfcn b\\xfct\\xfcn sonu\\xe7laryla ortadan kaldrlmasna karar verilir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"2.\\xc7ekle ilgili karlkszdr sebebiyet verme su\\xe7undan hakknda mahkumiyet karar verilen kii, mahk\\xfbm olduu cezann tamamen infaz edildii tarihten itibaren \\xfc\\xe7 yl ve her halde yasan konulduu tarihten itibaren on yl ge\\xe7tikten sonra, h\\xfckm\\xfc veren mahkemeden \\xe7ek d\\xfczenleme ve \\xe7ek hesab a\\xe7ma yasann kaldrlmasn isteyebilir; mahkemenin verecei karara itiraz edebilir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital Bankaclk\"\n                }\n            ],\n            tags: [\n                \"\\xe7ek\",\n                \"\\xe7ek su\\xe7u\",\n                \"\\xe7ekle ilgili karlkszdr ilemi\"\n            ]\n        },\n        {\n            id: 28,\n            subtitle: \"GDPR Karar\",\n            date: \"24.04.2024\",\n            title: \"Yunanistan Veri Koruma Otoritesi, \\xfc\\xe7\\xfcnc\\xfc bir kiinin \\xe7ar merkezi g\\xf6r\\xfcmelerinin bir kopyasn ilgili kiiye g\\xf6nderen Vodafone'a 40.000 Euro tutarnda para cezas verdi.\",\n            slug: \"ilgili-kisi-ile-baskasinin-verilerini-paylasan-veri-sorumlusuna-ceza\",\n            text: \"Veri sorumlusu Vodafone, \\xe7ar merkeziyle yapt g\\xf6r\\xfcmelerin kaytlarnn bir kopyasn isteyerek eriim talebinde bulunan bir ilgili kiiye, baka bir kiinin g\\xf6r\\xfcme kaytlarn iletmitir. Bu durum kendisine bildirilmesine ramen Vodafone herhangi bir aksiyon almam, bunun \\xfczerine ilgili kii Yunanistan Veri Koruma Otoritesine ikayette bulunmutur. Otorite eriim talebi kapsamnda baka bir kiinin verilerinin bir kopyasn g\\xf6ndermesi ve bu nedenle meydana gelen ihlali bildirmemesi gerek\\xe7eleriyle GDPR madde 15(3) ve madde 33 uyarnca veri sorumlusuna  40.000 Euro para cezas vermitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Bir ilgili kii, veri sorumlusu Vodafonea veri eriim talebinde bulunarak irketin \\xe7ar merkeziyle yapt g\\xf6r\\xfcmelerin kaytlarnn bir kopyasn istemi ancak ilgili kiiye baka bir kiinin konumalarnn yer ald bir kayt g\\xf6nderilmitir. Kendi g\\xf6r\\xfcmelerinin de yanllkla baka birisine iletildiinden endie duyan ilgili kii, olup biteni bildirmek i\\xe7in veri sorumlusu ile temasa ge\\xe7mitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusuna derhal haber verilmesine ramen olayn aratrlmas i\\xe7in veri sorumlusu tarafndan herhangi bir ilem yaplmam, aksine veri sorumlusu, kendi sorumluluunu veri ileyen \\xfczerine brakmaya \\xe7alm ve ilgili kiinin s\\xf6z konusu kaytlar iade etmek i\\xe7in kendisiyle iletiime ge\\xe7mesini \\xf6nermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu \\xe7\\xf6z\\xfcmden memnun olmayan ilgili kii, Yunanistan Veri Koruma Otoritesine (Otorite) ikayette bulunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, GDPR madde 15(3) h\\xfckm\\xfc dorultusunda kiisel verilere eriim hakknn ayn zamanda ilenmekte olan verilerin bir kopyasn edinme hakkn da i\\xe7erdiinin altn \\xe7izmi, ayrca effafln kiisel verilerin etkili bir ekilde korunmasnn bir koulu olmas nedeniyle bu hakkn kullanlmasnn meru bir menfaatle gerek\\xe7elendirilmesine ihtiya\\xe7 duyulmadn da vurgulamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite ayrca, GDPR madde 4(12) uyarnca 'kiisel veri ihlalinin', kiisel verilerin kazara veya yetkisiz olarak ifa edilmesine yol a\\xe7an bir g\\xfcvenlik ihlali anlamna geldiini hatrlatmtr. Bir g\\xfcvenlik ihlali ger\\xe7ekletiinde ilgili kiinin fiziki, maddi veya manevi zarara urayabileceini belirtmi ve bu nedenle veri sorumlusunun, \\xf6renme tarihinden itibaren gecikmeksizin en ge\\xe7 72 saat i\\xe7inde, kiisel veri ihlalini yetkili denetim makamna bildirmesi gerektiinin altn \\xe7izmitir (GDPR Madde 33).\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda Otorite, veri sorumlusunun her iki y\\xfck\\xfcml\\xfcl\\xfce de uymadna karar vermi ve veri sorumlusunu 40.000 Euro tutarnda para cezasna \\xe7arptrmtr.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Karar detaylar\",\n                    href: \"https://gdprhub.eu/index.php?title=HDPA_%28Greece%29_-_7%2F2023&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"veri koruma\",\n                \"veri ihlali\"\n            ]\n        },\n        {\n            id: 27,\n            subtitle: \"Makale\",\n            date: \"2023\",\n            slug: \"emekli-iscinin-hak-ve-alacaklari\",\n            title: \"EMEKL OLAN \\xc7NN AYNI VERENE BALI OLARAK \\xc7ALIMAYA DEVAM ETMES HALNDE TARAFLARIN HAK VE ALACAKLARI\",\n            text: \"Emeklilikte Yaa Taklanlar (EYT) Kanunu olarakta bilinen Sosyal Sigortalar ve Genel Salk Sigortas Kanunu ile 375 sayl Kanun H\\xfckm\\xfcnde Kararnamede Deiiklik Yaplmasna Dair Kanun (Kanun), 03.03.2023 tarihinde Resmi Gazetede yaymlanarak y\\xfcr\\xfcrl\\xfce girmitir. Yaplan deiiklik ile bu nitelikteki \\xe7alanlarn emeklilie hak kazanmalar i\\xe7in ya kriteri ortadan kaldrlmtr. B\\xf6ylece ya dndaki dier artlar (sigortallk s\\xfcresi ve prim g\\xfcn says) tayan \\xe7alanlar, emekli olabileceklerdir.\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"I. VEREN EMEKL OLAN \\xc7 LE YENDEN S\\xd6ZLEME YAPMAK ZORUNDA MI?\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"verenin, emekli olan i\\xe7ilerin bir ksmyla i ilikisinin devam ettirip; bir ksmyla yeni bir i s\\xf6zlemesi yapmakszn yollarn ayrmas m\\xfcmk\\xfcn olmakla birlikte bu durum eit davranma y\\xfck\\xfcml\\xfcl\\xfc\\xfc ve ayrmclk yasa \\xe7er\\xe7evesinde deerlendirilmelidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kural olarak iverenin i\\xe7ilere eit davranma borcu, i s\\xf6zlemesinin kurulmasndan sonra doacaktr. Ayrmclk yasa ise, i s\\xf6zlemesi kurulmadan \\xf6nce ie alm aamasnda da g\\xf6zetilmelidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dolaysyla eit davranma y\\xfck\\xfcml\\xfcl\\xfc\\xfc i s\\xf6zlemesinin kurulmasndan sonra g\\xfcndeme geleceinden i ilikisinin sona ermesi halinde s\\xf6zleme serbestisi gerei bir ksm i\\xe7ilerle yeniden i s\\xf6zlemesi yaplmamas m\\xfcmk\\xfcnd\\xfcr. Ancak eit davranma prensibinden farkl olarak ayrmclk yasa i s\\xf6zlemesinin kurulmasndan \\xf6nce de g\\xf6zetilecektir. \\xd6rnein sadece emeklilie hak kazanan erkeklerle i s\\xf6zlemesi kurulmas ve kadnlarla i ilikisinin sona erdirilmesi ayrmclk yasana aykr olacaktr. Bu kapsamda iverenin, yeni i s\\xf6zlemesi yapaca emekli i\\xe7ilerini belirlerken iyerinin ihtiya\\xe7larn, i\\xe7inin kalifiyelik durumunu dikkate alarak objektif kriterlere bal hareket etmesi gerekmektedir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"II. \\xc7NN MAAININ BELRLENMES\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayn iverene bal olarak yeniden istihdam edilen i\\xe7ilerin maa bakmndan ise s\\xf6zleme serbestisi gerei taraflarca farkl bir \\xfccretin kararlatrlmas m\\xfcmk\\xfcnd\\xfcr. Nitekim Yargtay g\\xfcncel kararlarnda yeni i s\\xf6zlemesinde belirlenen \\xfccretin, irade fesad olmad s\\xfcrece ge\\xe7erli olduunu ve ayrmclk yasann ihlali anlamna gelmeyeceini kabul etmektedir. Bu itibarla emekli olan i\\xe7ilerle kurulacak yeni i ilikisinde, i s\\xf6zlemesinin asli unsuru olan \\xfccretin a\\xe7k\\xe7a belirlenmesi ve bu s\\xf6zlemenin imzalanmas s\\xfcrecinde i\\xe7inin iradesinin hi\\xe7bir ekilde etkilenmemesi yasal bir zorunluluktur.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"III. EMEKLLK SONRASI \\xc7ALIMADA  G\\xdcVENCES\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" Kanununun 18. maddesi uyarnca i\\xe7inin i g\\xfcvencesi kapsamnda olmas i\\xe7in iyerinde en az 6 aylk kdeminin bulunmas gerekir. Ayn maddenin 4. fkrasnda ise bu kdemin ne ekilde hesaplanaca belirtilmi ve \\xe7inin alt aylk kdemi, ayn iverenin bir veya deiik iyerlerinde ge\\xe7en s\\xfcreler birletirilerek hesap edilir. ifadelerine yer verilmitir. Buna g\\xf6re i g\\xfcvencesinden yararlanma balamnda 6 aylk kdem s\\xfcresi, emeklilik \\xf6ncesi \\xe7allan s\\xfcre de eklenerek hesaplanacaktr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"IV. EMEKLLK SEBEBYLE FESHTE TAZMNAT VE ALACAKLARIN DURUMU\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"A. KIDEM TAZMNATI\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Emeklilik sebebiyle fesih halinde i\\xe7i, kdem tazminatna hak kazanacaktr. Ancak i s\\xf6zlemesinin feshine ramen i\\xe7inin aralksz olarak \\xe7almaya devam ettii hallerde kdem tazminat talebine ilikin \\xe7eitli ihtimaller ortaya \\xe7kmaktadr:\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"1. \\xe7iye Emeklilik Annda Tazminat \\xd6demesinin Yaplmas\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" s\\xf6zlemesinin emeklilik ile birlikte i\\xe7i tarafndan feshini takiben i\\xe7inin iveren b\\xfcnyesinde \\xe7almaya devam etmesi halinde, yeni bir i ilikisi kurulmu saylacaktr. Buna g\\xf6re, i s\\xf6zlemesinin emeklilik sebebiyle feshi sonrasnda \\xf6nceki i ilikisi tasfiye olacandan, emekli olan ancak iyerinde ayn ekilde \\xe7almaya devam eden i\\xe7i, emeklilik annda kdem tazminatn talep edebilecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xe7iye kdem tazminat \\xf6demesi yaplmasnn akabinde i\\xe7inin bir s\\xfcre sonra ayn iverene ait iyerinde \\xe7alarak yeniden kdem tazminatna hak kazanmas da m\\xfcmk\\xfcn olabilmektedir. Dolaysyla emeklilik annda i\\xe7iye kdem tazminat \\xf6demesi yaplmsa ve emeklilik sonras i ilikisi de kdem tazminat douracak ekilde sona ererse, kdem tazminat hesab i\\xe7i lehine olacak ekilde emeklilik \\xf6ncesi ve sonrasndaki t\\xfcm \\xe7alma s\\xfcresi ve i\\xe7inin emeklilikten sonraki \\xfccreti (son \\xfccret) \\xfczerinden yaplacak; emeklilik srasnda i\\xe7iye \\xf6denen kdem tazminat bedeli bu hesaptan mahsup edilecektir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"2. \\xe7iye Tazminat \\xd6demesi Yaplmadan  likisinin Devam Etmesi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uygulamada kimi zaman i\\xe7i ile iveren arasndaki g\\xfcven ilikisinden kaynakl olarak i\\xe7inin emekliliinin akabinde kdem tazminat ve fesihten kaynakl alacaklar \\xf6denmeden i ilikisine devam edilebildii de g\\xf6r\\xfclmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" s\\xf6zlemesinin sonraki s\\xfcre\\xe7te baka bir sebeple sona erdii durumlarda bu tazminat talepleri, sonraki feshin hakl bir nedene dayanp dayanmadna g\\xf6re deiecektir. Bu kapsamda, emekli olmasna ramen emeklilik annda kdem tazminatn almayan ve iveren b\\xfcnyesinde \\xe7almaya devam eden i\\xe7inin, bu i s\\xf6zlemesinin sonraki bir tarihte feshi halinde aadaki ihtimaller mevcuttur:\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"a. Emeklilikten Sonra  S\\xf6zlemesinin \\xe7i Tarafndan Haksz/veren Tarafndan Hakl Sebeple Feshi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu durumda i\\xe7i emeklilik sonras d\\xf6nemde kurulan i ilikisi bakmndan kdem tazminatna hak kazanamayacaktr. Ancak i\\xe7i ile iveren arasndaki \\xf6nceki i ilikisi emeklilik nedeni ile sona erdiinden i\\xe7inin emeklilik \\xf6ncesi i s\\xf6zlemesinden kaynakl kdem tazminat talebi g\\xfcndeme gelecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dolaysyla, i\\xe7i emeklilikten sonraki \\xe7almas esnasnda istifa etse dahi, emeklilik tarihine kadar ge\\xe7en s\\xfcredeki i ilikisi \\xe7alann istifas ile deil emeklilik ile sona ermi olacandan bu s\\xfcrece ilikin kdem tazminat hakk baki kalacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Anlan kdem tazminat bedeli, ikinci i s\\xf6zlemesinin sona erdii tarihte hesaplanacak olsa da, bu kdem tazminatna esas \\xfccret, i\\xe7inin emeklilik tarihindeki \\xfccretidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xe7iye kdem tazminat \\xf6demesinin emeklilik annda yaplmamas halinde, iveren tarafndan i\\xe7iye bu tazminata ilikin bir faiz borcu doaca da hatrlatlmaldr. Buna g\\xf6re emeklilik sebebiyle fesih annda kdem tazminat \\xf6denmezse, bu tazminat bedeline faiz ileyecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" Kanununun Ek Madde-3 maddesinde a\\xe7k\\xe7a, kdem tazminat alacann zamanam s\\xfcresinin 5 yl olduu d\\xfczenlenmitir. Bu h\\xfck\\xfcmden hareketle, i\\xe7inin emeklilik sebebiyle hak kazand kdem tazminatnn da 5 yllk zamanam s\\xfcresine tabidir. S\\xf6z konusu 5 yllk s\\xfcre, i ilikisinin emeklilik sebebiyle sona erdii tarihte balayacaktr. Zira Yargtay kararlarna g\\xf6re, kdem tazminat alaca, s\\xf6zlemenin feshi ile muaccel ve talep edilebilir hale gelmekte, bu kapsamda zamanam s\\xfcresi de emeklilik sebebi ile fesih tarihinde balayacaktr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"b. Emeklilikten Sonra  S\\xf6zlemesinin \\xe7i Tarafndan Hakl/veren Tarafndan Haksz Sebeple Feshi\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Emeklilikten sonraki d\\xf6nem yeni bir i ilikisi olarak nitelendirildiinden, i\\xe7inin gerekli koullar yeniden salamas artyla bir kdem tazminat hakk daha doacaktr. \\xe7inin emeklilik sebebiyle doan kdem tazminat alacan da almad g\\xf6zetildiinde, i\\xe7inin batan itibaren saylacak \\xe7alma s\\xfcresi ve son \\xfccreti \\xfczerinden kdem tazminat hesab yaplacaktr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"B. YILLIK ZN S\\xdcRES VE \\xdcCRET\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yllk \\xfccretli izine hak kazanmak i\\xe7in gerekli s\\xfcrelerin hesabnda, i\\xe7inin ayn iverenin bir veya \\xe7eitli iyerlerinde \\xe7alt s\\xfcreler birletirilerek g\\xf6z \\xf6n\\xfcne alnacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Emeklilik sonrasnda i ilikisinin devam halinde i\\xe7inin yllk izin s\\xfcresi i\\xe7inin t\\xfcm \\xe7alma d\\xf6nemi \\xfczerinden hesaplanacaktr. Bununla birlikte yllk izin \\xfccreti alaca i s\\xf6zlemesinin feshi ile birlikte muaccel olduundan Yargtay i\\xe7i lehine yorum yaparak i ilikisi, emeklilik sebebiyle sekteye uramam gibi bu \\xfccretlerin zamanamna uramad y\\xf6n\\xfcnde karar tesis etmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"C. HBAR TAZMNATI\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xe7inin i s\\xf6zlemesinin emeklilik sebebiyle feshi halinde bildirim s\\xfcrelerine uygun davranma y\\xfck\\xfcml\\xfcl\\xfc\\xfc bulunmamaktadr. Ksaca, emeklilik sebebiyle i s\\xf6zlemesinin feshi halinde, yukarda belirtildii \\xfczere i\\xe7inin kdem tazminat hakk olmakla beraber iverenden ihbar tazminat talep edilebilmesi imk\\xe2n yoktur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yargtay kararlarnda da h\\xfck\\xfcm altna alnd \\xfczere i\\xe7inin iyerinde emeklilik sonras \\xe7almalar yeni bir i s\\xf6zlemesi niteliinde olacandan ihbar tazminat hesabnda i\\xe7inin iyerinde \\xe7alt s\\xfcreler birletirilmeyecektir. Dier bir deyile emeklilikten sonra akdedilen yeni i s\\xf6zlemesi ile ihbar s\\xfcresi en batan ilemeye balayacaktr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"VI. SOSYAL G\\xdcVENLK DESTEK PRM (SGDP)\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sosyal G\\xfcvenlik Destek Primi (SGDP) emeklilik ile ilgili artlar yerine getirerek kendilerine yallk/emeklilik ayl balanan kiilerin aylklarnn kesilmeden tekrar i s\\xf6zlemesine tabi \\xe7almalar halinde iverenlerinden, kendi adna \\xe7almalar halinde de dorudan kendilerinden alnan primdir. Bu itibarla SGDP uygulamas esasen emekli olanlarn tekrar istihdam piyasasna d\\xf6nmesine mani olmak ve SGKnn prim geliri elde etmesi i\\xe7in uygulamaya sokulmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"5510 sayl Sosyal Sigortalar ve Genel Salk Sigortas Kanunu ile birlikte 01.10.2008 tarihinde bir reform yaplm olup SGDPnin \\xf6denmesi artlar, anlan tarihten \\xf6nce veya sonra sigortal olunmasna g\\xf6re deiiklik g\\xf6stermektedir.\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"01.10.2008 tarihinden \\xf6nce sigortal olan \\xe7alanlar i\\xe7in, hangi kurumdan emekli olurlarsa olsunlar emekli olduktan sonra 4/a kapsamnda emekli aylklar kesilmeden SGDP kapsamnda \\xe7alabileceklerdir. Bu kiiler emekli aylklarn herhangi bir kesinti olmadan alabileceklerdir. Dolaysyla bu tarihten \\xf6nce sigortal olan ve emeklilik sonrasnda \\xe7almaya devam eden i\\xe7ilerin prime esas kazan\\xe7lar \\xfczerinden kesilen %32 oranndaki SGDPyi iverenler \\xf6demekle y\\xfck\\xfcml\\xfcd\\xfcr. Bu kapsamda bu i\\xe7ilerin yallk aylndan SGDPnin kesilmesi m\\xfcmk\\xfcn deildir.\",\n                        \"01.10.2008 tarihinden sonra sigortal olan \\xe7alanlar i\\xe7in, emekli olup yeniden \\xe7almaya balayanlarn aylklar, \\xe7almaya baladklar tarihi takip eden \\xf6deme d\\xf6nemi banda kesintiye uramaktadr. Anlan tarih sonras 4/a sigortals olanlar y\\xf6n\\xfcnden SGDP \\xf6deyerek \\xe7alma imkan bulunmamaktadr. Bu kapsamdaki emekliler, yeniden \\xe7alma halinde maalarnn kesilmesine raz olacaklardr.\"\n                    ]\n                },\n                {\n                    type: \"header\",\n                    content: \"VII. SONU\\xc7\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yukarda ayrntlarna yer verildii \\xfczere;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"\\xe7inin emeklilik sonras ayn iyerinde \\xe7almaya devam etmesi m\\xfcmk\\xfcnd\\xfcr.\",\n                        \"\\xe7i emeklilik ile birlikte kdem tazminatna hak kazanacak olup bu \\xf6demenin kural olarak i s\\xf6zlemesinin emeklilik sebebiyle sona erdii anda yaplmas gerekir.\",\n                        \"Kdem tazminat \\xf6demesi yaplmadan i\\xe7inin \\xe7almaya devam etmesi halinde i ilikisinin ikinci ksmnn ne ekilde sona erdii kdem tazminat bedelinin belirlenmesi a\\xe7sndan \\xf6nemlidir.\",\n                        \" s\\xf6zlemesinin emeklilik sebebiyle sona erdirilmesi i\\xe7in i\\xe7inin mutlaka SGKdan buna ilikin yazy iverene ibraz gerekmektedir.\",\n                        \"\\xe7inin sigortallk balangcna g\\xf6re maa kesintisi veya SGDP kapsamnda olup olmayaca deimektedir.\"\n                    ]\n                }\n            ],\n            tags: [\n                \"emekli\",\n                \"i\\xe7i\",\n                \"hakvealacak\"\n            ],\n            author: \"\"\n        },\n        {\n            id: 26,\n            subtitle: \"IAPP Haberleri\",\n            date: \"22.04.2024\",\n            title: \"Colorado Eyalet Meclisi tarafndan, beyin verilerinin korunmasna ilikin yeni yasa tasars kabul edildi.\",\n            slug: \"colorado-eyalat-meclisi-tarafindan-beyin-verilerinin-korunmasina-iliskin-yeni-yasa-tasarisi-kabul-edildi\",\n            text: \"The New York Times'n haberine g\\xf6re Colorado Eyalet Meclisi tarafndan, biyometrik ve 'n\\xf6ral verilerin' korunmas amacyla Colorado Gizlilik Yasas'nda yaplan bir deiiklik onayland. lgili deiikliin t\\xfcketicileri (ilgili kiileri), beyin faaliyetleri kapsamnda veri toplayan cihazlardan korumay ama\\xe7lad ifade edildi. D-Colo Eyalet Temsilcisi Cathy Kipp tarafndan, teknolojinin faydal olabilecei ancak d\\xfc\\xfcncelerinin okunmasn ve biyolojik verilerinin kullanlmasn istemeyen insanlar i\\xe7in baz \\xf6nlemlerin olmas gerektii ifade edildi.\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1. ngiltere Veri Koruma Otoritesi (ICO) tarafndan aydnlatma metni ablonlar g\\xfcncellendi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ICO tarafndan iletmelerin kendilerine \\xf6zg\\xfc bir aydnlatma metni oluturmasna yardmc olmas amacyla aydnlatma metni ablonu oluturucu gelitirildi. Bu kapsamda gelitirilen uygulamada; m\\xfcteriler ve tedarik\\xe7ilerin yan sra \\xe7alan ve g\\xf6n\\xfcll\\xfc bilgileri i\\xe7in de \\xf6zel ablonlarn mevcut olduu ve ICO tarafndan gelecek aylarda sekt\\xf6rel bazda ablon aydnlatma metinlerinin yaynlanmasnn planland ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/u-k-updates-privacy-notice-template/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. Colorado Eyalet Meclisi tarafndan, beyin verilerinin korunmasna ilikin yeni yasa tasars kabul edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The New York Times'n haberine g\\xf6re Colorado Eyalet Meclisi tarafndan, biyometrik ve 'n\\xf6ral verilerin' korunmas amacyla Colorado Gizlilik Yasas'nda yaplan bir deiiklik onayland. lgili deiikliin t\\xfcketicileri (ilgili kiileri), beyin faaliyetleri kapsamnda veri toplayan cihazlardan korumay ama\\xe7lad ifade edildi. D-Colo Eyalet Temsilcisi Cathy Kipp tarafndan, teknolojinin faydal olabilecei ancak d\\xfc\\xfcncelerinin okunmasn ve biyolojik verilerinin kullanlmasn istemeyen insanlar i\\xe7in baz \\xf6nlemlerin olmas gerektii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/colorado-passes-privacy-law-to-protect-brain-data/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. Norve\\xe7 Veri Koruma Otoritesi tarafndan davran kurallar denet\\xe7ileri tarafndan yerine getirilmesi gereken koullar yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Norve\\xe7 Veri Koruma Otoritesi tarafndan, sekt\\xf6re \\xf6zg\\xfc davran kurallarn denetleyen kurulular tarafndan yerine getirilmesi gereken koullar yaymland. Sekiz kategoriden oluan koullarn, AB Genel Veri Koruma T\\xfcz\\xfc\\xfcn\\xfcn (GDPR) 41. Maddesine dayand ve menfaat \\xe7atmas h\\xfck\\xfcmleri ile ilgili kii ikayetlerinin incelenmesi ve giderilmesine y\\xf6nelik mekanizmalar i\\xe7erdii belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/norways-dpa-issues-requirements-for-data-controller-accredidation/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. ICO tarafndan, salk verilerinin effaflna ilikin klavuz yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ICO tarafndan, hastalarn kiisel verilerinin ilenmesi ve saklanmasna ilikin aydnlatlmalarn salamak amacyla salk kurulularna y\\xf6nelik bir klavuz yaymland. Bahse konu klavuzun, etkili effaflk bilgileri gelitirmeye y\\xf6nelik pratik admlar tevik etmeyi ve gelitirmeyi ama\\xe7lad belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/uk-ico-releases-guidance-on-health-data-transparency/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. Yunanistan Veri Koruma Otoritesi tarafndan bir gazeteye veri ihlali sebebiyle para cezas verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yunanistan Veri Koruma Otoritesi tarafndan, bir  irketin dosyalarna hukuka aykr eriim ve zararl yazlm y\\xfcklemeleriyle sonu\\xe7lanan bir veri ihlalinin ardndan Hellenic Post'a 2.99 milyon Euro tutarnda para cezas verildi. Otorite tarafndan, irketin GDPR kapsamnda gerekli olan yeterli korumay salamad tespit edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/norway-dpa-updates-data-transfer-guidance-for-third-countries/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6. Bir fidye yazlm grubu tarafndan, yol a\\xe7tklar veri ihlalinden elde edilen tbbi ve finansal kaytlarn satld a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Wired'n haberine g\\xf6re fidye yazlm grubu RansomHub tarafndan, Change Healthcare isimli salk yazlm firmasna yaplan bir siber saldrnn ardndan ABD vatandalarnn tbbi ve finansal kaytlarnn \\xe7alnd ve bu kaytlarn i\\xe7erisindeki kiisel verilerin satld iddia edildi. Emsisoft Tehdit Analisti Brett Callow tarafndan, bu iddiann verileri ihlale konu olan irketlerden ek fidye \\xf6demesi almak amacyla ortaya atld ve verilerin ger\\xe7ekten satlacann d\\xfc\\xfcn\\xfclmedii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/ransomware-group-sells-medical-and-financial-records-from-data-breach/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7. Yar letken materyal \\xfcretimi yapan bir irketin veri ihlali ile kar karya olduu iddia edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Techerati'nin haberine g\\xf6re yar iletken materyal \\xfcretimi yapan irket Nexperia tarafndan, Hollanda Veri Koruma Otoritesine bir veri ihlali bildiriminde bulunuldu. Nexperia tarafndan, ihlale ilikin i\\xe7 soruturmann s\\xfcrmesi nedeniyle ihlal srasnda veri kayb yaanp yaanmad dorulanmad. irket tarafndan ayn zamanda yaanan veri ihlalinin neticelerini hafifletilmesi amacyla gerekli admlarn atld ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/semiconductor-manufacturer-experiences-data-breach/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8. ABD Federal Ticaret Komisyonu (FTC) tarafndan, aydnlatma metnine aykr uygulamalar sonucunda bir tele-salk irketine 7 milyon dolar tutarnda idari para cezas uyguland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"FTC tarafndan \\xf6nerilen ve bir federal bir yarg\\xe7 tarafndan onaylanmay bekleyen talimatlandrmada; bir tele-salk firmasnn, ilgili kiilere y\\xf6nelik aydnlatma metnine aykr olacak nitelikte faaliyetler y\\xfcr\\xfctt\\xfc\\xfc ve ilgili kiilerin hizmeti sonlandrmasna ilikin politikalar hakknda yanltc ifadeler kulland \\xf6ne s\\xfcr\\xfcld\\xfc. FTC tarafndan, ilgili karara konu Cerebral isimli irkete ve irket CEO'su Kyle Robertson'a, m\\xfcterilerin kiisel verilerini hukuka aykr bir ekilde elde ettii i\\xe7in 7 milyon ABD dolar tutarnda idari para cezas verildi. FTC tarafndan ilgili irketin daha sonra ilenen bahse konu verileri \\xfc\\xe7\\xfcnc\\xfc taraflara satt ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/pending-ftc-order-would-fine-telehealth-company-7-million-for-violating-its-own-privacy-notice/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9. Bir hukuk firmas tarafndan yaanan veri ihlali sonucu a\\xe7lan davada, 8 milyon dolar karlnda uzlama saland a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Reuters'in haberine g\\xf6re Orrick, Herrington & Sutcliffe hukuk firmas tarafndan, 600.000 m\\xfcteriyi etkileyen ve firmann yetersiz teknik ve idari tedbirleri sonucu ger\\xe7ekletii iddia edilen veri ihlalini konu eden toplu davada 8 milyon dolar karlnda uzlamaya varld. Bununla birlikte, ABD Pennsylvania Dou B\\xf6lgesi B\\xf6lge Mahkemesi tarafndan, marketler zinciri Wawa'ya kar daha \\xf6nce a\\xe7lan benzer konulu bir davada 3,2 milyon ABD dolar tutarndaki yasal \\xfccretler iade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/law-firm-settles-data-breach-lawsuit-us-judge-approves-3-2m-for-lawyers-in-data-privacy-lawsuit/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10. ABD Temsilciler Meclisi tarafndan, kiisel verilerin istihbarat kurumlarna ve polise satn snrlayan yasa tasars kabul edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CyberScoop'un haberine g\\xf6re ABD Temsilciler Meclisi tarafndan kolluk kuvvetleri ve istihbarat kurumlarnn arama emri almadan veri komisyoncularndan kiisel veri satn almasn engelleyen yasa tasars kabul edildi. Buna ek olarak Y\\xf6netim ve B\\xfct\\xe7e Ofisi tarafndan Beyaz Saray adna yaplan a\\xe7klamada tasarya kar olunduu ifade edilerek aksi y\\xf6nde h\\xfck\\xfcmler i\\xe7eren bir baka yasa tasarsna destek olunduu belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylar\",\n                    href: \"https://iapp.org/news/a/us-house-passes-bill-prohibiting-intelligence-agencies-law-enforcement-from-buying-pi-from-data-brokers/\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"Colorado\",\n                \"Beyin Verileri\",\n                \"Gizlilik Yasas\"\n            ]\n        },\n        {\n            id: 25,\n            subtitle: \"Makale\",\n            date: \"2023\",\n            slug: \"dijital-bankacilik-ve-servis-modeli-bankaciligi\",\n            title: \"Dijital Bankaclk Ve Servis Modeli Bankacl\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"Dijital Bankaclk\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"1.Genel Olarak\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital bankalar, bankaclk hizmetlerini fiziksel ubeler yerine elektronik bankaclk hizmetleri datm kanallar araclyla sunan kredi kuruluunu ifade eder. Bu tanmdan hareketle,\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"5411 sayl Bankaclk Kanunu (Kanun),\",\n                        \"Bankaclk D\\xfczenleme ve Denetleme Kurumu (BDDK) tarafndan \\xe7karlan ve 29.12.2021 tarihli 31704 sayl Resmi Gazetede yaymlanarak 01.01.2022 tarihinde y\\xfcr\\xfcrl\\xfce giren Dijital Bankalarn Faaliyet Esaslar ile Servis Modeli Bankacl Hakknda Y\\xf6netmelik (Dijital Banka Y\\xf6netmelii),\",\n                        \"BDDK tarafndan \\xe7karlan ve 15.03.2020 tarihli 31069 sayl Resmi Gazetede yaymlanarak 01.07.2020 tarihinde y\\xfcr\\xfcrl\\xfce giren Bankalarn Bilgi Sistemleri ve Elektronik Bankaclk Hizmetleri Hakknda Y\\xf6netmelik,\",\n                        \"BDDK tarafndan \\xe7karlan ve 01.04.2021 tarihli 31441 sayl Resmi Gazetede yaymlanarak 01.05.2021 tarihinde y\\xfcr\\xfcrl\\xfce giren Bankalarca Kullanlacak Uzaktan Kimlik Tespiti Y\\xf6ntemlerine ve Elektronik Ortamda S\\xf6zleme likisinin Kurulmasna likin Y\\xf6netmelik,\",\n                        \"BDDK tarafndan \\xe7karlan ve 01.11.2006 tarihli 26333 sayl Resmi Gazetede yaymlanarak ayn tarihte y\\xfcr\\xfcrl\\xfce giren Bankalarn zne Tabi lemleri ile Dolayl Pay Sahipliine likin Y\\xf6netmelik,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"T\\xfcrk Hukukunda dijital bankacla ilikin temel hukuki d\\xfczenlemeleri oluturmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital Banka Y\\xf6netmeliinin amac, sadece elektronik bankaclk hizmetleri datm kanallar \\xfczerinden hizmet veren ubesiz bankalarn faaliyetlerine ve bankaclk hizmetlerin finansal teknoloji irketleri ve dier iletmelere bir servis modeli olarak sunulabilmesine ilikin usul ve esaslarn belirlenmesi olarak belirlenmitir. Bu kapsamda aada dijital bankacln unsurlarna, bu tip bankalarn kurulum s\\xfcre\\xe7lerine, iletilmelerine ve faaliyet snrlarna ilikin bilgi verilecektir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"2.Dijital Bankalarn Kuruluu\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital bankalarn kuruluunda, Bankalarn zne Tabi lemleri ile Dolayl Pay Sahipliine likin Y\\xf6netmelik h\\xfck\\xfcmleri uyarnca, bankalarn kurulularna ilikin artlar ge\\xe7erlidir. Buna g\\xf6re T\\xfcrkiyede bir dijital banka kurulabilmesi, bir banka kurulabilmesinin artlarna bal olup bankann dijital nitelikte olmasna ilikin olarak Dijital Banka Y\\xf6netmeliindeki ilave d\\xfczenlemeler ge\\xe7erli olacaktr. Bu kapsamda dijital banka kurmak isteyen irketler BDDKya bir bavuru dilek\\xe7esi sunacaklardr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Buna g\\xf6re bir dijital bankann kurulumu i\\xe7in gerekli olan temel bilgi ve belgeler aadaki gibidir:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Banka kurulmasndan beklenen fayday analiz eden, yaplacak faaliyetlerin neler olduunu, i\\xe7 denetim, i\\xe7 kontrol ve risk y\\xf6netiminin nasl ger\\xe7ekletirileceini i\\xe7eren i planlar ile bankann yapsal \\xf6rg\\xfctlenmesini g\\xf6steren, kuruluun mali yaps ile ilgili projeksiyonlarnn sermaye yeterliliini de i\\xe7erecek ekilde ortaya konulduu faaliyet program\",\n                        \"Y\\xf6netmelikin EK-1 ve EK-2deki beyannamelerin noter onayl \\xf6rnekleri\",\n                        \"Ortaklk ana s\\xf6zleme tasla,\",\n                        \"Banka ortaklarnn m\\xfcflis olmadklarna, konkordato ilan etmediklerine, yeniden yaplandrma bavurularnn tasdik edilmediine ve haklarnda iflasn ertelenmesi karar verilmediine ilikin ilgili mahkemelerden alnacak belgeler,\",\n                        \"Banka ortaklarnn adli sicil belgeleri,\",\n                        \"Kurucu t\\xfczel kiilerin ortakla ilikin genel kurul veya y\\xf6netim kurullar tarafndan alnm karar \\xf6rnekleri,\",\n                        \"TMSFden temin edilecek ve EK-3te \\xf6rnei verilen belge,\",\n                        \"Ortaklarn faaliyet izni kaldrlan veya TMSFye devredilen baka bir bankada herhangi bir ortaklklar olmadna ilikin beyanlar,\",\n                        \"Kurucu t\\xfczel kiilerin kurulularna ilikin Ticaret Sicil Gazetesi,\",\n                        \"Kurucu t\\xfczel kiilerin ger\\xe7ek kii ortaklara ulalncaya kadar ortaklarnn tamamn ve pay oranlarn g\\xf6steren listesi,\",\n                        \"Kurucu t\\xfczel kiilerin faaliyet konular ve yatrm ve ileme alanlar hakknda detayl a\\xe7klamalar ve YMM tarafndan onaylanm son 3 yla ait bilan\\xe7o ve gelir tablolar,\",\n                        \"Kurucu t\\xfczel kiilerin sermaye grubunun ve bu grubun bal ortaklklarnn son 3 yla ait bilan\\xe7o ve gelir tablolar,\",\n                        \"Ortaklarn g\\xfcncel vergi ve prim borcu olmadna ilikin vergi daireleri ve SGKdan alnacak yaz,\",\n                        \"Kurucularn son 5 yla ilikin gelir ve/veya kurumlar vergisi beyannameleri, sahip olduklar tanmazlara ilikin emlak vergisi beyannameleri, bu tanmazlarn erhleri g\\xf6sterir ekilde takyidatl tapu kaytlar,\",\n                        \"Sermayenin %10 ve fazlasn taahh\\xfct eden kurucularn beyannamelerinde belirttikleri mevduat ve kredi hesaplarna ilikin bilgileri ile bu hesaplarn a\\xe7l bilgilerini i\\xe7eren ilgili bankalardan BDDKya hitaben d\\xfczenlenmi belgeler,\",\n                        \"Sermayenin %10 ve fazlasn taahh\\xfct eden kurucularn mali durumlar hakknda YMM tarafndan d\\xfczenlenmi rapor,\",\n                        \"Bankann y\\xf6netim kurulu \\xfcyeleri ve m\\xfcd\\xfcr\\xfc belirlenmise, bu kiilere ilikin detayl bilgiler,\",\n                        \"Kurucular temsilen yetkili kiilere verilmi vekaletname \\xf6rnekleri,\",\n                        \"Sermayenin 10 ve fazlasn taahh\\xfct eden kurucularn, gerekli kayna nasl temin edeceklerine ilikin EK-4teki \\xf6rnee uygun olarak imzalayacaklar taahh\\xfctname.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Anlan belgelere ek olarak, Dijital Banka Y\\xf6netmeliinde dijital bankalara \\xf6zel olacak ekilde bir ksm bilgi ve belgeler de kurulu i\\xe7in ilave olarak talep edilmektedir. Buna g\\xf6re;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Bavurucunun hakim ortaklarnn teknoloji, elektronik ticaret ya da telekom\\xfcnikasyon hizmetleri sunan t\\xfczel kiiler olmas durumunda, bu kiilerin T\\xfcrkiyede yerleik olmas art koulabilecektir. Bu kurulular bor\\xe7luluk durumu ve mali g\\xfc\\xe7lerine ilikin risk verilerinin paylalmas i\\xe7in Risk Merkezi ile bilgi alverii s\\xf6zlemesi imzalayacak ve bunu da BDDKya sunacaktr.\",\n                        \"Bavurucu, nakden ve her t\\xfcrl\\xfc muvazaadan ari olmak \\xfczere 1 Milyar T\\xfcrk Liras asgari \\xf6denmi sermayeyi g\\xf6stermek zorundadr.\",\n                        \"Dijital Bankann y\\xf6netici pozisyonundaki personelinin dijital bankalarn i modelinin yapsna \\xf6zg\\xfc riskleri anlayacak ve g\\xf6revlerini yerine getirmelerini salayacak yeterli bilgi ve deneyime sahip olup olmadklar dikkate alnacaktr. Buna g\\xf6re bilgi sistemlerinden sorumlu en \\xfcst d\\xfczey y\\xf6netici olarak belirtilen personelin en az genel m\\xfcd\\xfcr yardmcs seviyesinde olmas ve y\\xf6netim kurulu \\xfcyelerinden en az birinin bilgi sistemleri y\\xf6netimi alannda en az 10 yllk mesleki tecr\\xfcbeye sahip olmas art koulmutur.\",\n                        \"Yukarda belirtilen BDDKya sunulacak i plannda ek olarak; -Bavurucunun \\xf6renciler, ev hanmlar, 18 ya alt gen\\xe7ler, KOBler gibi hedef kitlelere ilikin sunaca \\xfcr\\xfcn ve hizmetlere ilikin pazarlama stratejisi, -Hedef kitlenin oluturduu pazarn b\\xfcy\\xfckl\\xfc\\xfc ve pazar boluu analizi, Se\\xe7ilen pazardaki rekabeti salamak ve s\\xfcrd\\xfcr\\xfclebilirlik i\\xe7in gelecek 5 yla ilikin fiyatlama politikas, tahmin edilen m\\xfcteri says, yatrmn ne zaman baa ba noktasna geleceine ilikin finansal projeksiyonlar ve finansal tablolar ile bu tahminlere ilikin saysal analizler de mevcut olmaldr.\",\n                        \"Yukarda belirtilen BDDKya sunulacak faaliyet program dok\\xfcmannda ek olarak; -Sistem ve a mimarisinin genel g\\xf6r\\xfcn\\xfcm\\xfc, - Bankalarn Bilgi Sistemleri ve Elektronik Bankaclk Hizmetleri Hakknda Y\\xf6netmelikin 4. maddesinde d\\xfczenlenen bilgi sistemleri strateji plan, -Bankalarn Bilgi Sistemleri ve Elektronik Bankaclk Hizmetleri Hakknda Y\\xf6netmelikte d\\xfczenlenen bilgi sistemleri riks y\\xf6netimi, bilgi g\\xfcvenlii y\\xf6netimi, bilgi sistemleri proje y\\xf6netimi, bilgi teknolojisi operasyon y\\xf6netimi, eriilebilirlik y\\xf6netimi, bilgi sistemleri s\\xfcreklilik y\\xf6netimi ve d hizmet alm y\\xf6netimine ilikin s\\xfcre\\xe7 d\\xf6kumanlar, -Bilgi sistemlerine ilikin d hizmet alnacaksa bu d hizmet salayclarnn tam listesi ve bunlara ilikin risk deerlendirmesi, -M\\xfcteri talep ve ikayetlerinin alnmasna ilikin sistemin ileyiine ilikin detayl bilgiler, -Elektronik bankaclk hizmetleri datm kanallarnda ilem g\\xfcvenliinin nasl salanaca ve m\\xfcteri kimliinin nasl dorulanacana ilikin datm kanal bilgileri, -Bankalarca Kullanlacak Uzaktan Kimlik Tespiti Y\\xf6ntemlerine ve Elektronk Ortamda S\\xf6zleme likisinin Kurulmasna likin Y\\xf6netmelik h\\xfck\\xfcmleri uyarnca ger\\xe7ekletirilecek kimlik tespiti teknolojilerine ilikin bilgiler ve bu Y\\xf6netmelik uyarnca m\\xfcteri ile kurulacak s\\xf6zlemelerin g\\xfcvenliine ilikin bilgileri de bulunmas gerekmektedir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"B\\xfct\\xfcn bu saylan belgelerin teslimi zorunlu olmakla birlikte BDDK, gerekli g\\xf6rd\\xfc\\xfc ilave belgeleri de bavurucudan talep edebilecektir. Bavurunun ger\\xe7ekletirilmesinin akabinde BDDK incelemelerini yapacak olup bavurusu uygun g\\xf6r\\xfclen kurulua, bavurunun yapld tarihten itibaren en ge\\xe7 3 ay i\\xe7erisinde faaliyet izni verilecektir. Bu izin Resmi Gazetede yaymlanacak ve yaym tarihi itibariyle y\\xfcr\\xfcrl\\xfce girecektir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"3.Dijital Bankann Faaliyet Kapsam ve Kstlamalar\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital Banka Y\\xf6netmeliinin 4. maddesi uyarnca dijital bankalar kural olarak, kredi kurulularnn ger\\xe7ekletirebilecei t\\xfcm faaliyetleri yerine getirebilirler. Baka bir ifadeyle, \\xf6ng\\xf6r\\xfclen kurulu s\\xfcrecini tamamlayan dijital bankalar kural olarak, mevduat bankalar veya katlm bankalarnn y\\xfcr\\xfctt\\xfckleri t\\xfcm faaliyetleri y\\xfcr\\xfctebileceklerdir. Dolaysyla dijital bankalar, kredi kurulularnn tabi olduu t\\xfcm mevzuata tabidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital bankalarn m\\xfcterilerinin kimlerden oluabileceine ilikin olarak Y\\xf6netmelikin 5. maddesinde 'Dijital bankalarn kredi m\\xfcterileri yalnzca finansal t\\xfcketiciler ve KOBler olabilir.' ifadesi mevcuttur. T\\xfcketici ticari bir ama\\xe7 g\\xfctmeksizin ilemler yapan ger\\xe7ek veya t\\xfczel kii olarak tanmlanabileceinden; finansal t\\xfcketici de bireysel ihtiya\\xe7larn karlamak amacyla finansal kurululardan hizmet alan kii olarak tanmlanabilecektir. Bu tanmdan hareketle, \\xf6rnein herhangi bir bankadan bireysel ihtiya\\xe7 kredisi kullanan bir ger\\xe7ek kii finansal t\\xfcketici olup Y\\xf6netmelik h\\xfck\\xfcmleri kapsamnda olacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu noktada belirtmek gerekir ki dijital bankalar yalnzca finansal t\\xfcketiciler ve KOBlere sunacaklar hizmetlerin yannda;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Bankalararas veya para piyasalar ile sermaye piyasalarnda faaliyet g\\xf6stermek suretiyle kredi ilemleri de ger\\xe7ekletirebilir.\",\n                        \"Dier bankalara kredi de kullandrabilir.\",\n                        \"KOB boyutunu aan iletmeler i\\xe7in d\\xf6viz kredisi de kullandrabilir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital bankalar, yalnzca bir genel m\\xfcd\\xfcrl\\xfck ve genel m\\xfcd\\xfcrl\\xfce bal hizmet birimleri olarak tekilatlanabileceklerdir. Buna g\\xf6re, dijital bankalar, acente, temsilci veya fiziken ube a\\xe7amazlar; m\\xfcterilerine fiziken kiralk kasa ve emanete alma ilemleri ile saklama hizmeti sunamazlar. Dijital bankalarn fiziki bir varlklarnn olmamas gerektiine ilikin bu h\\xfck\\xfcmlere istisna olarak Y\\xf6netmelikte, dijital bankalarn m\\xfcteri ikayetleri veya pazarlama hizmetleri i\\xe7in fiziksel b\\xfcrolar oluturmas ise m\\xfcmk\\xfcn klnmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital bankalarn bir m\\xfcterisine kullandrabilecei teminatsz nakdi t\\xfcketici kredisinin toplam, m\\xfcterinin aylk ortalama net gelirinin 4 katn aamayacaktr. M\\xfcterinin aylk ortalama net geliri tespit edilemiyorsa verilecek t\\xfcketici kredisi 10.000-T\\xfcrk Lirasn aamayacaktr. Belirtilmelidir ki bu maddi snrlamaya; dijital bankalarn salayaca kredi kart harcamalar, nakit \\xe7ekimleri ve kredili mevduat hesaplar dahil deildir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"BDDK, sistemik \\xf6nemli banka olarak tanmlad baz bankalara, banka tamponu olarak bulundurduu sermaye orannda deiecek ekilde ilave \\xe7ekirdek sermaye bulundurma y\\xfck\\xfcml\\xfcl\\xfc\\xfc getirmitir. Bu y\\xfck\\xfcml\\xfcl\\xfck, dijital bankalar i\\xe7in de ayn ekilde uygulanacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Belirtmek gerekir ki, dijital banka faaliyet iznini almasn takip eden s\\xfcre\\xe7te, asgari \\xf6denmi sermaye tutarn 1 Milyar T\\xfcrk Lirasndan 2,5 Milyar T\\xfcrk Lirasna \\xe7karrsa BDDK tarafndan bahsi ge\\xe7en kstlamalarn bir ksmnn veya tamamnn kaldrlmasna karar verilebilir. BDDK tarafndan kstlamalarn kaldrlmas ile birlikte dijital banka, standart bir bankann yapabilecei her t\\xfcrl\\xfc faaliyeti ger\\xe7ekletirebilecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"Servis Modeli Bankacl\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"1.Genel Olarak\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dijital bankalarn d\\xfczenlendii Y\\xf6netmelikte bu tip bankalara ek olarak Servis Modeli Bankacl ad verilen bir sistem daha \\xf6ng\\xf6r\\xfclm\\xfct\\xfcr. Bu sistemle bankalarn, bankaclk hizmetlerini banka d irketlerin uygulamalar veya internet siteleri \\xfczerinden m\\xfcterilere sunmas m\\xfcmk\\xfcn hale gelmitir. Uygulamada Banking as a Service (BaaS) olarak da bilinen servis modeli bankacl; bankalarn bankaclk hizmetlerini, banka d irketlerin uygulamalar veya internet siteleri \\xfczerinden m\\xfcterilerine sunmas olarak tanmlanabilecektir. Y\\xf6netmelikte de servis modeli bankaclk; Aray\\xfcz salayclarnn sunduklar aray\\xfcz yoluyla, m\\xfcterilerin servis bankalarnn sistemleriyle dorudan a\\xe7k bankaclk servisleri araclyla balant kurarak servis bankas \\xfczerinden bankaclk ilemlerinin ger\\xe7ekletirebildikleri hizmet modeli olarak tanmlanmtr. Bu h\\xfck\\xfcmden hareketle;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Servis Bankas: Servis modeli bankacl hizmeti sunan bankay,\",\n                        \"Aray\\xfcz Salayc: Mobil uygulamas ya da internet taraycs temelli aray\\xfcz\\xfc \\xfczerinden, servis bankasnn sunduu bankaclk hizmetlerine bankann a\\xe7k bankaclk servisleri yoluyla ulaarak, m\\xfcterilerinin bankaclk ilemlerini ger\\xe7ekletirmesine imk\\xe2n salayan sermaye irketi eklinde kurulmu iletmeleri,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ifade etmektedir. Bu tanmlardan hareketle, dijital bankalarn yannda geleneksel bankalarn da servis bankas olabilmesi m\\xfcmk\\xfcnd\\xfcr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"2.Servis Modeli Bankacln \\xc7alma Prensibi\"\n                },\n                {\n                    type: \"image\",\n                    content: _images_blog_baasModeli_jpg__WEBPACK_IMPORTED_MODULE_2__[\"default\"]\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"API (application programming interface) araclyla bankalarn banka olmayan iletmelere entegre olmas\",\n                        \"\\xd6rnein; Kredi kart kullanmn banka d bir irket olan havayolu firmasnn salad u\\xe7u mili ile entegre etmek\",\n                        \"Sadakat puanlar\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Servis bankasnn aray\\xfcz salaycsnn m\\xfcterisine bankaclk hizmeti sunabilmesi i\\xe7in s\\xf6z konusu m\\xfcteri ile servis bankas arasnda bir s\\xf6zleme ilikisinin mevcut olmas zorunludur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Hizmetin verilecei aray\\xfcz\\xfcn yukarda yer verilen Bankaclk mevzuatna uygunluundan aray\\xfcz salaycs ve servis bankas m\\xfcteselsil sorumlu tutulmutur. Dolaysyla, sistemde bilgi ve ilem g\\xfcvenlii, kimlik dorulama vb. hususlarda yaanabilecek sorunlardan her iki taraf da sorumludur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Aray\\xfcz salayclarn sermaye irketi eklinde kurulmu ve T\\xfcrkiyede yerleik olmas gerekmektedir. Y\\xf6netmelikle bankalarn aray\\xfcz salayc olmas yasaklanmtr; ancak \\xf6deme ve elektronik para kurulular ve dier finansal kurulularn aray\\xfcz salayc olmas m\\xfcmk\\xfcnd\\xfcr. Bir aray\\xfcz salayc birden fazla servis bankas ile \\xe7alabilir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"BaaS hizmetini, faaliyet izni alm normal veya dijital farketmeksizin bankalar, servis bankas olarak sunabilir. Bankalarn servis bankas olarak hizmet verebilmesi i\\xe7in BDDKdan ayrca izin almasna veya faaliyet iznini geniletmesine gerek bulunmamaktadr. Servis bankas aray\\xfcz salayclar ile imzalad her hizmet s\\xf6zlemesinin ve aray\\xfcz salaycya verecei hizmetlerin kapsamnda deiiklik \\xf6ng\\xf6ren her s\\xf6zleme deiikliinin bir \\xf6rneini imza tarihini m\\xfcteakip bir hafta i\\xe7inde yazl olarak BDDKya g\\xf6ndermekle y\\xfck\\xfcml\\xfcd\\xfcr. Servis bankas aray\\xfcz salaycnn b\\xfct\\xfcn m\\xfcterilerine bankaclk hizmeti salamak zorunda deildir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"M\\xfcteriye bankaclk hizmetini servis bankas salayacak ve asl s\\xf6zleme; servis bankas ile m\\xfcteri arasnda imzalanacaktr. Kurulacak bu s\\xf6zleme Bankaclk Kanununa tabi olacaktr. Bu kapsamda, servis bankas ile aray\\xfcz salayc arasnda akdedilen servis bankacl hizmetine ilikin s\\xf6zleme; bu hizmetin verilmesi i\\xe7in yeterli olmayacaktr. Aray\\xfcz salayc s\\xf6z konusu hizmetlerin kendisi tarafndan deil banka tarafndan salanacan a\\xe7k\\xe7a belirtmelidir.\"\n                }\n            ],\n            tags: [\n                \"Dijital Bankaclk\",\n                \"Bankaclk\",\n                \"Servis Modeli Bankacl\",\n                \"Servis Modeli\"\n            ],\n            author: \"Av. Sla Evrim Atar\"\n        },\n        {\n            id: 24,\n            subtitile: \"GDPR KARARI\",\n            date: \"19.04.2024\",\n            title: \"Slovenya Veri Koruma Otoritesi, veri sorumlusunun \\xf6l\\xe7\\xfcs\\xfcz adres paylamn ve silme taleplerini reddetmesini eletirdi ve kamuya eriilemez hale getirmesi y\\xf6n\\xfcnde talimat verdi.\",\n            slug: \"ikametgah-adresinin-olcusuz-bicimde-yayinlanlanmasi-nedeniyle-yaptirim-uygulanmasi\",\n            text: \"Slovenya Veri Koruma Otoritesi, Slovenya Cumhuriyeti Kamu Yasal Kaytlar ve lgili Hizmetler Ajans'nn (AJPES) ilgili kiiye ait daimi ve ge\\xe7ici ikamet edilen \\xfclke yerine a\\xe7k adresini a\\xe7klanmasn \\xf6l\\xe7\\xfcs\\xfcz bularak silme taleplerini reddetmesini eletirdi. Ajans, daimi ve ge\\xe7ici ikamet adreslerinin yaymlanmas y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc vurgulayarak silme hakkna istisna tekil ettiini belirse de Otorite, ikamet adresine ilikin bilgileri yasal dayanak ve \\xf6l\\xe7\\xfcs\\xfcz bir ekilde kamuya a\\xe7k hale getirmesi gerek\\xe7esiyle AJPES'e, 40 g\\xfcn i\\xe7inde kamuya eriilemez hale getirme emri verdi. Slovenya Veri Koruma Otoritesi, Slovenya Cumhuriyeti Kamu Yasal Kaytlar ve lgili Hizmetler Ajans'nn (AJPES) ilgili kiiye ait daimi ve ge\\xe7ici ikamet edilen \\xfclke yerine a\\xe7k adresini a\\xe7klanmasn \\xf6l\\xe7\\xfcs\\xfcz bularak silme taleplerini reddetmesini eletirdi. Ajans, daimi ve ge\\xe7ici ikamet adreslerinin yaymlanmas y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc vurgulayarak silme hakkna istisna tekil ettiini belirse de Otorite, ikamet adresine ilikin bilgileri yasal dayanak ve \\xf6l\\xe7\\xfcs\\xfcz bir ekilde kamuya a\\xe7k hale getirmesi gerek\\xe7esiyle AJPES'e, 40 g\\xfcn i\\xe7inde kamuya eriilemez hale getirme emri verdi.\",\n            dynamicContent: [\n                {\n                    type: \"pragraph\",\n                    content: \"Slovenya Veri Koruma Otoritesi, Slovenya Cumhuriyeti Kamu Yasal Kaytlar ve lgili Hizmetler Ajans'na, GDPR Madde 17 uyarnca ilgili kiinin silme talebine uymasn emretmitir. Ulusal yasalara aykr olarak, Ajans ikayet\\xe7inin sadece ikamet ettii \\xfclke yerine tam adresini yaynlamt.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kii, Slovenya Cumhuriyeti Kamu Yasal Kaytlar ve lgili Hizmetler Ajans AJPES'in (veri sorumlusu), Slovenya letme Sicili'nde (PRS) \\xe7evrimi\\xe7i olarak, herhangi bir yasal dayanak olmakszn, ilgili kiinin daimi ve ge\\xe7ici ikamet adresine ilikin bilgileri kamuya sunduunu belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kii ayrca, 22 ubat 2023 ve ardndan 24 ubat 2023 tarihlerinde kiisel verilerle ilgili olarak e-posta yoluyla bir silme talebi g\\xf6nderdiini ve bu taleplerin veri sorumlusu tarafndan reddedildiini ileri s\\xfcrm\\xfct\\xfcr. Bu nedenle, 27 Mart 2023 tarihinde, ilgili kii Slovenya Veri Koruma Otoritesi'ne bir ik\\xe2yette bulunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu nedenle Veri Koruma Otoritesi, ikayet\\xe7inin kiisel verilerin ilenmesinin hukuka uygunluuna ilikin talebine dayanarak veri sorumlusuna kar denetim prosed\\xfcr\\xfcn\\xfc balatmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lemlerin balatlmasnn ardndan veri sorumlusu, Ulusal Kara Para Aklama ve Ter\\xf6r\\xfcn Finansmannn \\xd6nlenmesi Kanunu'nun (Kanun) 51. Maddesinin, Kanun'un 43. Maddesi ile balantl olarak, 2016 ylndan bu yana, daimi ve ge\\xe7ici ikametgahlarna ilikin bilgiler de dahil olmak \\xfczere, PRS'de kaytl kurulularn verilerinin kamuya a\\xe7klanmasn gerektirdiini belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Slovenya Veri Koruma Otoritesi, veri sorumlusunun, Kanun'un 43. maddesi ile balantl olarak Kanun'un 51. maddesine dayanarak, ikayet\\xe7inin daimi ve ge\\xe7ici ikamet adresi de dahil olmak \\xfczere kiisel verilerini kamuya a\\xe7klamakla y\\xfck\\xfcml\\xfc olduunu g\\xf6zlemlemitir. B\\xf6yle bir y\\xfck\\xfcml\\xfcl\\xfck daha sonra GDPR Madde 17(3)(b) uyarnca silme hakk i\\xe7in hari\\xe7 tutma gerek\\xe7esine yol a\\xe7acaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bununla birlikte, Veri Koruma Otoritesi, veri sorumlusunun yalnzca ikayet\\xe7inin ikamet ettii \\xfclkeyi deil, ayn zamanda s\\xf6z konusu ulusal mevzuat kapsamnda gerekli olmayan adresi de yaynladn belirtmitir. Bu arada, Kanun'un 51(1) maddesi, belirli bir adresin deil, daimi ve ge\\xe7ici ikamet edilen \\xfclkenin a\\xe7klanmasn \\xf6ng\\xf6rmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dolaysyla veri sorumlusu, ikayet\\xe7inin daimi ve ge\\xe7ici ikamet adresine ilikin bilgileri yasal bir dayanak olmakszn kamuya a\\xe7k hale getirerek GDPR'nin 6. maddesini ihlal etmitir. Yasal bir dayanan bulunmamas nedeniyle, veri sorumlusu ayrca ikayet\\xe7inin s\\xf6z konusu verilerin silinmesi talebini hukuka aykr bir ekilde reddederek GDPR Madde 17(1)'i ihlal etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"GDPR Madde 58(2)(d) uyarnca, Veri Koruma Otoritesi, veri sorumlusunun kararn tebli edildii tarihten itibaren 40 g\\xfcn i\\xe7erisinde ikayet\\xe7inin PRS'deki verilerini kamuya eriilemez hale getirerek usuls\\xfczl\\xfckleri d\\xfczeltmesini emretmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"\",\n                    href: \"https://gdprhub.eu/index.php?title=IP_%28Slovenia%29_-_07141-9%2F2023%2F10&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"dataprotection\",\n                \"privacy\",\n                \"dataprocessing\",\n                \"datasecurity\"\n            ]\n        },\n        {\n            id: 23,\n            subtitle: \"GDPR KARARI\",\n            date: \"17.04.2024\",\n            title: \"Romanya Veri Koruma Otoritesi, ticari ileti g\\xf6nderilmesine itiraz edilmesine ramen ileti g\\xf6nderilmeye devam edilmesi sebebiyle 1.000 Euro para cezas verdi.\",\n            slug: \"itiraza-ragmen-ticari-ileti-gonderilmesi-nedeniyle-yaptirim-uygulanmasi\",\n            text: \"lgili kiinin ikayeti \\xfczerine Romanya Veri Koruma Otoritesi, itiraz edilmesine ramen ticari ileti g\\xf6nderiminin durdurulmamas ve ilgili kiiye talep tarihinden itibaren bir ay i\\xe7inde cevap verilmemesi nedenleriyle veri sorumlusunun GDPR Madde 12(3) ve Madde 21i ihlal ettiini tespit etmitir. Veri sorumlusuna 1.000 Euro para cezas vermi ve irketin ilgili kii bavurularna ilikin prosed\\xfcr\\xfcn\\xfc deitirmesi y\\xf6n\\xfcnde \\xf6nlem almas gerektiine karar vermitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Romanya Veri Koruma Otoritesi, Tensa Art Design SA hakknda soruturma balatm ve GDPR Madde 12(3) ve 21i ihlal ederek bir ilgili kiinin ticari iletileri alma itirazna yant vermediini tespit etmitir. Veri Koruma Otoritesi, veri sorumlusuna 1.000 Euro tutarnda bir para cezas uygulamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu Tensa Art Design SA iinin bir par\\xe7as olarak ticari iletiler g\\xf6nderen ve g\\xf6zl\\xfck, g\\xfcne g\\xf6zl\\xfc\\xfc ve kontakt lens satan bir g\\xf6zl\\xfck firmasdr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bir ilgili kii, b\\xfclten aboneliinden \\xe7karak GDPR Madde 21de \\xf6ng\\xf6r\\xfcld\\xfc\\xfc \\xfczere ticari iletileri almaya itiraz etmitir. Ancak, veri sorumlusu ilgili kiinin telefon numarasna SMS yoluyla sk sk ticari iletiler g\\xf6ndermeye devam etmitir. Sonu\\xe7 olarak, ilgili kii Romanya Veri Koruma Otoritesine (Veri Koruma Otoritesi) ikayette bulunmu ve Veri Koruma Otoritesi'nin konuyu aratrmasn istemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"GDPR Madde 21 uyarnca ilgili kiilerin, GDPR Madde 6(1)(e) (kamu yarar) veya GDPR Madde 6(1)(f) (meru menfaat) yasal dayanaklarna dayanarak yaplan ilemlere itiraz etme hakk olduu belirtilmitir. Ayrca, GDPR Madde 21(2)nin, ilgili kiilere dorudan pazarlama ama\\xe7l ilemeye itiraz etme hakkn da verdii \\xf6zellikle vurgulanmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Soruturma srasnda Veri Koruma Otoritesi, veri sorumlusunun ilgili kiinin talebine GDPR Madde 12(3) ve GDPR Madde 21 uyarnca ilgili kiinin talebini madde h\\xfck\\xfcmlerine uygun olarak \\xe7\\xf6z\\xfcme kavuturduu sonucuna varlabilecek bir delil sunmadn ve itiraz hakknn kullanlmasnn ardndan alnan \\xf6nlemlere ilikin olarak ilgili kiiye talep tarihinden itibaren bir ay i\\xe7inde bir cevap vermediini tespit etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri Koruma Otoritesi, veri sorumlusunun ilgili kiinin itirazna sayg g\\xf6stermeyerek GDPR Madde 12(3) ve Madde 21'i ihlal ettiine karar vermitir. Veri Koruma Otoritesi, GDPR Madde 58(2)(i) uyarnca yetkilerine dayanarak veri sorumlusuna 1.000 Euro (4.947,9 RON) para cezas vermitir. Ayrca GDPR Madde 58(2)(d)ye dayanarak Veri Koruma Otoritesi, kiisel verilerin ilenmesinin GDPR kapsamndaki ilgili kiilerin haklarna sayg g\\xf6stermesini salamak i\\xe7in veri sorumlusunun irket d\\xfczeyinde mevcut prosed\\xfcrleri deitirmek i\\xe7in gerekli \\xf6nlemleri almasn ve bunlar \\xe7alanlara iletmesini emretmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Karar\",\n                    href: \"https://gdprhub.eu/index.php?title=ANSPDCP_(Romania)_-_Fine_against_Tensa_Art_Design_SA&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"dataprotection\",\n                \"privacy\",\n                \"dataprocessing\",\n                \"datasecurity\"\n            ]\n        },\n        {\n            id: 22,\n            subtitle: \"IAPP HABERLER\",\n            date: \"16.04.2024\",\n            slug: \"iapp-haberleri-9-16-nisan-2024\",\n            title: \"Haftalk IAPP Haberleri 9 - 16 Nisan 2024\",\n            text: \"D\\xfcnya Genelinde Kiisel Verilere likin G\\xfcncel Gelimeler\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1. Fransa Veri Koruma Otoritesi (CNIL) tarafndan, bir irkete \\xfc\\xe7\\xfcnc\\xfc kiilere spam mesajlar yollad gerek\\xe7esi ile 525.000 Euro tutarnda idari para cezas verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNIL tarafndan, maazalarnda satlan \\xfcr\\xfcnleri tantmak amacyla ilgili kiileri arayan ve mesajlar atan teknoloji tedarik\\xe7isi Hubside.Store'a 525.000 Euro tutarnda idari para cezas verildi. CNIL tarafndan, irketin potansiyel m\\xfcterilerin kiisel verilerini veri komisyoncularndan satn ald ve promosyan iletilerinin g\\xf6nderilmesi adna ilgili kiilerden  ge\\xe7erli bir rza alnmad \\xf6ne s\\xfcr\\xfcld\\xfc.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cnil-fines-technology-store-chain-for-unsolicited-calls-texts-sent-to-prospective-customers/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. ABD Federal letiim Komisyonu (FCC) tarafndan, aile i\\xe7i iddet madurlarnn korunmas i\\xe7in ek \\xf6nlemler alnmas \\xf6nerildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"FCC tarafndan; aile i\\xe7i iddet madurlarn ara\\xe7 i\\xe7i bilgi sistemlerinden kaynaklanacak muhtemel mahremiyet risklerinden korumay ama\\xe7layan 2022 G\\xfcvenli Balantlar Yasas i\\xe7in ek h\\xfck\\xfcmler \\xf6nerildi. FCC Bakan Jessica Rosenworcel tarafndan, 'Aile i\\xe7i iddet ve istismardan kurtulan hi\\xe7bir madur, araba kullanmndan vazge\\xe7me ile ara\\xe7 i\\xe7i balantlar vastasyla takip edilme ve zarar g\\xf6rme arasnda bir tercih yapmak zorunda kalmamaldr.' a\\xe7klamas yapld.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/fcc-proposes-additional-rules-to-protect-domestic-abuse-survivors/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. Mastercard tarafndan mahremiyeti tevik eden teknolojilere ilikin rehber yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mastercard tarafndan, mahremiyetin tevik edilmesi ile arttrlmasn ama\\xe7layan ve finans sekt\\xf6r\\xfcndeki g\\xfcvenlik risklerinin azaltlmas adna ilgili teknolojilerin kullanlmasnn \\xf6nemini vurgulayan bir rehber yaymland. Mastercard tarafndan; yenilik\\xe7i mahremiyet \\xe7\\xf6z\\xfcmlerinin  s\\xfcrd\\xfcr\\xfclmesi i\\xe7in, mahremiyeti tevik eden teknolojilerinin kullanmnn artrlmas  hususunda kanun koyucular ile kurulularn ibirlii yapmas gerektii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/mastercard-releases-pets-guide/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. G\\xfcney Kore Veri Koruma Otoritesi (PIPC) tarafndan uluslararas iletmeler i\\xe7in uyum rehberi yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"PIPC tarafndan, uluslararas iletmelerin G\\xfcney Kore Kiisel Verileri Koruma Yasas'na uyum salamalarna yardmc olmas amacyla bir rehber yaymland. lgili rehberde, iletmeler tarafndan g\\xf6z ard edilmi olabilecei gerek\\xe7esiyle 2023 ylnda yasada yaplm olan deiikliklere odaklanld. \"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/south-korea-puts-out-personal-information-guide-for-oversea-biz/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. Danimarka Veri Koruma Otoritesi tarafndan yurtd veri aktarm rehberi g\\xfcncellendi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Danimarka Veri Koruma Otoritesi tarafndan, yurtdna kiisel veri aktarmlarnn nasl yaplmas gerektiine ilikin mevcut rehber g\\xfcncellendi. lgili rehberde, Avrupa Veri Koruma Kurulu ve Avrupa Komisyonu tarafndan yaplm olan yeni d\\xfczenlemelere de yer verildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/norway-dpa-updates-data-transfer-guidance-for-third-countries/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6. Fransa Parlamentosu ve Avrupa Birlii Siber G\\xfcvenlik Ajans (ENISA) tarafndan bulut egemenlii ele alnacak.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Euractiv'in haberine g\\xf6re Fransz Parlamentosu \\xfcyeleri tarafndan SREN dijital yasa tasarsnn bulut egemenliine ilikin h\\xfck\\xfcmlerinin oylanaca belirtildi. ENISAnn, AB siber g\\xfcvenlik sertifikasyon program araclyla, bulut g\\xfcvenlii \\xf6zelindeki gelimeleri onaylamasnn beklendii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/french-parliament-eu-to-vote-on-cloud-sovereignty/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7. Ele ge\\xe7irilen \\xfc\\xe7\\xfcnc\\xfc taraf \\xe7erez bilgilerinin bilgisayar korsanlarnn verileri dorulamasna olanak salayabilecei belirtildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"MediaPost'un haberine g\\xf6re, bilgisayar korsanlarnn; \\xfc\\xe7\\xfcnc\\xfc taraf \\xe7erezlerin analiz edilmesi ve ifre olmadan \\xe7evrimi\\xe7i hesaplara giri yaplmas suretiyle, hukuka aykr olarak ele ge\\xe7irilen verileri dorulayabilecei ifade edildi. NordVPN G\\xfcvenlik Danma Kurulu \\xdcyesi Adrianus Warmenhoven tarafndan; aktif bir \\xe7erezin ele ge\\xe7irilmesi durumunda, saldrgann hesap ifresine sahip olmadan veya \\xe7ok fakt\\xf6rl\\xfc kimlik dorulamaya ihtiya\\xe7 duymadan kullanc hesaplarna giri yapabilecei belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/stolen-cookies-could-allow-hackers-to-verify-data/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8. Hong Kong Veri Koruma Otoritesi (PCPD) tarafndan Cyberport siber saldrsna ilikin soruturma raporu yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"PCPD tarafndan, Cyberport'a yaplan ve 13.000 kiiyi etkileyen siber saldrya ilikin soruturma raporu yaymland. PCPD tarafndan; Cyberport'un, olayn ger\\xe7eklemesinden \\xf6nce, bilgi sistemlerinin g\\xfcvenliinin salanmas adna yeterli teknik ve idari tedbirleri uygulamad ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/pcpd-says-releases-report-on-cyberport-cyberattack/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9. Avrupa Parlamentosu tarafndan Avrupa Birlii Genel Veri Koruma T\\xfcz\\xfc\\xfc (GDPR)ne ilikin yeni usul d\\xfczenlemeleri kabul edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avrupa Parlamentosu tarafndan, GDPRn uygulanmasna ilikin yeni usul d\\xfczenlemeleri kabul edildi. Bahse konu d\\xfczenlemelerin; veri koruma otoriteleri arasndaki ibirlii d\\xfczeyini artrarak AB \\xfcye \\xfclkeleri arasndaki veri aktarm y\\xf6ntemlerini yeknesaklatrmay, uyumazlk \\xe7\\xf6z\\xfcm mekanizmalarn gelitirmeyi ve usul kurallar ile haklar uyumlu hale getirmeyi ama\\xe7lad belirtildi. S\\xf6z konusu d\\xfczenlemelerin Haziran aynda AB genelinde yaplacak se\\xe7imlerin ardndan g\\xf6reve balayacak olan Avrupa Parlamentosu tarafndan ele alnmasnn beklendii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/european-parliament-agrees-to-new-eu-gdpr-procedural-rules/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10. Avrupa Birlii Adalet Divan (ABAD) tarafndan Hessen Veri Koruma Otoritesinin ilgili kii ikayeti \\xfczerine harekete ge\\xe7mediine karar verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avrupa Birlii Adalet Divan Basavcs tarafndan; bir vatandan kiisel verilerine yerel bir tasarruf bankas \\xe7alan tarafndan ilgili kiinin rzas olmakszn eriilmesine y\\xf6nelik Hessen Veri Koruma Otoritesinin herhangi bir idari yaptrm uygulamad belirtildi. Basavc tarafndan; Otoritenin harekete ge\\xe7mekle y\\xfck\\xfcml\\xfc olduu ve verilerin hukuka aykr olarak ilendiinin bildirilmesi \\xfczerine ihlali gidermek i\\xe7in en uygun idari tedbir ile yaptrmlarn uygulanmasna ilikin karar verilmesi gerektii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cjeu-advocate-general-rules-german-state-dpa-failed-to-sanction-bank-for-personal-data-breach/\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"news\",\n                \"dataprotection\",\n                \"privacy\",\n                \"datasecurity\"\n            ]\n        },\n        {\n            id: 21,\n            subtitle: \"GDPR KARARI\",\n            date: \"11.04.2024\",\n            slug: \"veri-sorumlusundan-izinsiz-alt-veri-isleyen-gorevlendirilmesi\",\n            title: \"talya Veri Koruma Otoritesi, veri sorumlusunun izni olmadan alt veri ileyen g\\xf6revlendirdii ve veri ihlalini veri sorumlusuna ge\\xe7 bildirdii i\\xe7in veri ileyene 800.000 Avro para cezas verdi.\",\n            text: \"Veri sorumlusunun m\\xfcterilerine sunduu mobil bankaclk portalna bir siber saldr yaplm, 777.765 ilgili kii bu saldrdan etkilenmitir. Mobil web sayfas ve uygulamas \\xfczerinde g\\xfcvenlik a\\xe7 testleri yapmakla g\\xf6revli veri ileyen hem veri sorumlusundan izin almakszn alt veri ileyen g\\xf6revlendirerek hem de meydana gelen veri ihlalini veri sorumlusuna bildirmeyerek yasal/s\\xf6zlemesel y\\xfck\\xfcml\\xfcl\\xfcklerini gerei gibi yerine yerine getirmemitir. Bunun \\xfczerine Otorite veri ileyene 800.000 Avro para cezas vermitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"22 Ekim 2018 tarihinde, UniCredit S.p.A. ('veri sorumlusu') 11 Ekim ile 21 Ekim 2018 tarihleri arasndaki d\\xf6nemde meydana gelen bir kiisel veri ihlalini talyan DPA'ya (DPA) bildirmitir. hlal, veri sorumlusunun m\\xfcteriler i\\xe7in olan mobil bankaclk portalna yaplan bir siber saldr nedeniyle meydana gelmitir. \\xdc\\xe7\\xfcnc\\xfc taraflar, otomatik olarak oluturulan basit PIN kodlarn deneyerek m\\xfcteri hesaplarna erimeye \\xe7almtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mobil bankaclk portalnn, ihlali kolaylatran iki g\\xfcvenlik a\\xe7 bulunmutur: \"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Birincisi, portal m\\xfcterilerin kiisel verilerini (ad, soyad, vergi kodu ve dahili banka kimlik kodu) kimlik dorulama giriimlerine verilen HTML yantlarnda, giriimlerin baarsz olduu durumlar da dahil olmak \\xfczere kullanma sunmutur.\",\n                        \"kinci olarak, veri sorumlusu basit PIN'lerin kullanmn snrlamam ve hesaplar m\\xfcteri giri bilgilerini tanmlamay ama\\xe7layan siber saldrlara (kaba kuvvet saldrlar) kar savunmasz hale getirmitir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"HTML yant a\\xe7 nedeniyle, her oturum a\\xe7ma giriimi siber saldrganlarn 777.765 mevcut ve eski m\\xfcterinin adlarna, vergi numaralarna/kodlarna ve dahili banka kimlik kodlarna eriim salamasna sebep olmutur. Bu m\\xfcterilerden 6.959'u bakmndan, siber saldrganlar portal PIN'lerini de baaryla tespit etmi, veri sorumlusu daha sonra tespit edilen PIN'leri bloke etmitir. hlal, ilgili kiilerin bankaclk verilerini i\\xe7ermemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu, GDPR Madde 34 uyarnca ihlali y\\xfcksek riskli olarak deerlendirmemitir. Web sitesinde genel bir bildirim yaynlam ve yalnzca ifreleri tespit edilen 6.959 ilgili kiiye dorudan bildirimde bulunmutur. DPA, bir \\xf6n incelemenin ardndan ihlalin ilgili kiilerin haklar a\\xe7sndan y\\xfcksek risk tekil edebileceini tespit ederek bu g\\xf6r\\xfce katlmamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu, savunmasnda ihlalin NTT Data Italia S.p.A.'nn ('veri ileyen') ihmali sonucu meydana geldiini ileri s\\xfcrm\\xfct\\xfcr. Veri ileyen, Truel IT S.r.l. ('alt veri ileyen') ile birlikte veri sorumlusunun mobil web sayfas ve uygulamas \\xfczerinde g\\xfcvenlik a\\xe7 testleri yapmakla g\\xf6revlendirilmitir. Alt veri ileyen, veri sorumlusunun \\xf6nceden yazl izni olmakszn g\\xf6revlendirilmitir ve 10 Ekim 2018 tarihinde mobil portaln g\\xfcvenlik a\\xe7klarndan alt veri ileyen haberdar olmutur. Alt veri ileyen g\\xfcvenlik a\\xe7klarn y\\xfcksek seviye olarak tanmlam ve 19 Ekim 2018 tarihinde veri ileyene bildirmi, veri ileyen ise bu g\\xfcvenlik a\\xe7klarn 22 Ekim 2018 tarihine kadar veri sorumlusuna bildirmemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"DPA, bir kiisel veri ihlali durumunda, kiisel verilerin korunmasna ilikin genel sorumluluk veri sorumlusunda olmasna ramen; veri ileyenin, veri sorumlusunun kiisel veri ihlallerinin bildirilmesine ilikin olanlar da dahil olmak \\xfczere GDPR'nin 32. ila 36. maddelerinde belirtilen y\\xfck\\xfcml\\xfcl\\xfckleri derhal ve yeterli bir ekilde yerine getirmesini salamada hala temel bir rol oynadn deerlendirmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xd6zellikle, GDPR Madde 33(2) uyarnca, bir kiisel veri ihlali durumunda, veri ileyenin ihlalden haberdar olduktan sonra gecikmeksizin veri sorumlusunu bilgilendirmesi gerekmektedir. DPA, GDPR kapsamnda kiisel veri ihlallerinin bildirilmesine ilikin 9/2022 sayl Rehbere atfta bulunarak, veri ileyenin 'veri sorumlusuna derhal bildirimde bulunmasn ve akabinde ortaya \\xe7kan ihlal hakknda daha fazla bilgi vermesini' tavsiye etmitir; bu bildirimin, 'veri sorumlusunun denetim makamna 72 saat i\\xe7inde bildirimde bulunma y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc' yerine getirmesine yardmc olmak i\\xe7in \\xf6nemli olduunu belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"DPA, ihlal alt veri ileyen tarafndan tespit edilmi olmasna ramen, GDPR Madde 33(2) kapsamnda veri sorumlusunu bilgilendirme y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfcn, veri sorumlusuna bilgilendirme yapmadan \\xf6nce ihlalden kaynaklanan riski deerlendirmesi gerekmeyen ilk veri ileyende kaldn eklemitir. DPA'ya g\\xf6re, veri ileyenin veri sorumlusunu 11 veya 12 Ekim 2018 gibi erken bir tarihte bilgilendirmesi gerekirken veri ileyen, veri sorumlusuna 22 Ekim 2018 tarihine kadar bildirimde bulunmayarak GDPR Madde 33(2)'yi ihlal etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Buna ek olarak, DPA, veri ileyenin veri sorumlusundan \\xf6nceden izin almadan baka bir veri ileyeni g\\xf6revlendirdiini ve bu nedenle GDPR Madde 28(2)'de belirtilen y\\xfck\\xfcml\\xfcl\\xfc\\xfc ihlal ettiini belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yukarda belirtilen hususlara dayanarak, DPA veri ileyene 800.000 Avro para cezas vermitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylarna ulamak i\\xe7in tklaynz.\",\n                    href: \"https://gdprhub.eu/index.php?title=Garante_per_la_protezione_dei_dati_personali_%28Italy%29_-_9991064&mtc=today \"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"garante\",\n                \"databreach\",\n                \"subprocessor\",\n                \"personaldata\"\n            ]\n        },\n        {\n            id: 20,\n            subtitle: \"GDPR KARARI\",\n            date: \"05.04.2024\",\n            title: \"spanya Ulusal Mahkemesi, \\xfclkenin Veri Koruma Otoritesi tarafndan BBVA Bankasna verilen 5.000.000 Euro tutarndaki para cezasn iptal etti.\",\n            slug: \"otoritenin-sikayet-konusundan-bagimsiz-sorusturma-yurutmesi\",\n            text: \"spanya Ulusal Mahkemesi, \\xfclkenin Veri Koruma Otoritesi (Otorite) tarafndan BBVA Bankasna verilen 5.000.000 Euro tutarndaki para cezasn iptal etmitir. Banka tarafndan, Otoritenin bankann veri ileme faaliyetleriyle veri koruma politikasna y\\xf6nelik genel soruturma balatmak i\\xe7in bireysel ikayetleri bahane olarak kulland iddia edilmitir. Mahkeme incelemesi srasnda bir Y\\xfcksek Mahkeme kararna atf yaparak, Otoritenin ikayetlerde bildirilen olgular incelemedii, bu olgularla ilgili kantlarn deerlendirmesini yapmad ve olgular veri koruma politikasyla ilikilendirmedii gerek\\xe7eleriyle h\\xfck\\xfcm kurmutur. Mahkeme ilgili kii ikayetlerini incelerken ikayet konusu olgular ile bal kalmak y\\xfck\\xfcml\\xfcl\\xfc\\xfcne uygun hareket etmedii gerek\\xe7esiyle, Otoriteyi s\\xf6z konusu olgular veya 'ikayetin konusunu' aratrmakla snrlandrmtr. Mahkeme tarafndan, ikayet kapsamnda bireysel ihlal kantlanmamken bankann veri koruma politikasnn t\\xfcm m\\xfcterilerin haklarn ihlal ettii sonucuna varlmamas gerektii gerek\\xe7esiyle ilgili para cezasnn iptaline h\\xfckmedilmitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"spanya Ulusal Mahkemesi ('Mahkeme') BBVA Bankasna verilen milyonlarca liralk para cezasn iptal etmitir. Mahkeme, Veri Koruma Otoritesinin ('Otorite') ikayetlerde bildirilen olgularn \\xf6tesine ge\\xe7mesi ve bankann veri koruma politikas hakknda genel bir soruturma y\\xfcr\\xfctmesi nedeniyle idari yaptrm prosed\\xfcr\\xfc ilkelerinin ihlal edildiine karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu karar, Otoritenin BBVA Bankasnn GDPR 6., 13. ve 14. maddelerini ihlal ettii gerek\\xe7esiyle bankaya kesmi olduu 5.000.000 Euro tutarnda para cezas karsnda yapm olduu temyiz bavurusu sonucu verilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Banka, temyiz bavurusu kapsamnda ele ald dier hususlarn yan sra, Otorite tarafndan y\\xfcr\\xfct\\xfclen soruturmann amac ile ilgili kiiler tarafndan yaplan ikayetler arasnda bir balant olmadn iddia etmitir. Banka tarafndan Otoritenin bankann uygulamalarna ve veri koruma politikasna y\\xf6nelik bir t\\xfcr genel inceleme balatmak i\\xe7in belirli ve bireysel iddia ve ikayetleri bir bahane olarak kulland iddia edilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mahkeme, bankann baz arg\\xfcmanlarn reddederken, yaplan ikayetler ile otoritenin vermi olduu nihai karar arasnda kopukluk olduunu kabul etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mahkeme, GDPR madde 57(1)(f)'nin Otoriteye veri sorumlusunun kiisel veri ileme faaliyetlerindeki mevcut durumu veya ikayet konusunu soruturma imkan verdiini vurgulamtr. Ancak Mahkeme, bu imkann veri koruma politikasna ilikin genel bir soruturma y\\xfcr\\xfct\\xfclmesini kapsamayacan deerlendirmitir. Mahkeme gerek\\xe7esinde, Otorite kapsamnda idari yaptrm prosed\\xfcr\\xfc ilkelerinin uygulanmasna y\\xf6nelik kriterlerin belirlendii 23 Nisan 2019 tarihli \\xf6nceki kararlarndan birine (Rec. 88/2017) atfta bulunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xf6z konusu davada; Mahkeme, Otoritenin:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"(i) ikayetlerde bildirilen olgular incelemedii;\",\n                        \"(ii) bu olgularla ilgili olarak kantlarn bir deerlendirmesini yapmad ve\",\n                        \"(iii) olgular veri koruma politikas belgesiyle ilikilendirmedii sonucuna varmtr.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otoritenin veri koruma politikasna ilikin genel bir soruturma a\\xe7tn tespit eden Mahkeme'nin g\\xf6r\\xfc\\xfcne g\\xf6re, Otorite, ilgili kii ikayetlerinin olgular ile bal kalmak y\\xfck\\xfcml\\xfcl\\xfc\\xfcne uygun hareket etmemitir. Bu nedenle, Otorite Mahkemenin karar ile  s\\xf6z konusu olgular veya 'ikayetin konusunu' aratrmakla snrlandrlmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mahkeme, spanya Anayasas'nn 25(1) maddesinde \\xf6ng\\xf6r\\xfclen yasallk ilkesine atfta bulunmu ve bu ilkenin 'yasad davranlarn ve bunlara karlk gelen yaptrmlarn normatif olarak \\xf6nceden belirlenmesinin zorunlulua d\\xf6n\\xfct\\xfc\\xfc' bir Y\\xfcksek Mahkeme i\\xe7tihadna atfta bulunmutur. Atfta bulunulan kararda Y\\xfcksek Mahkeme, GDPR veya dier veri koruma mevzuat potansiyel ihlalleri cezalandrmadndan, yalnzca veri koruma politikasnn varlnn herhangi bir somut ihlale karlk gelmediini belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mahkeme ayrca, masumiyet karinesi ilkesine gerektii gibi sayg g\\xf6sterilmesi i\\xe7in olaylara ilikin kantlarn deerlendirilmesinin Otoritenin yetkisi dahilinde olduuna karar vermitir. Mahkeme kararnda, bu davada Otoritenin ikayetlerle ilgili kantlanm olgular ele aldna ancak nihai kararnda bu ger\\xe7ekleri deerlendirmediine dikkat \\xe7ekmitir. Mahkeme kararnda, bireysel bir veri ihlali kantlanmamsa, veri koruma politikasnn t\\xfcm m\\xfcterilerin haklarn ihlal ettii sonucuna da varlmamas gerektii sonucuna varmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu nedenlerle Mahkeme, Otoritenin kararn hukuka uygun olmad gerek\\xe7esiyle iptal etmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Kararn detaylarna ulamak i\\xe7in tklaynz.\",\n                    href: \"https://gdprhub.eu/index.php?title=AN_-_0000104/2021&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"BBVA\",\n                \"bank\",\n                \"dataprotection\",\n                \"datapolicy\"\n            ]\n        },\n        {\n            id: 19,\n            subtitle: \"IAPP HABERLER\",\n            date: \"01.04.2024\",\n            slug: \"iapp-haberleri-5-nisan-2024\",\n            title: \"Haftalk IAPP Haberleri 1 - 5 Nisan 2024\",\n            text: \"D\\xfcnya Genelinde Kiisel Verilere likin G\\xfcncel Gelimeler\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1. Almanya Salk Bakanl tarafndan Salk Verileri Kullanm Yasas'nn y\\xfcr\\xfcrl\\xfce girdii duyuruldu.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Almanya Salk Bakanl tarafndan, Salk Verileri Kullanm Yasas'nn 26 Mart tarihinde y\\xfcr\\xfcrl\\xfce girdii duyuruldu. Bahse konu yasann ila\\xe7 irketlerine, aratrma amacyla hastalarn salk verilerine eriim izni verilerek salk aratrmalarn ilerletmeyi ama\\xe7lad ifade edildi. Yasa ile birlikte; verilerin aratrmaclara takma adlatrlarak/ps\\xf6donim ekilde sunulaca ve hasta mahremiyetinin ihlal edilmesi halinde idari para cezalar verilecei belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/german-ministry-announces-the-enactment-of-the-health-data-use-act/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. Googlen gizlilik davasnda uzlalmas adna  kullanc verilerini silecei a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The Wall Street Journal'n haberine g\\xf6re Google tarafndan, ABD'de a\\xe7lan bir davadaki uzlamann par\\xe7as olarak Chromeun gizli sekme modu \\xfczerinden toplanan verilerin yok edilecei a\\xe7kland. Ayrca Google'n gizli sekme modu vastasyla toplad kullanc verilerini g\\xfcncellemesi ve gizli sekme modu \\xf6zelinde, kullanclarn \\xfc\\xe7\\xfcnc\\xfc taraf \\xe7erezleri varsaylan olarak engellemelerine imkan verecek deiikliklerin ger\\xe7ekletirilmesi gerektii ifade edildi. Tazminatlar ilgili uzlama kapsamna dahil edilmemi olmakla birlikte, bu durumun kullanclarn bireysel tazminat alacaklar i\\xe7in talepte bulunmalarna imkan tanmakta olduu ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/google-promises-to-delete-user-data-to-settle-privacy-lawsuit/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. talya Veri Koruma Otoritesi (Garante) tarafndan, \\xe7alan gizlilii ihlalleri nedeniyle atk imha irketlerine ceza verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Garante tarafndan, \\xe7alanlarn ie devam durumunu tespit etmek i\\xe7in y\\xfcz tanma teknolojisini kullandklar iddiasyla be atk imha irketine para cezas verildi. Garante tarafndan ilgili irketlerin; s\\xf6z konusu biyometrik verileri silme ve \\xe7alanlarn ie devam durumu ile puantaj kaytlarnn  kontrol edilmesi i\\xe7in daha az m\\xfcdahaleci sistemler kullanma y\\xf6n\\xfcnde talimatlandrld ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/italys-dpa-says-fines-waste-disposal-companies-over-employee-privacy-violations/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. Finlandiya Veri Koruma Otoritesi tarafndan, Pozitif Kredi Sicili uygulamasna ilikin rehber yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Finlandiya Veri Koruma Otoritesi tarafndan, Pozitif Kredi Sicili kapsamnda ilenecek olan  kiisel verilere ilikin klavuz yaymland. Otorite tarafndan, Pozitif Kredi Sicili kaytlar araclyla vatandalarn verilerinin ilenmesinin denetlenecei ancak vatandalar tarafndan verilerin ilenmesinin reddedilemeyecei veya verilerin silinmesinin talep edilemeyeceiifade edildi. Pozitif Kredi Sicilinin 1 Nisan'da y\\xfcr\\xfcrl\\xfce girdii belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/finlands-dpa-issues-guidance-on-the-positive-credit-information-register/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. ABD Siber G\\xfcvenlik nceleme Kurulu (CSRB) tarafndan bulut hizmet salayclarna g\\xfcvenlik iyiletirmeleri \\xf6nerildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"AB ve ABD h\\xfck\\xfcmet yetkililerinin e-postalarn a\\xe7a \\xe7karan 2023 yazndaki Microsoft Exchange Online veri ihlali kapsamnda ger\\xe7ekletirilen bamsz bir incelemenin ardndan CSRB tarafndan t\\xfcm bulut hizmeti salayclarna, g\\xfcvenlik tedbirlerini artrmalar ve olas saldrlara kar siber dayankllk oluturmalar tavsiye edildi. Siber G\\xfcvenlik ve Altyap Ajans tarafndan, CSRB'nin tavsiyeleri dorultusunda b\\xfcy\\xfck bulut hizmet salayclar \\xf6zelinde iyi uygulamalar gelitirilmesinini planland ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cyber-safety-review-board-recommends-security-improvements-for-cloud-service-providers/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6. Ontarioda veri ihlali meydana gelen be hastanede, ihlalden etkilenen ilgili kiilere ihlal bildirimleri g\\xf6nderildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yahoo News'in haberine g\\xf6re, Ontario'daki be hastane tarafndan, hastanede y\\xfcr\\xfct\\xfclen hizmetleri haftalarca etkiledii a\\xe7klanan b\\xfcy\\xfck \\xe7apl bir siber saldrnn ardndan 326.000'den fazla hastaya veri ihlal bildirimi g\\xf6nderildii a\\xe7kland. Yetkililer tarafndan, ihlalden etkilenen 326.800 kiinin kiisel verilerinin ele ge\\xe7irildii ve ilgili hastanelerden biri \\xf6zelinde hastalara ait elektronik tbbi kaytlarn da ihlalden etkilendii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/ontario-hospitals-to-send-breach-notifications-to-affected-patients-following-major-cyberattack/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7. Yeni Zelanda Veri Koruma Otoritesi tarafndan bir tedarik\\xe7i irketin y\\xfcz tanma programnn soruturulaca a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"NewstalkZB'nin haberine g\\xf6re, Yeni Zelanda Veri Koruma Otoritesi tarafndan, gda marketi tedarik\\xe7isi Foodstuffs North Island unvanl irketin y\\xfcz tanma teknolojisi ile ilgili bir soruturma balataca a\\xe7kland. Foodstuffs'ta kullanlan y\\xfcz tanma teknolojisinin, \\xfclkenin veri koruma mevzuatna uygun olup olmadnn incelenecei ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/nz-privacy-commissioner-to-investigate-retailers-facial-recognition-program/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8. AT&T unvanl telekom\\xfcnikasyon irketi tarafndan, irketin sistemlerinde yaanan veri ihlalinin ardndan yedi milyonun \\xfczerinde m\\xfcterinin ifresinin sfrland a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"New York Times'n haberine g\\xf6re AT&T tarafndan, 7.6 milyon m\\xfcterinin ifreleri, m\\xfcterilerine ait verilerin dark web'de yaynlandnn tespit edilmesi akabinde sfrland. AT&T tarafndan ayrca 65.4 milyon eski m\\xfcterinin kiisel verilerinin ihlalden etkilendii ve baz m\\xfcterilerin sosyal g\\xfcvenlik numaralarnn da veri ihlaline konu olduu  tespit edildi. AT&T tarafndan yaplan a\\xe7klamada; irket i\\xe7inden ve dndan g\\xf6revlendirilmi siber g\\xfcvenlik uzmanlar tarafndan desteklenen bir soruturmann balatld ve yaplan ilk incelemelere g\\xf6re  g\\xf6re ihlale konu veri setinin 2019 yl veya daha \\xf6ncesine ait olduunun tespit edildii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/att-resets-7-6m-customer-passcodes-after-data-leak/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9. Yeni Zelanda Veri Koruma Komiseri tarafndan daha sk veri koruma mevzuat oluturulmas y\\xf6n\\xfcnde \\xe7arda bulunuldu.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"RNZ'nin haberine g\\xf6re, Yeni Zelanda Veri Koruma Komiseri Michael Webster tarafndan; daha kat bir veri koruma mevzuat oluturulmas ve gizlilik endielerinin giderilmesi adna finansman destei \\xe7arsnda bulunuldu. Webster tarafndan, Veri Koruma Otoritesine yaplan ikayetlerin ge\\xe7tiimiz yla g\\xf6re %79 orannda arttn, buna karlk, veri koruma mevzuatnn ihlal edilmesi durumunda \\xf6ng\\xf6r\\xfclen yaptrmlarn snrl olduu ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/nz-privacy-commissioner-calls-for-stricter-privacy-legislation/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10.\tNijerya'nn dijital kimlik uygulamas kapsamnda y\\xfcz d\\xf6rt milyon adet dijital kimlik oluturuldu.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Biometric Updatein haberine g\\xf6re, Nijerya tarafndan uygulamaya alnan dijital kimlik programna y\\xfcz d\\xf6rt milyon kiinin kayt yaptrd ve y\\xfcz krk sekiz milyon kayt hedefinin yaklak %70'ine ulaldn belirtildi. \\xdclkenin Veri Koruma Otoritesi tarafndan; personellerin, Nijerya Veri Koruma Yasas tarafndan zorunlu olduu \\xf6ng\\xf6r\\xfclen \\xf6zen y\\xfck\\xfcml\\xfcl\\xfc\\xfc ve standard konusunda bilgi sahibi olmalarn salamak amacyla, bir dizi eitim ger\\xe7ekletirilecei ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/nigerias-digital-id-program-issues-104m-identification-numbers/\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"HABERLER\",\n                \"VER KORUMA\",\n                \"G\\xdcNCEL\"\n            ]\n        },\n        {\n            id: 1111111,\n            subtitle: \"Makale\",\n            date: \"2023\",\n            slug: \"emekli-olan-iscinin-calismaya-devam-etmesi\",\n            title: \"EMEKL OLAN \\xc7NN AYNI VERENE BALI OLARAK \\xc7ALIMAYA DEVAM ETMES HALNDE \\xc7NN HAK VE ALACAKLARI\",\n            text: \"Kanunlarda belirlenen \\xf6zel artlarla birlikte \\xf6ng\\xf6r\\xfclen sigortallk s\\xfcresinin ve prim \\xf6deme g\\xfcn saysnn tamamlanmas ile birlikte i\\xe7i, emeklilie hak kazanmaktadr. Bununla birlikte 30.01.2023 tarihinde T\\xfcrkiye B\\xfcy\\xfck Millet Meclisine sunulan kanun teklifi ile kamuoyunda Emeklilikte Yaa Taklanlar olarak bilinen sigortallarn emeklilik artlarnn kanunlamas \\xe7almas da balamtr.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Ancak bilindii \\xfczere, uygulamada gerek EYT kapsamnda gerekse de dier kanunlardan kaynaklanan ekilde emeklilie hak kazanan i\\xe7ilerin \\xf6nemli bir ksm ayn iverene bal olarak veya farkl iyerlerinde \\xe7almaya devam etmektedir. Bu durum anlan nitelikteki i\\xe7ilerin i s\\xf6zlemelerinin ne ekilde devam edecei ile birlikte tazminat ve alacak taleplerine ilikin de tartmalarn da beraberinde getirmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda bu bilgi notunda, EYT Kanun teklifinin detaylar ile emekli olmasna ramen \\xe7almaya devam eden i\\xe7ilerin hukuki durumu ve tazminat ve alacak taleplerine ilikin bilgi vermek ama\\xe7lanmaktadr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"II - EYT KANUN TEKLFNDE \\xd6NG\\xd6R\\xdcLEN D\\xdcZENLEMELER\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"30.01.2023 tarihinde Sosyal Sigortalar ve Genel Salk Sigortas Kanunu ile 375 sayl Kanun H\\xfckm\\xfcnde Kararnamede Deiiklik Yaplmasna Dair Kanun Teklifi T\\xfcrkiye B\\xfcy\\xfck Millet Meclisine sunulmu olup ayn tarihte Meclis Plan ve B\\xfct\\xe7e Komisyonu ile Salk, Aile, \\xc7alma ve Sosyal ler Komisyonuna g\\xf6nderilmitir. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Anlan Kanun teklifi ile Emeklilikte Yaa Taklanlar olarak bilinen konunun \\xe7\\xf6z\\xfcm\\xfc i\\xe7in d\\xfczenleme yaplmtr. Kanun teklifi, esasa ilikin 2 madde ve y\\xfcr\\xfctmeye ilikin 2 madde olmak \\xfczere toplam 4 maddeden olumaktadr. Teklif metni \\xf6zetle u ekildedir:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Sosyal Sigortalar Kanunu, Esnaf ve Sanatkarlar ve Dier Bamsz \\xc7alanlar Sosyal Sigortalar Kurumu Kanunu, Tarm \\xe7ileri Sosyal Sigortalar Kanunu ve T\\xfcrkiye Cumhuriyeti Emekli Sand Kanunu kapsamnda sigortallar i\\xe7in her bir Kanun b\\xfcnyesinde ayr ayr belirlenen ya, sigortallk balang\\xe7 tarihi ve s\\xfcresi ile prim g\\xfcn saysn tamamlamalarnn akabinde yallk ayl \\xf6denecei d\\xfczenlenmitir. Teklif yasalarsa, bu \\xe7alanlarn emeklilie hak kazanmalar i\\xe7in ya kriteri ortadan kaldrlacak ve ya dndaki dier artlar (sigortallk s\\xfcresi ve prim g\\xfcn says) tamalar halinde, emekli aylndan yararlanacaklardr.\",\n                        \"Prim g\\xfcn says her kanunda farkl d\\xfczenlendiinden t\\xfcm hak sahipleri i\\xe7in tek bir prim g\\xfcn says belirlenmemitir. \\xd6rnein SSK b\\xfcnyesinde 1982 \\xf6ncesi sigortal olanlar i\\xe7in 5000 prim g\\xfcn says; bu tarihten sonrakiler i\\xe7in 5600 ve 5975 prim g\\xfcn saylar aranmaktadr.\",\n                        \"Kanun teklifi ile \\xe7alann geriye d\\xf6n\\xfck herhangi hak talebinde bulunamayaca ve \\xe7alana geriye d\\xf6n\\xfck bir \\xf6deme yaplmayaca a\\xe7k\\xe7a d\\xfczenlenmitir. Bu kapsamda kamuoyunda intibak olarak anlan uygulama hayata ge\\xe7irilmemi olup daha \\xf6nce emekli olmu sigortallar bu deiiklik kapsam dnda braklmtr.\",\n                        \"Emeklilik sebebiyle i s\\xf6zlemesinin feshi halinde, i\\xe7inin ayn iyerinde \\xe7almaya devam etmesi m\\xfcmk\\xfcnd\\xfcr. Bu kapsamda i\\xe7i emekliliinin akabinde 10 g\\xfcn i\\xe7erisinde ayn iveren b\\xfcnyesinde \\xe7almaya devam ederse, iverene, %32 orannda Sosyal G\\xfcvenlik Destek Primi (SGDP) \\xf6demesi i\\xe7in %5 orannda bir destek salanacaktr. Bu kapsamda i ilikisinin devam istenen \\xe7alanlarla 10 g\\xfcn i\\xe7erisinde yeniden i s\\xf6zlemesi kurulmas prim desteinden yararlanlabilmesi i\\xe7in \\xf6nemlidir.\",\n                        \"Kamu kurum ve kurulular ile belediyelerde taeron sistemiyle \\xe7alanlarn istihdam s\\xfcrelerinin emeklilie hak kazandklar s\\xfcreyi ge\\xe7emeyeceine ilikin d\\xfczenleme y\\xfcr\\xfcrl\\xfckten kaldrlmtr. Dolaysyla bu nitelikteki \\xe7alanlarn zorunlu olarak emekli edilmesinin \\xf6n\\xfcne ge\\xe7ilmitir.\"\n                    ]\n                },\n                {\n                    type: \"header\",\n                    content: \"III- EMEKLNN \\xc7ALIMAYA DEVAM ETMES VE ETLK LKES\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Eitlik ilkesi 4757 sayl  Kanununda ( Kanunu) dorudan d\\xfczenlenmemekle birlikte, Anayasann 10. maddesinde d\\xfczenlenen eitlik ilkesinin i hukukundaki g\\xf6r\\xfcn\\xfcm\\xfc, iverenin eit davranma borcudur. Eit davranma borcu, i\\xe7eriinde iverenin genel olarak i\\xe7iler arasnda eit davranma y\\xfck\\xfcml\\xfcl\\xfc\\xfc ve ayrmclk yasaklarn barndran birleik bir bor\\xe7tur.Kural olarak iverenin i\\xe7ilere eit davranma borcu, i s\\xf6zlemesinin kurulmasndan sonra g\\xfcndeme gelecektir. Ayrmclk yasa ise, i s\\xf6zlemesi kurulmadan \\xf6nce ie alm aamasnda da g\\xf6zetilmelidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Aada detaylaryla a\\xe7klanaca \\xfczere, emeklilik ile birlikte i s\\xf6zlemesi fesihle sona erecektir. Bu halde iveren, emekli i\\xe7ilerin bir ksmyla i ilikisine devam etmek isterse bu i\\xe7ilerle yeni bir i s\\xf6zlemesi yapacaktr. Bu durumda yukarda da belirtildii gibi, eitlik ilkesi i s\\xf6zlemesinin kurulmasndan sonra g\\xfcndeme geleceinden emekli olan i\\xe7ilerin bir ksmyla i ilikisinin devam ettirilmesi; bir ksmyla ise yeni bir i s\\xf6zlemesi yaplmamas eitlik ilkesine aykr deildir. Baka bir ifadeyle, eit davranma borcu i s\\xf6zlemesi devam ederken uygulama alan bulacandan, i ilikisinin sona ermesi halinde s\\xf6zleme serbestisi gerei bir ksm i\\xe7ilerle yeniden i s\\xf6zlemesi yaplmamas m\\xfcmk\\xfcnd\\xfcr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ancak eitlik ilkesinin yannda ayrmclk yasana i s\\xf6zlemesinin kurulmasndan \\xf6nce de dikkat edilmesi gerekecektir. Bu haliyle \\xf6rnein sadece emeklilie hak kazanan erkeklerle i s\\xf6zlemesi kurulmas ve kadnlarla i ilikisinin sona erdirilmesi ayrmclk yasana aykr kabul edilecektir. Bu kapsamda iverenin, yeni i s\\xf6zlemesi yapaca emekli i\\xe7ilerini belirlerken iyerinin ihtiya\\xe7larn, i\\xe7inin kalifiyelik durumunu dikkate almas \\xf6nerilmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xd6te yandan, emekli i\\xe7iyle yaplacak yeni i s\\xf6zlemesinde daha d\\xfc\\xfck bir \\xfccret belirlenmesinin m\\xfcmk\\xfcn olup olmad da tartmaldr. Bu kapsamda yine s\\xf6zleme serbestisi gerei, emeklilik sonrasnda yaplacak yeni i s\\xf6zlemelerinde \\xfccretin taraflarca kararlatrlmasnn m\\xfcmk\\xfcn olduu deerlendirilmektedir. Nitekim Yargtay 9. Hukuk Dairesinin 09.09.2019 tarihli 2016/6107 E. 2019/15398 K. sayl kararnda, emeklilik sonras kurulan i s\\xf6zlemesinde \\xf6nceki d\\xf6neme g\\xf6re d\\xfc\\xfck \\xfccret belirlendii ve bu durumun \\xe7alma koullarnda esasl deiiklik olduu iddiasyla a\\xe7lan davada, yeni i s\\xf6zlemesinin irade fesad olmad m\\xfcddet\\xe7e ge\\xe7erli olduu kabul edilmitir. lgili karar;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Davac, 01.01/2010 tarihinden itibaren muvafakati olmakszn \\xfccretinin d\\xfc\\xfcr\\xfcld\\xfc\\xfc iddiasyla anlan tarihten itibaren hesaplanacak \\xfccret farkn talep etmitir. Dosyada mevcut imzas ink\\xe2r edilmeyen s\\xf6zleme i\\xe7eriine g\\xf6re, davacnn yeni imzalad s\\xf6zleme ile \\xfccretinin d\\xfc\\xfcr\\xfclmesine muvafakat verdii anlalmaktadr. Davacnn s\\xf6zlemeyi imzalarken hataya d\\xfc\\xfcr\\xfcld\\xfc\\xfcne ilikin iddiasn dorulayan tann da ayn iddia ile dava a\\xe7tnn anlalmas karsnda, bu tann beyanna ihtiyatla yaklalmas gerektii a\\xe7ktr. Bu konuda bakaca delil de yoktur. Sonu\\xe7 itibariyle; imzas ink\\xe2r edilmeyen ve irade fesad altnda imzaland kantlanamayan s\\xf6zlemeye deer verilerek davacnn \\xfccretinin d\\xfc\\xfcr\\xfclmesine muvafakat verdii kabul edilip davann reddi gerekirken kabul\\xfc hataldr.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"eklindedir. Bu itibarla emekli olan i\\xe7ilerle kurulacak yeni i ilikisinde, i s\\xf6zlemesinin asli unsuru olan \\xfccretin a\\xe7k\\xe7a belirlenmesi ve bu s\\xf6zlemenin imzalanmas s\\xfcrecinde i\\xe7inin iradesinin hi\\xe7bir ekilde etkilenmemesi yasal bir zorunluluktur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayn y\\xf6nde emeklilik sonrasnda i\\xe7i ile yaplacak i s\\xf6zlemesinde farkl bir \\xfccret belirlenmesinin ayrmclk yasana aykr olmayacana ilikin olarak Yargtay Hukuk Genel Kurulunun 30.09.2021 tarihli 2018/592 E. 2021/1129 K. sayl kararnda,\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Bu a\\xe7klamalara g\\xf6re, daval iverenin ie balayan i\\xe7ilerin bir ksmn eski \\xfccretleri ile ie balatmasna karlk davacy fesih \\xf6ncesi \\xfccretinden daha d\\xfc\\xfck \\xfccret ile ie balatmak suretiyle ayrmclk yapt iddias, kanunda belirtilen ayrmclk sebeplerinden ve benzerlerinden hi\\xe7birine girmemektedir. Bu \\xfccret farknn i\\xe7inin deitirmesi m\\xfcmk\\xfcn olmayan ve deitirmesi kendisinden beklenemeyecek \\xf6zelliklerinden kaynakl olmadndan benzeri sebepler ksmna girmesi de m\\xfcmk\\xfcn deildirBununla birlikte, davac i\\xe7i ile daval arasnda imzalanan 10.08.2009 tarihli yeni i s\\xf6zlemesinde de \\xfccretin yazl olmas, i\\xe7inin s\\xf6zlemenin sonuna imza atarak s\\xf6zlemeyi kabul etmesi, ayrca emeklilik nedeniyle i s\\xf6zlemesini feshettiine dair dilek\\xe7esinden sonra imzalad sulh ve ibraname balkl belgede de iverenin de hi\\xe7bir hak ve alacann kalmadn beyan etmesi karsnda, s\\xf6zleme \\xf6zg\\xfcrl\\xfc\\xfc \\xe7er\\xe7evesinde i s\\xf6zlemesini imzalayan taraflarn \\xfccreti serbest\\xe7e belirledikleri sonucuna varldndan davacnn \\xfccret fark talebinin de yerinde olmad kabul edilmitir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ifadelerine yer verilmitir. Bu h\\xfck\\xfcmde, emeklilik sonrasnda yeni yaplan i s\\xf6zlemesinde taraflarn s\\xf6zleme serbestisi gereince \\xf6nceki \\xfccretten farkl bir \\xfccret belirlemesinin m\\xfcmk\\xfcn olduuna ve bu durumun ayrmclk yasann ihlali anlamna gelmeyeceine karar verilmitir.\"\n                }\n            ],\n            tags: [\n                \"EMEKLLK\",\n                \"\\xc7\",\n                \"HAK\",\n                \"ALACAK\",\n                \"EYT\"\n            ],\n            author: \"Av. Sla Evrim Atar\"\n        },\n        {\n            id: 18,\n            subtitle: \"GDPR KARARI\",\n            date: \"03.04.2024\",\n            slug: \"ilgili-kisi-basvurusuna-zamaninda-cevap-verilmemesi\",\n            title: \"Oldenburg  Mahkemesi; bir irketin i uyumazl srasnda eski \\xe7alannn eriim talebine yant vermemesi nedeniyle veri sorumlusuna 10.000  para cezas verdi.\",\n            text: \"Bir ilgili kii ve eski ivereni arasnda \\xf6denmemi ikramiyeler ve rekabet yasa ihlali nedeniyle istihdam anlamazl ortaya \\xe7kmtr. lgili kii bu ihtilaf srasnda, irket tarafndan kendisiyle ilgili olarak tutulan kiisel verileri elde etmek i\\xe7in eriim talebinde bulunmu ancak veri sorumlusu bu bilgileri salamay reddetmitir. irketin, ilgili kiinin kiisel verilere eriim talebini reddetmesi \\xfczerine ilgili kii mahkemeye bavurmu ve manevi tazminat talep etmitir. Mahkeme, eski iverenin ilgili kii bavurusuna konu verileri 20 ay sonra g\\xf6r\\xfclmekte olan dava srasnda a\\xe7klamasnn GDPR Madde 15 ve GDPR Madde 12 h\\xfck\\xfcmlerini ihlal ettiini tespit ederek her ay i\\xe7in 500 Euro olacak ekilde toplamda 10.000 Euro manevi tazminat \\xf6denmesine h\\xfckmetmitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kii balang\\xe7ta genel m\\xfcd\\xfcr ve daha sonra sat m\\xfcd\\xfcr\\xfc olarak g\\xf6rev yapt veri sorumlusu eski irketine aralarndaki istihdam ilikisinden kaynaklanan bir dava a\\xe7mtr. Eskiden \\xe7alt irketin havai fiek ithal ederek bunlar satclara satan ve satn alanlarn da daha sonra bu havai fiekleri 'son kullanclara' satan bir irket olduu belirtilmitir. lgili kii irket tarafndan istihdam edilirken ayn zamanda i dnda kendi iini de y\\xfcr\\xfctm\\xfc ve havai fiekleri dorudan bu 'son kullanclara' satmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Taraflar arasndaki istihdam anlamazl davas tevike dayal ikramiyelerin \\xf6denmesi ve s\\xf6zleme sonras rekabet yasa maddesinin ihlal edildii iddias ile a\\xe7lmtr. lgili kii \\xf6denmemi ikramiyelerini geri almaya \\xe7alrken, veri sorumlusu veri sahibinin i dnda bu ii y\\xfcr\\xfctme eylemlerinin s\\xf6zleme sonras rekabet yasa maddesini ihlal ettiini ileri s\\xfcrm\\xfct\\xfcr. Bu iddia ilgili kii tarafndan reddedilerek irket \\xe7alan olduu s\\xfcrece bu ii y\\xfcr\\xfctmesine izin verildiine dair bir anlamalarnn olduu belirtilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu ihtilaf srasnda, ilgili kii, irket tarafndan kendisiyle ilgili olarak tutulan kiisel verileri elde etmek i\\xe7in GDPR Madde 15 uyarnca eriim talebinde bulunmu ancak veri sorumlusu bu bilgileri salamay reddetmitir. lgili kii, 20 ay sonra veri sorumlusunun belgeleri davann bir par\\xe7as olarak a\\xe7klamasna kadar bu bilgileri alamamtr. Bu kapsamda, ilgili kii, eski ivereninin talebine yant vermeyerek GDPR'nin 12. ve 15. maddelerini ihlal ettiini iddia etmi ve veri sorumlusunun yant vermedii her ay i\\xe7in 500 Euro olmak \\xfczere 10.000 Euro tutarnda manevi tazminat talep etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sonu\\xe7ta bu davann veri koruma y\\xf6n\\xfcyle ilgili olarak mahkeme; ilgili kiinin lehine karar vermi ve veri sorumlusunun GDPR Madde 15 ve GDPR Madde 12 kapsamndaki y\\xfck\\xfcml\\xfcl\\xfcklerini ihlal ettiini tespit etmitir. Mahkeme, GDPR Madde 82(1)'in bu t\\xfcr zararlarn talep edilmesine imkan vermesi ve GDPR'nin ilgili maddelerinin ihlal edilmesinin tazminat \\xf6denmesi i\\xe7in yeterli olmas nedeniyle, veri sorumlusunun 10.000 Euro manevi tazminat \\xf6demesine karar vermitir. Ayrca, davacnn bilgilerde sahip olduu \\xf6nemli menfaate ve bu davalardaki tazminatlarn \\xf6nemli bir \\xf6nleyici ve caydrc etkiye sahip olabileceine de dikkat \\xe7ekilmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://gdprhub.eu/index.php?title=ArbG_Oldenburg_-_3_Ca_150/21&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"EMPLOYMENT\",\n                \"DISPUTE\",\n                \"FORMEREMPLOYEE\",\n                \"PERSONALDATA\"\n            ]\n        },\n        {\n            id: 17,\n            subtitle: \"IAPP HABERLER\",\n            date: \"01.04.2024\",\n            slug: \"iapp-haberleri-1-nisan-2024\",\n            title: \"Haftalk IAPP Haberleri 26 Mart - 1 Nisan 2024\",\n            text: \"D\\xfcnya Genelinde Kiisel Verilere likin G\\xfcncel Gelimeler\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1. Kenya Veri Koruma Otoritesi tarafndan TikTok'un Kenya Veri Koruma Yasasna uyumluluunu kantlamas talep edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bizcommunity'nin haberine g\\xf6re Kenya Veri Koruma Otoritesi tarafndan, TikToku Veri Koruma Yasas ile uyumlu olduunu kantlamas y\\xf6n\\xfcnde talimatlandrld. Bahse konu talimatlandrma; TikTokun mahremiyet politikalarn inceleyen dier \\xfclkelerin ardndan iletildi. TikTok tarafndan, \\xe7eitli haber kurulular ve web siteleri araclyla, politikalarn savunur nitelikte a\\xe7klamalar yapld.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/kenya-pushes-tiktok-to-show-privacy-law-compliance/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. Avrupa Komisyonu (Komisyon) tarafndan Dijital Piyasalar  Yasas (DMA) ihlali iddialarnn soruturulaca a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Komisyon tarafndan; DMAya uyumlu olunmad gerek\\xe7esiyle, Apple, Alphabet ve Meta aleyhine soruturma a\\xe7ld a\\xe7kland. \\xd6zellikle Meta'nn hedefli reklamcla y\\xf6nelik '\\xf6de veya rza g\\xf6ster' abonelik modelinin Komisyon tarafndan soruturulaca bilgisi paylald.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/european-commission-to-investigate-several-gatekeepers-for-alleged-dma-violations/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. General Motors tarafndan veri komisyoncularna veri aktarmnn durdurulduu a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"New York Times gazetesinin haberinde; General Motors tarafndan, ara\\xe7 s\\xfcr\\xfcc\\xfclerine ait verilerin LexisNexis ve Verisk firmalarna paylamnn durdurulduu ifade edildi. Bir\\xe7ok s\\xfcr\\xfcc\\xfcn\\xfcn, verilerin bahse konu irketlerle paylaldn ve daha sonra bu verilerin sigorta primlerini artrmak i\\xe7in sigorta irketlerine satldn bilmedikleri belirtildi. CNBC tarafndan konuyla alakal yaplan baka bir haberde ise, balantl ara\\xe7larn giderek daha fazla gizlilik riski oluturduu ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/gm-stops-sharing-driver-data-with-two-brokers/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. Suudi Arabistan Veri Koruma Otoritesi tarafndan kiisel veri aktarmlarna ilikin i\\xe7in taslak h\\xfck\\xfcmler hazrland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Suudi Arabistan Veri Koruma ve Yapay Zeka Otoritesi tarafndan, kiisel verilerin yurt dna aktarm faaliyetlerinde mahremiyeti koruyacak yeterli tedbirlerin salanmas amacyla hazrlanan bir y\\xf6netmelik tasla kamuoyuna sunuldu. Bahse konu taslak y\\xf6netmeliin 18 Nisan'a kadar kamuoyu g\\xf6r\\xfc\\xfcne a\\xe7k olaca ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/saudi-arabias-dpa-drafts-rules-for-personal-data-transfers-outside-kingdom/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. \\xc7in Halk Cumhuriyeti Siber G\\xfcvenlik Kurumu (CAC) tarafndan, yurt dna veri aktarm faaliyetlerine ilikin g\\xfcncel kurallar yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Reuters'in haberine g\\xf6re; CAC tarafndan, yurt dna veri aktarmn ve bu veri aktarm \\xf6zelindeki g\\xfcvenlik tedbirlerinin raporlanmasna ilikin standartlar d\\xfczenleyen kurallar g\\xfcncellendi. CAC tarafndan; uluslararas ticaret ve tamaclk sekt\\xf6r\\xfcne ilikin kiisel veri veya y\\xfcksek \\xf6nemde veri i\\xe7ermeyen bilgiler de dahil olmak \\xfczere, ticaretten elde edilen verilerin ibu yeni kurallara tabi olmad ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cac-releases-updated-rules-for-crossborder-data-transfers/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6. talya Veri Koruma Otoritesi (Garante) tarafndan, hasta mahremiyetinin \\xe7evrimi\\xe7i ortamlarda korunmasna ilikin rehber yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Garante tarafndan, \\xe7evrimi\\xe7i salk portallar kapsamnda kiisel verilerin ilenmesine ilikin bir rehber yaymland. Bahse konu rehberin; hastalarn ilgili portallar vastasyla \\xe7evrimi\\xe7i balant kurarken salk \\xe7alanlar ile paylatklar bilgilerin asgari d\\xfczeyde ilenmesini ve yeterli  tedbirlerle korunmasn salamay ama\\xe7lad belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/italys-dpa-publishes-guidance-on-online-patient-privacy-safeguards/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7. Portekiz Veri Koruma Otoritesi (CNPD) tarafndan Worldcoin'in biyometrik veri ileme uygulamalar engellendi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNPD tarafndan, Worldcoin Foundation'n Orb \\xfcr\\xfcn\\xfc araclyla ger\\xe7ekletirilen biyometrik veri ileme faaliyetlerinin ge\\xe7ici olarak snrlandrld duyuruldu. Worldcoin Foundation'n iris ve y\\xfcz taramalarn toplamas sebebiyle soruturulduu veya faaliyet g\\xf6stermesinin engellendii en son \\xfclkenin Portekiz olduu belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cnpd-also-blocks-worldcoins-biometric-collection-practices/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8. Fransa Veri Koruma Otoritesi (CNIL) tarafndan, kiisel veri g\\xfcvenlii rehberi yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNIL tarafndan, 2024 ylna ilikin kiisel veri g\\xfcvenlii rehberi yaymland. Bahse konu rehberin \\xf6zellikle; yapay zeka, mobil uygulamalar, bulut hizmetleri ile uygulama programlama aray\\xfczlerine ve kiisel verilerin ilgili alanlar \\xf6zelinde hangi kurallara riayet edilerek ilenmesi gerektiine odakland ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cnil-publishes-new-guide-on-data-security/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9. zlanda Veri Koruma Otoritesi (Pers\\xf3nuvernd) tarafndan bir irket aleyhine, irket \\xe7alanlarnn g\\xfcvenlik kameralar vastasyla,  kiisel verilerin korunmasna ilikin mevzuata aykr olarak izlenmesi  sebebiyle 1,5 milyon ISK tutarnda para cezasna h\\xfckmedildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Pers\\xf3nuvernd tarafndan, zlanda'da mukim Subway restoranlarnn iletmecisi olan Stj\\xf6rnuna ehf aleyhine 1,5 milyon ISK tutarnda para cezasna h\\xfckmedildi. Pers\\xf3nuvernd tarafndan, bir \\xe7alan ikayetinin soruturulmasnn ardndan irketin kiisel verilerin korunmas ve ilenmesine ilikin yasaya uyum salamad tespit edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/iceland-dpa-issues-isk1-5m-to-company-for-electronic-monitoring/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10. ABD Siber G\\xfcvenlik ve Altyap Ajans (CISA) tarafndan, siber saldrlarn raporlanmasna ilikin y\\xf6netmelik yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The Wall Street Journal'n haberine g\\xf6re, CISA tarafndan kritik altyap ileten irketlere y\\xf6nelik olarak, siber saldr raporlama y\\xf6netmelii yaymland. Bahse konu d\\xfczenlemelerin mevzuat kapsamnda olan irketlere \\xf6nemli siber saldrlar 72 saat i\\xe7inde, fidye yazlm saldrs kapsamnda ger\\xe7ekletirilen \\xf6demeleri ise 24 saat i\\xe7inde bildirilme y\\xfck\\xfcml\\xfcl\\xfc\\xfc getirdii  ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cisa-releases-cyberattack-reporting-regulations/\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"GDPR\",\n                \"KVKK\",\n                \"news\",\n                \"privacy\",\n                \"dataprotection\"\n            ]\n        },\n        {\n            id: 16,\n            subtitle: \"GDPR KARARI\",\n            date: \"29.03.2024\",\n            slug: \"arama-sonuclarindaki-urllerin-kaldirilmasi\",\n            title: \"Garante, eski bir politikacnn adyla ilikilendirilen URL'leri kaldrmas i\\xe7in Google'a 20 g\\xfcn s\\xfcre tand.\",\n            text: \"Eski bir politikac, siyasi ge\\xe7miiyle ilgili Googleda yer alan i\\xe7erikler nedeniyle kiisel ve mesleki itibarnn zarar g\\xf6rd\\xfc\\xfcn\\xfc, i\\xe7erikteki konularn \\xfczerinden neredeyse 10 yl ge\\xe7tiini ve kamunun bilgi sahibi olmas a\\xe7sndan herhangi bir yarar salamadn belirterek i\\xe7eriklerin kaldrlmasn istemitir. Garante, ilgili kiinin adnn ge\\xe7tii URL'lerdeki i\\xe7eriklerin eski olmas ve siyasi g\\xf6revlerinin 5 yldr son bulmu olmasna deinerek Googlea ilgili kiinin adyla balantl olarak arama sonu\\xe7larnda bulunabilecek URL'lerin kaldrmasn emretmitir.\",\n            \"dynamicContent\": [\n                {\n                    type: \"paragraph\",\n                    content: \"Eski bir politikac (ilgili kii) tarafndan, Google LLC'den (veri sorumlusu) kendi adyla ilikilendirilen ve siyasi ballyla ilgili bilgiler i\\xe7eren yaz, makale vs. balant veren bir dizi URL'nin kaldrlmas istenmitir. lgili kii, bahse konu yaynlar \\xfczerinden epey zaman ge\\xe7tiini ve kiisel verilerinin bu ekilde a\\xe7klanmasnn artk kamu yarar nitelii tamadn belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kii 5 Mays 2021'de, talya Veri Koruma Otoritesine (Garante) ikayette bulunarak veri sorumlusundan i\\xe7erii kaldrmasn talep etmi ve bu t\\xfcr bilgilerin uzun s\\xfcredir online platformlarda bulunmasnn bir sonucu olarak ahsi ve mesleki itibarnn zarara uradn iddia etmitir. lgili kii, hakknda yaynlanan ve silinmesini talep ettii i\\xe7erikler hakknda herhangi bir hukuki ilem balatlmadn, silme talebini iletmesinden be yl \\xf6ncesinde siyasi kariyerinin sona erdiini vurgulamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri Sorumlusu, s\\xf6z konusu URL'lerden birine ilikin sayfada ilgili kiinin adnn tespit edilemediini ifade etmi ve dolaysyla ilgili sayfann isimle balantl arama sonu\\xe7lar arasnda g\\xf6r\\xfcnmesini \\xf6nlemek i\\xe7in yalnzca manuel \\xf6nlemler aldn iletmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu dier URL'lerle ilgili olarak; i\\xe7eriklerin, yaynland srada ilgili kiinin sahip olduu siyasi rolle balantl i\\xe7erikler olmas sebebiyle  talebin yerine getirilemeyeceini savunmutur. Bahse konu i\\xe7eriin, spesifik olarak; ilgili kiinin, se\\xe7menleri kendi partisine oy vermeye ikna etmeye \\xe7alt bir videoyla ilgili olduu tespit edilmitir. lgili kii bu videoyu se\\xe7im kampanyas srasnda \\xe7ekmi ve kamuya a\\xe7k olarak paylamak amac dorultusunda kendi rzasyla yaynlamtr. Dolaysyla bu koullar, kamunun bu konuda bilgi sahibi olma \\xe7karnn varln belirlemitir. Ayrca veri sorumlusu, ilgili kiinin halihazrda siyasi bir g\\xf6revde bulunmamasna ramen yine de bir iadam olarak kamuda yer aldn belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Garante, s\\xf6z konusu ilk URL balantsnda ilgili kiinin adnn belirtilmemesi \\xfczerine bu konuda \\xf6nlem alnmasna gerek olmadna karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bununla birlikte Garante dier URL'lerle ilgili olarak; ilgili kiinin siyasi se\\xe7imler srasnda yapt a\\xe7klamalarn i\\xe7eriinin neredeyse on yl \\xf6nce ger\\xe7ekletiini ve ayrca ilgili kiinin be yl boyunca herhangi bir siyasi g\\xf6revde bulunmadn belirtmitir. Dolaysyla, s\\xf6z konusu i\\xe7eriklerin Google'da korunmasna y\\xf6nelik \\xf6zel bir gerekliliin bulunmadna karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu nedenle Garante, veri sorumlusuna, ilgili kiinin adyla balantl olarak bulunabilecek arama sonu\\xe7larndaki URL'leri kaldrmasn emretmi ve GDPR madde 58(2)(c) ve madde 58(2)(g) h\\xfck\\xfcmleri uyarnca durumu d\\xfczeltmesi i\\xe7in yirmi g\\xfcn s\\xfcre vermitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"lgili karara buradan ulaabilirsiniz.\",\n                    href: \"https://gdprhub.eu/index.php?title=Garante_per_la_protezione_dei_dati_personali_(Italy)_-_9866622&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"KVKK\",\n                \"personaldata\",\n                \"searchengine\",\n                \"privacy\"\n            ]\n        },\n        {\n            id: 15,\n            subtitle: \"GDPR KARARI\",\n            date: \"27.03.2024\",\n            slug: \"isten-ayrilan-iscinin-kurumsal-eposta-hesabinin-kapatilmamasi\",\n            title: \"Bel\\xe7ika Veri Koruma Otoritesi, bir iverene iten ayrlan i\\xe7isinin kurumsal e-posta hesabn kapatmas talimatn verdi.\",\n            text: \"Bel\\xe7ika Veri Koruma Otoritesi (Otorite) tarafndan, iten ayrlan i\\xe7isinin kurumsal e-posta hesabn zamannda kapatmayan veri sorumlusu hakknda balatlan soruturmada; ayrlan i\\xe7inin \\xf6nceden konu hakknda bilgilendirilmi olmas artyla e-posta hesabnn prensip olarak 1 ay boyunca otomatik yant sistemi kullanlarak a\\xe7k kalabilecei, ayrlan i\\xe7inin irketteki pozisyonuna g\\xf6re s\\xfcrenin 3 aya kadar uzatlabilecei belirtilmitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Bel\\xe7ika Veri Koruma Otoritesi, bir veri sorumlusunun eski bir \\xe7alann kurumsal e-posta hesabn zamannda silmedii i\\xe7in GDPR Madde 5(1)'i ihlal ettiine karar verdi. Otorite, e-posta hesabnn son i g\\xfcn\\xfcnde ve ilgili e-postaya tanmlanan otomatik yantn bir ay veya baz istisnalarda 3 ay i\\xe7inde devre d braklmas gerektiini belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bir ilgili kii, 6 Haziran 2023 tarihine kadar yaklak on ay boyunca veri sorumlusuna ait iyerinde \\xe7almtr.  faaliyetleri kapsamnda ilgili kii adna bir Microsoft hesab oluturulmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kiinin i s\\xf6zlemesinin feshedilmesinin ardndan, ilgili kii tarafndan veri sorumlusuna bir eriim talebinde bulunularak veri sorumlusunun hangi verileri ilemeye devam ettiine dair bilgi talep edilmi ancak bir yant alnamamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kii, profesyonel (i) posta kutusunun hala aktif olduunu anladn, bunun sebebinin ise bu adrese bir e-posta g\\xf6nderdiinde bir ileti onay almas olduunu iddia etmitir. Bu nedenle, 24 Ekim 2023 tarihinde, ilgili kii Bel\\xe7ika Veri Koruma Otoritesine ikayette bulunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bel\\xe7ika Veri Koruma Otoritesi, veri minimizasyonu (GDPR Madde 5(1)(c)) ve saklama snr (GDPR Madde 5(1)(e)) ilkeleriyle birlikte ama\\xe7 snrlamas ilkesine (GDPR Madde 5(1)(b)) uymak i\\xe7in, veri sorumlusunun, ilgili kiinin posta kutusuna en ge\\xe7 son g\\xfcn\\xfcne kadar otomatik bir bildirim g\\xf6ndermesi ve bu konuda \\xf6nceden bilgilendirilmesi gerektiine karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, bahse konu otomatik mesajn sonraki t\\xfcm muhataplar ilgili kiinin artk veri sorumlusu b\\xfcnyesinde faaliyet g\\xf6stermedii konusunda uyardn ve ilke olarak 1 ay olmak \\xfczere makul bir s\\xfcre boyunca y\\xfcr\\xfcrl\\xfckte olmas gerektiini belirtmitir. Yine Otorite, somut olaya ve \\xe7alann i tanm kapsamndaki sorumluluunun derecesine bal olarak, 3 ay ge\\xe7memek \\xfczere daha uzun bir s\\xfcreye izin verilebileceini eklemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu \\xf6rnekte, Otorite s\\xfcrenin 1 ila 3 ay arasnda olabileceini ve yalnzca ilgili kiinin a\\xe7k rzasn aldktan sonra s\\xfcrenin uzatlmas gerektiini dorulamtr. Otoritenin a\\xe7klamalar dorultusunda ilgili kii 6 Haziran 2023 tarihinde iine son verdiinden, e-posta adresinin 6 Temmuz 2023 veya 6 Eyl\\xfcl 2023 tarihinde kapatlmas gerektii sonucu ortaya \\xe7kmtr. Bununla birlikte, ilgili kii 13 Kasm 2023 tarihinde e-postann hala aktif olduunu kantlamtr. Bu nedenle Otorite, GDPR Madde 5(1)(b), GDPR Madde 5(1)(c) ve GDPR Madde 5(1)(e)'nin ihlal edildiini tespit etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yasal dayanak a\\xe7sndan Otorite, bahse konu ileme faaliyetinin yasal dayanann GDPR Madde 6(1)(f) kapsamnda irketin d\\xfczg\\xfcn ileyiini salamak i\\xe7in veri sorumlusunun meru menfaati olabileceini kabul etmitir. Bununla birlikte, Otorite, veri sorumlusunun ilgili kiiyi ge\\xe7erli yasal dayanak hakknda bilgilendirdiini kantlayan herhangi bir kant bulunmadn kaydetmitir. Dolaysyla Otorite, ilgili kii ile veri sorumlusu arasndaki s\\xf6zlemenin sona ermesinin ardndan e-posta adresinin ilenmesi i\\xe7in ge\\xe7erli bir yasal dayanak bulunmadna karar vermitir. Dolaysyla, veri sorumlusu tarafndan GDPR Madde 6(1) ihlal edilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite profesyonel e-posta hesabn zamannda kapatmad i\\xe7in veri sorumlusuna bir uyarda bulunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Eriim talebiyle ilgili olarak, Otorite veri sorumlusunun, GDPR Madde 12(3) ve (4) ile balantl olarak GDPR Madde 15(1)'i ihlal ederek yant verdiine dair hi\\xe7bir kant bulunmadndan, ilgili kiinin eriim hakkn ihlal ettiine karar vermitir. Bu nedenle Otorite, veri sorumlusunun karardan sonraki 30 g\\xfcn i\\xe7inde karara uymas noktasnda veri sorumlusunu talimatlandrmtr.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://gdprhub.eu/index.php?title=APD/GBA_(Belgium)_-_01/2024&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"KVKK\",\n                \"corporate\",\n                \"email\",\n                \"personaldata\"\n            ]\n        },\n        {\n            id: 14,\n            subtitle: \"IAPP HABERLER\",\n            date: \"26.03.2024\",\n            slug: \"iapp-haberleri-26-mart-2024\",\n            title: \"Haftalk IAPP Haberleri 19 - 26 Mart 2024\",\n            text: \"D\\xfcnya Genelinde Kiisel Verilere likin G\\xfcncel Gelimeler\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1. T\\xfcrkiye Rekabet Kurumu (Rekabet Kurumu) tarafndan, Instagram ve Threads uygulamalar araclyla ilenen verilerin birletirilmesi ge\\xe7ici olarak durduruldu.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Rekabet Kurumu tarafndan; y\\xfcr\\xfct\\xfclen soruturma kapsamnda; Meta tarafndan  Instagram hesaplarna dayal olarak Threads profili oluturan kullanclara ait verilerin, kullanclara onay se\\xe7enei sunulmakszn birletirilmesinin; soruturma tamamlanana kadar telafisi g\\xfc\\xe7 zararlara yol a\\xe7aca gerek\\xe7esiyle anlan faaliyetlerin engellenmesine y\\xf6nelik ihtiyati tedbir uygulanmasna karar verildi. Soruturmann, Meta'nn Threads ve Instagram uygulamalarn balamak suretiyle h\\xe2kim durumunu k\\xf6t\\xfcye kulland \\xfcphesine dayand ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/turkey-places-temporary-restraint-on-meta-platforms/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. Otomobil \\xfcreticisi General Motors ve veri komisyoncusu LexisNexis'e t\\xfcketici gizliliini ihlal ettikleri iddiasyla dava a\\xe7ld.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The New York Times'n haberine g\\xf6re, ABD Florida G\\xfcney B\\xf6lgesi B\\xf6lge Mahkemesi'nde a\\xe7lan davada General Motors ve veri komisyoncusu LexisNexis'in veri toplama faaliyetleri sonucunda t\\xfcketici gizlilii yasalarnn ihlal edildii \\xf6ne s\\xfcr\\xfcld\\xfc. lgili davada, LexisNexis tarafndan t\\xfcketici bilgilendirme raporu vastasyla, ara\\xe7larn sisteminden toplanan verilerin t\\xfcketiciden izin alnmakszn sigorta irketleriyle paylalmasnn t\\xfcketicilerin ara\\xe7 sigortalama faaliyetlerini zorlatrd iddia edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/automaker-and-data-broker-sued-for-alleged-consumer-privacy-violations/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. zlanda Veri Koruma Otoritesi (Otorite) tarafndan, \\xe7ocuklarn verilerinin korunmasna ilikin rehber yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite Personuvernd tarafndan, \\xe7ocuklarn verilerinin nasl ilenmesi gerektii ve k\\xfc\\xe7\\xfcklere ait g\\xf6rsel verilerin, \\xe7evrimi\\xe7i mecralarda hangi koullar altnda paylalabilecei konusunda tavsiyeler i\\xe7eren bir rehber yaymland. Otorite tarafndan ilgili rehberde, \\xe7ocuklarn verilerinin yaymlanmasn isteyip istemedii konusundaki g\\xf6r\\xfclerinin dikkate alnmas ve GDPR kapsamndaki \\xf6zel koruma \\xf6nlemlerine uyulmas \\xf6nerildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/icelands-ppa-offers-advice-for-putting-childrens-images-online/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. Avrupa Veri Koruma Kurulu (EDPB) tarafndan ya dorulama uygulamalar \\xfczerinde \\xe7almaya baland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"spanya Veri Koruma Otoritesi tarafndan yaplan a\\xe7klamada, EDPB tarafndan \\xe7evrimi\\xe7i mecralarda kullanlabilecek ya dorulama y\\xf6nergelerinin oluturulmas \\xfczerine \\xe7allmaya baland ve ilgili \\xe7almann EDPB ve Otorite tarafndan ibirlii i\\xe7erisinde y\\xfcr\\xfct\\xfclecei ifade edildi. spanya Bakanlar Kurulu tarafndan ksa bir s\\xfcre \\xf6nce, kullanclarn yalarna uygun bir hizmet almasn salarken ayn zamanda kullanclarn verilerinin ve mahremiyetinin korunmasn salamak \\xfczere bir \\xe7alma grubunun kurulduu a\\xe7klanmt.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/aepd-edpb-approves-work-on-age-verification-definitions/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. Fransa Veri Koruma Otoritesi (CNIL) tarafndan, sk\\xe7a rastlanan veri ihlali senaryolarnda veri sorumlularna rehberlik etmesi amacyla g\\xf6rsel i\\xe7erikte bir y\\xf6nlendirme \\xe7almas yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNIL tarafndan, baz yaygn veri ihlali senaryolarnn neler olduu ve bu veri ihlalleri kapsamnda yaanan sorunlarn nasl \\xf6nlenecei hususlarn detaylandran bir infografik \\xe7almas yaymland.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cnil-offers-strategies-for-common-data-breaches/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6. Fransz sizlik Kurumu (France Travail) sistemlerinde ger\\xe7ekleen veri ihlalinden 43 milyon kiinin etkilendii belirltildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bleeping Computer'n haberinde, France Travailn 43 milyon kiinin verilerini ihlal eden bir siber saldrya maruz kald belirtildi. France Travail tarafndan, vatandalar ait \\xe7alan aday profilleri de dahil olmak \\xfczere \\xe7eitli kiisel verilerin, meydana gelen siber saldrdan etkilendii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/french-agency-experiences-data-breach/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7. Finlandiya Veri Koruma Otoritesi tarafndan hukuka aykr olarak y\\xfcr\\xfct\\xfclen veri saklama faaliyetleri nedeniyle \\xe7evrimi\\xe7i faaliyet g\\xf6steren bir veri sorumlusuna para cezas verilmesine h\\xfckmedildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Finlandiya Veri Koruma Otoritesi tarafndan; online perakende platformu Verkkokauppa.com'a, veri saklama faaliyetlerini a\\xe7k ekilde ortaya koyan bir saklama ve imha politikasnn uygulamada olmamas, m\\xfcterilerin \\xfcr\\xfcn satn almak i\\xe7in hesap a\\xe7malarnn zorunlu tutulmu olmasve her iki uygulamann da GDPR ihlal ettii gerek\\xe7elerine dayanlarak 856.000 Euro para cezas verildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/finlands-dpa-fines-online-retailer-for-data-retention-compliance-issues/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8. Kanada Veri Koruma Otoritesi tarafndan, Gizlilik Etki Deerlendirmesi (PIA) dok\\xfcman ve eklerinin Otoriteye sunulmasna hizmet eden \\xe7evrimi\\xe7i bir form uygulamaya alnd. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kanada Veri Koruma Otoritesi tarafndan, yeni bir PIA g\\xf6nderim formunun uygulamaya alnd duyuruldu. Otoritenin web sitesinden eriilebilen PIA g\\xf6nderim formunun, federal kurumlarn etki deerlendirmesine ilikin gereklilikleri yerine getirmeleri adna basit ve g\\xfcvenli bir yol sunduu belirtildi. Otorite tarafndan, PIA s\\xfcrecinin genel anlamda mahremiyeti g\\xfc\\xe7lendirdii, kamu yararn destekledii ve g\\xfcven yaratt belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/canadas-opc-revamps-privacy-assessment-form/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9. Norve\\xe7 Veri Koruma Otoritesi tarafndan, bir kamu kuruluu aleyhine 20 milyon NOK tutarnda para cezasna h\\xfckmedildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Norve\\xe7 Veri Koruma Otoritesi tarafndan, Norve\\xe7 \\xc7alma ve Refah Ofisi'ne kiisel verilerin uygun g\\xfcvenlik \\xf6nlemleri ve eriim kontrolleri olmakszn b\\xfcy\\xfck \\xf6l\\xe7ekte ilenmesi nedeniyle 20 milyon NOK tutarnda para cezas verildi. Otorite tarafndan soruturmann Eyl\\xfcl 2023te a\\xe7ld ve bu s\\xfcre\\xe7te bir dizi yasa ihlali tespit edildii belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/norways-dpa-issues-nok20-million-fine-to-national-labor-and-welfare-office/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10.\tBirleik Krallk (BK) Parlamentosu tarafndan Avrupa Birlii (AB) ile BK arasnda ger\\xe7ekleecek veri aktarmlarna ilikin mevcut yeterlilik kararnn g\\xf6zden ge\\xe7irilecei a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Birleik Krallk Lordlar Kamaras Avrupa leri Komitesi tarafndan, yenileme karar \\xf6ncesinde AB ile BK arasndaki veri aktarmlarna ilikin yeterlilik kararnn g\\xf6zden ge\\xe7irilmesi adna resmi bir inceleme balatld. Bahse konu incelemenin, yeterlilik kararnn g\\xf6zden ge\\xe7irilmesini, mevcut rejime y\\xf6nelik potansiyel zorluklarn incelenmesini ve yeterlilik kararnn feshedilmesi ya da kesintiye uramas halinde ortaya \\xe7kacak sonu\\xe7larn analiz edilmesini i\\xe7erdii ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/uk-parliament-to-review-eu-uk-adequacy-agreement-ahead-of-looming-renewal-decision/\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"GDPR\",\n                \"KVKK\",\n                \"news\",\n                \"privacy\",\n                \"dataprotection\"\n            ]\n        },\n        {\n            id: 13,\n            subtitle: \"GDPR KARARI\",\n            date: \"22.03.2024\",\n            slug: \"google-hizmetleri-kullanan-veri-sorumlusuna-ceza\",\n            title: \"zlanda Veri Koruma Otoritesi, ilkokullarda Google hizmetlerinin kullanmndan kaynaklanan GDPR ihlalleri nedeniyle Reykjavik Belediyesine 13.270  para cezas verdi.\",\n            text: \"zlanda Veri Koruma Otoritesi (Otorite), Reykjavik Belediyesi'nin (Belediye) ilkokullarnda eitim i\\xe7in Google hizmetlerini kullanmasna ilikin soruturma balatmtr. Otorite, Belediye'nin kiisel verilerin yalnzca belirtilen ama\\xe7lar dorultusunda ilenmesini salamas gerektiine, bu hususta gereken tedbirleri almakla y\\xfck\\xfcml\\xfc olduuna karar vermitir. Belediye, hizmet verilerinin Google tarafndan ilenmesinin gereklilii konusunda veri etki deerlendirmesi yapmam; dolaysyla GDPR kapsamndaki y\\xfck\\xfcml\\xfcl\\xfcklerini yerine getirmemitir. Otorite, Belediyeyi ileme faaliyetlerini GDPR ile uyumlu hale getirmesini talimatlandrp, ihlallerin nitelii ve ciddiyetini, \\xe7ocuklarn kiisel verileriyle ilgili olmasn ve hassas veriler bulunabileceini deerlendirerek Belediyeye 13.270  para cezas vermitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"zlanda Veri Koruma Otoritesi, Reykjavik Belediyesi'nin ilkokullarnda eitim i\\xe7in Google Bulut \\xe7\\xf6z\\xfcmlerinin ve Google Workspace'in kullanmn deerlendirmek amacyla resen bir soruturma balatmtr. Veri Koruma Otoritesi, 25 ubat 2022 tarihinde veri sorumlusu olan Reykjavik Belediyesine bir soru formu g\\xf6ndermi ve deerlendirmesini veri sorumlusu tarafndan verilen cevaplara ve aadaki belgelere dayanarak ger\\xe7ekletirmitir:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"1- Google'n \\xf6renci sisteminde ilenen verilerle ilgili t\\xfcm bilgileri i\\xe7eren ve 'ileme dosyas' olarak adlandrlan bir dosya iletilmitir; bu kapsamda dier verilerin yan sra, hemen hemen her hizmet kapsamnda, \\xf6rencilerin adlarnn, e-posta adreslerinin ve ebeveynleri ile sosyal g\\xfcvenlik numaralar hakknda \\xf6renciler tarafndan eklenebilecek ek bilgilerin ilendii anlalmtr.\",\n                        \"2- Ekte ayrca Veri Koruma Etki Deerlendirmesine yer verilmitir, bu deerlendirmede veri sorumlusu, dier ama\\xe7larn yan sra, veri sorumlusu Google'n sistemlerinin okullarda kullanlmasnn amacnn, \\xf6rencilerin akademik ilerlemelerini desteklemek olduunu belirtmitir. Ayrca, kiisel verilerin saklanmas ve silinmesi ile ilgili olarak Veri Koruma Etki Deerlendirmesinde, \\xe7ou verinin t\\xfcm okul yl boyunca saklandn ve \\xf6retmenlerin bu verileri silmeye tevik edildii belirtilmitir. Deerlendirmede ayrca Google ile Belediye arasnda olan ilikiye istinaden bir veri ileme anlamasnn mevcut olduu ve GDPR Madde 28(3) ile uyumlu talimatlar i\\xe7erdii belirtilmitir. Dolaysyla veri sorumlusu Belediye, Veri Koruma Etki Deerlendirmesinde ilkokul \\xf6rencilerinin hak ve \\xf6zg\\xfcrl\\xfcklerine y\\xf6nelik riskleri azaltmak i\\xe7in yeterli tedbirleri ald sonucuna varmtr.\",\n                        \"3- \\xdc\\xe7\\xfcnc\\xfc olarak, Belediye veri ileme s\\xf6zlemesini eklemitir. Belediye ile Google arasndaki anlama, Reykjavik Belediyesi'nin veri sorumlusu, Google'n ise veri ileyen olduunu \\xf6ng\\xf6rm\\xfct\\xfcr. S\\xf6zlemede ayrca, veri sorumlusunun veri ileyene kiisel verilerin ilenmesi konusunda talimat verdii ancak bunun belirli durumlarla snrl olduu belirtilmitir. Ayrca s\\xf6zleme, ileme g\\xfcvenlii, kiisel verilerin aktarm ve dier y\\xfck\\xfcml\\xfcl\\xfcklere ilikin h\\xfck\\xfcmler i\\xe7ermektedir.\",\n                        \"4- Buna ek olarak veri sorumlusu, Google'n bulut hizmetlerine ilikin hizmet artlarn ve Google'n gizlilik politikasn iletmitir. Google'n artlarnda, Google'a veri sorumlusu tarafndan salanan bilgileri ve Google'n kendi toplad bilgileri, kullanclar tarafndan eklenen bilgileri veya hizmetlerinin kullanmna dayal cihaz, log ve konum bilgilerini i\\xe7erdii bilgisi yer almtr. artlar ayrca, Google'n hizmetlerini kullanrken kullanclarn toplad bilgileri yalnzca bu hizmetleri salamak i\\xe7in ilediini ve bu verilerin Google'n gizlilik politikasna uygun olarak ilendii belirtilmitir. Google'n gizlilik politikas m\\xfcteri verileri ile hizmet verileri arasnda ayrm yaparak; m\\xfcteri verilerinin, Reykjavik Belediyesi'nin veya Google'n \\xf6renci sistemi kullanclarnn sistem araclyla Google'a ilettii bilgilerle ilgili olduu ve ileme anlamas kapsamnda ilendii, hizmet verilerinin ise Google tarafndan bulut hizmetlerinin salanmas ve y\\xf6netimi srasnda toplanan veya oluturulan veriler olduu ve gizlilik politikasna uygun olarak ilendii a\\xe7klanmtr.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Son olarak, veri sorumlusu yorumlarnda, sistemlerin yaklak 8.500 \\xf6renci tarafndan kullanldn ve GDPR ile uyumluluu salamak i\\xe7in veri sorumlusu olarak elinden gelen her eyi yaptn iddia etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, veri sorumlusunun a\\xe7klamalarn ve g\\xf6r\\xfclerini dinledikten sonra nihai kararn yaynlamtr. Otorite, \\xf6ncelikle projeler, testler ve \\xf6renciler tarafndan kaydedilen dier veriler de dahil olmak \\xfczere m\\xfcteri verilerinin, belirli \\xf6rencilerle ilikilendirilebilmesi halinde GDPR kapsamnda her zaman kiisel veri olarak kabul edilmesi gerektiini ve ayn hususun onlarla ilikilendirilebilen hizmet verileri i\\xe7in de ge\\xe7erli olduunu a\\xe7klamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xd6n deerlendirmesinde Otorite, eitim balamnda \\xe7ocuklarn kiisel verilerinin GDPR h\\xfck\\xfcmlerine, \\xf6zellikle de \\xf6l\\xe7\\xfcl\\xfcl\\xfck ve veri minimizasyonu ilkelerine uygun olarak ilenmesini salamann son derece \\xf6nemli olduunu vurgulamtr. Otorite ayrca bu t\\xfcr kiisel verilerin ilenme amacnn dar bir ekilde tanmlanmas gerektiini belirtmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, Belediye'nin ilkokullarda Google sistemlerini kullanmaya karar vermesi nedeniyle, GDPR kapsamnda bir veri sorumlusu olarak kabul edilmesi gerektiini tespit etmitir. Bununla birlikte, Belediye tarafndan salanan a\\xe7klamalar nda Otorite, Belediyenin hizmet verilerinin Google tarafndan ilenmesiyle ilgili olarak bir veri sorumlusu olarak kabul edilemeyeceini, \\xe7\\xfcnk\\xfc ileme ama\\xe7larn ve kapsamn belirleyen ve bu durumda bir veri sorumlusu olan tarafn Google olduunu kabul etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yine de Veri Koruma Otoritesi, Google'n hizmetlerinden yararlanmaya karar verenin Belediye olmas nedeniyle, Belediyenin sorumluluktan tamamen muaf tutulamayacan deerlendirmitir. Otorite, veri sorumlularnn ileme faaliyetlerinin her zaman GDPR Madde 5'in ileme ilkelerine uygun olmasn salamaktan sorumlu olduunu ve GDPR Madde 24 kapsamnda bunu salamak i\\xe7in uygun \\xf6nlemleri almakla y\\xfck\\xfcml\\xfc olduunu a\\xe7klamtr. Ayrca, bir kiiye veri sorumlusu adna ileme g\\xf6revi verildiinde, GDPR Madde 28(1) uyarnca ileme i\\xe7in yeterli g\\xfcvence salayan veri ileyenleri se\\xe7mekle y\\xfck\\xfcml\\xfc olan tarafn veri sorumlusu olduu deerlendirilmitir. Otorite, EDPB Klavuz lkeleri 7/2020'ye atfta bulunarak, veri sorumlusunun ileme faaliyetini bir hizmet salaycya emanet ederken, 'hizmet salaycnn, ileme faaliyetinin nitelii, kapsam, balam ve amac bakmndan ve kaytl kii i\\xe7in ileme faaliyetiyle ilikili olas riskleri dikkate alarak, sorumluluunu yeterli bir ekilde yerine getirmesini salayp salamadn dikkatli bir ekilde deerlendirmesi gerektiini' a\\xe7klamtr. Ayrca veri sorumlusunun, yeterli ileme s\\xf6zlemelerini art komaktan ve ama\\xe7la snrllk ilkesinin salanmasn temin etmekten sorumlu olmas gerektii ifade edilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dolaysyla Otorite, bir hizmet salaycnn bir veri sorumlusuyla yapt ileme anlamas temelinde eriim salad kiisel verileri kullanmas ve bu verileri kendi ama\\xe7lar i\\xe7in kullanmas durumunda, bu hizmet salaycsnn bir veri sorumlusu olarak kabul edilmesi gerektiini tespit etmitir. S\\xf6z konusu soruturmada, bu t\\xfcr bir ilemenin GDPR ihlaline sebebiyet verdii de deerlendirilmitir. Otorite \\xf6zellikle, Belediye'nin her hal\\xfckarda kiisel verilerin kendi belirledii ileme ama\\xe7lar dorultusunda ilenmesini salamas gerektiine karar vermitir. Hizmet verilerinin ilenmesi veri ileme s\\xf6zlemesine dahil edilmediinden, Belediye hizmet verilerinin Google tarafndan ilenmesinin gerekli olup olmad deerlendirmesini yapmam ve dolaysyla GDPR Madde 5(1), GDPR Madde 24(1) ve GDPR Madde 28(1) kapsamndaki y\\xfck\\xfcml\\xfcl\\xfcklerini yerine getirmemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"kinci olarak Otorite, veri ileme s\\xf6zlemesi Google'n kiisel verileri daha fazla ilemesini engellemediinden, s\\xf6zlemenin GDPR Madde 28(3)(a)'y ihlal ettiine karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri ileme faaliyetinin hukuka uygunluuna ilikin olarak veri sorumlusu, Google sistemleri araclyla \\xf6rencilerin kiisel verilerinin ilenmesinin GDPR Madde 6(1)(f) kapsamnda kamu yararna bir g\\xf6revin yerine getirilmesi i\\xe7in gerekli olduunu iddia etmitir. Otorite, bu durumda ilenen kiisel verilerin belirli bir ama\\xe7 i\\xe7in gerekli olmas ve \\xe7ocuklarn kiisel verilerinin \\xf6zel korumay hak ettii ger\\xe7eini de dikkate alarak \\xf6l\\xe7\\xfcl\\xfcl\\xfck ilkesini yanstmas gerektiine karar vermitir. M\\xfcteri verileriyle ilgili olarak Otorite, \\xf6rencilerin kiisel verilerinin belirli ama\\xe7lar i\\xe7in ilendii ve okulun kamusal g\\xf6revini yerine getirmesi i\\xe7in gerekli kabul edilebilecei sonucuna varmtr. Bununla birlikte, hizmet verilerinin Google tarafndan ilenmesine ilikin olarak Otorite, GDPR Madde 5(1)(b) uyarnca, veri sorumlusunun \\xf6rencilerin verilerinin ileme i\\xe7in belirtilen ama\\xe7lar dnda kullanlmadndan emin olma y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfc yinelemitir. Otoriteye g\\xf6re veri sorumlusu; Google'n gizlilik politikasnn, Google'n hizmet verilerini baka ama\\xe7lar i\\xe7in kullanabileceini belirttiinden ve veri sorumlusu bu t\\xfcr bir ileme konusunda bir pozisyon almadndan, GDPR Madde 5(1)(b) ve GDPR Madde 6(4)'\\xfc ihlal etmi olmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"D\\xf6rd\\xfcnc\\xfc olarak tasarmla mahremiyet ve varsaylan olarak mahremiyet gereklilikleri ile ilgili olarak Otorite, veri sorumlusunun bu ilkeleri uygulamak i\\xe7in gerekli organizasyonel \\xf6nlemleri almad sonucuna varmtr. Ayrca, GDPR Madde 5(1)(e) kapsamndaki verileri saklama snrlamas ilkesi ile ilgili olarak Otorite, veri sorumlusunun bu ilke ile ilgili olarak verileri sakladn, ancak Google'n bulut hizmetleri i\\xe7in gizlilik politikasndan kiisel verileri ne kadar s\\xfcreyle sakladnn a\\xe7k olmadn tespit etmitir. Bu nedenle Otorite, bu konuda ilgili bilgileri edinmenin ve bu konuda bir pozisyon almann veri sorumlusunun sorumluluunda olduuna karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Beinci olarak Otorite, veri sorumlusu tarafndan y\\xfcr\\xfct\\xfclen Veri Koruma Etki Deerlendirmesi'nin GDPR Madde 35(7)'nin t\\xfcm asgari gerekliliklerini i\\xe7ermedii i\\xe7in tam olarak kabul edilemeyeceine karar vermitir. \\xd6zellikle, Google tarafndan hizmet verileri \\xfczerinde ger\\xe7ekletirilen ileme faaliyetlerini (a) bendi kapsamnda ileme tanmna dahil etmemi; (b) bendi kapsamnda ilemenin gerekliliini deerlendirmemi ve ayrca (c) bendi kapsamnda bireylerin hak ve \\xf6zg\\xfcrl\\xfcklerine y\\xf6nelik riskleri yeterince deerlendirmemitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Son olarak Otorite, veri sorumlusunun kiisel verilerin ABD'ye g\\xfcvenli bir ekilde aktarlmasn salayamadna ve dolaysyla GDPR Madde 44'\\xfc ihlal ettiine karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"T\\xfcm bunlarn nda, Otorite ilk olarak Belediyeye GDPR Madde 58(2)(d) uyarnca ileme faaliyetlerini GDPR ile uyumlu hale getirmesi talimatn vermitir. Buna ek olarak, ihlallerin varl, nitelii ve ciddiyeti, \\xe7ocuklarn kiisel verileriyle ilgili olmas ve potansiyel olarak hassas kiisel veriler i\\xe7erebilecei g\\xf6z \\xf6n\\xfcne alnarak GDPR Madde 83(2)(a) ve GDPR Madde 83(2)(g) uyarnca veri sorumlusuna 2.000.000 ISK / 13.270  tutarnda idari para cezas vermitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"lgili karara buradan ulaabilirsiniz.\",\n                    href: \"https://gdprhub.eu/index.php?title=Pers%C3%B3nuvernd_(Island)_-_2022020363&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"KVKK\",\n                \"icelanddpa\",\n                \"google\",\n                \"education\",\n                \"databreach\"\n            ]\n        },\n        {\n            id: 12,\n            subtitle: \"GDPR KARARI\",\n            date: \"20.03.2024\",\n            slug: \"yerinde-incelemelerde-vucut-kamerasi-kullanilarak-veri-islenmesi\",\n            title: \"Romanya Veri Koruma Otoritesi, Ulusal T\\xfcketiciyi Koruma Kurumu'nun irketlere y\\xf6nelik soruturmalarnda v\\xfccut kameralar kullanmasn durdurmasn emretti.\",\n            text: \"Romanya Veri Koruma Otoritesi (Otorite)nin, Ulusal T\\xfcketiciyi Koruma Kurumunun iletmelerde yapt yerinde incelemeler srasnda v\\xfccut kameralar kullanmas ile ilgili balatt soruturmada; kameralarn \\xe7alanlarn yan sra maazalar gibi alanlardaki dier kiilerin de g\\xf6r\\xfcnt\\xfclerini kaydettii ve 6 aydan fazla s\\xfcre saklad tespit edilmitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Mays 2023'ten itibaren veri sorumlusu Ulusal T\\xfcketiciyi Koruma Kurumu (ANPC), iletmelerle yaplan yerinde incelemeler srasnda giysiye takl v\\xfccut kameras cihazlar kullanmtr. Cihazlar, ANPC tarafndan delil olarak kullanlmak \\xfczere ilgili kontrol eylemlerini kaydetmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ANPC'nin giysiye takl v\\xfccut kamera cihazlar kullanarak veri koruma mevzuatn ihlal ettiine dair ikayetler \\xfczerine Romanya Veri Koruma Otoritesi (Otorite) bir soruturma a\\xe7mtr. Soruturma; kaytlarn meslektalarn, \\xe7alanlarn veya ticari iletmelerin temsilcilerinin yan sra maazalar, y\\xfczme havuzlar, restoranlar, barlar veya salonlardaki \\xe7ocuklar veya yetikinler de dahil olmak \\xfczere dier \\xf6zel kiilerin de g\\xf6r\\xfcnt\\xfclerini yakaladn g\\xf6stermitir. Ayrca v\\xfccut kameras cihazlar araclyla ilenen kiisel verilerin herhangi bir anlama olmakszn ve herhangi bir denetim olmakszn 6 aydan fazla bir s\\xfcre boyunca sakland ortaya \\xe7kmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, veri ileme faaliyetlerinin yasal dayanan deerlendirmi ve veri sorumlusunun, kontrol faaliyetleri balamnda bu t\\xfcr cihazlarn kullanlmasn m\\xfcmk\\xfcn klan a\\xe7k yasal h\\xfck\\xfcmler olduunu kantlayamadna karar vermitir. Veri ileme faaliyetinin ayrca kamu yararna y\\xfcr\\xfct\\xfclen bir g\\xf6revin yerine getirilmesi veya veri sorumlusuna verilen resmi yetkinin kullanlmas i\\xe7in de gerekli olmad tespit edilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda Otorite, veri sorumlusunun GDPR Madde 5(1)(a) ve 6(a)'y ihlal ettiini belirtmi ve v\\xfccut kameras cihazlar araclyla ger\\xe7ekletirilen kiisel veri ileme faaliyetlerinin durdurulmas ve bu t\\xfcr cihazlarn kullanm sonucunda daha \\xf6nce kaydedilen kiisel verilerin silinmesi emriyle birlikte veri sorumlusuna bir uyar vermitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"lgili karara buradan ulaabilirsiniz.\",\n                    href: \"https://gdprhub.eu/index.php?title=ANSPDCP_(Romania)_-_Fine_to_ANPC_(National_Authority_for_Consumer_Protection)&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"KVKK\",\n                \"romaniadpa\",\n                \"bodycamera\",\n                \"databreach\"\n            ]\n        },\n        {\n            id: 11,\n            subtitle: \"Haftalk IAPP Haberleri\",\n            date: \"19.03.2024\",\n            slug: \"haftalik-iapp-haberleri-2\",\n            title: \"Haftalk IAPP Haberleri 12 - 19 Mart 2024\",\n            text: \"D\\xfcnya Genelinde Kiisel Verilere likin G\\xfcncel Gelimeler\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1.\tsve\\xe7 stinaf Mahkemesi tarafndan, bir finansal hizmet irketine Avrupa Genel Veri Koruma T\\xfcz\\xfc\\xfc (GDPR) ihlalleri nedeniyle 7,5 milyon sve\\xe7 Kronu tutarnda ceza kesildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Reuters'in haberine g\\xf6re, GDPR h\\xfck\\xfcmlerini ihlal ettii iddiasyla finans hizmetleri irketi Klarna'ya verilen cezann sve\\xe7 dari stinaf Mahkemesi tarafndan 7,5 milyon sve\\xe7 Kronu'na y\\xfckseltildii a\\xe7kland. \\xd6nceki yl, ilk derece mahkemesi tarafndan irketin 6 milyon sve\\xe7 Kronu ceza \\xf6demesi gerektiine h\\xfckmedilirken, istinaf mahkemesi tarafndan, Klarna'nn m\\xfcterilerine kiisel verilerinin nasl sakland konusunda net ve a\\xe7k  bilgi vermedii gerek\\xe7esiyle ilgili para cezasnn 7,5 milyon sve\\xe7 Kronuna y\\xfckseltilmesine karar verildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/financial-services-company-fined-733324-for-gdpr-regulations/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2.\tGeneral Motors'un s\\xfcr\\xfcc\\xfclerin verilerini sigorta irketleriyle paylat iddia edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"The New York Times'n haberinde, otomobil \\xfcreticisi firmalar tarafndan s\\xfcr\\xfcc\\xfclerin verilerinin veri komisyoncusu LexisNexis araclyla sigorta irketleriyle paylald iddia edildi. LexisNexis tarafndan t\\xfcketicinin talebi \\xfczerine t\\xfcketiciyle paylalan t\\xfcketici bilgilendirme raporunun i\\xe7erii incelendiinde General Motors tarafndan, t\\xfcketicilerin hz ve kilometre dahil s\\xfcr\\xfc bilgilerinin s\\xfcr\\xfcc\\xfclerin rzas olmakszn LexisNexis ile paylald tespit edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/general-motors-shared-drivers-data-with-insurance-companies/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3.\tABD Temsilciler Meclisi Komitesi tarafndan veri komisyoncularnca ger\\xe7ekletirilen yurt d veri aktarmlarnn snrlandrlmasna ilikin kanun tasars onayland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ABD Temsilciler Meclisi Enerji ve Ticaret Komitesi tarafndan, ABD merkezli veri komisyoncular tarafndan \\xf6zel nitelikli kiisel verilerin yurt dnda mukim ABD hasmlarna  aktarlmasn engelleyen kanun tasars onayland. Bahse konu yasann, ABD Bakan Joe Biden'n benzer aktarm faaliyetlerini konu alan son kararnamesini tamamlayc nitelikte olduu a\\xe7kland.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/us-house-committee-approves-bill-to-limit-data-brokers-foreign-data-transfers/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4.\tAvrupa Birlii Adalet Divan (ABAD) tarafndan, veri koruma otoritelerinin ikayete gerek olmakszn veri silme talimat verebileceine h\\xfckmedildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ABAD tarafndan, bir \\xfcye devletin veri koruma otoritesinin, ilgili kii tarafndan otoriteye GDPR h\\xfck\\xfcmleri uyarnca ger\\xe7ekletirilen bir ikayet olmakszn da kiisel verilerin silinmesine y\\xf6nelik karar almaya yetkili olduuna karar verildi. Bahse konu karar, bir belediyenin Covid-19 yardm fonlarnn verilmesi amacyla Macaristan Devlet Hazinesi'nden b\\xf6lge sakinlerinin kiisel bilgilerini talep etmesi akabinde Budapete Y\\xfcksek Mahkemesi yarglamasna konu olan dava \\xf6zelinde Mahkemenin yorum talebi \\xfczerine alnd.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cjeu-issues-interpretation-in-budapest-high-court-deletion-case/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5.\tAirbnb tarafndan g\\xf6zetim ve izleme politikas g\\xfcncellenerek i\\xe7 mekan kameras kullanm yasakland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"NPR tarafndan yaymlanan habere g\\xf6re; Airbnbnin, g\\xfcvenlik politikalarnda yapt g\\xfcncellemenin bir par\\xe7as olarak platform i\\xe7erisindeki kiralk m\\xfclklerde kameralar ve ses kayt cihazlar da dahil olmak \\xfczere i\\xe7 mekan izleme ve g\\xf6zetleme cihazlarnn kullanm yasakland. Politikann 30 Nisan tarihinde y\\xfcr\\xfcrl\\xfce girecei ve politika kapsamnda, mahremiyet beklentisi daha y\\xfcksek olan alanlarda d mekan kameralarnn da kullanmnn yasaklanaca a\\xe7kland.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/airbnb-bans-indoor-cameras-in-surveillance-policy-update/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6.\tDanimarka Veri Koruma Otoritesince bir gazete tarafndan hukuka aykr olarak \\xe7erez duvar  kullanlmasna y\\xf6nelik olarak karar verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Danimarka Veri Koruma Otoritesi tarafndan Berlingske Gazetesine \\xe7erez y\\xf6netim paneli kullanmn GDPRa uygun hale getirmesi talimat verildi. Otorite tarafndan yaplan bir soruturmada, bir kullancnn veri toplanmasna izin vermemesi halinde irketin i\\xe7erii engelledii tespit edildi. Otorite tarafndan bahse konu uygulamann GDPR kapsamnda hukuka uygun olarak verilen a\\xe7k rza gerekliliklerini karlamad belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/denmarks-dpa-decides-cookie-walls-that-block-content-violates-user-consent/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7.\tFransa Veri Koruma Otoritesi (CNIL) tarafndan se\\xe7men gizliliini koruma plan a\\xe7kland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNIL tarafndan 'se\\xe7im g\\xf6zlem merkezini yeniden aktif hale getirmek suretiyle' se\\xe7menlerin  gizliliinin korunmas ama\\xe7lanan  se\\xe7men gizliliini koruma plan a\\xe7kland. CNIL tarafndan; se\\xe7menlerin adaylar tarafndan propaganda amacyla toplanan kiisel verilerine \\xf6ncelik verilmesinin  ve hedefli siyasi reklamlarn ortadan kaldrmasnn ama\\xe7land a\\xe7kland.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cnil-announces-plan-to-protect-voter-privacy/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8.\tAvrupa Parlamentosu tarafndan Siber Dayankllk Yasas kabul edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avrupa Parlamentosu tarafndan 12 Mart 2024 tarihinde Siber Dayankllk Yasas kabul edildi. Bahse konu yasann; ifre y\\xf6neticileri, akll ev asistanlar ve dier Nesnelerin nterneti cihazlar gibi \\xfcr\\xfcnleri kapsad belirtilirken ilgili yasa kapsamnda, \\xfcr\\xfcnlerin bilgi g\\xfcvenlii risklerine g\\xf6re snflandrlaca  ifade edildi. Yasann y\\xfcr\\xfcrl\\xfce girmesi i\\xe7in ise Avrupa Birlii Bakanlar Konseyi tarafndan kabul edilmesi gerekiyor.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/european-parliament-passes-cyber-resilience-act/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9.\tAvrupa Veri Koruma Denet\\xe7isi (EDPS) tarafndan, Avrupa Komisyonu'nun Microsoft 365 kullanmnn Avrupa Birlii veri koruma yasalarn ihlal ettii tespit edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"EDPS tarafndan, Avrupa Komisyonu'nun Microsoft 365 kullanmnn, AB kurumlar, organlar, ofisleri ve ajanslar tarafndan ilenen kiisel verilerin korunmasn d\\xfczenleyen  2018/1725 sayl AB T\\xfcz\\xfc\\xfcn\\xfcn  \\xe7eitli h\\xfck\\xfcmlerini ihlal ettii tespit edildi. EDPS tarafndan; Avrupa Komisyonunun Avrupa Ekonomik Alan dna aktarlan kiisel verilerin, baka bir yarg alanna aktarldktan sonra, ayn d\\xfczeyde korunmasn salamak i\\xe7in yeterli \\xf6nlemleri almad iddia edildi. EDPS tarafndan, Avrupa Komisyonunun 9 Aralk tarihine kadar  Microsoft 365 kullanm yoluyla ger\\xe7ekleen t\\xfcm veri aklarn askya almas zorunlu klnd.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/edps-finds-european-commissions-use-of-microsoft-365-violates-provisions-of-gdpr/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10.\tFacebook ve Zoom, Brezilya'da veri toplama nedeniyle para cezasna \\xe7arptrld.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xe3o Lu\\xeds Mahkemesi tarafndan, ilgili irketlerin bir entegrasyon arac araclyla kullanclarn rzas olmakszn kiisel verilerini toplayp paylat tespit edildikten sonra Facebook ve Zoom'un toplu olarak 20 milyon BRL ve her bir Brezilyal Apple iOS kullancsna ise 500 BRL \\xf6demesine karar verildi. Ayn zamanda, irketlerin anlan kiisel verilerin temin edilme usul\\xfcn\\xfc a\\xe7klamalarna ve toplanan kiisel verileri imha etmelerine h\\xfckmedildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/facebook-zoom-hit-with-fines-over-user-data-collection/\"\n                }\n            ],\n            tags: [\n                \"privacy\",\n                \"iapp\",\n                \"news\",\n                \"datadeletion\",\n                \"gdpr\"\n            ]\n        },\n        {\n            id: 10,\n            subtitle: \"GDPR KARARI\",\n            date: \"15.03.2024\",\n            slug: \"bayi-tarafindan-ilgili-kisi-disindaki-ucuncu-tarafa-sim-kart-kopyasinin-paylasilmasi\",\n            title: \"spanya Veri Koruma Otoritesi, ilgili kii dndaki \\xfc\\xe7\\xfcnc\\xfc bir tarafa ilgili kiinin SIM kartnn bir kopyasn salayan veri sorumlusuna 70.000  para cezas verdi.\",\n            text: \"Telekom\\xfcnikasyon hizmetleri sunan bir veri sorumlusunun m\\xfcterisi olan ilgili kii, iki farkl bankadan hesaplarna eriim giriimleri ve \\xfcpheli ilemler yapldna ilikin e-posta almtr. Veri sorumlusu ile iletiime ge\\xe7tiinde ilgili kiiye, SIM kartnn bir kopyasnn \\xe7karld ve bu t\\xfcr mesajlarn s\\xf6z konusu kopyann kullanld dolandrclk faaliyetleri sebebiyle  iletilmi olabilecei belirtilmitir. Bunun \\xfczerine ilgili kii spanya Veri Koruma Otoritesine (Otorite) ikayette bulunmutur. Veri sorumlusu, kopyann \\xfcr\\xfcn ve hizmetlerinin datmndan sorumlu veri ileyenlerde meydana geldiini ve kopyann yalnzca hat sahibi tarafndan yaplabileceini belirtmitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Digi Spain Telecom (Veri sorumlusu), kamuya telekom\\xfcnikasyon hizmetleri sunan bir irkettir. Veri sorumlusunun m\\xfcterilerinden biri olan bir ilgili kii, cep telefonunun ebeke ile balantsnn kesildiini fark etmitir. Ayn g\\xfcn\\xfcn ilerleyen saatlerinde ilgili kii, iki farkl bankadan hesaplarna eriim giriimleri olduu ve Bizum (spanya'da yaygn olarak kullanlan bir mobil \\xf6deme \\xe7\\xf6z\\xfcm\\xfc) araclyla \\xfcpheli ilemler yapld hakknda e-posta almtr. Veri sorumlusu ile iletiime ge\\xe7tiinde ilgili kiiye, SIM kartnn bir kopyasnn \\xe7karld ve bu t\\xfcr mesajlarn s\\xf6z konusu kopyann kullanld dolandrclk faaliyetleri sebebiyle iletilmi olabilecei belirtilmitir. Bu kapsamda, ilgili kii spanya Veri Koruma Otoritesine (Otorite) ikayette bulunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ikayete cevaben, veri sorumlusu, kopyann \\xfcr\\xfcn ve hizmetlerinin datmndan sorumlu sat noktalarndan birinde (Veri leyen) meydana geldiini ve kopyann yalnzca hat sahibi tarafndan ahsen yaplabileceini belirtmitir. Veri sorumlusuna g\\xf6re, s\\xf6z konusu ilemde m\\xfcteri orijinal kimlik belgesini g\\xf6stermeli ve ilemci bunu dorulamaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri sorumlusu ayrca  aadaki iddialarda bulunmutur:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"(a) kopya SIM kart, kimlik dorulama prosed\\xfcr\\xfcne ramen, ilgili kiinin kimliinin su\\xe7lular tarafndan taklit edilmesi nedeniyle verilmitir;\",\n                        \"(b) mobil aa eriim, ilgili kiinin bir sat noktasna gitmesinin ardndan ayn g\\xfcn i\\xe7inde iyiletirilmitir;\",\n                        \"(c) su\\xe7lulara zaten sahip olduklarndan farkl herhangi bir kiisel veri salanmamtr;\",\n                        \"(d) kopya SIM kart talep eden kiinin t\\xfcketici olmamas, kendi bana meruiyet eksiklii veya ilemede \\xf6zen eksiklii anlamna gelmez;\",\n                        \"(e) uygulanan \\xf6zen tedbirlerini g\\xf6z ard ederek veri sorumlusuna kat bir sorumluluk rejimi uygulamak m\\xfcmk\\xfcn deildir;\",\n                        \"(f) GDPR Madde 83(2) uyarnca; \\xf6zel nitelikli kiisel veri ilenmemi olmas, ibirlii ve veri sorumlusu i\\xe7in bir menfaatin bulunmamas gibi hafifletici koullar veri sorumlusunun lehine deerlendirilmelidir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, bir SIM kartn kopyasnn sahibini tanmlanabilir hale getirdiini ve bu nedenle GDPR Madde 4(1) uyarnca kiisel veri olduunu belirtmitir. Ayrca, \\xfc\\xe7\\xfcnc\\xfc bir tarafn ilgili kiinin kimliine b\\xfcr\\xfcnmesi durumunda, \\xf6rnein banka hesaplarna eriip kontrol edebilecekleri i\\xe7in kiisel verilerin yasad bir ekilde ilenmesinin s\\xf6z konusu olduuna dikkat \\xe7ekmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, bir veri sorumlusunun GDPR uyumluluunu salamak i\\xe7in uygun \\xf6nlemleri uygulama ve hesap verebilirlik ilkesi gerei bu uyumluluu g\\xf6sterme y\\xfck\\xfcml\\xfcl\\xfc\\xfc olduunu hatrlatmtr S\\xf6z konusu olayda, \\xfc\\xe7\\xfcnc\\xfc bir tarafa m\\xfckerrer bir SIM kart salanmas, m\\xfcterilerin veri koruma haklarn kesinlikle ihlal etmitir. Bununla birlikte, Otorite'ye g\\xf6re, veri sorumlusu kendi kimlik dorulama prosed\\xfcr\\xfcn\\xfc izlediini kantlayamamtr. Dolaysyla, b\\xf6yle bir durumda m\\xfckerrer SIM kartn verilmemesi gerektiini savunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Otorite, genel bir kural olarak, telekom operat\\xf6rlerinin bir s\\xf6zlemenin ifas i\\xe7in gerekli olduu i\\xe7in m\\xfcterilerinin verilerini GDPR Madde 6(1)(b) temelinde ilediini vurgulamtr. SIM kartlarn \\xe7oaltlmas da dahil olmak \\xfczere hizmetlerini salamak i\\xe7in, bu operat\\xf6r veri sorumlularnn veri ileyen olarak hareket eden yetkili temsilcilerden oluan bir aa sahip olduunu ancak ileme ara\\xe7larn ve ama\\xe7larn belirledikleri i\\xe7in veri sorumlusu olmaya devam ettiklerini ve  bu nedenle, olas ihlallerden sorumlu olduklarn vurgulamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda Otorite, veri sorumlusunun yeterli teknik ve idari tedbirleri  almadn ve bunun da \\xfc\\xe7\\xfcnc\\xfc bir tarafn kimlik hrszl yaparak ilgili kiinin kiisel verilerine eriim salamasna izin verdiini deerlendirmitir. Otorite'nin g\\xf6r\\xfc\\xfcne g\\xf6re, \\xfc\\xe7\\xfcnc\\xfc bir tarafn herhangi bir yasal dayanak olmakszn kiisel verilere erimesi nedeniyle GDPR Madde 6(1)'in ihlali ger\\xe7eklemitir. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sonu\\xe7 olarak Otorite, GDPR Madde 6(1)'in ihlali nedeniyle veri sorumlusuna 70.000 Euro para cezas vermitir. Otorite, para cezasnn miktarn belirlemek i\\xe7in, sahtekarln farkna varlmasnn ardndan alnan ve etkili olduu d\\xfc\\xfcn\\xfclen \\xf6nlemler dnda, veri sorumlusu tarafndan \\xf6ne s\\xfcr\\xfclen neredeyse dier t\\xfcm hafifletici nedenleri reddetmitir.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"lgili karara buradan ulaabilirsiniz.\",\n                    href: \"https://gdprhub.eu/index.php?title=AEPD_(Spain)_-_00636-2022&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"KVKK\",\n                \"spaindpa\",\n                \"telecom\",\n                \"personaldata\",\n                \"simcard\",\n                \"databreach\"\n            ]\n        },\n        {\n            id: 9,\n            subtitle: \"GDPR KARARI\",\n            date: \"13.03.2024\",\n            title: \"Polonya Veri Koruma Otoritesi, kiisel veri ihlali hakknda Otoriteyi ve t\\xfcm ilgili kiileri bilgilendirmedii i\\xe7in bir konut topluluuna para cezas verdi.\",\n            slug: \"polonya-veri-koruma-otoritesi-karari-1\",\n            text: \"Kiralk konutlar y\\xf6neten ve bu konutlarn bakmn yapan bir konut topluluunun (veri sorumlusu) kiraclarnn (ilgili kiiler) kiisel verilerini i\\xe7erir belgelerinin \\xe7alnmas \\xfczerine veri sorumlusu ilgili kiilerden yalnzca birini bilgilendirmi ve Polonya Veri Koruma Otoritesine (Otorite) de bildirimde bulunmamtr.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"ubat 2020'de, kiralk konutlar y\\xf6neten ve bu konutlarn bakmn yapan bir konut topluluuna ait (veri sorumlusu), kiraclarn (ilgili kiiler) kiisel verilerini i\\xe7eren belgeler \\xe7alnmtr. \\xc7alnan kiisel veriler, isimler, adresler, banka hesap bilgilerinin yan sra, iki ilgili kiinin kiisel kimlik numarasn i\\xe7eren bir noter senedinden olumaktadr. Ancak, veri sorumlusu ilgili kiilerden yalnzca birini - noter senedinde kiisel verileri bulunan kiiyi - bilgilendirmitir. Ayrca, GDPR Madde 33(1)'in gerektirdii ekilde Polonya Veri Koruma Otoritesine (Otorite) bildirimde bulunmamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ekim 2020'de, Otorite bu olay hakknda bilgi veren isimsiz bir ihbar almtr. hbar \\xfczerine Otorite bir soruturma balatm ve bu dorultuda ihlalden etkilenen ilgili kiilerin says ve \\xe7alnan veri kategorileri de dahil olmak \\xfczere veri sorumlusundan bilgi talep etmitir. Veri sorumlusu, ilgili kiileri veri ihlali hakknda s\\xf6zl\\xfc olarak bilgilendirdiini ve Veri Koruma Otoritesinin de bilgilendirilmesi gerektiinin farknda olmadn iddia etmitir. Ayrca veri sorumlusu, senedi hazrlayan noter (veri ileyen) ile bir veri ileme s\\xf6zlemesi imzalamadn bildirmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lk olarak Veri Koruma Otoritesi GDPR Madde 33(1)'in, ilgili kiilerin hak ve \\xf6zg\\xfcrl\\xfcklerine y\\xf6nelik riskin k\\xfc\\xe7\\xfck olduu veya hi\\xe7 risk olmad haller haricinde, veri sorumlusunun herhangi bir kiisel veri ihlalini 72 saat i\\xe7inde Veri Koruma Otoritesine bildirmesini zorunlu kldn hatrlatmtr. Bu olayda Otorite, \\xe7alnan kiisel verilerin yetkisiz bir \\xfc\\xe7\\xfcnc\\xfc taraf\\xe7a kimlik dolandrcl yapmak i\\xe7in kullanlabileceini belirtmitir. Dolaysyla, Veri Koruma Otoritesi ilgili kiilerin haklarna y\\xf6nelik y\\xfcksek bir risk olduunu deerlendirmi ve veri sorumlusunun veri ihlalini Veri Koruma Otoritesine bildirmeyerek GDPR Madde 33(1)'i ihlal ettiine karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"kinci olarak, Veri Koruma Otoritesi veri sorumlusunun kiisel verilerin adil ve effaf bir ekilde ilenmesini (GDPR Madde 5(1)(a)) ve uygun teknik ve organizasyonel \\xf6nlemlerin alnmasn salamak i\\xe7in veri ileyen ile yazl bir veri ileme protokol\\xfc imzalamayarak GDPR Madde 28(1), (3) ve (9)'u ihlal ettiine karar vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xdc\\xe7\\xfcnc\\xfc olarak Veri Koruma Otoritesi, veri sorumlusunun GDPR Madde 34(1)'i ihlal ederek etkilenen ilgili kiilerden yalnzca birini bilgilendirdiine dikkat \\xe7ekmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yukarda belirtilen ihlaller nedeniyle, Veri Koruma Otoritesi veri sorumlusuna 1.556,28 PLN (yaklak 340 ) para cezas vermitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\"\n                },\n                {\n                    type: \"link\",\n                    content: \"lgili karara buradan ulaabilirsiniz.\",\n                    href: \"https://gdprhub.eu/index.php?title=UODO_(Poland)_-_DKN.5131.31.2021&mtc=today\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"KVKK\",\n                \"polanddpa\",\n                \"databreach\",\n                \"housing\",\n                \"personaldata\"\n            ]\n        },\n        {\n            id: 8,\n            subtitle: \"Haftalk IAPP Haberleri\",\n            date: \"12.03.2024\",\n            slug: \"haftalik-iapp-haberleri-1\",\n            title: \"Haftalk IAPP Haberleri 5 - 12 Mart 2024\",\n            text: \"D\\xfcnya Genelinde Kiisel Verilere likin G\\xfcncel Gelimeler\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"1.\tFransa Veri Koruma Otoritesi (CNIL) tarafndan, veri simsar ihlalleri nedeniyle bir telefon aratrmas irketine para cezas verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CNIL tarafndan; telefon aratrmas irketi olan FORIOU'ya, simsarlardan veri satn ald ve bunlar ilgili kiilerin rzas olmakszn kulland iddiasyla 310.000 euro para cezas verildi. Yetkililer tarafndan, irketin iddia edilen veri almlar i\\xe7in AB Genel Veri Koruma T\\xfcz\\xfc\\xfc (GDPR) kapsamnda ge\\xe7erli bir yasal dayana olmad belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/cnil-hits-commercial-prospector-for-data-broker-violations/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2.\tAvrupa Birlii Adalet Divan ('ABAD') tarafndan, cezai mahkumiyete ilikin bilgilerin gizlilik yasalar kapsamnda olduu belirtildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ABAD tarafndan, bir kiinin cezai mahkumiyetinin s\\xf6zl\\xfc olarak bildirilmesinin AB gizlilik hukuku kapsamnda olduuna ve talep sahibinin \\xf6zel bir menfaati olmad s\\xfcrece bu ilemin ger\\xe7ekletirilmemesi gerektiine h\\xfckmedildi. Bahse konu kararn, Dou Finlandiya Temyiz Mahkemesi'nde g\\xf6r\\xfclen ve mahkemenin elence irketi Endemol Shine Finland Oy'a bir kiinin sabka kaydna ilikin verileri vermeyi reddettii bir davadan \\xe7kt ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/european-court-of-justice-says-criminal-convictions-fall-under-privacy-laws/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"3.\tKatalonya Veri Koruma Otoritesi ('Otorite') tarafndan, kripto para karlnda takas edilen biyometrik verilere ilikin klavuz yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Katalonya Veri Koruma Otoritesi tarafndan kripto para transferlerinde kullanlan g\\xf6z taramalar da dahil olmak \\xfczere biyometrik verilerin kullanmna ilikin bir klavuz yaymland. Otorite tarafndan, vatandalarn 'kiisel verilerin deerinin, kontrols\\xfcz olarak paylalmas ve aktarlmasyla ilgili risklerin farknda olmalarn' salamak i\\xe7in biyometrik veriler toplanmadan \\xf6nce vatandalara aydnlatlm onam alnmas  gerektii belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/catalonia-dpa-issues-guidance-on-biometric-data-exchanged-for-cryptocurrency/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4.\tngiltere Veri Koruma Otoritesi ('ICO') tarafndan, bir hayat sigortas irketine istenmeyen aramalar nedeniyle 80.000 GBP ceza verildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ICO tarafndan hayat sigortas irketi olan Pinnacle Life'a t\\xfcketicilere 'agresif' ve 'yanltc' aramalar yapt i\\xe7in 80.000 GBP para cezas verildi. Otorite tarafndan, Pinnacle'n 47.998 istenmeyen arama yapt ve yaptrm kararlarndan ka\\xe7nmak i\\xe7in baka bir isim altnda faaliyet g\\xf6stermeye \\xe7alt belirtildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/pinnacle-life-hit-with-gbp80000-fine-for-spam-calls/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5.\tHollanda vatandalarnn hassas verilerinin \\xe7alnd ve Dark Web'de yaynland belirtildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"RTL Nieuws'un haberine g\\xf6re, ge\\xe7tiimiz yl Hollanda merkezli iletmelere yaplan fidye yazlm saldrlar sonucu \\xe7alnan Hollanda pasaportlarnn binlerce kopyasnn Dark Web'de eriime a\\xe7ld ifade edildi. Hollanda vatandalarna ait dier hassas veriler arasnda hesap \\xf6zetleri, maa bordrolar ve boanma belgelerinin yer ald ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/thousands-of-dutch-citizens-sensitive-documents-stolen-and-posted-on-dark-web/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6.\tsrail Veri Koruma Otoritesi (PPA) tarafndan \\xe7alanlarn biyometrik verilerinin ilenmesine ilikin rehber yaymland.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"PPA tarafndan, iyerinde biyometrik teknoloji kullanmay d\\xfc\\xfcnen kamu kurulular ve \\xf6zel kurulular i\\xe7in bir politika rehberi yaymland. Bu rehberde verilerin nasl toplanabilecei ve nasl kullanlmas gerektiinin a\\xe7kland ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/israel-publishes-employee-biometrics-guidelines/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"7.\tAvrupa Komisyonu tarafndan, Meta'ya 'Pay or Okay' hizmeti hakknda resmi bilgi talebi g\\xf6nderildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avrupa Komisyonu tarafndan, Dijital Hizmetler Yasas kapsamnda Meta'ya resmi bir bilgi talebi g\\xf6nderildii a\\xe7kland. Komisyon tarafndan, Meta'nn abonelie dayal reklamsz hizmeti, \\xf6zellikle Facebook ve Instagram'n reklam uygulamalar, tavsiye sistemleri ve abonelik modeline y\\xf6nelik risk deerlendirmeleri hakknda bilgi istendii belirtildi. Buna ek olarak The New York Times'n haberinde, Dijital Hizmetler Yasas gibi k\\xfcresel d\\xfczenlemelerin, B\\xfcy\\xfck Teknoloji irketlerinin \\xfcr\\xfcnlerini t\\xfcketicilere nasl uyarladklar konusunda b\\xfcy\\xfck bir deiime neden olduu ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/european-commission-issues-rfi-to-meta/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"8.\tKanada Y\\xfcksek Mahkemesi tarafndan, polisin IP adreslerini kullanabilmek i\\xe7in arama iznine sahip olmas gerektiine h\\xfckmedildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"CBC News'in haberinde Kanada Y\\xfcksek Mahkemesi tarafndan, IP adreslerine ilikin vatandalarn  makul bir gizlilik  beklentisi olduu belirtilerek kolluk kuvvetlerinin IP adresi elde etmek i\\xe7in bir arama izni olmas gerektiine h\\xfckmedildi. British Columbia Temel \\xd6zg\\xfcrl\\xfckler Dernei Dava Direkt\\xf6r\\xfc Vibert Jack tarafndan, Kanadallarn IP adreslerini kullanrken mahremiyet beklentisi olmayaca fikrinin \\xe7ok korkutucu olduu ifade edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/canadas-supreme-court-says-police-must-have-a-warrant-to-obtain-an-ip-address/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"9.\tABDde casus yazlm teknoloji irketine y\\xf6nelik yaptrm karar alnd.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"GovInfoSecurity'nin haberinde, ABD Hazine Bakanlnn, casus yazlm irketi Intellexa Consortium'a kar, irketin kulland casus yazlm teknolojisinin h\\xfck\\xfcmet yetkililerini izlemek i\\xe7in kullanld iddias \\xfczerine yaptrm karar alnd ifade edildi. Hazine Bakanl tarafndan yaplan a\\xe7klamada, irketin teknolojisinin 'yabanc akt\\xf6rler tarafndan insan haklar ihlallerini m\\xfcmk\\xfcn klmak ve d\\xfcnyann d\\xf6rt bir yanndaki muhalifleri bask ve misilleme i\\xe7in hedef almak amacyla k\\xf6t\\xfcye kullanld' iddia edildi.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/us-issues-sanctions-against-spyware-technology-company/\"\n                },\n                {\n                    type: \"header\",\n                    content: \"10. Yeni Zelanda Veri Koruma Otoritesi (OPC) tarafndan daha ar veri gizlilii cezalar talep edildi.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Scoop News'in haberinde, OPC Bakan Michael Webster tarafndan, veri ihlalleri i\\xe7in daha ar cezalar istendii ifade edildi. Ulusal Siber G\\xfcvenlik Zirvesi'nde yaplan bu a\\xe7klamalar, \\xf6nceki haftalarda halka y\\xf6nelik yaplan iki anketin de kurulularn veri ihlalleri i\\xe7in daha g\\xfc\\xe7l\\xfc cezalarla kar karya kalmas gerektiine inandn g\\xf6stermesinin ardndan yapld.\"\n                },\n                {\n                    type: \"link\",\n                    content: \"Haberin tamam i\\xe7in linke tklaynz.\",\n                    href: \"https://iapp.org/news/a/new-zealand-privacy-commissioner-calls-for-heavier-data-privacy-fines/\"\n                }\n            ],\n            tags: [\n                \"IAPP\",\n                \"KVKK\"\n            ]\n        },\n        {\n            id: 7,\n            subtitle: \"GDPR KARARI\",\n            date: \"08.03.2024\",\n            slug: \"ispanya-veri-koruma-otoritesi-karari-1\",\n            title: \"spanya Veri Koruma Otoritesi, bir ticari kuruluun g\\xfcvenlik kameras araclyla \\xe7alanlarn seslerini kaydederek GDPR Madde 6'y ihlal ettii gerek\\xe7esiyle veri sorumlusuna 5.000  para cezas verdi.\",\n            text: \"spanya Veri Koruma Otoritesi, ticari kurulularna mikrofonlu bir g\\xfcvenlik kameras yerletirerek GDPR Madde 6'y ihlal ederek bir \\xe7alann sesini toplad i\\xe7in veri sorumlusuna 5.000  para cezas vermitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kii ticari bir iletmede \\xe7almaktadr ve iletmenin g\\xfcvenlik kameralar tarafndan izlendiinin farkndadr. Bir i g\\xfcn\\xfcnde, ilgili kii, patronu ve iletmenin sahibi olan veri sorumlusundan bir telefon alm ve veri sorumlusu arka plan m\\xfczii yerine haberlerin sesinin gelmesi konusunda ikayet etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"lgili kii, konumalarnn izlendiinin farknda olmadn iddia ederek spanya Veri Koruma Otoritesine ikayette bulunmutur. Veri Koruma Otoritesi bir soruturma balatm ve veri sorumlusuna bildirimde bulunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Buna cevaben, veri sorumlusu alarm sisteminin kurulumu, bakm ve y\\xf6netiminden sorumlu g\\xfcvenlik hizmeti irketi ile imzalanan bir s\\xf6zlemeyi sunmutur. S\\xf6zlemede taraflar, sahadaki sesi dinlemek i\\xe7in bir mikrofon kurulaca, ancak kayt yaplmayaca konusunda anlamlardr. Bu nedenle, veri sorumlusu herhangi bir gizlilik ihlali olmadn savunmutur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri Koruma Otoritesi Koruma Otoritesi, soyunma odalarna, tuvaletlere, yemek odalarna veya benzer yerlere kamera yerletirilmesine kar yasan altn \\xe7izmitir.analizine, bir kiinin hem g\\xf6r\\xfcnt\\xfcs\\xfcn\\xfcn hem de sesinin GDPR tarafndan tanmlanan artlar altnda kiisel veri tekil ettiini ve bu nedenle davaya uygulanabilir olduunu belirterek balamtr. Ardndan, bir kayt olup olmadna baklmakszn, yalnzca sesin yakalanmasnn kiisel verilerin ilenmesini tekil ettiini vurgulamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Veri Koruma Otoritesi, LOPDGDD Madde 22'nin, aadaki koullarn salanmas halinde kiilerin ve mallarn g\\xfcvenliini salamak i\\xe7in video kameralarn kurulumuna izin verdiini hatrlatt: a) verilerin toplanmasndan itibaren en fazla bir ay i\\xe7inde imha edilecei; ve b) izlenen alana g\\xf6r\\xfcn\\xfcr bir bildirim yerletirilir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca, LOPDGDD Madde 89'un orantllk ilkesine uyulmasn zorunlu kldna ve iyerine kurulacak kameralar i\\xe7in baz koullar belirlediine dikkat \\xe7ekmitir. Bu koullar arasnda,Veri Koruma Otoritesi, soyunma odalarna, tuvaletlere, yemek odalarna veya benzer yerlere kamera yerletirilmesine kar yasan altn \\xe7izmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca, iyerinde ses kaydna yalnzca burada y\\xfcr\\xfct\\xfclen faaliyetlerin tesislerin, mallarn ve kiilerin g\\xfcvenlii i\\xe7in ilgili riskler oluturmas durumunda izin verildiini a\\xe7k\\xe7a belirtmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Somut olayda, Veri Koruma Otoritesi, denetleyicinin ticari kuruluundaki ses kaydnn, \\xe7alanlarnn ve m\\xfcterilerinin mahremiyetine ciddi bir m\\xfcdahale tekil ettiini ve bu m\\xfcdahalenin ama\\xe7lanan g\\xfcvenlik ama\\xe7larna g\\xf6re orantsz olduunu tespit etmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu nedenlerle, Veri Koruma Otoritesi 6. Maddenin ihlal edildiine karar vermi ve veri sorumlusuna 5.000 Euro para cezas vermitir.\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"KVKK\"\n            ]\n        },\n        {\n            id: 6,\n            subtitle: \"GDPR KARARI\",\n            date: \"07.03.2024\",\n            slug: \"avrupa-birligi-adalet-divani-karari-1\",\n            title: \"Avrupa Birlii Adalet Divan, ilgili kiinin GDPR Madde 15(1)deki haklarn kullanrken veri sorumlusu b\\xfcnyesindeki \\xe7alanlarn kiisel verilerinin talep edilmesi halinde, bu talebin yalnzca ilgili kiinin haklarn etkili bir ekilde kullanmasn salamak i\\xe7in zorunlu olmas ve \\xe7alanlarn hak ve \\xf6zg\\xfcrl\\xfcklerine zarar verilmemesi kouluyla karlanabileceine karar verdi.\",\n            text: \"Finlandiya'daki veri sorumlusu bir bankann eski bir \\xe7alan ve m\\xfcterisi olan ilgili kii, m\\xfcteri verilerine banka personeli tarafndan 2013 ylnda birka\\xe7 kez hukuka uygun olmadan eriildii \\xfcphesiyle 2018 ylnda veri sorumlusundan; m\\xfcteri verilerine erien kiilerin kimlii, kesin tarihleri, ve bu eriimlerin ama\\xe7lar hakknda kendisini bilgilendirmesini talep eden bir eriim talebinde bulunmutur. Veri sorumlusu, s\\xf6z konusu bilgilerin \\xe7alanlarnn kiisel verilerini tekil ettii gerek\\xe7esiyle, \\xe7alanlarnn kimliini a\\xe7klamay reddetmitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Bunun \\xfczerine ilgili kii, veri sorumlusunun talep edilen bilgileri kendisine salamas i\\xe7in Finlandiya Veri Koruma Otoritesine (Otorite) bavurmutur. Otorite, veri sorumlusunu hakl bularak ilgili kiinin bavurusunu reddetmitir. Daha sonra, ilgili kii bu karara kar Dou Finlandiya dare Mahkemesi nezdinde dava a\\xe7mtr. Mahkeme \\xf6n karar i\\xe7in Avrupa Birlii Adalet Divanna (ABAD) bavurmu ve esasen ileme faaliyetleri srasnda oluturulan log verilerinin, \\xf6zellikle de veri sorumlusunun \\xe7alanlarnn kimliinin, GDPR Madde 15 kapsamnda olup olmadn sormutur, zira bu log kaytlarnn ilgili kiinin verilerinin ilenmesinin hukuka uygunluunu deerlendirmesi i\\xe7in gerekli olabileceini belirtmitir. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ABAD, ilk olarak, bir ilgili kiinin GDPR Madde 15(1) kapsamnda, kiisel veriler \\xfczerinde ger\\xe7ekletirilen eriim ilemlerinin tarihleri ve ama\\xe7lar ile ilgili olarak veri sorumlusundan bilgi alma hakkna sahip olduunu ve ilgili kiinin log kaytlarnda yer alan kiisel verilerine bavuran kiilere ilikin bilgilerin GDPR Madde 4(1) kapsamnda kiisel veri tekil edebileceini belirtmitir. Ancak eriim hakknn bakalarnn hak ve \\xf6zg\\xfcrl\\xfcklerini olumsuz y\\xf6nde etkilememesi gerektiini hatrlatarak veri ileme faaliyetinin hukuka uygunluunun salanmas amacyla veri sorumlusu \\xe7alanlarnn kimliklerinin ilgili kiiye a\\xe7klanmas gerekli olduunda;  eriim hakknn kullanlmas ile bakalarnn haklar veya \\xf6zg\\xfcrl\\xfckleri arasnda bir denge kurulmas gerekecei vurgulanmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sonu\\xe7 olarak, ABAD, GDPR Madde 15(1)'in, ilgili kiinin GDPR kapsamndaki haklarn etkili bir ekilde kullanmasn salamak i\\xe7in  zorunlu olmadk\\xe7a ve \\xe7alanlarn hak ve \\xf6zg\\xfcrl\\xfcklerinin dikkate alnmas kouluyla, ilgili kiiye veri sorumlusunun yetkisi altnda ve talimatlarna uygun olarak eriim ilemlerini ger\\xe7ekletiren \\xe7alanlarn kimliklerini elde etme hakk vermediine karar vermitir.\"\n                }\n            ],\n            tags: [\n                \"GDPR\",\n                \"KVKK\"\n            ]\n        },\n        {\n            id: 1,\n            subtitle: \"Makale\",\n            date: \"2023\",\n            slug: \"tasimacilik-faaliyetlerinde-arac-ici-kameralar-araciligiyla-calisanlarin-izlenmesi\",\n            title: \"Tamaclk Faaliyetlerinde Ara\\xe7 \\xe7i Kameralar Araclyla \\xc7alanlarn zlenmesi\",\n            text: \"G\\xfcn\\xfcm\\xfczde elektronik ticaretin yaygnlamasyla birlikte posta hizmeti sunan irketlerin younluu ve \\xf6nemi de ayn oranda artmtr. Peki tamaclk faaliyetlerinin yerine getirilmesi srasnda kargo irketlerinin Kiisel Verilerin Korunmas Kanunu kapsamnda y\\xfck\\xfcml\\xfcl\\xfckleri nelerdir? Ara\\xe7 i\\xe7i kameralar araclyla y\\xfcr\\xfct\\xfclen kiisel veri ileme faaliyetlerin \\xf6l\\xe7\\xfcl\\xfcl\\xfck ilkesine uygun olmas i\\xe7in alnmas gereken aksiyonlar nelerdir? Bu sorular ve daha fazlasnn cevab bu ayki blog yazmzda!\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"Ara\\xe7 i\\xe7i kamera araclyla of\\xf6r g\\xf6r\\xfcnt\\xfclerini ileme faaliyetini ger\\xe7ekletirmek i\\xe7in a\\xe7k rza alnmas gerekli midir? Yoksa KVKK m.5/2de yer alan hukuki sebepler uyarnca bu veri ileme faaliyeti ger\\xe7ekletirilebilir mi?\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" Sal ve G\\xfcvenlii Kanunu 4. maddesine g\\xf6re veren, \\xe7alanlarn ile ilgili salk ve g\\xfcvenliini salamakla y\\xfck\\xfcml\\xfc olup bu \\xe7er\\xe7evede; b) yerinde alnan i sal ve g\\xfcvenlii tedbirlerine uyulup uyulmadn izler, denetler ve uygunsuzluklarn giderilmesini salar. Bu maddeye g\\xf6re de iveren \\xe7alanlarn g\\xfcvenliini salamakla y\\xfck\\xfcml\\xfcd\\xfcr. Bu y\\xfck\\xfcml\\xfcl\\xfck hem i\\xe7inin kiisel haklarnn ihlalini \\xf6nlemek ve korumak hem de \\xe7alanlarn g\\xfcvenlii dahil olmak \\xfczere iyerindeki ileyi ve d\\xfczeni salamak y\\xfck\\xfcml\\xfcl\\xfc\\xfc olduu eklinde yorumlanmaldr. \\xd6ncelikle deerlendirilmesi gereken hususlar arasnda; veri sorumlusunun meru menfaati, ilgili kiinin temel hak ve \\xf6zg\\xfcrl\\xfckleri \\xfczerinde kiisel verinin ilenmesinin yarataca etki ile duruma ve olayn mahiyetine g\\xf6re farkllk g\\xf6sterecek olan dengeler (\\xfcst\\xfcn gelen menfaatin ve hakkn deerlendirilmesi) bulunmaktadr. Veri sorumlusunun meru menfaati, ger\\xe7ekletirilecek olan ileme sonucunda elde edecei \\xe7kara ve faydaya y\\xf6neliktir. Veri sorumlusunun elde edecei fayda; meru, ilgili kiinin temel hak ve \\xf6zg\\xfcrl\\xfc\\xfc ile yarabilecek d\\xfczeyde etkin, belirli ve halihazrda mevcut olan bir menfaatine ilikin olmaldr. Veri sorumlusunun ger\\xe7ekletirdii g\\xfcncel aktivitelerle ilikili ve ona yakn gelecekte fayda salayacak bir ilem olmas gerekmektedir. Veri sorumlusunun elde edecei fayda; meru, ilgili kiinin temel hak ve \\xf6zg\\xfcrl\\xfc\\xfc ile yarabilecek d\\xfczeyde etkin, belirli ve halihazrda mevcut olan bir menfaatine ilikin olmaldr. Meru menfaat i\\xe7in dikkat edilmesi gereken hususlar;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Veri sorumlusu iverenin elde edecei faydann ilgili kiinin hak ve \\xf6zg\\xfcrl\\xfc\\xfc ile yarabilecek d\\xfczeyde etkin belirli ve halihazrda mevcut olan bir menfaatine ilikin olmaldr.\",\n                        \"Elde edilecek fayda iveren veri sorumlusunun ger\\xe7ekletirdii g\\xfcncel aktivitelerle ilikili ve ona yakn gelecekte fayda salayacak bir ilemle ilgili olmas gereklidir. \",\n                        \"Veri ileme faaliyetinde iveren veri sorumlusunun menfaati olup olmad belirlendikten sonra kiisel verisi ilenecek olan ilgili kiinin temel hak ve \\xf6zg\\xfcrl\\xfcklerinin neler olduunun tespiti gereklidir.\",\n                        \"Ardndan denge testi yaplmas gereklidir. Veri sorumlusunun meru menfaati \\xe7ok g\\xfc\\xe7l\\xfc ve etkin olmad takdirde, ilgili kiinin hak ve menfaatleri, veri sorumlusunun meru ancak daha az \\xf6neme sahip menfaatinden daha \\xfcst\\xfcn gelebilecektir. Bu dorultuda, ele alnacak olan meru menfaat ciddi, \\xf6nemli ve halihazrda mevcut olmaldr.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Tamaclk faaliyetinin y\\xfcr\\xfct\\xfclmesi srasnda olas bir i kazasnda of\\xf6r\\xfcn kusurunun tespiti i\\xe7in iverenin ara\\xe7ta kamera bulundurmasnda meru bir menfaati vardr. Kanunun ilgili maddesi h\\xfckm\\xfc itibariyle meru menfaate dayanlmas nedeniyle a\\xe7k rza alnmas art deildir. Fakat bu srada s\\xfcrecin KVKK m.4 kapsamnda genel ilkeler dorultusunda y\\xfcr\\xfct\\xfclmesi gerekmektedir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"Kamera kayd ger\\xe7ekletirilirken s\\xfcre\\xe7 nasl dizayn edilmelidir? Bilgilendirme nasl yaplmal, konu hakknda nasl bir prosed\\xfcr izlenmelidir? Kamera cihazlar nasl konumlandrlmaldr?\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avrupa Veri Koruma Denet\\xe7isi tarafndan yaymlanan G\\xfcvenlik Kameralar Rehberi bu konuda birtakm \\xf6nerilerde bulunmaktadr.\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"\\xc7alanlara kar aydnlatma y\\xfck\\xfcml\\xfcl\\xfc\\xfcn\\xfcn yerine getirilmesi\",\n                        \"Ara\\xe7larda yalnzca tama esnasnda kayt yaplmas, mesai saatleri dnda kayt yaplmamas\",\n                        \"Kamera kaytlarnn yalnzca kabinin i\\xe7ini ve yolu \\xe7ekecek ekilde konumlandrlmas, of\\xf6r\\xfcn y\\xfcz\\xfcn\\xfc \\xe7ekmemesi\",\n                        \"Kameralarn ses kayd \\xf6zelliine sahip olmamas\",\n                        \"Kamerann g\\xf6r\\xfc alanna yol dnda aracn \\xe7evresinde kalan farkl m\\xfclklerdeki insanlarn girmesinin engellenmesi\",\n                        \"G\\xf6r\\xfcnt\\xfclerin ilendikleri ama\\xe7 dorultusunda makul bir s\\xfcre saklanmas\"\n                    ]\n                },\n                {\n                    type: \"header\",\n                    content: \"Sonu\\xe7\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ara\\xe7 i\\xe7i kameralar kullanlmas srasnda \\xe7alanlardan a\\xe7k rza temin edilmesi zorunluluk olmasa da, KVKK m.4 kapsamnda genel ilkelere uygun hareket edilmesi ve KVKK m.5/2(f) uyarnca denge testinin yaplmas gerekliliktir. Veri sorumlusu olan iveren tarafndan s\\xfcrecin ne ekilde tasarlanaca, faaliyetin KVKK kapsamnda hukuka uygunluunu salayacak unsurlar etkileyecektir.\"\n                }\n            ],\n            author: \"Av. Bilge Ezgi Peker\",\n            tags: [\n                \"Ara\\xe7 Kameralar\",\n                \"KVKK\"\n            ]\n        },\n        {\n            id: 2,\n            subtitle: \"Makale\",\n            date: \"2023\",\n            slug: \"hashlenmis-veri-anonim-veri-midir\",\n            title: \"Hashlenmi Veri Anonim Veri Midir?\",\n            text: \"Hashlenmi verinin anonim veri niteliinde olup olmadnn tespit edilebilmesi i\\xe7in \\xf6ncelikle hashleme kavramn irdelemekte fayda vardr. Hashleme herhangi bir uzunluktaki girdiyi alarak onu bir dizi algoritma ile ifreli \\xe7kt haline d\\xf6n\\xfct\\xfcrme ilemine verilen isimdir. Uzmanlar hashleme kavramn genellikle tek tarafl bir ifreleme y\\xf6ntemi olarak tanmlamaktadr. Bu ilem sonrasnda elde edilen deere ise hash deeri denir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Hashlenmi verinin anonim veri niteliinde olup olmadnn tespit edilebilmesi i\\xe7in \\xf6ncelikle hashleme kavramn irdelemekte fayda vardr. Hashleme herhangi bir uzunluktaki girdiyi alarak onu bir dizi algoritma ile ifreli \\xe7kt haline d\\xf6n\\xfct\\xfcrme ilemine verilen isimdir. Uzmanlar hashleme kavramn genellikle tek tarafl bir ifreleme y\\xf6ntemi olarak tanmlamaktadr. Bu ilem sonrasnda elde edilen deere ise hash deeri denir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Hashleme y\\xf6nteminde kullanlan algoritma \\xe7eidine g\\xf6re, elde edilen hash deeri deiiklik g\\xf6stermektedir. Ayn zamanda aadaki \\xf6rneklerde g\\xf6r\\xfcld\\xfc\\xfc \\xfczere, algoritmann deimesinin yan sra hashleme ilemine tabi olan kelimede bir harfin baka bir harfle deitirilmesi ya da bir harfin b\\xfcy\\xfck/k\\xfc\\xe7\\xfck harf olarak deitirilmesi dahi ortaya \\xe7kan hash deerini dorudan deitirebilmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xd6rnein, SHA256 ve SHA1 algoritmalar kullanlarak KPVeri ve kpveri kelimeleri hashlendiinde ortaya \\xe7kan deerler aadaki gibidir:\"\n                },\n                {\n                    type: \"image\",\n                    content: _images_blog_hashdescription_jpg__WEBPACK_IMPORTED_MODULE_0__[\"default\"]\n                },\n                {\n                    type: \"header\",\n                    content: \"Peki \\xe7eitli algoritmalar kullanlarak bir veri ya da veri seti hashlendiinde ulalan hash deeri/leri her ihtimalde anonim veri nitelii kazanr m?\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"T\\xfcrk Mevzuatnda hashleme, 6698 sayl Kiisel Verilerin Korunmas Kanunu (KVKK) bata olmak \\xfczere herhangi Kanun ya da ikincil d\\xfczenlemede tanmlanmamtr. Mahremiyet ile ilgili uluslararas mevzuatta hatta g\\xfcn\\xfcm\\xfczde en gelimi mahremiyet mevzuat olarak kabul edilen Avrupa Birlii Genel Veri Koruma T\\xfcz\\xfc\\xfcnde (GDPR) de bu y\\xf6nteme ilikin dorudan bir hukuki d\\xfczenlemeye rastlanmamaktadr. Bu anlamda hashleme daha \\xe7ok mevzuatn konusu deil, teknik bir standardn konusudur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"KVKKnn tanmlar maddesinde kiisel veri kimlii belirli veya belirlenebilir ger\\xe7ek kiiye ilikin her t\\xfcrl\\xfc bilgi eklinde tanmlanmtr. Anonimletirme ilemi ise, kiisel verilerin baka verilerle eletirilse dahi hi\\xe7bir surette kimlii belirli veya belirlenebilir bir ger\\xe7ek kiiyle ilikilendirilemeyecek hale getirilmesidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"bu tanmlardan yola \\xe7karak doktrinde hashlenmi verinin kiisel veri olduunu ya da tam tersine bir yorumla verinin anonim veri nitelik kazandn deerlendiren uzmanlar bulunmaktadr. Dolaysyla bu konuya ilikin sonuca varmak i\\xe7in uluslararas otoriteler tarafndan verilen kararlar ve yaynlanan i\\xe7erikleri g\\xf6zden ge\\xe7irmek faydal olacaktr:\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"spanya Veri Koruma Otoritesi tarafndan yaynlanan bir rehberde; anonimletirme tekniklerine ilikin 5/2014 sayl g\\xf6r\\xfc yazsnda, hashleme y\\xf6nteminin bir kimliksizletirme y\\xf6ntemi olarak deerlendirildii belirtilmitir. Buna g\\xf6re; kiisel verileri kimliksizletirme (pseudonymization) veya anonim hale getirmek i\\xe7in hashleme y\\xf6nteminin kullanlmasnn, veri ilemede kullanlan \\xf6zel hashleme y\\xf6ntemi ile ilikili bir yeniden tanmlama risk analiziyle gerek\\xe7elendirilmesi gerekecektir. Bu t\\xfcr bir risk analizinin hashleme ile temsil edilen deere bal olan veya olabilecek bilgiler \\xf6ncelikli olmak kaydyla, hem hashleme s\\xfcrecini hem de hashleme y\\xf6ntemini oluturan dier unsurlar incelemesi/kapsamas gerekecektir. Bu analiz uzun vadede \\xe7\\xf6z\\xfcmlenebilme olaslnn nesnel bir deerlendirmesiyle sonu\\xe7lanmaldr. Yani uzun vadede \\xe7\\xf6z\\xfcmlenebilme ihtimali ve riskleri objektif bir ekilde deerlendirilmelidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Belirli artlarn salanmas halinde baz uluslararas otoritelerince hashleme y\\xf6nteminin anonimletirme teknii olarak kabul edilebilecei g\\xf6r\\xfclmektedir. Bu kapsamda; spanya Veri Koruma Otoritesinin rehberinde, hashleme y\\xf6nteminin anonim hale getirme y\\xf6ntemi olarak kabul edilebilmesi i\\xe7in risk deerlendirmesinde:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Verinin yeniden \\xe7\\xf6z\\xfcmlenmesine izin veren t\\xfcm bilgilerin ortadan kaldrlmasnn garanti edilmesi a\\xe7sndan gerekli idari tedbirlerin alnmas,\",\n                        \"Kiisel verilerin beklenen kullanm \\xf6mr\\xfcn\\xfcn \\xf6tesinde olacak bir ekilde sistem g\\xfcvenliinin garanti edilmesi gerektii belirtilmitir.\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kriterler nda verilerin hash y\\xf6ntemine tabi tutulmas durumunda, hashlenen her veri kiisel veri niteliini korur ya da hashlenen her veri kiisel veri niteliini kaybederek anonim hale gelir eklinde nihai bir yorum yapmak doru olmayacaktr. Konu olduk\\xe7a tartmal olmakla birlikte, somut olay \\xf6zelinde deerlendirme yaplmas daha isabetli olacaktr. Bu noktada deerlendirme kriterlerinin odak noktasnda \\xe7\\xf6z\\xfcmlenebilirlik kriterinin olmas gerekir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xd6rnein, bir veri setinin hashleme ilemine tabi tutulup yurt dna aktarlmas durumunda yurt dnda mukim taraf (veri sorumlusu yahut veri ileyen) herhangi bir veriyi kullanarak eletirme ger\\xe7ekletirmesi neticesinde hashlenen veriyi \\xe7\\xf6z\\xfcmleyebiliyor ise bu durumda veri, kiisel veri niteliini korumaktadr. Ancak, yurt dnda yerleik taraf herhangi bir veriyle eletirme yapamyor ve dolaysyla hashlenen veriyi \\xe7\\xf6z\\xfcmleyemiyor ise burada verinin kiisel veri niteliini kaybettii ve anonim hale geldii deerlendirilebilecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Konuya ilikin Alman Mahkemesi tarafndan verilen bir kararda (VG Bayreuth, Beschluss v. 08.05.2018  B 1 S 18.105) da hash y\\xf6ntemi hakknda somut olay \\xf6zelinde deerlendirme yaplm olup, Facebook tarafndan \\xfc\\xe7\\xfcnc\\xfc taraf veri sorumlularndan alnan hashlenmi verilerin, Facebook veritabannda kaytl olan veriler olabilecei ve veriler hashlenmi ise de bu verilerin Facebook tarafndan tespit edilebilme imkan olabilecei deerlendirilerek hashlenen verinin anonim hale gelmedii neticesine varlmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Konu hakkndaki Kiisel Verileri Koruma Kurulu (Kurul) kararnda (20/05/2020 tarihli ve 2020/404 sayl Karar \\xd6zeti) ise biyometrik verilerin hash y\\xf6ntemi ile biyometrik veri niteliini kaybetmedii vurgulanmtr. Olduk\\xe7a isabetli bir karar olsa da kararn \\xe7k yoluna dikkat \\xe7ekmek gerekir. Somut olayda, yalnzca tek bir veri (biyometrik veri) hashlenmekte ve hashlenen veri sistemlerde yer alan biyometrik veri ile veri sorumlusu b\\xfcnyesindeki sistemlerde eletirilebilmektedir. Bu durumda hashlenmi olsa da biyometrik veriye ulam/eriim imkan s\\xf6z konusu olduu bilhassa \\xe7\\xf6z\\xfcmleme imkan g\\xf6zetilerek, Kurul tarafndan verinin anonim hale gelmedii eklinde deerlendirme yaplmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sonu\\xe7 olarak, hashlenen bir verinin kiisel veri niteliini kaybedip kaybetmedii hususu somut olay \\xf6zelinde deerlendirilmelidir:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Hashlenen veri \\xe7\\xf6z\\xfcmlenebilir durumda ise; verinin halen kiisel veri niteliini haiz olaca ve bu s\\xfcre\\xe7 \\xf6zelinde hashleme y\\xf6nteminin anonim hale getirme y\\xf6ntemi deil, kimliksizletirme y\\xf6ntemi olduu ve bu hashleme kiisel veriler a\\xe7sndan ancak bir g\\xfcvenlik tedbiri olarak deerlendirilmesi daha isabetli olacaktr.\",\n                        \"Hashlenen verinin \\xe7\\xf6z\\xfcmlenmesine imkan veren t\\xfcm gerekli verilerin ortadan kaldrlmasnn garanti edilmesi ve bu noktada t\\xfcm tedbirlerin alnmas ayrca, kiisel verilerin beklenen kullanm \\xf6mr\\xfcn\\xfcn \\xf6tesinde olacak bir ekilde sistem g\\xfcvenliinin teknik anlamda garanti edilmesi sonucunda verinin \\xe7\\xf6z\\xfcmlenebilme imkannn bulunmamas durumunda hashleme y\\xf6ntemi bir anonimletirme y\\xf6ntemi olarak deerlendirilebilecektir.\"\n                    ]\n                }\n            ],\n            tags: [\n                \"Veri ifreleme\",\n                \"KVKK\"\n            ],\n            author: \"Av. Mert Atl\"\n        },\n        {\n            id: 3,\n            subtitle: \"Makale\",\n            date: \"2023\",\n            slug: \"odeme-ve-elektronik-para-kuruluslarinin-masak-mevzuati-kapsaminda-yukumlulukleri\",\n            title: \"\\xd6deme ve Elektronik Para Kurulularnn Masak Mevzuat Kapsamnda Y\\xfck\\xfcml\\xfcl\\xfckleri\",\n            text: \"Ulusal ve uluslararas alanda yaanan ekonomik ve teknolojik gelimeler, su\\xe7 gelirlerinin aklanmas ve ter\\xf6r\\xfcn finansman riskini arttrmtr. Bu y\\xfczden pek \\xe7ok \\xfclkede olduu gibi \\xfclkemizde de yasal d\\xfczenlemeler yaplmakta ve var olan uygulamalar g\\xfc\\xe7lendirilmektedir. Bu kapsamda su\\xe7 gelirlerinin aklanmas, ter\\xf6rizm finansman gibi mali su\\xe7larn ilenmesinin \\xf6nlenmesi amacyla bir denetim ihtiyac ortaya \\xe7kmtr. Bu denetim ihtiyac 19.11.1996 tarih ve 22822 sayl Resmi Gazetede yaymlanarak y\\xfcr\\xfcrl\\xfce giren 4208 sayl Karaparann Aklanmasnn \\xd6nlenmesine Dair Kanun ile hukuki bir kimlik kazanm ve kanunun uygulanmasna y\\xf6nelik olarak \\xe7karlan y\\xf6netmelikler ile T\\xfcrk finansal sistemi ilk kez bu derece dorudan yasal d\\xfczenlemelere tabi hale gelmitir.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"4208 sayl Kanun ile T\\xfcrkiyede su\\xe7 gelirlerinin aklanmasnn \\xf6nlenmesine dair yasa ile belirtilen y\\xfck\\xfcml\\xfcl\\xfcklere ilikin veri toplama, deerlendirme, uygulama, denetleme, d\\xfczenleme ve koordinasyon g\\xf6revini y\\xfcr\\xfctmekle g\\xf6revli olan Hazine ve Maliye Bakanl (Bakanlk)na bal olarak Mali Su\\xe7lar Aratrma Kurulu Bakanl (MASAK) kurulmutur. \\xdclkemizde aklama su\\xe7uyla m\\xfccadele esas itibari ile Bakanlk b\\xfcnyesinde g\\xf6rev yapan T\\xfcrkiyenin mali istihbarat birimi MASAK tarafndan y\\xfcr\\xfct\\xfclmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"MASAK, T\\xfcrkiyenin finansal sistemini su\\xe7lulardan koruyarak \\xfclkenin finansal \\xf6zg\\xfcrl\\xfc\\xfcn\\xfc salayp T\\xfcrkiye'de mali su\\xe7larla m\\xfccadele etmektedir. Bu kapsamda, \\xf6zellikle kara para aklama, ter\\xf6rizm finansman ve uyuturucu ka\\xe7ak\\xe7l gibi finansal su\\xe7larla m\\xfccadele ederek finansal ilemler ve para transferleri yoluyla ger\\xe7ekletirilen su\\xe7larn \\xf6nlenmesi, tespit edilmesi ve bu su\\xe7lara karanlarn adalete teslim edilmesi g\\xf6revlerini s\\xfcrd\\xfcrmektedir. Ayrca finansal kurulularn ve iletmelerin m\\xfcteri bilgilerinin kaydedilmesi, kimlik tespiti, para transferleri ve dier ilemlerinin takip edilmesi yoluyla mali su\\xe7lar izlemekte ve bu su\\xe7larla m\\xfccadele etmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"5549 sayl Su\\xe7 Gelirlerinin Aklanmasnn \\xd6nlenmesine Dair Kanununun (Kanun) uygulanmas amacyla bir\\xe7ok y\\xf6netmelik ve ayrca MASAK tarafndan tebliler yaynlanmtr. Bunlardan en \\xf6nemlileri Kanunun uygulanmasna ilikin usul ve esaslarn d\\xfczenlendii 09.01.2008 tarih ve 26751 sayl Resmi Gazetede yaymlanan Su\\xe7 Gelirlerinin Aklanmasnn ve Ter\\xf6rizmin Finansmann \\xd6nlenmesine Dair Tedbirler Hakknda Y\\xf6netmelik (Y\\xf6netmelik) ve su\\xe7 gelirlerinin aklanmasnn \\xf6nlenmesi amacyla y\\xfck\\xfcml\\xfclerin uyum program oluturmalarna ilikin esaslarn d\\xfczenlendii 16.09.2008 tarih ve 26999 sayl Resmi Gazetede yaymlanan Su\\xe7 Gelirlerinin Aklanmasnn ve Ter\\xf6r\\xfcn Finansmannn \\xd6nlenmesine likin Y\\xfck\\xfcml\\xfcl\\xfcklere Uyum Program Hakknda Y\\xf6netmelii (Uyum Y\\xf6netmelii)dir. Yaplan a\\xe7klamalardan hareketle bu ksa notta, \\xd6deme ve Elektronik Para Kurulularnn MASAK mevzuat kapsamndaki y\\xfck\\xfcml\\xfcl\\xfckleri incelenecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"Y\\xdcK\\xdcML\\xdcL\\xdcKLER\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kanun, Y\\xf6netmelik ve Uyum Y\\xf6netmelii kapsamnda su\\xe7 gelirlerinin aklanmas ile daha etkin m\\xfccadele edilebilmesi ve mali su\\xe7lularn engellenmesi i\\xe7in hukukumuzda birtakm kurulular ve dier baz meslek gruplar y\\xfck\\xfcml\\xfc saylmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda Kanunun Tanmlar balkl 2. maddesinde bendinde y\\xfck\\xfcml\\xfcler belirtilmitir. Bankaclk, sigortaclk, bireysel emeklilik, sermaye piyasalar, \\xf6d\\xfcn\\xe7 para verme ve dier finansal hizmetler ile posta ve tamaclk, talih ve bahis oyunlar alannda faaliyet g\\xf6sterenler; d\\xf6viz, tanmaz, deerli ta ve maden, m\\xfccevher, nakil vastas, i makinesi, tarihi eser, sanat eseri ve antika ticareti ile itigal edenler veya bu faaliyetlere araclk edenler ile noterler, spor kul\\xfcpleri Kanunun uygulanmasnda y\\xfck\\xfcml\\xfc saylmtr. Saylanlar dnda kalan gruplarn y\\xfck\\xfcml\\xfc yaplabilmesi i\\xe7in de Cumhurbakanna yetki verilmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xfck\\xfcml\\xfcler, Kanunda bulunduklar sekt\\xf6r kapsamnda saylmken Y\\xf6netmelikte ise ayr ayr adlaryla belirtilmitir. Y\\xf6netmelikte yer alan dier maddelerde baz istisnalar bulunmakla beraber y\\xfck\\xfcml\\xfcler 4. maddede saylmtr. Bu kapsamda \\xd6deme Kurulular ve Elektronik Para Kurulularnn (Kurulular) da Kanundan doan y\\xfck\\xfcml\\xfcl\\xfcklerden sorumlu olaca d\\xfczenlenmitir:\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"MADDE 4- (1) Kanunun uygulanmasnda y\\xfck\\xfcml\\xfc, aada saylanlar ile bunlarn ube, acente, temsilci ve ticari vekilleri ile benzeri bal birimlerdir:\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"MADDE 4- (1) Kanunun uygulanmasnda y\\xfck\\xfcml\\xfc, aada saylanlar ile bunlarn ube, acente, temsilci ve ticari vekilleri ile benzeri bal birimlerdir:\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"S\\xf6z konusu deiiklik Kurulularn finansal ilemlerinin elektronik ortamda ger\\xe7ekletirilmesi nedeniyle, bu ilemleri su\\xe7lularn ama\\xe7lar dorultusunda kullanarak su\\xe7 gelirlerini aklama veya ter\\xf6r\\xfcn finansmanna araclk etme riski tamalar nedeniyle yaplmtr. Ayrca Y\\xf6netmelikin 3. maddesinin (f) bendi uyarnca Kurulular finansal kurulu kapsamna alnmtr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"\\xd6DEME VE ELEKTRONK PARA KURULULARININ Y\\xdcK\\xdcML\\xdcL\\xdcKLER\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kurulularn Kanun ve Y\\xf6netmelik kapsamnda \\xfcpheli ilem bildirimi, uyum program oluturulmas, bilgi ve belge verme y\\xfck\\xfcml\\xfcl\\xfc\\xfc gibi birtakm y\\xfck\\xfcml\\xfcl\\xfckleri bulunmaktadr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"M\\xfcteri Tanma ve Kimlik Dorulama Y\\xfck\\xfcml\\xfcl\\xfc\\xfc\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin \\xfc\\xe7\\xfcnc\\xfc b\\xf6l\\xfcm\\xfcnde m\\xfcterinin tannmasna ilikin esaslar d\\xfczenlenmitir. Kurulular, kendi nezdinde ya da araclk ettii ilemlerde ilem yaplmadan \\xf6nce, ilem yapanlar ile nam ve hesaplarna ilem yaplanlarn kimliklerini tespit etmek ve dorulamak zorundadr. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin 5. maddesi uyarnca, i ilikisi balamadan veya ilem yaplmadan \\xf6nce Kurulular;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"S\\xfcreli i ilikisi tesisinde tutar g\\xf6zetmeksizin,\",\n                        \"lem tutar ya da birbiriyle balantl birden fazla ilemin toplam tutar y\\xfczseksenbebin TL ve \\xfczeri olduunda,\",\n                        \"Elektronik transferlerde ilem tutar ya da birbiriyle balantl birden fazla ilemin toplam tutar onbebin TL ve \\xfczeri olduunda,\",\n                        \"\\xfcpheli ilem bildirimini gerektiren durumlarda tutar g\\xf6zekmeksizin,\",\n                        \"Daha \\xf6nce elde edilen m\\xfcteri kimlik bilgilerinin yeterlilii ve doruluu konusunda \\xfcphe olduunda tutar g\\xf6zetmeksizin,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"kimlie ilikin bilgileri almak ve bu bilgilerin doruluunu teyit etmek suretiyle m\\xfcterilerinin ve m\\xfcterileri adna veya hesabna hareket edenlerin kimliini tespit etmek ve ilemin ger\\xe7ek faydalancsnn ortaya \\xe7karlmas i\\xe7in gerekli tedbirleri almak zorundadr. Ayrca Kurulular s\\xfcrekli i ilikisinin bulunmas halinde, i ilikisinin amac ve mahiyeti hakknda bilgi alr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"\\xfcpheli lemleri Bildirme Y\\xfck\\xfcml\\xfcl\\xfc\\xfc\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin d\\xf6rd\\xfcnc\\xfc b\\xf6l\\xfcm\\xfcnde \\xfcpheli ilem bildirimine ilikin esaslar d\\xfczenlenmitir. \\xfcpheli ilem, Kurulular nezdinde veya bunlar araclyla yaplan veya yaplmaya teebb\\xfcs edilen ileme konu malvarlnn; yasa d yollardan elde edildiine veya yasa d ama\\xe7larla kullanldna, bu kapsamda ter\\xf6rist eylemler i\\xe7in ya da ter\\xf6r \\xf6rg\\xfctleri, ter\\xf6ristler veya ter\\xf6r\\xfc finanse edenler tarafndan kullanldna veya bunlarla ilgili ya da balantl olduuna dair herhangi bir bilgi, \\xfcphe veya \\xfcpheyi gerektirecek bir hususun bulunmas halidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kurulular;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"\\xfcpheli ilem ile karlatnda ilem hakknda gerekiyorsa yetki ve imkanlar \\xf6l\\xe7\\xfcs\\xfcnde aratrma yaparak edinilen bilgi ve bulgular g\\xf6z \\xf6n\\xfcne alp \\xfcpheli lem Bildirim Formu doldurmak suretiyle en ge\\xe7 on i g\\xfcn\\xfc i\\xe7inde MASAKa bildirmek,\",\n                        \"\\xfcpheli ilem bildirimi Kuruluun kanuni temsilcisi ya da uyum g\\xf6revlisi araclyla ger\\xe7ekletirmek\",\n                        \"Bildirimde bulunulan ilemle ilgili daha sonra yeni bilgi ve bulgular edildii taktirde, tekrar \\xfcpheli lem Bildirim Formu doldurulur ve daha \\xf6nce yaplan bildirime ek olduu belirtilerek gecikmeksizin MASAKa g\\xf6ndermek,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"zorundadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca Kurulular, \\xfcpheli ilem bildiriminde bulunulduuna veya bulunulacana dair y\\xfck\\xfcml\\xfcl\\xfck denetimiyle g\\xf6revlendirilen denetim elemanlarna ve yarglama srasnda mahkemelere verilen bilgiler dnda, ileme taraf olan dahil olmak \\xfczere hi\\xe7 kimseye bilgi veremezler.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Bilgi ve Belge Verme Y\\xfck\\xfcml\\xfcl\\xfc\\xfc\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin beinci b\\xf6l\\xfcm\\xfcnde bilgi ve belge vermeye ilikin esaslar d\\xfczenlenmitir. Kurulular, MASAK veya yetkili makamlar tarafndan talep edildiinde bu bilgileri paylamaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu kapsamda Kurulular, MASAK ve denetim elemanlar tarafndan istenebilecek olan;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"her t\\xfcrl\\xfc bilgi, belge ve bunlara ilikin her t\\xfcrl\\xfc ortamdaki kaytlarn,\",\n                        \"bu kaytlara eriimi salamak veya okunabilir hale getirmek i\\xe7in gerekli t\\xfcm bilgi ve ifreleri,\",\n                        \"tam ve doru olarak, istenilen usul, ekil ve s\\xfcrede gecikmeksizin,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"vermek i\\xe7in gerekli kolayl salamak zorundadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu zorunluluun istisnasn savunma hakkna ilikin h\\xfck\\xfcmler oluturmaktadr. Ancak burada da Kurulular \\xf6zel kanunlarda yazl h\\xfck\\xfcmleri ileri s\\xfcrerek bilgi ve belge vermekten ka\\xe7namayacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kurulular ayrca denetim kapsamnda defter ve belgeleri hazr bulundurmak; t\\xfcm bilgi ilem sistemini, denetimin ama\\xe7larna uygun olarak denetim elemanlarna a\\xe7mak ve verilerin g\\xfcvenliini salamak zorundadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Baz durumlarda ise Kurulularn devaml olarak bilgi verme y\\xfck\\xfcml\\xfcl\\xfc\\xfc bulunmaktadr. Kurulular, taraf olduu veya araclk ettii ilemlerden Bakanlk\\xe7a belirlenecek tutar aanlar MASAKa devaml olarak bildirmek zorundadr. Devaml bilgi verme kapsamndaki ilem t\\xfcrleri, bilgilerin ne ekilde ve hangi s\\xfcrelerde verilecei ve uygulamaya ilikin dier usul ve esaslar Bakanlk\\xe7a belirlenmektedir.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Muhafaza ve braz Y\\xfck\\xfcml\\xfcl\\xfc\\xfc\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xf6netmelikin sekizinci b\\xf6l\\xfcm\\xfcnde muhafaza ve ibraza ilikin esaslar d\\xfczenlenmitir. Kurulular, m\\xfcterilerinin ilemlerine ilikin kaytlar tutmaldr. Bu kaytlar, MASAK tarafndan istenildiinde sunulmaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kurulularn; \"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"her t\\xfcrl\\xfc ortamdaki, y\\xfck\\xfcml\\xfcl\\xfcklerine ve ilemlerine ilikin belgeleri d\\xfczenleme tarihinden,\",\n                        \"defter ve kaytlar ise son kayt tarihinden; kimlik tespitine ilikin belge ve kaytlar son ilem tarihinden,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"itibaren sekiz yl s\\xfcre ile muhafaza etmek ve istenmesi halinde yetkililere ibraz etmek zorunluluu bulunmaktadr. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kurulular nezdinde a\\xe7lacak hesaplarla ilgili kimlik tespitine ilikin belgelerin muhafaza s\\xfcresinin balang\\xe7 tarihi hesabn kapatld tarihtir. Ayrca \\xfcpheli ilem bildirimine veya uyum g\\xf6revlisine yaplan dahili bildirimlere y\\xf6nelik belge ve kaytlar, bildirime ek yaplan belgeler de muhafaza ve ibraz y\\xfck\\xfcml\\xfcl\\xfc\\xfc kapsamndadr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Uyum Program Oluturma ve Uyum G\\xf6revlisi Atanmas Y\\xfck\\xfcml\\xfcl\\xfc\\xfc\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uyum Y\\xf6netmelii gereince m\\xfcnhasran fatura \\xf6demelerine araclk hizmeti, m\\xfcnhasran \\xf6deme emri balatma hizmeti ve m\\xfcnhasran \\xf6deme hesabna ilikin bilgilerin hizmetini salayan \\xf6deme kurulular hari\\xe7 olmak \\xfczere Kurulularn uyum program oluturmalar ve uyum g\\xf6revlisi atamalar gerekmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Mevzuata uyumun salanmas amacyla risk temelli bir yaklamla oluturulmas gereken uyum program;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Kurum politikas ve prosed\\xfcrlerinin oluturulmas,\",\n                        \"Risk y\\xf6netimi faaliyetlerinin y\\xfcr\\xfct\\xfclmesi,\",\n                        \"zleme ve kontrol faaliyetlerinin y\\xfcr\\xfct\\xfclmesi,\",\n                        \"Uyum g\\xf6revlisi atanmas ve uyum birimi oluturulmas,\",\n                        \"Eitim faaliyetlerinin y\\xfcr\\xfct\\xfclmesi,\",\n                        \"\\xe7 denetim faaliyetlerinin y\\xfcr\\xfct\\xfclmesi,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"tedbirlerini i\\xe7eren bir yapya sahip olarak Kurulularca oluturmaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Uyum program kapsamndaki risk y\\xf6netimi ile izleme ve kontrole ilikin faaliyetler, y\\xf6netim kurulunun g\\xf6zetim, denetim ve sorumluluunda uyum g\\xf6revlisi tarafndan yerine getirilir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"M\\xfcnhasran fatura \\xf6demelerine araclk hizmeti, m\\xfcnhasran \\xf6deme emri balatma hizmeti ve m\\xfcnhasran \\xf6deme hesabna ilikin bilgilerin sunulmas hizmetini salayan \\xf6deme kurulular ise Y\\xf6netmelikte bahsedilen uyum programn oluturmakszn idari d\\xfczeyde uyum g\\xf6revlisi atamak zorundadr.\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Elektronik Tebligat Kullanma Y\\xfck\\xfcml\\xfcl\\xfc\\xfc\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kanunun 9/A maddesinde yaplacak olan tebligatlarn elektronik ortamda tebli edilebilecei ve tebligata elektronik ortamda cevap verilmesi istenebilecei d\\xfczenlenmekte ve MASAKa elektronik ortamdaki tebligata ilikin usul ve esaslar belirleme yetkisi verilmitir. MASAK tarafndan elektronik ortamda yaplacak olan tebligatlar, MASAK tarafndan oluturulan sistem vastasyla yaplmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kurululara Kanun kapsamnda yaplacak olan tebligatlarn elektronik ortamda yaplmas esastr. Bu dorultuda Kurulular, MASAKa hesap a\\xe7lmas i\\xe7in bavuruda bulunmaldr. Yaplan bavuru MASAK tarafndan deerlendirildikten sonra uygun g\\xf6r\\xfclmesi halinde sistem i\\xe7erisinde hesap oluturulmaktadr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"Y\\xdcK\\xdcML\\xdcL\\xdcKLERN DENETM VE HLAL\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kanunun 11. maddesinde mevzuat kapsamnda d\\xfczenlenen y\\xfck\\xfcml\\xfcl\\xfcklerin denetiminin: Vergi M\\xfcfettileri, Bakanlkta istihdam edilen Hazine ve Maliye Uzmanlar, G\\xfcmr\\xfck ve Ticaret M\\xfcfettileri, Bankalar Yeminli Murakplar, Hazine Kontrol\\xf6rleri, Sigorta Denetleme Uzman ve Akt\\xfcerleri, Bankaclk D\\xfczenleme ve Denetleme Kurumu ve Sermaye Piyasas Kurulu Uzmanlar ile T\\xfcrkiye Cumhuriyet Merkez Bankas Denet\\xe7ileri ve Uzmanlar ksaca Denetim Eleman tarafndan ger\\xe7ekletirilecei d\\xfczenlenmitir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Y\\xfck\\xfcml\\xfcl\\xfck denetimiyle g\\xf6revlendirilen denetim elemanlar,  Kurululardan Kanun kapsamnda her t\\xfcrl\\xfc bilgi, belge ve s\\xf6zl\\xfc bilgi almaya yetkilidir. Denetim elemanlar, uyum denetimi sonucunda y\\xfck\\xfcml\\xfcl\\xfck uyum denetimi raporu, y\\xfck\\xfcml\\xfcl\\xfck ihlal incelemesi sonucunda ise y\\xfck\\xfcml\\xfcl\\xfck ihlali inceleme raporu d\\xfczenler. D\\xfczenlenen raporlar, MASAK tarafndan deerlendirildikten sonra ilem tesis edilmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"D\\xfczenlenen raporlar sonucunda Kurulularn ihlal ettii y\\xfck\\xfcml\\xfcl\\xfc\\xfcn t\\xfcr\\xfcne g\\xf6re idari para cezas ya da adli ceza uygulanmaktadr. 2023 yl i\\xe7in s\\xf6z konusu ihlallerde uygulanacak idari para cezas miktarlar aada belirtilmitir.\"\n                },\n                {\n                    type: \"image\",\n                    content: _images_blog_paracezalari_jpg__WEBPACK_IMPORTED_MODULE_1__[\"default\"]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bu maddenin ihlali halinde Kurululara yazl ihtar yaplarak otuz g\\xfcnden az olmamak \\xfczere bir s\\xfcre verilir. Bu s\\xfcre sonunda eksikliklerin tamamlanmamas h\\xe2linde be y\\xfcz bin T\\xfcrk liras idari para cezas uygulanr. dari para cezasnn teblii ile birlikte yazl ihtar yaplarak altm g\\xfcnden az olmamak \\xfczere yeni bir s\\xfcre verilir. Bu s\\xfcre sonunda da eksikliklerin tamamlanmamas h\\xe2linde verilen ilk idari para cezasnn iki kat idari para cezas daha uygulanr. kinci idari para cezasnn tebliinden itibaren otuz g\\xfcn i\\xe7inde eksikliklerin tamamlanmamas h\\xe2linde Kurulularn faaliyetlerinin belli bir s\\xfcre durdurulmas, kstlanmas veya faaliyet izin belgesinin iptaline y\\xf6nelik tedbirlerin alnmas i\\xe7in durum ilgili kuruma bildirilir.\"\n                }\n            ],\n            author: \"Av. Tolgahan Sar\",\n            tags: [\n                \"MASAK\",\n                \"\\xd6deme Kurulular\",\n                \"Elektronik Para Kurulular\"\n            ]\n        },\n        {\n            id: 4,\n            subtitle: \"Makale\",\n            date: \"2023\",\n            slug: \"chatgpt-nin-guncel-gelismeleri-gdpr-ve-kvkk-kapsaminda-degerlendirilmesi\",\n            title: \"ChatGPTnin G\\xfcncel Gelimeleri & GDPR ve KVKK Kapsamnda Deerlendirilmesi\",\n            text: \"Bildiiniz gibi sklkla duyduumuz, OpenAl tarafndan gelitirilen yapay zekaya dayal sohbet robotu ChatGPT bu sralar g\\xfcndemimizi olduk\\xe7a megul ediyor. Peki ChatGPT nedir ve nasl kullanlr? ChatGPTnin kiisel veri g\\xfcvenlii a\\xe7sndan riskleri nelerdir? ChatGPT Avrupa Veri Koruma T\\xfcz\\xfc\\xfc (GDPR) ve 6698 sayl Kiisel Verilerin Korunmas Kanunu (KVKK) kapsamnda nasl deerlendirilir? Bu gibi sorular ve daha fazlasnn cevaplarndan bu ayki blog yazmzda bahsedeceiz!\",\n            dynamicContent: [\n                {\n                    type: \"header\",\n                    content: \"Yapay Zeka Robotu ChatGPT Nedir ve Nasl Kullanlr? \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ChatGPT OpenAl tarafndan \\xfcretilen, google arama motoru \\xfczerinde yapt aramalar sayesinde kullanclarn sorularna ilikin tatmin edici cevaplar verebilen, yapay zekaya dayal bir sohbet robotudur.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ChatGPT nasl kullanlr konusuna gelecek olursak, sorumuzun cevab aslnda \\xe7ok basit olacaktr. Sohbet robotunu kullanabilmek adna ilk adm olarak kullanclarn chat.openai.com adresine girmesi, eer daha \\xf6nce kaytl bir hesab bulunmuyorsa Sign up  butonu vastasyla bir hesap oluturup devamnda telefona gelecek olan dorulama kodunun girilmesi ChatGPT sohbet ekranna ulamak i\\xe7in yeterli olacaktr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"ChatGPT ve Kiisel Veri G\\xfcvenlii A\\xe7sndan Riskleri\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ChatGPT'nin kullanm baz  kiisel g\\xfcvenlik ve gizlilik risklerini de beraberinde getirmektedir. ChatGPT, kullanclarn chat botuna sorduu sorular kaydedebilmekte ve bu bilgileri kullanarak daha iyi bir performans sergilemek adna robot i\\xe7i eitimlerde kullanabilmektedir. Kullanclar tarafndan chat botuna yazlacak metinlerde kiisel verilerin yazlabilmesi ve \\xf6zellikle \\xf6zel nitelikli kiisel verilerin yazlmas ihtimali sebebiyle ChatGPT tarafndan kiisel verilerin ilenmesi ve saklanmas s\\xf6z konusu olabilmektedir. ChatGPTnin ibu verileri saklamas ve kullanmas, kullanclar \\xf6zelinde kiisel verilere ilikin hak ihlallerinin olumasnda b\\xfcy\\xfck bir risk oluturmaktadr. Ayrca \\xe7ocuklara ilikin etkili bir kontrol mekanizmasnn olmamas da \\xe7ocuk verilerinin ilenmesi a\\xe7sndan olduk\\xe7a b\\xfcy\\xfck risk tekil etmektedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kullanclar ChatGPT sohbet robotu ile sohbetleri esnasnda gizlilik ve g\\xfcvenlik risklerini azaltmak amacyla, ChatGPT ile sohbet ederken kiisel verilerini paylamamal ve sohbet robotu kullanm esnasnda \\xfcpheli mesajlar veya yantlar dikkatlice deerlendirmelidir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"ChatGPTnin G\\xfcncel Gelimeleri ve ChatGPTnin GDPR ve KVKK Kapsamnda Uyumluluunun Deerlendirilmesi \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Son zamanlarda giderek yaygnlaan ChatGPT yapay zeka sohbet robotuna ilikin tartmalar veri koruma alannda da hzla artmaktadr. ChatGPTnin pop\\xfclerlemesiyle beraber uluslararas veri koruma otoriteleri tarafndan ChatGPT yakn mercek altna alnm ve uygulamann kullanmnn yasaklanmasna kadar giden hususlar veri koruma otoriteleri tarafndan tartmaya balanmtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Bilindii \\xfczere 2023 Mart ay sonlarnda talya Veri Koruma Otoritesi (Garante) tarafndan, ChatGPTnin, dil modelini eitmek amacyla kullanclara ilikin kiisel verilerin toplu olarak toplamasnn yasal bir dayanann olmamas, 13 ya alt \\xe7ocuklarn platformu kullanmasna ilikin herhangi bir ya kontrol mekanizmas olmamas,  verilerin toplanma usul\\xfcne ilikin kullanclara bilgi verilmemesi, verilerin nasl ilendiinin netletirilmemesi ve veri y\\xf6netimi se\\xe7eneklerinin sunulmamasndan dolay OpenAle GDPR ile uyumlu olunmas i\\xe7in 30 g\\xfcnl\\xfck s\\xfcre verilmi ve bu s\\xfcrede ChatGPT ge\\xe7ici olarak talyada engellenmitir. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"2023 Nisan ay sonuyla OpenAl tarafndan; kiilerin sohbet ge\\xe7milerini devre d brakmasna (varsaylan olarak kapal) imkan tanyan bir sistem gelitirilmi, GDPR kapsamnda kullanclarn kiisel verilerini kaldrmak i\\xe7in bavurabilecekleri yeni bir form oluturulmu, talyadaki kullanclarn ya, \\xfcyelik aamasnda dorulanaca OpenAl tarafndan belirtilmi ve GDPRa uygun veri koruma g\\xf6revlisine nasl ulalaca dahil olmak \\xfczere, ChatGPTnin kiisel bilgileri nasl topladn a\\xe7klayan bir yardm merkezi makalesi yaymlanmtr. T\\xfcm bu admlarn akabinde ChatGPT Nisan ay sonuyla talyada kullanma tekrardan a\\xe7lmtr. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Garantenin soruturmas, zaten yakn mercek altnda olan OpenAl \\xfczerinde dikkatleri toplamtr. Avrupa Veri Koruma Kurulu (EDPB) OpenAle y\\xf6nelik bilgi paylamn artrmak i\\xe7in \\xf6zel bir veri koruma ekibi kurulmasna karar verirken, Alman Kiisel Verilerin Korunmas ve Bilgi \\xd6zg\\xfcrl\\xfc\\xfc sorumlular tarafndan veri g\\xfcvenlii endieleri sebebiyle gerekirse ChatGPTnin engellenecei ifade edilmi ve  'bir veri koruma etki deerlendirmesi yaplp yaplmadn ve veri koruma risklerinin kontrol altnda olup olmadn bilmek istendii' s\\xf6ylenip GDPRdan kaynakl sorunlar i\\xe7in OpenAle 11 Hazirana kadar s\\xfcre verilmitir. \"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"T\\xfcm bu kararlardan anlalaca \\xfczere bir yandan Avrupa yasama organlar Al Act (Yapay Zeka Yasas)n ilerletirken dier yandan OpenAl irketi Avrupa Veri Koruma Otoritelerince g\\xf6zlem altnda tutulmaktadr ve irketin bundan sonra izleyecei kiisel verileri korumaya ilikin politikalar GDPRa uyumluluk a\\xe7sndan olduk\\xe7a \\xf6nem arz edecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"KVKK kapsamnda mevzuatmzn,doktrindeki bir\\xe7ok g\\xf6r\\xfce g\\xf6re, yapay zeka uygulamalar a\\xe7sndan AB mevzuat paralelinde g\\xfcncellenme ihtiyac duyduu yadsnamaz bir ger\\xe7ek olmakla beraber; KVKK kapsamndaki y\\xfck\\xfcml\\xfcl\\xfcklerin salanmas adna OpenAl yapay zeka sohbet robotunun aadaki ilkeler ilkeler \\xe7er\\xe7evesinde hareket etmesi KVKK ve GDPRa uyumluluu a\\xe7sndan \\xf6nem arz edecektir;\"\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Yasallk, effaflk:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Veri ilemek i\\xe7in uygun yasal dayanan oluturulmas (Anayasa md.20/3 ve KVKK). \\xd6zel nitelikli kiisel verilerin ilenmesi hususunda gerekiyorsa KVKK m.6daki gereklilikler mutlaka yerine getirilmelidir.\",\n                        \"Kullanclara kiisel verilerinin nasl ve neden kullanld, kimlerle paylalaca ve saklama s\\xfcreleri konusunda balang\\xe7tan itibaren a\\xe7k ve effaf olunmaldr.\"\n                    ]\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Veri Minimizasyonu ve G\\xfcvenlik:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Veri g\\xfcvenlii ve risk y\\xf6netimi a\\xe7sndan tedbirler alnmaldr.\",\n                        \"Amacn ger\\xe7ekletirilmesi i\\xe7in yalnzca minimum ekilde veriler ilenmelidir. Bu kapsamda KVKK m.4/1(\\xe7)de kapsamnda kiisel veriler ilendikleri ama\\xe7la, balantl ve snrl olmaldr.\"\n                    ]\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Hesap Verilebilirlik:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"Veri sorumlularnn kiisel verileri ilemelerinden kaynaklanabilecek riskleri hesaba katmaldr.\"\n                    ]\n                },\n                {\n                    type: \"subheader\",\n                    content: \"Veri Sahibinin Haklar\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"lgili kiilere KVKK m.11 kapsamndaki bilgilendirme, eriim, d\\xfczeltme ve silme haklar uygun bir ekilde hatrlatlmaldr.\"\n                    ]\n                },\n                {\n                    type: \"header\",\n                    content: \"Sonu\\xe7\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"ChatGPT her ne kadar hayatmz kolaylatrc ekilde bizlere hizmet verse de gerek KVKK gerekse GDPR kapsamndaki uyumluluunun salanmas adna OpenAl tarafnca \\xf6nlemlerin alnmas kiisel verilerin g\\xfcvenlii a\\xe7sndan ve irketin yaptrma maruz kalmamas adna b\\xfcy\\xfck \\xf6nem arz etmektedir. S\\xf6z konusu uyumluluk uluslararas veri koruma otoriteleri tarafndan yakn mercek altna alnarak takip edilmekle beraber; ilerleyen g\\xfcnlerde ulusal mevzuatmz a\\xe7sndan da gerekli y\\xfck\\xfcml\\xfcl\\xfcklerin yerine getirilip getirilmediinin takibinin Kurul tarafndan irdelenmesi  beklenmektedir.\"\n                }\n            ],\n            tags: [\n                \"ChatGPT\",\n                \"KVKK\",\n                \"GDPR\"\n            ]\n        },\n        {\n            id: 5,\n            subtitle: \"Makale\",\n            date: \"2023\",\n            slug: \"is-sozlesmesi-devam-ederken-isciye-yapilan-kidem-tazminati-odemeleri\",\n            title: \" S\\xf6zlemesi Devam ederken \\xe7iye Yaplan Kdem Tazminat \\xd6demeleri\",\n            text: \"\\xe7i ve iveren arasndaki i s\\xf6zlemesinin son bulmas ile g\\xfcndeme gelen kdem tazminat, i\\xe7iye iverenine ball dolaysyla \\xf6denen bir ypranma tazminatdr. Yargtay kdem tazminatn, iverene ait iyeri ya da iyerlerinde belli bir s\\xfcre \\xe7alm olan i\\xe7inin, iini kaybetmesi halinde, iinde ypranmas ve yeni bir i edinmede karlaaca g\\xfc\\xe7l\\xfckler ve iverene salad katk g\\xf6z \\xf6n\\xfcne alnarak, ge\\xe7mi hizmetlerine karlk olmak \\xfczere, kanuni esaslar dahilinde iverence i\\xe7iye verilen toplu para olarak tanmlamaktadr.\",\n            dynamicContent: [\n                {\n                    type: \"paragraph\",\n                    content: \"Her ne kadar 1475 sayl  Kanunu, 4857 sayl  Kanununun y\\xfcr\\xfcrl\\xfce girmesi ile ilga edilmi olsa da 1475 sayl  Kanununun kdem tazminat d\\xfczenleyen 14. maddesi 4857 sayl kanunun 120. maddesi ile y\\xfcr\\xfcrl\\xfckte braklmtr. S\\xf6z konusu d\\xfczenlemeye g\\xf6re i\\xe7inin kdem tazminatna hak kazanabilmesi belli artlara balanmtr. \\xe7inin ayn iverenin yannda en az 1 yl \\xe7almas \\xf6n koulu ile i s\\xf6zlemesinin;\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"veren tarafndan iyi niyet ve ahlak kurallarna aykrlk nedenleri dndaki nedenlerle feshedilmesi,\",\n                        \"\\xe7i tarafndan salk, iyi niyet ve ahlak kurallarna aykrlk veya benzeri nedenlerle feshedilmesi,\",\n                        \"Kadn i\\xe7inin evlenmesi halinde 1 yl i\\xe7inde kendi istei ile feshedilmesi,\",\n                        \"Emeklilik hakknn elde edilmesi veya ya dnda gereken sigortallk s\\xfcresi ve prim g\\xfcn\\xfcn\\xfcn doldurulmas nedeni ile feshedilmesi,\",\n                        \"Erkek i\\xe7inin askere gitmesi sebebiyle feshedilmesi,\",\n                        \"\\xe7inin \\xf6l\\xfcm\\xfcyle feshedilmesi,\"\n                    ]\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"koullarndan birinin ger\\xe7eklemesi halinde i\\xe7inin kdem tazminatna hak kazanaca h\\xfck\\xfcm altna alnmtr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"2. AVANS \\xd6DEMES\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kdem tazminatna hak kazanmak i\\xe7in bir\\xe7ok art bulunmakla beraber en \\xf6nemlisi i s\\xf6zlemesinin sona ermesidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Buna ramen uygulamada, \\xe7eitli sebeplerle \\xf6rnein ev almak, d\\xfc\\xfcn yapmak, bor\\xe7 \\xf6demek i\\xe7in paraya ihtiyac olan i\\xe7inin istei \\xfczerine iverence, i s\\xf6zlemesi fesh edilmeksizin kdem tazminat ad altnda \\xf6demeler yaplabildii g\\xf6r\\xfclmektedir. 4857 sayl  Kanununda, i\\xe7i \\xe7almaya devam ederken o tarihe kadar birikmi kdem tazminatnn \\xf6denebileceine dair bir d\\xfczenleme bulunmamakla beraber Yargtay bu t\\xfcr \\xf6demeleri avans \\xf6demesi olarak kabul etmektedir: \\xe7inin i s\\xf6zlemesi feshedilmedii halde \\xe7eitli nedenlerle kdem tazminat ad altnda yaplan \\xf6demeler avans niteliinde saylmaldr.[2]\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Yargtayn kdem tazminat ad altnda yaplan \\xf6demeyi avans \\xf6demesi olarak kabul ettii bir baka bir durum ise i hayatnda karmza \\xe7kan girdi-\\xe7kt uygulamasdr. veren, ileride daha az kdem tazminat \\xf6demek amacyla i s\\xf6zlemesini feshedip kdem tazminatn \\xf6dedii i\\xe7isiyle yeniden i s\\xf6zlemesi yapmaktadr. Kat \\xfczerinde girdi-\\xe7kt yaplsa da fiilen ayn iyerinde \\xe7almas devam eden i\\xe7iye kdem tazminatn azaltmak i\\xe7in yaplan bu ara \\xf6demeler kdem tazminat nitelii tamamaktadr. Yargtay burada i s\\xf6zlemesinin feshinin daha az kdem tazminat \\xf6deme amac tayp tamadn, fesih tarihi ile ie yeniden baland tarih arasndaki s\\xfcreyi de dikkate alarak i s\\xf6zlemesi sona ermi gibi g\\xf6sterilen i\\xe7iye yaplan kdem tazminat \\xf6demesini avans \\xf6demesi olarak deerlendirmektedir.[3]\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"yerinin devrinde ise devreden iveren tarafndan fesih tarihindeki kdem tazminat tavan \\xfczerinden hesaplanan kdem tazminat tutar i\\xe7iye tam olarak \\xf6dendiinde, devreden iverenin ilerde i\\xe7iye daha az kdem tazminat \\xf6demek amacyla devir ile fesih yapld sonucuna varlmas Yargtay tarafndan doru bulunmam; i\\xe7i \\xf6nceki s\\xfcre i\\xe7in tavan esasna g\\xf6re hesaplanm olan kdem tazminatn ald ve haklarnn tam olarak \\xf6dendii belirtilerek, i s\\xf6zlemesinin feshinden bir g\\xfcn sonra iveren nezdindeki \\xe7almalar yeni bir i s\\xf6zlemesi niteliinde kabul edilmitir.[4]\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avans \\xf6demesi niteliindeki bu \\xf6demeler, i\\xe7i ve iveren tarafndan arabuluculuk anlama tutananda kdem tazminat ad altnda yazlsa dahi Yargtay, bu \\xf6demeleri avans olarak kabul etmektedir. Ger\\xe7ekten de, i\\xe7inin iki g\\xfcn i\\xe7erisinde ie girdi-\\xe7kt yaplmasnn ger\\xe7ekte bir fesih ilemi olmad halde avans niteliinde \\xf6demelerin kdem ve ihbar tazminat olarak anlama tutananda g\\xf6sterilmesi, ayrca anlama tutanann d\\xfczenlendii tarih itibariyle i s\\xf6zlemesi devam eden i\\xe7inin i s\\xf6zlemesi sona ermedii halde kullandrlmayan yllk izin hakknn parasal alacaa d\\xf6n\\xfct\\xfcr\\xfclmesi kanuna uygun g\\xf6r\\xfclmemi ve ger\\xe7ekte bir fesih s\\xf6z konusu olmad halde i\\xe7iye ihbar ve kdem tazminat ad altnda bir \\xf6demenin arabulucu \\xf6n\\xfcnde yaplan anlama ile kararlatrlm olmas \\xf6demenin avans niteliini ortadan kaldrmayaca kararlatrlmtr.[5]\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Peki i s\\xf6zlemesinin kdem tazminatna hak kazanlarak feshedilmi olmas durumunda daha \\xf6nce yaplan avans \\xf6demesinin durumu ne olacaktr? \"\n                },\n                {\n                    type: \"header\",\n                    content: \"3. AVANS \\xd6DEMESNN KIDEM TAZMNATINDAN MAHSUP EDLMES\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Hukuken yaplm bulunan avans \\xf6demesinin, belirli artlarn olumas halinde kdem tazminatndan mahsup edilebilmesi m\\xfcmk\\xfcnd\\xfcr. Yargtayn yerleik uygulamas da bu y\\xf6ndedir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xe7inin i s\\xf6zlemesinin feshinde kdem tazminatna hak kazanlmas durumunda iyeri ya da iyerlerinde ge\\xe7en t\\xfcm  hizmet s\\xfcrelerine g\\xf6re kdem tazminat hesaplanmal, daha \\xf6nce avans olarak \\xf6denen miktar yasal  faiziyle birlikte mahsup edilmelidir. Kdem tazminatna hak kazanmad halde avans ad altnda \\xf6demeyi alan ve bu ekilde yararlanan i\\xe7i de sonucuna katlanmaldr.[6]\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" s\\xf6zlemesi, kdem tazminatna hak kazanarak sona eren i\\xe7iye yaplan avans \\xf6demesi, \\xf6deme tarihinden ger\\xe7ek fesih tarihine kadar hesaplanacak yasal faizi de eklenerek t\\xfcm hizmet s\\xfcresi ve son \\xfccreti \\xfczerinden hesaplanacak olan kdem tazminatndan mahsup edilecektir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avans \\xf6demesinin yapld tarih ile fesih tarihi arasndaki s\\xfcre i\\xe7in yasal faiz uygulanmasnn, hakkaniyet gerei olduu da ilgili yarg kararlarnda ayrca vurgulanmtr. Yargtayn kararllk kazanan bu uygulamas dorultusunda iverenlerin de iyi niyetle yaptklar bu \\xf6demeler nedeniyle madur olmamalar ama\\xe7lanmtr.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"4. AVANS \\xd6DEMESNN PRM VE VERGYE TAB OLMASI\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xe7inin \\xe7alt s\\xfcre ve son esas \\xfccreti dikkate alnarak hesaplanan ve tavan snr amayan kdem tazminatlar 193 sayl Gelir Vergisi Kanununun 25. maddesi uyarnca gelir vergisinden muaf olup yalnzca damga vergisine tabidir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Keza kdem tazminat, 5510 sayl Sosyal Sigortalar Kanunu'nun 77. maddesine g\\xf6re de tavan snr amad s\\xfcrece sigorta priminden muaftr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Kdem tazminat a\\xe7sndan vergi ve prim d\\xfczenlemeleri b\\xf6yle olmakla beraber i\\xe7iye yaplan avans \\xf6demesinin vergi ve prime tabi olup olmad hususunda mevzuatta net bir h\\xfck\\xfcm bulunmamaktadr. Bu konudaki belirsizlik 19/12/2022 tarihli Gelir daresi Bakanlnca yaynlanan \\xf6zelge ile giderilmitir:\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"1475 sayl Kanunun 14 \\xfcnc\\xfc maddesinde hangi artlar altnda kdem tazminat \\xf6denecei a\\xe7k\\xe7a belirtilmekte olup hizmet erbabna kdem tazminat \\xf6denebilmesi i\\xe7in i s\\xf6zlemesinin feshedilmesi/sona ermesi gerekmektedir. Dolaysyla hizmet erbabnn i s\\xf6zlemesi feshedilmeden/sona ermeden \\xe7eitli sebeplerle kdem tazminat ad altnda yaplan \\xf6demelerin, 1475 sayl Kanunun 14 \\xfcnc\\xfc maddesi kapsamnda kdem tazminat olarak deerlendirilmeyecei tabidir. Buna g\\xf6re, irketiniz tarafndan i s\\xf6zlemesi feshedilmeden kdem tazminatna mahsuben avans olarak yaplan \\xf6demelerin \\xfccret \\xf6demesi olarak kabul\\xfc ve bu \\xf6demelerin, Gelir Vergisi Kanununun 61, 63, 94 ve 103 \\xfcnc\\xfc maddelerine g\\xf6re gelir vergisine tabi tutulmas gerekmektedir.[7]\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"G\\xf6r\\xfclecee \\xfczere i s\\xf6zlemesi feshedilmeden veya sona ermeden \\xe7eitli sebeplerle kdem tazminat ad altnda yaplan \\xf6demeler kdem tazminat olarak deerlendirilmeyecektir. Bu nedenle, i s\\xf6zlemesi feshedilmeden kdem tazminatna mahsuben yaplan ve \\xfccret nitelii tayan avans \\xf6demesi gelir vergisine tabi olacaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Sosyal g\\xfcvenlik prim \\xf6demesi i\\xe7in de benzer a\\xe7klamalar ge\\xe7erli olacaktr. \\xf6yle ki 5510 sayl Sosyal Sigortalar Kanununun 80. maddesinde stisnalar dnda her ne adla yaplrsa yaplsn t\\xfcm \\xf6demeler ile ayni yardm yerine ge\\xe7mek \\xfczere yaplan nakdi \\xf6demeler prime esas kazanca tabi tutulur. h\\xfckm\\xfc yer almaktadr. Her ne kadar kdem tazminat sigorta priminden muaf olsa da kdem tazminat nitelii tamayan ve \\xfccret kapsamnda yer ald anlalan avans \\xf6demesinin de sosyal g\\xfcvenlik primi hesaplamasna dahil edilmesi gerekecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"5. AVANS \\xd6DEMESNN ADES\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avans \\xf6demesinin iverenler a\\xe7sndan baz riskleri de bulunmaktadr. Kdem tazminatna hak kazanarak i s\\xf6zlemesi sona eren i\\xe7iye yaplan avans \\xf6demesinin mahsubu Yargtay uygulamalarnda netlik kazanm olsa da kdem tazminatna hak kazanmadan i s\\xf6zlemesi sona eren i\\xe7iye yaplan avans \\xf6demesinin iadesi noktasnda belirsizlik bulunmaktadr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"\\xe7iye yaplan avans \\xf6demesinin iadesi kanunda d\\xfczenlenmedii ve sosyal g\\xfcvenlik mevzuatnca \\xfccret  olarak nitelendirilip vergi kesintilerinin yapld da g\\xf6z \\xf6n\\xfcne alndnda iadesinin talep edilmesinin m\\xfcmk\\xfcn olmad g\\xf6r\\xfclecektir.\"\n                },\n                {\n                    type: \"header\",\n                    content: \"6. SONU\\xc7\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \" hayatnda i s\\xf6zlemesi devam ederken kdem tazminat ad altnda yaplan \\xf6demeler, yerlemi Yargtay uygulamalarnda avans \\xf6demesi olarak nitelendirilmektedir. \\xe7iye i s\\xf6zlemesi sona ermeden kdem tazminat ad altnda yaplm \\xf6demeler, daha sonra i\\xe7i iten ayrlrken avans \\xf6demesinin yapld tarihten i s\\xf6zlemesinin sona erdii tarihe kadarki s\\xfcre kapsamnda yasal faiz orannda deerlemeye tabi tutulur ve hesaplanan tutar, t\\xfcm s\\xfcre ve son \\xfccret \\xfczerinden hesaplanan kdem tazminat tutarndan mahsup edilir.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Avans \\xf6demesi herhangi bir kanunla ya da y\\xf6netmelikte d\\xfczenlenmemi olsa da Yargtay kararlarna konu olmu ve Yargtay iverence yaplan bu \\xf6demelerin mahsubuna imkan tanyarak, her iki taraf i\\xe7inde hakkaniyetin tesis edilmesini salamtr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Vergilendirme a\\xe7sndan ise kanunlarda tanmlanm tavana kadar ki ksmlar dnda kdem tazminat gelir vergisinden ve sigorta priminden muaftr. Ancak i\\xe7iye yaplan avans \\xf6demesi \\xfccret olarak kabul edilmektedir. Bu durumda da hem gelir vergisine tabi olur hem de sosyal g\\xfcvenlik primi kesintisi yaplr. \\xe7iye yaplacak avans \\xf6demesi gelir vergisine tabi olaca i\\xe7in gelir vergisi k\\xfcm\\xfclatif matrahn artracaktr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Ayrca unutulmamaldr ki kdem tazminatna hak kazanmadan i s\\xf6zlemesi sona eren i\\xe7iye yaplan avans \\xf6demesinin iadesinin m\\xfcmk\\xfcn olmayaca iverenlerce dikkate alnmaldr.\"\n                },\n                {\n                    type: \"paragraph\",\n                    content: \"Dipnot:\"\n                },\n                {\n                    type: \"list\",\n                    content: [\n                        \"1- Yargtay 9. HD., E. 2021/850 K. 2021/5875 T. 10.3.2021\",\n                        \"2- Yargtay 9. HD., E. 2021/5562 K. 2021/9893 T. 3.6.2021\",\n                        \"3- Yargtay 9. HD., E. 2006/12556 K. 2007/1252 T. 30.01.2007\",\n                        \"4- Yargtay 9. HD., E. 2007/27464 K. 2008/24648 T. 24.09.2008\",\n                        \"5- Yargtay 9. HD., E. 2021/12911 K. 2022/1387 T. 7.2.2022\",\n                        \"6- Yargtay 9. HD., E. 2021/2429 K. 2021/9447 T. 20.5.2021\",\n                        \"7- 19.12.2022 tarihli 62030549-120[94-2020/94]-1500056 sayl \\xf6zelge\"\n                    ]\n                }\n            ],\n            tags: [\n                \" Hukuku\",\n                \"Kdem Tazminat\",\n                \"Avans \\xd6demesi\"\n            ],\n            author: \"Av. Tolgahan Sar\"\n        }\n    ]\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/data/newsSection.js\n");

